	(jeweils treuhänderisch für den Parteivorstand der SPD)', '1970/74 Martin-Luther-Grundschule Düren, 1974/83 Burgau-Gymnasium Düren, Abitur. 1983/85 Zivildienst St. Augustinus Krankenhaus Düren-Lendersdorf. Studium Biologie und Sozialwissenschaften Univ. Köln (ohne Abschluss). Pflegediensthelfer, Tutor an der math.-nat. Fakultät Univ. Köln, Mitarbeiter Büromaschinen Vertrieb und Service GmbH, Wahlkreismitarbeiter, MdB, Europapolitischer Koordinator, Mitarbeiter Martin Schulz, MdEP. Vors. DPG-Bundesverband; Mitglied u. a. GEW, Vors. Stiftungsrat Stiftung für die internationale Jugendbegegnungsstätte Oswiecim, Oswiecim (Polen), Mitgl. Kuratorium Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, Mitgl. Vorst. Stiftung Lebenshilfe Düren, Mitgl. Stiftung Flucht, Vertreibung, Versöhnung. 1990/98 Vors. SPD Ortsverein Düren-Mitte, seit 1998 Vors. SPD Unterbezirks Düren, 2005/14 Vors. SPD Mittelrhein, seit Jan. 2014 Schatzmeister der SPD. 1984/94 sachkundiger Bürger der Stadt Düren, 1994/10 Mitgl. Kreistag Düren. Englisch (f). - MdB 1998/05 und seit Okt. 2009.', 'Dietmar', '11003199');
