	1. Vorsitzender des Freundeskreises', '1980/82 Hauptschule St. Georg Freising, 1982/86 Staatl. Wirtschaftsschule Freising. 1986/88 Ausbildung zum Bürokaufmann bei der Fa. Tengelmann & Kaisers. 1988/92 Kaufm. Angestellter bei der Fa. Tengelmann & Kaisers für Aktionsware und Neueröffnungen, 1992/93 Kaufm. Angestellter bei der Fa. F.X. Mühlbauer, Freising. Seit 1993 Außendienstmitarbeiter AOK Bayern - Die Gesundheitskasse. Mitgl. der CSU seit 1995, 1999/08 stellv. CSU-Ortsvors. Freising, 2008/14 CSU-Ortsvors. Freising, seit 2006 stellv. Kreisvors. der CSU. Stadtrat Freising 2002/14, Mitgl. im Kreistag Freising seit 2008. - MdB seit Okt. 2013.', 'Erich', '11004311');
	1. Vorsitzender, ehrenamtlich', '1971 Abitur am Engelbert-Kämpfer-Gymnasium in Lemgo. Studium der Rechtswissenschaften, 1979/82 wissenschaftl. Assistent Univ. Bielefeld, Promotion zum Dr. jur. Tätigkeit als Rechtsanwalt. 1982/86 Richter am Amts- und Landgericht Osnabrück, an den Amtsgerichten Bersenbrück und Papenburg, 1986/88 Richter am Landgericht Osnabrück. 1985/88 Lehrbeauftragter der Universität Osnabrück. 1988/91 städtischer Oberrechtsrat in der Alten Hansestadt Lemgo, 1991/97 Stadtdirektor der Stadt Voerde, 1997/02 hauptamtlicher Bürgermeister der Stadt Voerde. Juli 2010/Okt. 2013 Staatssekretär im Ministerium für Inneres und Kommunales des Landes Nordrhein-Westfalen. 2010/15 Vors. SPD-Unterbezirk Kreis Wesel. 2. Vors. Förderverein Haus Voerde. - MdB 2002/09 und seit Okt. 2013; 2008/09 finanzpolitischer Sprecher der SPD-Fraktion, seit 2013 haushaltspolitischer Sprecher der SPD-Fraktion; Mitgl. Finanzmarktgremium, seit Feb. 2016 Vors. Cum-Ex-Untersuchungsausschuss.', 'Hans-Ulrich', '11003575');
	1. Vorsitzender, ehrenamtlich', '1971/81 POS. 1981/83 Ausbildung Zootechniker/Mechanisator. Fernstudium FH Stadtroda und HU Berlin, 1989 Dipl.-Ing. agr. 1985/89 Schicht- und Abteilungsleiter ZBE Milchprod. Reichardtswerben, 1989/91 Leiter Gut Storkau, 1992/95 Arbeitsgruppenleiter Amt für Landwirtsch. und Flurneuordnung Süd Sachsen-Anhalt. Seit 1990 geschäftsf. Vorstand Weißenfelser Reitverein e. V., Leiter Reit-, Zucht- und Ausbildungsstall Markwerben mit Landwirtschaftsbetr., seit 1997 Inhaber Agentur für Tierversicherungen. Richter Pferdesport und -zucht. Seit 1999 Mitgl. der CDU, seit 2003 Mitgl. CDU-Kreisvorst. Weißenfels, seit 2007 stellv. Vors. CDU-Kreisverb. Burgenlandkreis, Mitarbeit CDU-LFA Landwirtschaft, 2010/12 Beisitzer CDU-Landesvorst. Sachsen-Anhalt. Seit 1994 Mitgl. Kreistag, 2004/07 stellv. CDU-Fraktionsvors., seit 2007 Vors. Kreistag; 1999/2014 Mitgl. Stadtrat Weißenfels, 2000/09 CDU-Fraktionsvors.; Mitgl. Verwaltungsrat Kreissparkasse Weißenfels/Sparkasse Burgenlandkreis; 2005/14 Vors. des Gemeinschaftsaussch. Verwaltungsgemeinsch. "Weißenfelser Land". 2010/14  1. Vizepräs. und Vors. d. LK für Pferdeleistungsprüfungen im LV d. RFV Sachsen-Anhalt. Russisch (G). - MdB seit Okt. 2009; seit Sept. 2013 stellv. Vors. der CDU-Landesgruppe Sachsen-Anhalt; stellv. Vors. Sportausschuss.', 'Dieter', '11004168');
