	B&B Hausverwaltung GbR, Schwerin', 'Polytechnische Oberschule, Berufsausbildung zum Bauzeichner. Studium der Gesellschaftswissenschaften und der Innenarchitektur mit Diplom. 1991/02 selbstständig mit eigenem Planungsbüro, danach bis Okt. 2010 Wahlbeamtin. Seit 2008 geschäftsführende Gesellschafterin der B&B Hausverwaltung GbR. 1977 Mitgl. der SED, jetzt DIE LINKE, seit Nov. 2012 Landesvors. der Partei DIE LINKE in Mecklenburg-Vorpommern; 1978/90 hauptamtliche Tätigkeiten bei der FDJ, FDGB, SED und SED/PDS. 1990/02 Kommunalpolitikerin, 1995/99 Stadtpräsidentin der Landeshauptstadt Schwerin, 2002/05 erste Stellvertreterin des Oberbürgermeisters und Beigeordnete für Bauen, Ordnung und Umwelt in Schwerin. Mitgl. Stiftungsrat der Bundesstiftung Baukultur, Mitgl. Verwaltungsrat der Bundesanstalt für Immobilienangelegenheiten, seit 2013 Mitgl. Stiftungsrat der Stiftung Berliner Schloss-Humboldtforum. Englisch (G), Russisch (G). - MdB seit 2005.', 'Heidrun', '11003740');
