	Beisitzer des Vorstandes, ehrenamtlich', 'Mittlere Reife. 1974 Meisterprüfung zum Landwirt. Seit 2006 Mitgl. im Landesvorst. des BUND, 2007/Okt. 2009 stellv. Landesvors., 2008/10 Bundesagrarsprecher des BUND. Mitbegünder der AbL - Arbeitsgemeinschaft bäuerliche Landwirtschaft e. V., 13 Jahre Landesvors. NRW. Mitbegründer Neulandverband für tiergerechte und umweltschonende Nutztierhaltung. Aufbau und ehrenamtl. Mitglied des Genossenschaftsvorst. 1980 Mitbegründer der Grünen im Kreis Unna, 2005/12 Kreisvors. der Grünen in Unna, 2010/13 Sprecher der BAG Landwirtschaft und ländliche Entwicklung von Bündnis 90/Die Grünen. 1994 bis 2002 Fraktionsvors. der Grünen im Kreistag Unna, 1999/02 Mitgl. im Regionalrat Arnsberg, 2005/10 grüner Kreissprecher und Vors. im Kreistag und Regionalrat. - MdB 2002/05 und seit Okt. 2009; agrarpolitischer Sprecher der Fraktion Bündnis 90/Die Grünen; in der 17. WP stellv. Vors. Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, in 18. WP stellv. Vors. Ausschuss für  Ernährung und Landwirtschaft.', 'Friedrich', '11003604');
