	Beisitzerin des Vorstandes, ehrenamtlich', '1959/71 Schule mit Abitur. 1971/76 Studium der Mathematik und VWL, Abschluss Dipl.-Mathematikerin. 1978/90 wissenschaftl. Mitarbeiterin Univ. Duisburg/Essen. 1985 Eintritt in Bündnis90/Die Grünen, seit 1999 Mitgl. im Parteirat, Juni 2012/Juni 2014 Mitgl. Landesvorst. Bündnis 90/Die Grünen NRW. 1985/89 Stadtverordnete Oberhausen; 1990/95 Fraktionsvors. der Grünen im Landtag NRW, 1995/2000 Ministerin für Umwelt, Raumordnung und Landwirtschaft in NRW, 2000/05 Ministerin für Umwelt, Naturschutz, Landwirtschaft und Verbraucherschutz in NRW. Mitgl. bei ver.di. Englisch. - MdB seit 2005; Nov. 2005/Mai 2006 Vors.  Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, Mai 2006/Okt. 2013 stellv. Fraktionsvors. und Pol. Koordinatorin des AK Umwelt und Energie der Fraktion Bündnis 90/Die Grünen, seit Jan. 2014 Vors. Ausschuss für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Bärbel', '11003774');
	Beisitzerin des Vorstandes, ehrenamtlich', 'Realschule, Abitur am Abendgymnasium. Studium der Angewandten Kulturwissenschaften, Abschluss Magister Artium. Beamtin beim Deutschen Wetterdienst; Tätigkeit in der Erwachsenenbildung. 1999/09 wissenschaftliche Mitarbeiterin einer Bundestagsabgeordneten. 2010/13 Leitung eines Hotels. Seit 1986 SPD-Mitgl., seit 2004 SPD-Vorsitzende in Lüneburg.  Seit 2001 Mitgl. Rat der Hansestadt Lüneburg. Mitgl. der Arbeiterwohlfahrt, ver.di, Deutsch-Dänische Gesellschaft, Allgemeiner Deutscher Fahrrad-Club (ADFC). - MdB seit Okt. 2013.', 'Hiltrud', '11004344');
