	Cajus Caesar GbR, Kalletal', 'Mittlere Reife. 1969/71 Forstlehre, Landesforstschule Arnsberg, Fachhochschulreife. 1971/74 Revierförsteranwärter. Dipl.-Forsting., Forstamtsrat. 1974/78 Revierleiter Forstrevier Lage, 1978/80 Forsteinrichtung Landesverb. Lippe, 1980/98 Revierleiter Forstrevier Kirchberg, 2005/07 und 2010/11 Projektleiter Forstmanagement beim Landesverb. Lippe. Seit 1969 Mitgl. CDU, 1980/84 Ortsvors. JU Kalletal, 1985/90 CDU-Gemeindeverbandsvors. Kalletal, 1990/Okt. 2013 Kreisvors. der CDU Lippe, seit 1992 Bezirksvorstandsmitgl. der CDU Ostwestfalen-Lippe. 1980/99 Mitgl. Gemeinderatsfraktion Kalletal, 1984/99 Mitgl. Lippischer Kreistag, u. a. Vors. Umweltausschuss und stellv. Fraktionsvors. der CDU. 1986/99 Mitgl. Landschaftsvers. Landschaftsverb. Westfalen-Lippe, dort u. a. umweltpol. Sprecher und stellv. Fraktionsvors. der CDU, Auszeichnung mit der Freiherr vom Stein Medaille in Silber, 1999/06 Abg. der Verbandsvers. Landesverb. Lippe, dort Fraktionsvors. der CDU. U. a. 2003/13 Mitgl. Bundespräs. Bund Heimat und Umwelt (BHU), seit Juni 2013 Mitgl. Kuratorium BHU, Mitgl. Bund Dt. Forstleute (BDF), dort 1975/82 stellv. Bundesjugendleiter und Landesjugendleiter NRW, Dt. Jagdschutzverband (DJV), Schutzgem. Dt. Wald (SDW), seit Mai 2014 Mitgl. Kuratorium Dt. Bundesumweltstiftung (DBU), seit Sept. 2014 Vors. Beirat der DBU Naturerbe GmbH, ehrenamtl. Mitgl. Dt. Forstzertifizierungsrat bei PEFC Dt. e. V., ehrenamtl. Mitgl. Aufsichtsrat wald-wird-mobil.de gGmbH, Mitgl. WWF, Energie Impuls OWL e. V. und in zahlr. regionalen Vereinen, Sport, Feuerwehr, Schützen, Heimat, Kultur, Ziegler, Wirtschaft und Kultur. Englisch (G). - MdB 1998/2005 und 2007/09 und seit Feb. 2011.', 'Cajus', '11003064');
