	GbR Mörikestr. 17, Backnang', '1983 Abitur. Studium der Rechtswissenschaften, 1989 1. jur. Staatsexamen Univ. Tübingen. 1989/91 Zivildienst. 1991/93 Referendariat in Stuttgart und Brüssel, 1993 2. jur. Staatsexamen in Stuttgart. Seit 1993 bis zur Wahl in den BT im Wirtschaftsministerium Baden-Württemberg, zunächst Landesbeauftragter beim Bund und Bundesratsreferent, dann Referent für Handwerk und Mittelstand. Oberregierungsrat a. D. Gründer und Mithrsg. des pol. Magazins "Berliner Republik". 1993/95 stellv. Bundesvors. der Jusos. Vizepräsident Dt.-Israelische Gesellschaft (DIG); Vorstandsmitgl. Atlantik-Brücke e. V., stellv. Vors. Kuratorium Deutsche Stiftung für Internat. rechtliche Zusammenarbeit (IRZ). - MdB seit 1998; bis 2013 Parl. Geschäftsführer der SPD-Fraktion; Vors. der Dt.-Portugiesischen Parlamentariergruppe; seit Dez. 2013 Parl. Staatssekretär beim BMin der Justiz und für Verbraucherschutz.
