	Michael Schüller & Rüdiger Kruse GbR, Hamburg', 'Abitur am Gymnasium Altona. Studium der Medizin bis zum 2. Statsexamen Univ. Hamburg. Geschäftsführer der Schutzgemeinschaft Deutscher Wald Landesverband Hamburg e. V. (SDW); Vors. der Stiftung Unternehmen Wald. 1975/93 Mitgl. in der Jungen Union, seit 1977 Mitgl. der CDU, Ortsvors. der CDU Lokstedt-Niendorf-Schnelsen, Kreisvors. der CDU Eimsbüttel. 2001/Okt. 2009 Mitglied der Hamburgischen Bürgerschaft. - MdB seit Okt. 2009; Beauftragter für maritime Wirtschaft der CDU/CSU-Fraktion.', 'Rüdiger', '11004083');
