	Mitglied der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK)
	Mitglied der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK)', '1973 Abitur. Wehr- und Zivildienst. Studium der Sozialwissenschaften in Göttingen. Tätigkeiten als Journalist und Pressesprecher. Mitgl. der Grünen seit 1980, 1994/98 Sprecher des Bundesvorst. von BÜNDNIS 90/DIE GRÜNEN. MdL Niedersachsen der 10. und 11. WP, mehrmals Vors. der Fraktion Die Grünen; 1990/94 Niedersächsischer Minister für Bundes- und Europaangelegenheiten. Mitgl. ver.di. - MdB seit 1998; Okt. 1998/Nov. 2005 Bundesminister für Umwelt, Naturschutz und Reaktorsicherheit; Okt. 2005/Okt. 2009 stellv. Vors. der Fraktion Bündnis 90/Die Grünen und Okt. 2009/Okt. 2013 Fraktionsvors. der Fraktion Bündnis 90/Die Grünen; Mitgl. Parl. Versammlung der NATO, Nov. 2015/April 2016 Ko-Vors. der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK).', 'Jürgen', '11003246');
