	Mitglied des Aufsichtsrates, ehrenamtlich (bis 31.01.2014)', '1974/84 POS Dessau. 1984/86 Ausbildung zur Zootechnikerin. 1986/88 Tätigkeit als Briefträgerin. 1986/88 Abendschule und Abitur am Philanthropinum, Dessau. 1988/93 Studium der Agrarwissenschaften Humboldt-Univ. Berlin. 1993/94 Fraktionsgeschäftsführerin der Stadtratsfraktion Bürger/Forum/Grüne in Dessau. Seit 1990 Mitgl. BÜNDNIS 90/DIE GRÜNEN, 1993/94 Mitgl. Landesvorst. BÜNDNIS 90/DIE GRÜNEN Sachsen-Anhalt; 2004 Leiterin des Wahlkampfes der Partei zum Europaparlament; 2005 Leiterin des Bundestagswahlkampfs von BÜNDNIS 90/DIE GRÜNEN gemeinsam mit Fritz Kuhn, 2002/13 Politische Bundesgeschäftsführerin von BÜNDNIS 90/DIE GRÜNEN. - MdB 1994/02 und seit Okt. 2013, 1998/02 und seit Okt. 2013 Parl. Geschäftsführerin der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Steffi', '11002720');
