	Mitglied des Aufsichtsrates, ehrenamtlich', 'Grundschule, Gymnasium, allgemeinbildendes Abitur 1972. Grundwehrdienst. Studium der Germanistik, Sportwissenschaften und Philosophie in Tübingen, 1. Staatsexamen 1979, Referendardienst, 2. Staatsexamen 1981. 1981/90 Lehramt an allgemeinbildenden Gymnasien (Deutsch, Sport). 1990 Referent für Öffentlichkeitsarbeit im Ministerium für Kultus, Jugend und Sport des Landes Baden-Württemberg, ab 1992 Pressesprecher im Kultusministerium. Seit 1990 Mitgl. der CDU, Ehrenvors. des CDU-Kreisverbandes Ostalb. Präs. im Deutschen Verband für das Skilehrwesen, Präs. im Internationalen Verband d. Schneesportinstruktoren. Englisch (f), Französisch (G), Latein (G). - MdB seit 1998; 2009/15 haushaltspol. Sprecher der CDU/CSU-Fraktion, seit Febr. 2015 Parl. Staatssekretär beim BMin. für Verkehr und digitale Infrastruktur.', 'Norbert', '11003033');
	Mitglied des Aufsichtsrates, ehrenamtlich', 'Realschulabschluss 1965. Gehobene Beamtenlaufbahn, Stadtinspektor 1970/73. 1972/73 Zivildienst. 1973/80 Geschäftsführer und Verwaltungsleiter bei Einrichtungen der SJD "Die Falken". Seit 1967 Mitgl. der SPD, bis Dez. 2015 Mitgl. im Bundesvorst. der SPD. - MdB seit 1980; Mai 1999/Dez. 2013 stellv. Vors. der SPD-Fraktion für die Bereiche Finanzen und Haushalt.', 'Joachim', '11001740');
