	Mitglied des Beirates (bis 16.01.2014)', '1974/80 Jugendleiter des Bundes Deutscher Kommunalbeamter und Arbeitnehmer im DBB. Aktiv in der Lebensrechtsbewegung, Mitgl. Bundesvorst. Lebenshilfe e.V., seit Nov. 2014 Vizepräs. Special Olympics Deutschland, Mitgl. der Landesarbeitsgemeinschaft Gemeinsam Leben, Gemeinsam Lernen NRW e. V., seit 1986 stellv. Bundesvors. der Christdemokraten für das Leben (CDL), Mitgl. Arbeitsgemeinschaft Spina bifida und Hydrocephalus (ASbH e. V.). Mitgl. bagfa Bundesarbeitsgemeinschaft der Freiwilligenagenturen im Projekt "Sensibilisieren, Qualifizieren und Begleiten - Freiwilligenagenturen als inklusive Anlauf- und Netzwerkstellen für Engagement weiterentwickeln", Mitgl. der KAB. 1971 Eintritt in die Schüler-Union und JU, 1974 Mitgl. der CDU, 1982 der CDA, 1987/2014 Mitgl. CDU-Bezirksvorst. Ruhrgebiet, 1989/2013 Kreisvors. der CDU Unna, 2010/14 Mitgl. CDU-Bundesvorst. Englisch (G). - MdB 1991/2009 und seit Aug. 2012; Jan. 2010/Jan. 2014 Behindertenbeauftragter der Bundesregierung.', 'Hubert', '11000975');
