	Mitglied des Beirates des Stadtteil-Projekts Lirich (bis 30.06.2014)', '1981/91 Elsa-Brändström-Gymnasium Oberhausen, 1991 Abitur. 1991/93 Zivildienst beim Arbeitskreis Behinderter und Nichtbehinderter Katholisches Stadthaus Mülheim an der Ruhr. 1993 Studium der Rechtswissenschaften Ruhruniv. Bochum. Seit 1998 Gründer und Geschäftsführer der SAV Service Agentur Vöpel, Firma für Dienstleistungen mit Ausrichtung auf den Bereich Neue Medien, Schwerpunkt der Tätigkeit im Bereich IT-Handel und IT-Service. 1988 Eintritt in die SPD, 1988 Leiter der Juso-AG im Ortsverein Oberhausen-West, 1992/94 Vors. der Oberhausener Jungsozialisten, 1995/05 stellv. Vors. Ortsverein Oberhausen-West, seit Febr. 2005 Vors. Ortsverein Oberhausen-West; 2000 Gründungsmitgl. Arbeitskreis "Neue Medien" der Sozialdemokratischen Gemeinschaft für Kommunalpolitik NRW. 1989/94 Bürgermitgl. im Umweltausschuss der Stadt Oberhausen, 1994/99 Mitgl. der Bezirksvertretung Alt-Oberhausen, 1999/14 Mitgl. Rat der Stadt Oberhausen, 2011/14 Bezirksbürgermeister von Alt-Oberhausen. - MdB seit Okt. 2013.', 'Dirk', '11004433');
