	Mitglied des Beirates für sparkassenpolitische Grundsatzfragen', 'Mitgl. ver.di, AWO und Deutscher Kinderschutzbund (DKSB). Mitgl. SPD-Unterbezirksvorst. Donau-Ries, Mitgl. SPD-Bezirksvorstand Schwaben. Mitgl. des Kreistags Donau-Ries seit 1996. Englisch (G). - MdB seit 1994.
	Mitglied des Beirates zur wissenschaftlichen Begleitforschung
	Mitglied des Beirates', 'Abitur an der Albert-Schweitzer-Schule in Kassel. Zivildienst AWO. Studium der Politik- und Rechtswissenschaften in Marburg und Gießen, 2. jur. Staatsexamen, Promotion im Kommunalrecht. Fachgruppenleiter "Öffentliches Recht" beim Bundesverband der Unfallversicherungsträger der öffentl. Hand. 1996 Rektor und bis heute Professor an der Hochschule der Gesetzlichen Unfallversicherung, Bad Hersfeld. Herausgeber des Nomos-Kommentars Sozialgesetzbuch VII. 1978/82 Juso-Unterbezirksvorstand, 1985/89 Gemeindevertretung Edermünde, 1997/99 stellv. Stadtverordnetenvorsteher Gudensberg, 1999/09 Bürgermeister der Stadt Gudensberg, seit 2001 im Kreistag Schwalm-Eder, Mitgl. in versch. kommunalen Aufsichtsräten und Zweckverbänden, 2006/11 Mitgl. Verbandsversammlung LWV Hessen. 2007 Bezirksvorst. und Schatzmeister der SPD Hessen-Nord. Stellv. Vors. Kurt-Schumacher-Gesellschaft, Vorstand Dt. Parlamentarische Gesellschaft, Mitgl. ver.di. Englisch (f), Französisch (G). - MdB seit Okt. 2009; 2011/13 stellv. rechtspol. Sprecher; seit Jan. 2014 Vors. Gesundheitsausschuss.
	Mitglied des Beirates', 'Abitur. Arbeit als Beamtin in Istanbul, zunächst Arbeiterin, dann Sozialarbeiterin und währenddessen Zusatzausbildung als Sozialberaterin auf dem zweiten Bildungsweg. 1990 Ernennung zur ersten Migrantenbeauftragten von Charlottenburg/Wilmersdorf; 2009 vorzeitiger Ruhestand nach fast zwanzigjähriger Tätigkeit. Zuerst in der Westberliner Frauen- und Friedensbewegung aktiv, besonderes Anliegen, Menschen verschiedener Herkunftsländer, Kulturen und Religionen zu vernetzen und ihnen eine Plattform zu schaffen, um so ihren Platz in der Mehrheitsgesellschaft zu behaupten. Gründerin, Vorstandsmitgl., Vors. oder Sprecherin u. a. im Türkischen Frauenverein, im Westberliner Komitee für die Rechte der Frau, im Türkischen Bund Berlin-Brandenburg, in der Berliner Initiative gegen Gewalt gegen Frauen sowie als Migrantenbeauftragte. Beiratsmitgl. im "Pangea-Haus" Bezirksamt Charlottenburg-Wilmersdorf. 2011 gemeinsam mit dem Ehemann Gründung der Eberhard Schultz-Stiftung für soziale Menschenrechte und Partizipation mit Sitz in Berlin, die es sich zur Aufgabe gemacht hat, die sozialen Menschenrechte im Sinne der UN-Charta von 1966 zu stärken. Kein Parteimitglied. - MdB seit Okt. 2013; Sprecherin für Soziale Menschenrechte der Fraktion DIE LINKE.', 'Azize', '11004422');
	Mitglied des Beirates', 'Abitur. Studium an der Fachhochschule für Finanzen, 1986 Abschluss als Dipl.-Finanzwirtin, anschl. Finanzbeamtin in NRW, 1991 Wechsel nach Brandenburg zum Mitaufbau der dortigen Fachhochschule. 1993/98 Finanzbeamtin im Thüringer Finanzministerium. 1998 Steuerberaterprüfung, nun tätig als Steuerberaterin. Fortbildungsprüfung zur Landwirtschaftlichen Buchstelle. 1989/93 Mitgl. im Stadtrat Neuss, 1994/02 und seit 2014 Mitgl. im Erfurter Stadtrat, 1998/02 Fraktionsvors.; Mitgl. im Steuerberaterverband Thüringen, Mitgl. Mittelstandsvereinigung und CDA. Mitgl. im Beirat des Staatswissenschaftlichen Forums e. V., Mitgl. Förderverein Ursulinenkloster Erfurt, Mitgl. Beirat Katholische Schulstiftung im Bistum Erfurt, Vorstandsmitgl. Freundeskreis des Ev. Augustinerklosters zu Erfurt e. V. Englisch (G). - MdB seit Okt. 2002; seit Jan. 2014 Vors. der AG Finanzen der CDU/CSU-Fraktion.', 'Antje', '11003646');
	Mitglied des Beirates', 'Ev. Mörike-Gymnasium Stuttgart, Abitur. Bis 1990 Studium Rechtswissenschaften. 1990/91 Rechtsanwältin, Stuttgart. 1991/03 Verwaltung Landeshauptstadt Stuttgart, zuletzt 2003/07 Leiterin Oberbürgermeisterbüro, Stadtdirektorin; 2007/09 Abteilungsleiterin im Landtag von Baden-Württemberg, Ministerialdirigentin. 2001/03 hauptamtl. Beisitzerin an der Vergabekammer des Landes Baden-Württemberg.  - MdB seit Okt. 2009; Vors. der Gruppe der Frauen der CDU/CSU-Fraktion, Vors. der Deutsch-Ägyptischen Parlamentariergruppe.', 'Karin', '11004104');
	Mitglied des Beirates', 'Juni 2000 Abitur am Franziskaner Gymnasium in Kreuzburg, Großkrotzenburg. 2000/01 Studium der Medienwissenschaften, Politikwissenschaft und Anglistik Univ. Trier, 2001/06 Studium Politikwissenschaft, Soziologie und Anglistik  Univ. Kassel, Abschluss Magistra Artium. 2005/06 Tutorin für politische Theorie an der Univ. Kassel. 2004/05 Wahlkreisreferentin der Bundestagsvizepräsidentin Dr. Antje Vollmer, 2005/07 Wahlkreisreferentin der hessischen Landtagsabgeordneten Sigrid Erfurth. 2004/07 Landesvors. der "Grünen Jugend Hessen" und Mitgl. im erweiterten Landesvorstand der hessischen Grünen, Gründungsmitgl. der Kasseler Grünen-Hochschulgruppe und AStA-Referentin der Univ. Kassel. April 2007 Mitgl. der Regionalen Planungsversammlung Nordhessen, 2006/07  Mitgl. der Stadtverordnetenversammlung Kassel. - MdB seit Febr. 2007; Sprecherin für Verbraucher- und Tierschutzpolitik Bündnis 90/Die Grünen, Febr. 2010 Mitgl. im Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, jetzt Ausschuss für Ernährung und Landwirtschaft.', 'Nicole', '11003884');
