	Mitglied des Beirates, ehrenamtlich (bis 06.05.2014)', 'Juni 2004 Abitur am Mallinckrodt Gymnasium in Dortmund. Seit 2004 Magisterstudium der Politikwissenschaft, des Öffentlichen Rechts und der Philosophie an der Eberhard-Karls-Univ. in Tübingen, 2006/10 Stipendiatin der Heinrich-Böll-Stiftung. 2005/07 Mitgl. des Allgemeinen Studierendenausschusses (AStA) an der Univ. Tübingen, 2005/06 stellv. Vors. des AStA, 2006/07 Mitgl. des Senates der Universität Tübingen. 2005/08 Mitgl. im Kreisvorst. Tübingen, 2007/09 Landesvorsitzende der GRÜNEN JUGEND Baden-Württemberg, 2009/15 Mitgl. im Landesvorst. von BÜNDNIS 90/DIE GRÜNEN Baden-Württemberg. Seit Sept. 2015 Mitgl. im 7. Beirat der Bundesakademie für Sicherheitspolitik (BAKS). - MdB seit Okt. 2009; in der 17. WP Sprecherin für Abrüstung; in der 18. WP Sprecherin für Sicherheitspolitik und Abrüstung der Fraktion Bündnis 90/Die Grünen, Obfrau im Verteidigungsausschuss und Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung.', 'Agnieszka', '11004106');
	Mitglied des Beirates, ehrenamtlich (bis 16.01.2014)
	Mitglied des Beirates, ehrenamtlich (bis 25.06.2015)
	Mitglied des Beirates, ehrenamtlich (bis 30.04.2014)
	Mitglied des Beirates, ehrenamtlich (bis 31.01.2016)', 'Grundschule in Brilon-Gudenhagen, danach Gymnasium Petrinum Brilon, 1991 Abitur. 1991/92 Offiziersausbildung mit Verwendungen u. a. im Einsatzführungskommando, Oberstleutnant d. R. Ab Wintersemester 1992/93 Studium der Rechts- und Politikwissenschaften an der Univ. Trier, Luxemburg und Speyer. 1997 Erstes jur. Staatsexamen und im Anschluss Magisterexamen in Politikwissenschaften. Ab Nov. 1997 Rechtsreferendar beim Oberlandesgericht in Koblenz. 1998/99 Dt. Hochschule für Verwaltungswissenschaften. 1999 Zweites jur. Staatsexamen. 1999/04 Geschäftsführer der Dt. Gesellschaft für Mediation (DGM). 1999/04 wiss. Mitarbeiter am Lehrstuhl von Prof. Dr. Katharina Gräfin von Schlieffen an der FernUniv. Hagen. 2003 Promotion zum Dr. jur. 2002/04 Dekanatsassistent von Prof. Dr. Dr. Vormbaum an der FernUniv. Hagen. 2000/06 Rechtsanwalt. 2006/08 Professor an der Fachhochschule des Bundes für öffentliche Verwaltung - Fachbereich Öffentliche Sicherheit, Abteilung Kriminalpolizei - beim Bundeskriminalamt in Wiesbaden. Seit 2008 Professor an der Fachhochschule für öffentliche Verwaltung des Landes Nordrhein-Westfalen FHöV NRW. Seit 1986 Mitgl. der JU Brilon. Seit 1989 Mitgl. der CDU, 2012/15 Kreisvors. der CDU im Hochsauerlandkreis. 2004/09 Fraktionsvors. der CDU im Rat der Stadt Brilon und stellv. Bürgermeister der Stadt Brilon. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Patrick', '11004155');
	Mitglied des Beirates, ehrenamtlich (bis 31.03.2014)', '1973/76 FH für Sozialarbeit, 1976 Sozialarbeiterin (grad.). 1976/77 Anerkennungsjahr als Sozialarbeiterin (staatl. Anerkennung), 1977/79 Sozialarbeiterin in der JVA Tegel. Studium der Rechtswissenschaften an der FU, 1982 1. jur. Staatsexamen; 1982/85 Rechtsreferendarin, 1985 2. jur. Staatsexamen. Rechtsanwältin. Seit 1979 Mitgl. der AL, jetzt BÜNDNIS 90/DIE GRÜNEN, versch. Funktionen, Juni 2000/März 2001 Vors. des Bundesvorst. von BÜNDNIS 90/DIE GRÜNEN. Mitgl. Abghs. Berlin 1985/87 und März 1989/Juni 2000, dort 1990/93 Vors. der Fraktion Bündnis 90/Grüne (AL)/UFV, 1995/98 stellv. Vors. und Jan. 1998/Juni 2000 Vors. der Fraktion BÜNDNIS 90/DIE GRÜNEN. - MdB seit Okt. 2002; Jan. 2001/Okt. 2005 Bundesministerin für Verbraucherschutz, Ernährung und Landwirtschaft, Okt. 2005/Okt. 2013 Vors. der Fraktion BÜNDNIS 90/DIE GRÜNEN, seit Jan. 2014 Vors. Ausschuss für Recht und Verbraucherschutz.', 'Renate', '11003576');
	Mitglied des Beirates, ehrenamtlich (bis 31.08.2015)', 'Fachhochschulreife. Polizeibeamter. Studium für den gehobenen Dienst und für den höheren Dienst. 20 Jahre aktiver Polizeidienst, 3 Jahre im Innen- und Staatsministerium Baden-Württemberg, zuletzt Referent für Innen- und Sicherheitspolitik im Staatsministerium Baden-Württemberg. 2000/05 Bezirksvors. AK Polizei der CDU Nordwürttemberg, seit 2002 Mitgl. Kreisvorst. CDU Landkreis Böblingen, 2005/11 Mitgl. im Landesvorst. der CDU Baden-Württemberg. Mitgl. der International Police Association IPA, Mitgl. Europa Union Deutschland e. V., im Deutsch-Amerikanischen Zentrum, Stuttgart; 2006/15 Präs. der THW-Landesvereinigung Baden-Württemberg, 2009/12 Mitgl. Beirat der Bundesakademie für Sicherheitspolitik. Preis des Landtags von Baden-Württemberg für besondere Leistungen auf dem Gebiet des Verfassungsrechts. Englisch (G). - MdB seit Okt. 2002; Vors. Parlamentarisches Kontrollgremium (PKGr), Vors. 3. Untersuchungsausschuss "Terrorgruppe NSU II".', 'Clemens', '11003507');
	Mitglied des Beirates, ehrenamtlich', '1961/70 Besuch von Schulen im Landkreis Kassel, Mittlere Reife. 1972 Berufsabschluss zur Kinderpflegerin. 1972/75 Gruppenleiterin im Kindergarten, 1984/96 EDV-Supporterin, 1999/05 Fraktionsreferentin, parl. Geschäftsführerin. 2005/09 MdL in Hessen. Seit 1974 Mitgl. der SPD; 1972/85 aktive Juso-Arbeit. 1989/06 Gemeindevertreterin in Niestetal, seit 1993 Kreistagsabgeordnete im Landkreis Kassel, 2006/14 Vors. und seit 2014 stellv. Vors. der Kreistagsfraktion. - MdB seit Okt. 2009.
	Mitglied des Beirates, ehrenamtlich', '1972 Abitur. 1972/78 Studium Deutsch und Sozialkunde, 1978 1. Staatsexamen, Referendariat, 1980 2. Staatsexamen. 1981/95 Gymnasiallehrer. 1976 Eintritt in die SPD, 1980/81 Juso-Vors. Unterbezirk Groß-Gerau, 1984/2014 Mitgl. SPD-Unterbezirksvorst. Groß-Gerau, 2008/10 Vors. SPD-Unterbezirk Groß-Gerau, 2001/15 Mitgl. im Bezirksvorst. Hessen-Süd. 1988/10 Mitgl. im Kreistag Groß-Gerau. MdL Hessen 1995/02. Seit 1976 Mitgl. THW, seit 1998 Landesvors. THW-Vereinigung Hessen, Mitgl. Präsidium der Bundesvereinigung THW. Ehrnamtl. Mitgl. Kuratorium Stiftung Technisches Hilfswerk, ehrenamtl. Mitgl. Beirat Zukunftsforum öffentliche Sicherheit e. V., Berlin, und Beirat Forschungsforum öffentliche Sicherheit, FU Berlin, ehrenamtl. Mitgl. Beirat Deutscher Feuerwehrverband, Mitgl. Beirat Stiftung Datenschutz, Mitgl. Beirat Marktwächters Digitale Welt des VZBV, Mitgl. Datenschutzbeirat Dt. Telekom. Mitgl. IG Bau, AWO, Naturfreunde. Mitgl. Katastrophenschutzstab Landkreis Groß-Gerau, Kreisbeauftragter und Fachberater des THW, Mitgl. der SEEBA (Schnelleinsatzeinheit Bergung Ausland des THW), Mitgl. (inaktiv) im Katastrophen-, Erkundungs- und Koordinierungsteam der Vereinten Nationen (UNDAC), div. Hilfseinsätze im In- und Ausland; Mitbegründer Zukunftsforum Öffentliche Sicherheit. Englisch (f). - MdB seit Okt. 2002; stellv. Vors. Ausschuss Digitale Agenda.
	Mitglied des Beirates, ehrenamtlich', '1983 Abitur am Gymnasium Martinum Emsdetten. 1983/90 Studium Soziologie, Geschichte und Politikwissenschaft an der Univ. Münster; 1988/90 Referentin für Kultur und Frieden im AStA. 1990/94 Landesgeschäftsführerin der Deutschen Friedensgesellschaft (DFG-VK) NRW in Dortmund, 1995/99 Leiterin der Bundesgeschäftsstelle der DFG-VK in Velbert, 1995/01 DFG-VK-Bundessprecherin, 1999/02 Elternzeit sowie Tätigkeit als freie Journalistin u. a. bei der münster-taz, 2000/03 Redakteurin der Zeitschrift "Friedensforum", 2002/09 Geschäftsführerin beim Bund für Soziale Verteidigung in Minden. 2005 Eintritt in die WASG, 2005/07 Sprecherin WASG Kreisverb. Steinfurt, 2007/08 Kreisvorstandsmitgl. DIE LINKE. Kreisverb. Steinfurt, 2008/09 Mitgl. im Präsidium des Landesrats der Partei DIE LINKE. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2009; seit Mai 2014 stellv. Vors. Dt.-Indische Parlamentariergruppe und Mitgl. der Dt.-Nordischen Parlamentariergruppe; seit Dez. 2015 gesundheitspol. Sprecherin der Fraktion DIE LINKE.', 'Kathrin', '11004181');
	Mitglied des Beirates, ehrenamtlich', 'Besuch der Volksschule in Lünten; Mittlere Reife am Werner-von-Siemens-Gymnasium in Gronau. Nach der mittleren Reife Familiengründung; etliche Jahre Tätigkeit im Verkauf von Damenoberbekleidung; Unterstützung, Versorgung und Pflege von Großeltern und Eltern bis 2011. Katholische Frauengemeinschaft; Arbeiterwohlfahrt; Gründungsmitglied des Kreisflüchtlingsrates Borken; Heimatverein Vreden-Lünten; Sportverein FC Vreden 52 e.V. Seit 1980 Mitglied der SPD; seit vielen Jahren stellvertretende Vorsitzende der SPD im Unterbezirk Borken; seit November 2012 Mitglied des Regionalvorstandes der SPD Westliches Westfalen;von 1984 bis 2004 Mitglied im Rat der Stadt Vreden; Ehrenratsfrau der Stadt Vreden; seit 1989 Mitglied des Kreistages Borken; 2004/13 Vorsitzende der SPD-Kreistagsfraktion. Mitgl. IG BCE. - MdB seit Okt. 2013.', 'Ursula', '11004404');
	Mitglied des Beirates, ehrenamtlich', 'Kooperative Gesamtschule/Albert-Einstein-Schule Laatzen, 1988 Abitur. 1988/96 Ersatzdienst im Rettungsdienst und Katastrophenschutz der Johanniter. 1993 1. Jur. Staatsexamen Univ. Hannover; 1996 Ergänzungsstudium an der Verwaltungshochschule in Speyer, 1997 2. Jur. Staatsexamen. Seit Juli 1997 Zulassung als Rechtsanwalt. 1999 Promotion Univ. Hannover in Verfassungsrecht und Rechtsgeschichte. Seit 2000 Fachanwalt für Strafrecht, Referent und Sachverständiger in Agrarausschüssen des EP und BT. 2000/04 stellv. Vors. der SPD Hannover-Land, 2005/09 stellv. Vors. der SPD in der Region Hannover, seit 2009 Vors. SPD-Unterbezirk Region Hannover, seit Juni 2008 Mitgl. Präsidium der Landes-SPD, seit Nov. 2013 Mitgl. Bundesvorst. der SPD. Seit 1991 Mitgl. im Rat der Stadt Laatzen, 1995/05 Fraktionsvorsitzender. Mitgl. NABU, AWO und CVJM. Englisch (f), Französisch (G). - MdB seit 2005; seit 2009 umweltpol. Sprecher, seit Juni 2015 Sprecher der Parlamentarischen Linken in der SPD-Fraktion.
	Mitglied des Beirates, ehrenamtlich', 'Studium der Geschichte, Kunstgeschichte und Germanistik in Stuttgart. 2002/13 Mitgl. Parteirat BÜNDNIS 90/DIE GRÜNEN. Französisch (f), Englisch (G). - MdB seit 1994; 1994/02 rechtspolitischer Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, Mitgl. im Fraktionsvorst. und 1998/02 politischer Koordinator des Arbeitskreises Innen, Recht, Frauen, Jugend und Petitionen. Okt. 2002/Okt. 2013 1. Parl. Geschäftsführer der Fraktion BÜNDNIS 90/DIE GRÜNEN, 2005/13 menschenrechtspolitischer Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, seit 2014 religionspol. Sprecher, 2014/März 2016 innenpol. Sprecher und seit 2016 migrationspol. Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, 2014/März 2016 Vors. der Deutsch-Israelischen Parlamentariergruppe des Deutschen Bundestages.', 'Volker', '11002625');
	Mitglied des Beirates, ehrenamtlich', 'Städtisches Gymnasium Löhne, 1998 Abitur. 1998/99 Grundwehrdienst. Studium der Rechtswissenschaft  Univ. Bielefeld, 1. Staatsexamen; Wissenschaftl. Hilfskraft an einem Lehrstuhl der Univ. Bielefeld, Referendariat im Bezirk des OLG Hamm, 2. Staatsexamen. Rechtsanwalt; Promotion zum Dr. jur. Univ. Bielefeld. Seit 1995 Mitgl. der CDU, seit 2012 Vors. CDU-Kreisverband Herford, seit 2014 stellv. Vors. CDU-Bezirksverband Ostwestfalen-Lippe. Seit 2002 Mitgl. Rat der Stadt Löhne, 2009/13 Vors. der CDU-Fraktion im Rat der Stadt Löhne. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Tim', '11004367');
