	Mitglied des Betriebsausschusses der Stadtwerke, ehrenamtlich (bis Juli 2014)', 'Ausbildung zum Groß- und Außenhandelskaufmann, Ausbildung zum Altenpflegehelfer; Diplom-Sozialpädagoge (FH), Diplom-Kaufmann (FH). Verkaufs-Sachbearbeiter im Groß- und Außenhandel; zehn Jahre als Sozialpädagoge in der Jugendhilfe tätig, seit 2006 selbstständig mit dem Aufbau und Führung einer Zeitarbeits- und Personalvermittlungsfirma für Fachkräfte im sozialen Bereich, 2012 Übergabe der Firma. Arbeit als Wirtschaftsmediator, Praxisanleiter in der Ausbildung von Erzieherinnen und Erziehern. Seit 1989 Mitgl. der GRÜNEN, 1990 Mitgl. Ortsvorstand der GRÜNEN in Filderstadt, Kassierer, 1990 Mitgründung der Grünen Jugend (damals GAJ) Baden-Württemberg, drei Jahre Mitgl. Landesvorst., 1991 Kreisvorstand der GRÜNEN. 1994/2014 Stadtrat in Filderstadt, 2009/13 Fraktionsvors., 1999/2014 Mitgl. Kreistag. - MdB seit Okt. 2013; Sprecher für Bahnpolitik der Fraktion Bündnis 90/Die Grünen.', 'Matthias', '11004278');
	Mitglied des Bezirksausschusses 16, ehrenamtlich (bis 30.04.2014)', '2001 Realschulabschluss, 2003 Fachhochschulreife. 2003/04 Zivildienst. 2004/09 Studium der Betriebswirtschaftslehre, Dipl.-Betriebswirt (FH). 2009/11 wissenschaftl. Mitarbeiter und Doktoratstudium, 2011 Promotion zum Dr. phil., 2011/13 Referent bei einer Krankenkasse. Mitgl. der Jungen Union seit 1999, der CSU seit 2001, 2009/11 Vors. der Jungen Union München, seit 2009 Ortsvors. der CSU Waldperlach und stellv. Kreisvors. der CSU München-Ost. - MdB seit Okt. 2013.', 'Wolfgang', '11004414');
