	Mitglied des Fachbeirates', '1995/2000 Studium der Rechtswissenschaft Julius-Maximilian-Univ. Würzburg, 1998 Studium des französischen und des Europarechts an der Universität Lausanne, 2000 1. jur. Staatsexamen, 2000/01 Promotionsstudium Univ. Würzburg, Stipendiatin der Konrad-Adenauer-Stiftung, 2000/02 Referendariat in Schweinfurt und Tätigkeit bei Pricewaterhouse Cooprs Veltins Rechtsanwaltsgesellschaft mbH, München. 2003 2. jur. Staatsexamen. Seit 2004 zugelassene Rechtsanwältin. Seit 1997 Mitgl. der CSU, 1999/09 stellv. JU-Bezirksvors., seit 2001 stellv. Landesvors. des AK Umweltsicherung und Landesentwicklung der CSU, 2003/11 Mitgl. im JU-Landesvorstand, seit 2003 Mitgl. im CSU-Bezirksvorstand, seit 2007 Mitgl. Landesvorst. der Frauen Union, seit 2009 Mitgl. CSU-Parteivorstand und Bezirksvors. der Frauen-Union, seit 2010 Mitgl. der Mittelstands-Union, seit 2011 stellv. FU-Landesvors. und CSU-Kreisvors. 2000/08 Gemeinderätin in Schwebheim (Lk. Schweinfurt), seit 2008 Kreisrätin im Landkreis Schweinfurt. Seit 2015 Mitgl. Stiftungsrat der Bundesstiftung Baukultur. Mehrfache Bayerische Meisterin im Tennis. 2004/Okt. 2013 Mitgl. Europäisches Parlament für Deutschland, umwelt-, verbraucherschutz-, gesundheits-, sportpolitische Sprecherin der CSU-Europagruppe. - MdB seit Okt. 2013; Obfrau der CDU/CSU-Fraktion im Ausschuss für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Anja', '11004440');
