	Mitglied des Gemeinderates (bis 13.04.2015)', 'Abitur am BSZ für Wirtschaft in Lichtenstein. Wehrdienst in Weiden in der Oberpfalz. Studium der Politikwissenschaft und Betriebswirtschaftslehre an der Technischen Universität Chemnitz. 2002/12 Mitarbeiter und Büroleiter bei einem MdB. 2012 Leiter des Büros für Wirtschaftsförderung der Stadt Zwickau; seit 2012 selbstständiger Wirtschafts- und Unternehmensberater. Seit 2002 Mitgl. der CDU, seit 2005 Vors. der CDU Mülsen, 2010/12 stellv. CDU-Kreisvors., seit 2012 Erster stellv. Vors. CDU-Kreisverband. 2009/12 Gemeinderat und stellv. Bürgermeister der Gemeinde Mülsen, Gemeinderatsmitglied der Gemeinde Mülsen bis April 2015. Seit Okt. 2013 Mitgl. Aufsichtsrat der Glauchau Holding GmbH. - MdB seit Okt. 2013.', 'Carsten', '11004332');
	Mitglied des Gemeinderates (bis April 2014)
	Mitglied des Gemeinderates (bis Juni 2014)', 'Mittlere Reife. Ausbildung zur Gymnastiklehrerin in Coburg, Abitur auf dem 2. Bildungsweg. Studium der Sozialwissenschaften an der Universität Wuppertal. Seit 1988 Mitgl. der SPD, bis 1999 Vorsitzende des Ortsvereins Kierspe, stellv. Vorsitzende des Unterbezirks Märkischer Kreis, Mitgl. Parteivorst. der SPD (Beisitzerin). Mitgl. der AWO, IGBCE, Mitgl. Verein "Gegen Vergessen - Für Demokratie e. V., Mitgl. Johanniter-Unfall-Hilfe, Bürgerbus Kierspe e.V., Förderverein Waldschule Märkischer Kreis e.V., Mitgl. DRK und FSC Arbeitsgruppe Deutschland e. V. 1994/2013 Mitgl. im Rat der Stadt Kierspe, 1999/07 Vors. der SPD-Fraktion. - MdB seit Okt. 2009.', 'Petra', '11004026');
