	Mitglied des Geschäftsführenden Bundesvorstandes, ehrenamtlich', '1983/92 Stiftisches Humanistisches Gymnasium Mönchengladbach, Abitur. 1992/93 Wehrdienst. 1993/97 Studium der Rechtswissenschaften an der Rheinischen Friedrich-Wilhelms-Universität in Bonn, 1998 Erstes jur. Staatsexamen, 1999/01 Referendariat und einsemestriges Ergänzungsstudium an der Deutschen Hochschule für Verwaltungswissenschaften in Speyer, 2001 Zweites jur. Staatsexamen. 2001/02 Rechtsanwalt in der Kanzlei Segbert & Partner, Korschenbroich; 2002/05 wissenschaftl. Mitarbeiter der CDU-Landtagsfraktion Nordrhein-Westfalen, dort Leiter des Referats Verkehrspolitik; 2005/09 stellv. Leiter des Ministerbüros des Finanzministeriums von Nordrhein-Westfalen. 1989 Eintritt in die Schüler Union und Junge Union, 1991 Eintritt in die CDU, seit 2000 Vors. CDU-Stadtverband Korschenbroich. 1999/09 Mitgl. Rat der Stadt Korschenbroich, 2004/09 Vors. des Ausschusses für Kultur, Familie und Soziales der Stadt Korschenbroich, 1999/02 stellv. Vors. und 2002/09 Vors. der CDU-Stadtratsfraktion Korschenbroichs. Seit 2014 Mitgl. des geschäftsführenden Vorstands des Weißen Rings e. V. - MdB seit Okt. 2009; seit der 18. WP Obmann im Ausschuss für Kultur und Medien und seit Okt. 2016 Vors. Innenausschuss.', 'Ansgar', '11004056');
