	Mitglied des Haushaltsausschusses, von Amts wegen', '1974 Abitur in Neunkirchen Saar. 1974/81 Studium der Rechtswissenschaften an der Univ. des Saarlandes, 1981 1. jur. Staatsexamen; 1981/84 Rechtsreferendariat, 1984 2. jur. Staatsexamen. 1984/89 Pers. Referentin MdB Werner Schreiber, 1989/2000 Hausfrau und Mutter. 1999/09 Bezirksbürgermeisterin (ehrenamtl.) im Stadtbezirk Halberg der Landeshauptstadt Saarbrücken. 2000/16 stellv. Kreisvors. CDU-Kreisverb. Saarbrücken-Stadt, seit 2000 Vors. CDU-Stadtbezirksverb. Halberg, 2003/05 Mitgl. im Landesvorst. der CDU Saar; seit 2008 Mitgl. BFA der CDU Deutschlands für Außen-, Sicherheits-, Entwicklungs- und Menschenrechtspolitik, 2011/13 Mitgl. BFA der CDU Deutschlands für Bildung, Forschung und Innovation; seit 2014 Mitgl. Bundesarbeitsgruppe Staatsfinanzen im Wirtschaftsrat der CDU e. V. Seit 2006 Vorstandsmitgl. bei Hilfe zur Selbsthilfe e. V. (HELP), seit 2010 Mitgl. Habitat for Humanity Deutschland, 2010/12 Mitgl. im ASA-Programmbeirat der Gesellschaft für Internationale Zusammenarbeit (GIZ), 2010/14 Mitgl. im Kuratorium der Georg Kraus Stiftung, seit 2011 Mitgl. Parl. Beirat für Bevölkerung und Entwicklung, seit 2014 Senatorin der Leibniz-Gemeinschaft, seit 2015 Kuratoriumsmitgl. Stiftung Haus der kleinen Forscher. - MdB seit 2005; seit 2010 Mitgl.der PV des Europarates, 2010 bis zur Auflösung Juni 2011 Mitgl. der Europ. Versammlung für Sicherheit und Verteidigung/Versammlung der WEU.', 'Anette', '11003776');
