	Mitglied des Kreistages (bis 30.04.2014)', '1990 Hochschulreife. Studium der Biologie an der Ludwig-Maximilian-Universität, 1997 Diplom-Biologe, Sept. 2003 Promotion im Fach Biologie. Seit Okt. 2003 tätig als unabhängiger Postdoc am Institut für Systematische Botanik. Nov. 1998/Okt. 2003 Mitarbeiter von Susanna Tausendfreund (MdL) und Nov. 2003/Okt. 2005 von Dr. Christian Magerl (MdL). Seit 1984 Mitarbeit, seit 1986 Mitgl. bei Bündnis 90/Die Grünen, 1988/95 Sprecher im Ortsverband Sauerlach, seit 1996 im Kreisverband München-Land, seit 2001 der LAK Ökologie. 2002/05 Gemeinderat in Sauerlach, 2003/14 Kreisrat im Kreistag des Landkreises München. Mitgl. beim Bund Naturschutz, VCD, LBV, Naturfreunde Deutschland und ver.di. - MdB seit Okt. 2005; 2011/13 Vors. Ausschuss für Verkehr, Bau und Stadtentwicklung; seit Okt. 2013 Vors. der Fraktion Bündnis 90/Die Grünen.', 'Anton', '11003772');
	Mitglied des Kreistages (bis 30.11.2013)
	Mitglied des Kreistages (bis Ende Januar 2015)
	Mitglied des Kreistages (bis Juni 2014)
	Mitglied des Kreistages (bis Mai 2014)
	Mitglied des Kreistages (bis März 2014)
	Mitglied des Kreistages', '1961/73 Schulzeit in Spremberg, 1973 Abitur. 1973/75 Grundwehrdienst in Cottbus. 1975/79 Studium in Potsdam, Abschluss Diplomlehrer für Biologie und Chemie. 1979/82 Lehrer in Spremberg und im Kreisgebiet; 1982/85 Aspirantur an der Zentrale für Wasservogelforschung der DDR, Bearbeitung ethologischer Fragestellungen, anschließend Promotion. 1985/90 Leiter "Station Junger Techniker und Naturforscher" in Spremberg. Seit Juli 1990 Amtsleiter und Dezernent im Landratsamt Spremberg.
	Mitglied des Kreistages', '1986 Abitur am Mons-Tabor-Gymnasium Montabaur. 1986/90 Studium Betriebswirtschaftslehre WHU Vallendar, 1988 Auslandssemester ESC Lyon und Carnegie Mellon University Pittsburgh, USA; 1990 Dipl.-Kfm. Wissenschaftl. Mitarbeiter an der WHU; 1994 Promotion Dr. rer. pol.; 2005/06 Zweitstudium Paul H. Nitze School of Advanced International Studies (SAIS) der Johns Hopkins University, Washington DC, USA, 2006 Master of International Public Policy (M.I.P.P.); 2011 Programm "The Global Economy", Harvard Business School, Cambridge MA, USA. 1994/2005 Tätigkeit im Corporate Finance-Geschäft bei Barclays/BZW, Credit Suisse First Boston und UBS in Frankfurt/Main und London, 2006/11 Leiter Mergers & Acquisitions (M&A)-Beratung bei Sal. Oppenheim jr. & Cie. KGaA. 2012/13 Prof. für Corporate Finance an der Frankfurt School of Finance & Management. Alt-Stipendiat der Konrad Adenauer-Stiftung. 2007/13 Board of Trustees des American Institute for Contemporary German Studies (AICGS) in Washington DC. Seit 2010 Mitgl. Aufsichtsrat der Böker & Paul AG - Kanzlei für Vermögensmanagement, Montabaur. 1991/95 Kreisvors. der Jungen Union Westerwald, 1992/2000 Mitgl. Landesvorst. der Jungen Union Rheinland-Pfalz, seit 1991 Mitgl. CDU-Bezirksvorst. Koblenz-Montabaur, seit 2014 Kreisvors. CDU Westerwald. Seit 1998 Mitgl. Kreistag Westerwaldkreis. - MdB seit Okt. 2013.', 'Andreas', '11004362');
