	Mitglied des Kreistages, ehrenamtlich', '1981 Mittlere Reife. 1981/83 Ausbildung zur Rechtsanwaltsfachangestellten. 1983/85 tätig im Ausbildungsberuf, 1986/89 Assistenz der Geschäftsleitung eines mittelständischen Dienstleistungsunternehmens, seit 1989 Siemens AG Healthcare Sector Erlangen, zuletzt freigestellte Betriebsrätin. Mitgl. der IG Metall und der Arbeiterwohlfahrt. Englisch (f). - MdB seit Okt. 2013.
	Mitglied des Kreistages, ehrenamtlich', '1983/92 Goethe-Gymansium Emmendingen, Abitur. 1992/93 Zivildienst im Rettungsdienst des Roten Kreuzes. 1993/98 Jura-Studium in Freiburg; 1999/2000 Referendariat in Offenburg; 2000/01 Promotion, Nebentätigkeiten an der Universität Freiburg. Seit 2001 Rechtsanwalt in Emmendingen. Seit 1990 Mitgl. der SPD, 2000 stellv. SPD-Kreisvors., seit 2004 SPD-Kreisvors. 1994/2013 Mitgl. im Gemeinderat Emmendingen, 2005/09 stellv. Oberbürgermeister von Emmendingen, seit 2009 Kreisrat. Mitgl. Weisser Ring, AWO, Deutsches Rotes Kreuz, Deutscher Anwaltverein, ASJ-Landesvorst Baden-Württemberg, Ski-Club Emmendingen, Handball-Club Emmendingen, TC Reute, Bürgerverein Bürkle-Bleiche, Föderverein Goethe-Gymnasium Emmendingen, Tabakverein Mahlberg, FC Bundestag und Hochburgverein Emmendingen. Englisch (f). - MdB seit Okt. 2013; seit Sept. 2014 Sprecher der SPD-Fraktion für Recht und Verbraucherschutz.
