	Mitglied des Kuratoriums für Deutsches und Internationales Parteienrecht und
	Mitglied des Kuratoriums', '1976 Abitur. 1976/83 Studium der Politikwiss., Philosophie und Dt. Philologie in Münster; 1980/82 Studienaufenthalte in Budapest, 1983 Magisterexamen. 1977/78 Zivildienst Frauenklinik Münster. 1983/85 Ass. der Staatsmin. Inge Donnepp, 1985/86 Ass. des MdL, Günter Harms. 1986/90 Lehrbeauftragter FH für öffentliche Verwaltung NRW, Münster, 1991/03 Amtsleiter für Stadtentwicklung u. Wirtschaftsförderung Stadt Beckum; seit 2003 Landesgeschäftsführer der Sozialdemokratischen Gemeinschaft für Kommunalpolitik (SGK) NRW. Seit 1975 Mitgl. der SPD, seit 2000 Mitgl. SPD-Landesvorst., seit 2001 Vors. SPD-Unterbezirk Warendorf. 1979/03 Ratsmitgl. Stadt Sendenhorst, 1988/02 Fraktionsvors.; 1992/14 Mitgl. Regionalrat (Bezirksplanungsrat) Münster, 1996/14 Fraktionsvors. Seit Nov. 2013 Mitgl. im Kuratorium St. Josef-Stift Sendenhorst (ehrenamtlich); Mitgl. ver.di, BUND, Naturfördergesellschaft Sendenhorst; Schützenverein St. Martinus Sendenhorst. - MdB seit Okt. 2013; seit 2014 kommunalpol. Sprecher der SPD-Fraktion.', 'Bernhard', '11004258');
	Mitglied des Kuratoriums', '1981 Abitur am Städtischen Gymnasium Erftstadt-Lechenich. 1981 Studium der Politologie, Soziologie, Philosophie und der politischen Ökonomie in Köln, Bonn und Bremen, 1990 Abschluss als Dipl.-Soz.Wiss. 1990/94 Jugendbildungsreferent der JungdemokratInnen/Junge Linke NRW; 1994 Wahlkampfleiter der PDS in NRW, 1994/02 wiss. Mitarbeiter der PDS im Bundestag; 2003/05 Persönlicher Referent der Berliner Senatorin für Gesundheit, Soziales und Verbraucherschutz, Dr. Heidi Knake-Werner; 2005/09 Leiter des Abgeordnetenbüros von Prof. Dr. Lothar Bisky im Deutschen Bundestag. 1980/96 Mitgl. der Jungdemokraten/Junge Linke, 1980/82 Mitgl. der FDP, 1988/90 Mitgl. der DKP, 1993/07 Mitgl. der PDS, 2005/07 Mitgl. der WASG,  2007 Gründungsmitgl. der Partei DIE LINKE. Mitgl. der IG Metall, der Rosa-Luxemburg-Stiftung NRW und des Instituts Solidarische Moderne, ordentliches Mitgl. Kuratorium Stiftung Haus der Geschichte. Englisch (f), Französisch (G). - MdB seit Okt. 2009; rentenpol. Sprecher der Fraktion DIE LINKE., Obmann und Mitgl. im Ausschuss für Arbeit und Soziales, seit Nov. 2014 Parl. Geschäftsführer der Fraktion DIE LINKE, Mitgl. Parlamentskreis Automobiles Kulturgut; stellv. Vors. der Deutsch-Spanischen und der Deutsch-Italienischen Parlamenteriergruppe, Mitgl. der Deutsch-Französischen Parlamentariergruppe.', 'Matthias W.', '11004012');
	Mitglied des Kuratoriums', '1991/97 Studium Politologie, Öffentliches Recht, Germanistik und Soziologie in Frankfurt/Main. Seit 1987 Mitgl. der SPD, 1996/15 Vorstandsmitgl. SPD-Bezirk Hessen-Nord, 2009/14 Generalsekretär SPD Hessen. Seit 2004 Mitgl. der Landessynode der Ev. Kirche Kurhessen-Waldeck und der Kammer für Öff. Verantwortung der EKD. Kuratoriumsmitgl. Stiftung Denkmal für die ermordeten Juden Europas, Mitgl. des Rundfunkrates Deutsche Welle. Aufsichtsratsvors. Zentrum für Internationale Friedenseinsätze ZIF, Kuratoriumsmitgl. Institut für europäische Politik IEP, Mitgl. des Vorst. des Dt.-Französischen Instituts, Mitgl. Stiftungsrat der Stiftung Flucht, Vertreibung, Versöhnung, Mitgl. Stiftungsrat der Deutschen Stiftung Friedensforschung (DSF). - MdB seit 1998; 2010/13 europapol. Sprecher der SPD-Fraktion, 2009/14 Vors. der Landesgruppe Hessen der SPD-Fraktion. Seit Dez. 2013 Staatsminister für Europa im Auswärtigen Amt, seit Jan. 2014 Beauftragter der Bundesregierung für die dt.-französische Zusammenarbeit.', 'Michael', '11003213');
	Mitglied des Kuratoriums', '1995 Abitur am Ulrich-von-Hutten-Gymnasium Berlin-Lichtenrade. Nov. 1992/Juni 1993 Besuch des Hurstpierpoint College in England. 1995/96 Grundwehrdienst im Jägerbataillon 581, Scharfschützenausbildung, März 1999 Unteroffizierslehrgang der Reserve. Studium der Rechtswissenschaften Freie Universität Berlin, 2002 erstes jur. Staatsexamen, 2008 zweites jur. Staatsexamen. 2008 Promotion an der Ludwig-Maximilians-Universität München im Europäischen Wirtschaftsverfassungsrecht. Seit 2008 Rechtsanwalt in der internationalen Wirtschaftskanzlei Hengeler Mueller. U. a. (Alt-) Stipendiat der Konrad-Adenauer-Stiftung, Mitgl. Kuratorium der Magnus-Hirschfeld-Stiftung, Mitgl. Deutschlandradio-Hörfunkrat, Mitgl. Bürgerinitiative Dresdner Bahn e. V. Seit 1998 Mitgl. der CDU, seit 2006 Vors. der CDU Lichtenrade, seit 2007 stellv. Kreisvors. der CDU Tempelhof-Schöneberg. Englisch (f), Französisch (G). - MdB seit Okt. 2009; Obmann der CDU/CSU-Fraktion im Ausschuss für Recht und Verbraucherschutz.', 'Jan-Marco', '11004100');
	Mitglied des Kuratoriums', '1995 Abitur. 1996/03 Studium der Kommunikationswissenschaften an der LMU München. 2004/08 Angestellte bei versch. Event-Agenturen. Ab 2008 Mitarbeiterin der Bundestagsfraktion DIE LINKE. Mitgl. im Förderkreis demokratische Volks- und Hochschulbildung, im Bund demokratischer Wissenschaftlerinnen und Wissenschaftler (BdWi), der Wolfgang-Abendroth-Stiftungs-Gesellschaft, des Kurt-Eisners-Verein in Bayern, der Gewerkschaft für Erziehung und Wissenschaft (GEW) und der Vereinten Dienstleistungsgewerkschaft (ver.di). Mitgl. im Beirat des Deutschen Studentenwerks und im Parlamentarischen Beirat der Fernuniversität in Hagen. 2004 Eintritt in die WASG, 2005 Mitgl. des geschäftsführenden Landesvorst. der WASG in Bayern und 2007/14 Mitgl. im Landesvorst. der LINKEN in Bayern. - MdB seit Okt. 2009; hochschul- und wissenschaftspolitische Sprecherin der Fraktion DIE LINKE.', 'Nicole', '11004041');
	Mitglied des Kuratoriums', '2002/06 Deutscher Bundestag, Tätigkeit für verschiedene Abgeordnete der CDU/CSU-Bundestagsfraktion. 2006/08 Haus & Grund Deutschland, 2008/13 BDA Bundesvereinigung der Deutschen  Arbeitgeberverbände Abteilung Arbeitsmarktpolitik. 2003 Eintritt in die CDU, seit 2014 stellv. Kreisvors. CDU Dahme-Spreewald, seit April 2015 stellv. Vors. der CDU Brandenburg, seit Juli 2015 Vors. Landesfachausschuss Artbeitsmarkt und Soziales der CDU Brandenburg, Mitgl. im Bundesfachausschuss Wirtschaft und Arbeit der CDU Deutschlands. Seit 2014 Mitgl. Präsidium DRK Brandenburg, seit 2014 Beiratsmitgl. Michels Kliniken, 2015 Mitgl. Kuratorium McDonalds Kinderhilfe Stiftung, seit Nov. 2016 Mitgl. Vorst. Heimatstiftung Museumsdorf Glashütte. - MdB seit Okt. 2013; Vors. Deutsch-Spanische Parlamentariergruppe, Vorstandsmitgl. im Parlamentskreis Mittelstand, Vors. der Kommission für ein modernes Arbeits- und Sozialrecht im Parlamentskreis Mittelstand.', 'Jana', '11004398');
	Mitglied des Kuratoriums', 'Bis 1992 Realschule Emlichheim. 1992/93 Berufsgrundbildungsjahr Agrarwirtschaft, 1993/95 betriebliche Ausbildung mit Abschlussprüfung. 1995/96 Wehrdienst bei der Bundeswehr in Lingen. 1997/98 einjährige Fachschule Agrarwirtschaft, 2002 Abschlussprüfung staatl. gepr. Landwirtschaftsmeister. 1998/01 Mitarbeiter auf dem landw. Familienbetrieb, 2001 Übernahme des Familienbetriebes, z. Zt. Betriebsleiter eines Milchviehbetriebes. 1994 Eintritt in die Junge Union, 2002 Eintritt in die CDU, 2003/09 Bezirksvors. der Jungen Union Osnabrück-Emsland, seit 2010 Mitgl. CDU-Bezirksvorst., seit Februar 2012 CDU-Vors. der Samtgemeinde Emlichheim. - MdB seit Okt. 2013.', 'Albert', '11004415');
	Mitglied des Kuratoriums', 'Seit 1984 Mitgl. der SPD. 1989/94 Stadträtin im Wieslocher Gemeinderat. 1991/94 Sprecherin Juso-Landesverb., 1999/09 Landesvors. SPD Baden-Württemberg, seit 2001 Mitgl. im SPD-Parteivorstand und Präsidium. 2006/09 MdL in Baden-Württemberg, 2006/08 Vors. der SPD-Landtagsfraktion Baden-Württemberg. Mitgl. u.a. bei der DLRG (Vizepräsidentin), THW (Ehrenpräsidentin THW-Jugend Baden-Württemberg), Eurosolar, Naturfreunde und ver.di. - MdB 1994/05 und seit Okt. 2009; 2002/05 Parl. Staatssekretärin beim BMin. des Innern; seit Dez. 2013 stellv. Vors. der SPD-Fraktion.
