	Mitglied des Kuratoriums, ehrenamtlich', '1974/78 Grundschule, 1978/87 Gymnasium in Bonn. 1987/93 Studium der Informatik und Biologie. 1991/95 wissenschaftlicher Mitarbeiter am Forschungszentrum Informationstechnik der GMD, 1996/2000 Wissensmanagement-Berater bei einer IT-Firma. 1985 Eintritt in die SPD, 1992/08 Mitgl. des Vorst. der Bonner SPD, 1992/2000 Sprecher und 2001/08 Vors. der Bonner SPD, 2009/11 Mitgl. SPD-Parteivorst. 1987/89 sachkundiger Bürger im Umweltausschuss der Stadt Bonn, 1989/94 Mitgl. der Bezirksvertretung Bonn-Beuel, 1994/02 Mitgl. im Rat der Stadt Bonn. Mitgl. u. a. ver.di, Greenpeace, BUND, ADFC, Eurosolar. Englisch (f), Französisch (G). - MdB seit Sept. 2000; Nov. 2005/Dez. 2013 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretär beim BMin. der Justiz und für Verbraucherschutz.', 'Ulrich', '11003450');
	Mitglied des Kuratoriums, ehrenamtlich', '1980 Realschule Oberhagen, 1983 Abitur Gymnasium Hohenlimburg. 1983/84 Wehrdienst, Sanitätssoldat. 1984/85 Vertretung des erkrankten Vaters als Schulhausmeister. 1985/88 Ausbildung zum Versicherungskaufmann. 1988 KDV-Anerkennung, Restzivildienst. 1988/93 Studium Biologie Ruhr-Univ. Bochum u. Diplomarbeit Max-Planck-Institut f. Molekulare Physiologie Dortmund, 1993/94 Ökologie-Studium (nebenberufl.) Univ.-GHS Essen. 1994/98 wissenschaftl. Mitarbeiter am Uniklinikum Essen. 1983 Eintritt in die SPD, stellv. Kassierer SPD Oberhagen. 1993/94 Mitgl. der Bezirksvertretung Eilpe/Dahl, 1994/98 Ratsmitgl. in Hagen. Vors. AWO Ennepe-Ruhr. Mitgl. ver.di, Falken, Naturschutzbund, Hagener Friedenszeichen, Eurosolar, Solarenergieförderverein, 3.-Welt-Laden, TSV Fichte Hagen, Verein Gegen Vergessen - Für Demokratie, Erzählcafé, Hospiz Emmaus Gevelsberg, Kuratorium "Ein Haus für Kinder" Hagen und Stiftung Zukunft EN, Gevelsberg und Mitgl. im Senat der Helmholtz-Gemeinschaft. Englisch (f), Französisch (G). - MdB seit 1998; in der 15. WP Vors. der Enquete-Kommission "Ethik und Recht der modernen Medizin",  2008/09 Vors. Parl. Ethik-Beirat.', 'René', '11003210');
	Mitglied des Kuratoriums, ehrenamtlich', '1985 Abitur am Zeppelin-Gymnasium Lüdenscheid. Grundwehrdienst. 1986/92 Studium der Rechtswissenschaften an der Universität Bonn, anschl. Referendarausbildung am OLG Koblenz, 1995 Zulassung als Rechtsanwalt, 2003 Promotion zum Dr. jur. an der Universität Bonn. 1995/05 Justiziar und Leiter der Abteilung Recht/Patente der DKR mbh, 2006/09 Rechtsanwalt und Prokurist BDO Deutsche Warentreuhand AG Wirtschaftsprüfungsgesellschaft. Mitgl. des Parlamentskreises Mittelstand, der DJK Eintracht Lüdenscheid, des Lüdenscheider Tennisvereins von 1899 e. V., des RC Lüdenscheid und des Sauerländer Gebirgsvereins. Stellv. Kreisvors. CDU Märkischer Kreis, Mitgl. CDU-Landesvorst. NRW; Bezirksvors. MIT Südwestfalen, stellv. Landesvors. MIT NRW, Mitgl. Bundesvorst. der MIT. Englisch (f). - MdB seit Okt. 2009; Mitgl. Vorst. der CDU/CSU-Fraktion.', 'Matthias', '11004051');
	Mitglied des Kuratoriums, ehrenamtlich', '1986 Abitur in Hattingen. 1986/90 Studium der Wirtschaftswissenschaft in Bochum, 1990 Dipl.-Ökonom. 1990/95 Wiss. Mitarbeiter am Institut für Entwicklungsforschung und Entwicklungspolitik Ruhr-Univ. Bochum, 1995 Dr. rer. oec. 1996/98 Wiss. Assistent Fakultät für Wirtschaftswissenschaft Ruhr-Univ. Bochum. 1983 Eintritt in JU und CDU, 1989 KPV, 1992 CDA. 1988/94 Stadtverbandsvors. JU Hattingen, 1992/96 Kreisvors. JU Ennepe-Ruhr, 1996/2000 Landesvors. JU NRW. 1994/98 Ortsvors. CDU Hattingen-Mitte, seit 1995 Kreisvors. CDU Ennepe-Ruhr, seit 2014 Beisitzer im Bundesvorst. der CDU. Seit 2002 Landesvors. CDA NRW, seit 2003 stellv. CDA-Bundesvors., seit 2005 Beisitzer Präs. EUCDA, seit 2011 Bundesvors. CDA/dbb-AG, seit 2016 Vors. Bundesfachausschuss Arbeit und Soziales der CDU. Beisitzer im Vorst. der Deutschen Atlantischen Gesellschaft; Mitgl. Kuratorium Dt. Orient-Stiftung, Mitgl. Stiftungsrat der Stiftung zur Aufarbeitung der SED-Diktatur. Mitgl. KAB. - MdB seit 1998; 2005/09 Vors. der AG Arbeit und Soziales der CDU/CSU-Fraktion; Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Arbeit und Soziales, seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin der Verteidigung.', 'Ralf', '11003055');
	Mitglied des Kuratoriums, ehrenamtlich', '1987 Abitur am Johannes-Althuisius-Gymnasium in Emden. 1990/93 Bezirksregierung Weser-Ems, zuletzt Regierungsinspektor z. A., 1993/2000 Fachhochschule Ostfriesland, zuletzt Regierungsoberamtsrat. 2003/13 hauptamtlicher Bürgermeister der Gemeinde Krummhörn. Mitgl. Arbeiterwohlfahrt, ver.di, Sozialverband Deutschland. Mitgl. der SPD. - MdB seit Okt. 2013.', 'Johann', '11004393');
	Mitglied des Kuratoriums, ehrenamtlich', '1991 Abitur an der Erweiterten Oberschule "Albert Einstein". 1992/95 Studium der Betriebswirtschaftslehre mit dem Schwerpunkt Wirtschaftsinformatik an der Technischen Fachhochschule Berlin, studienbegleitende Tätigkeit bei der IBM Deutschland GmbH. Mitgl. ver.di, ADFC, Solidaritätsdienst International (SODI), Verein "Helle Panke", der Gemeinschaft der Förderer von Zoo und Tierpark Berlin, Volkssolidarität, HELP-Hilfe zur Selbsthilfe e.V., Atlantik-Brücke e. V. und Verein für Pankow e. V. Seit 1990 Mitgl. der PDS, 1996 Wahl zum Bezirksvors. der PDS Marzahn, dort 1998 im Amt bestätigt, 1999 stellv. Landesvors. 2001/05 Landesvors. der PDS Berlin. 1995/09 Mitgl. des Abgeordnetenhauses von Berlin, dort in den Wissenschafts-, Wirtschafts-, Technologie-, Frauen-, Haushaltskontrollausschüssen sowie im Ausschuss für Jugend, dem Hauptausschuss und einer Enquetekommission; wirtschafts-, wissenschafts- und finanzpol. Sprecher der PDS-Fraktion, 2002/06 Vors. und 2006/09 stellv. Vors. der PDS-Fraktion im Berliner Abgeordnetenhaus. Englisch. - MdB seit Okt. 2009.', 'Stefan', '11004093');
	Mitglied des Kuratoriums, ehrenamtlich', '2006 Abschluss Magistra der Politik- und Kulturwissenschaften Univ. Leipzig. 2006/09 Wissenschaftliche Mitarbeiterin und Projektleiterin am Institut für Politikwissenschaft der Univ. Leipzig in verschiedenen Forschungsprojekten. 2008/13 Geschäftsführerin der Kreistagsfraktion DIE LINKE in Nordsachsen. Seit Juni 2012 Vors. der LINKEN im Kreisverband Nordwestsachsen. Mitgl. u. a. ver.di, Rosa-Luxemburg-Stiftung Sachsen. - MdB seit Okt. 2013; Sprecherin der Fraktion DIE LINKE für Kommunalfinanzen, seit Dez. 2014 Parl. Geschäftsführerin der Fraktion DIE LINKE, stellv. Vors. der Deutsch-Britischen und der Deutsch-Ukrainischen Parlamentariergruppe.', 'Susanna', '11004322');
	Mitglied des Kuratoriums, ehrenamtlich', 'Abitur 1969, Hegau-Gymnasium Singen. 1969/71 Wehrdienst, Fähnrich d. R. 1971/75 Studium der Rechts- und Staatswissenschaft Univ. Freiburg, 1975 1., 1977 2. jur. Staatsexamen. 1976/78 Univ. Freiburg, Beauftragter des Rektors für pol. Bildung. 1979 Eintritt in die Innenverwaltung Baden-Württemberg, 1980/90 stellv. Landrat im Landratsamt Tuttlingen. Ehrenvors. Psychosozialer Förderkreis Tuttlingen. 1966/84 JU-Mitgl., 1969/73 JU-Kreisvors. Konstanz, 1973/76 ehrenamtl. Geschäftsführer und Bezirksvorstandsmitgl. JU Südbaden; 1975/89 Pressesprecher und 1989/91 Schatzmeister der CDU Südbaden. 1984/86 Vors. CDU-Stadtverb. Tuttlingen, 1985/99 Vors. CDU-Kreisverb. Tuttlingen; 1991/05 Generalsekretär der CDU Baden-Württemberg, 2005 Generalsekretär der CDU Deutschlands. Englisch (G). - MdB seit 1990; 1998/Sept. 2002 Vors. der CDU-Landesgruppe Baden-Württemberg, 2002/05 1. Parl. Geschäftsführer der CDU/CSU-Fraktion, seit Nov. 2005 Vors. der CDU/CSU-Fraktion.', 'Volker', '11001074');
	Mitglied des Kuratoriums, ehrenamtlich', 'Abitur am Engelbert-von-Berg Gymnasium Wipperfürth. Betriebswirtschaftsstudium an der Univ. Köln, 1979 Diplom-Kaufmann. 1979/92 Angestellter in Finanzunternehmen, seit 1992 selbstständiger Wirtschaftsberater. 1972 Eintritt in die CDU, 1974/84 JU-Stadtverbands-, Kreis- und Bezirksvors., 1987/91 Kreisvors. der Mittelstandsvereinigung, 1989/95 Kreisschatzmeister der CDU, 1995/15 CDU-Kreisvors. Oberberg. 1979/82 Stadtrat in Wipperfürth, 1994 und 1999/10 Mitgl. Oberbergischer Kreistag, dort 1999/02 CDU-Fraktionsvors. 1999/02 Mitgl. der Landschaftsversammlung Rheinland. Englisch (f), Französisch (f). - MdB seit Okt. 2002; seit 2006 Vors. deutsch-kanadische Parlamentariergruppe; 2009/11 stellv. Vors. Finanzausschuss; 2011/14 finanzpolitischer Sprecher der CDU/CSU-Fraktion, seit 2014 Vors. parl. Finanzmarktgremium (Soffin).', 'Klaus-Peter', '11003528');
	Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Goetheschule Einbeck. Studium der Germanistik u. Anglistik in Tübingen. 1976/78 USA-Aufenthalt mit Aktion Sühnezeichen/Friedensdienste in Washington D.C. u. New York, Mitarbeit im Boykottbüro der Feld- u. Wanderarbeitergewerkschaft UFW/AFL-CIO. Studium der Rechtswissenschaften in Göttingen, 1983 Referendarexamen, danach wiss. Hilfskraft u. Arbeit in der Mieterberatung, 1986 Assessorexamen. 1986/90 Richter am Verwaltungsgericht. Seit 1980 Mitgl. der SPD, Funktionen bei den Jungsozialisten, seit 1989 Vors. SPD-Unterbezirk Göttingen. 1990/05 Mitgl. des Niedersächsischen Landtags, 1998/03 Minister für Wissenschaft und Kultur. 1999/04 Vors. Kuratorium VW-Stiftung, Mitgl. Kuratorium XLAB-Stiftung und Kuratorium Hertie School of Governance GmbH, Mitgl. in Kuratorien versch. Max-Planck-Institute, Juni 2014/Juni 2016 Mitgl. ZDF-Fernsehrat. - MdB seit Okt. 2005; Nov. 2007/Dez. 2013 Erster Parl. Geschäftsführer und seit Dez. 2013 Vors. der SPD-Fraktion.', 'Thomas', '11003820');
	Mitglied des Kuratoriums, jährlich, Stufe 3
