	Mitglied des Kuratoriums, von Amts wegen', '1982 Abitur in Düren. 1992 Magister Artium (M. A.) in den Fächern Politische Wissenschaft, Geschichte und Staatsrecht Univ. Bonn; 1985 Stipendiat der Konrad-Adenauer-Stiftung. 1992/04 Angestellter der Wirtschaftsvereinigung Stahl, Düsseldorf. 1997/05 Mitgl. Ausschuss für Öffentliche Verantwortung der Ev. Kirche im Rheinland. 2001/12 Vors. des CDU-Stadtverbandes Düren, 1989/12 stellv. Kreisvors. und seit 2012 Vors. CDU Kreis Düren, seit 2011 Vors. CDU-Bezirk Aachen; 1995/04 Landesvors. des Ev. Arbeitskreises (EAK) der CDU NRW und seit 2003 Bundesvors. des EAK des CDU/CSU Deutschlands. Seit 2000 Landessynodaler der Ev. Kirche im Rheinland, seit 2003 stellv. Mitgl. der Synode der Ev. Kirche in Deutschland (EKD), seit Nov. 2015 Mitgl. im Rat der EKD; seit 2006 Senator der Fraunhofer Gesellschaft. - MdB seit 1994; 1999/02 stellv. Vors. der Enquete-Kommission "Globalisierung der Weltwirtschaft", 1998/05 Obmann f. Bildung u. Forschung der CDU/CSU-Fraktion und 2003/05 Sprecher der CDU/CSU-Fraktion in der Enquete-Kommission "Ethik und Recht der modernen Medizin"; seit Nov. 2005 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung.', 'Thomas', '11002754');
	Mitglied des Landesvorstandes Fachbereich 6', '1984 Abitur am Gymnasium Ottweiler. 1984/85 Studium Mathematik mit Nebenfach Informatik, 1985/89 Studium an der FH Dudweiler, Abschluss Dipl.-Verwaltungswirt. 1990/91 Zivildienst. 1988/92 Zusatzstudium Fernuniv. Hagen, Vordiplom Ökonomie. 1992/95 wissenschaftl. Mitarbeiter der SPD-Landtagsfraktion, 1995/99 persönl. Referent von Innenminister Friedel Läpple, seit 1999 Referent im höheren Dienst beim Ministerium für Inneres und Europaangelegenheiten, seit 2003 stellv. Referatsleiter, seit 2004 Mitgl. Personalrat. Seit 1990 Vors. SPD-Ortsverein Welschbach, SPD-Gemeindeverbandsvors. in Illingen, Mitgl. Landesvorst der SPD Saar. Seit 1989 Mitgl. Gemeinderat Illingen und Ortsrat Welschbach, seit 1999 Ortsvorsteher in Welschbach, 1991/04 Vors. SPD-Fraktion im Illinger Gemeinderat, seit Juli 2009 Erster Beigeordneter der Gemeinde Illingen. Mitgl. u. a. ver.di, DRK, der Lebenshilfe Neunkirchen und deutsch-polnischer Freundeskreis Illingen. - MdB seit Jan. 2014.
	Mitglied des Landesvorstandes, ehrenamtlich', '1995 Abitur am Ignaz-Günther-Gymnasium in Rosenheim. Studium der Rechtswissenschaften in München. Mitgl. im Parteivorstand der CSU, Mitgl. im Bezirksvorstand der CSU Oberbayern, stellv. Kreisvors. der CSU Rosenheim-Land, Leiterin der CSU-Verkehrskommission, stellv. Landesvors. der Frauen-Union Bayern, stellv. Kreisvors. der Frauen-Union Rosenheim-Land, Mitglied im Bezirksvorstand der Frauen-Union Oberbayern.  Kreisrätin. Stellv. Kreisvors. des Bayerischen Roten Kreuzes Rosenheim, Schirmherrin Förderverein Kinderklinik Rosenheim, Schirmherrin Bundesverband Konduktive Förderung nach Petö e. V., Schirmherrschaft Pflegestiftung Meltl, Vorstandsmitgl. Fortschritt Rosenheim e.V. - MdB seit Okt. 2002; Vors. der AG Tourismus der CDU/CSU-Fraktion, stellv. Vors. der Gruppe der Frauen der CDU/CSU-Fraktion.', 'Daniela', '11003613');
