	Mitglied des Landtages', '2004 Abitur. 2004 Beginn des Studiums der Islamwissenschaften, Abschluss 2012. 2008 bis 2010 Sprecherin der Landesarbeitsgemeinschaft Europa-, Friedens und Außenpolitik der GRÜNEN Schleswig-Holstein, 2012 Kreisvors. der Kieler Grünen. Mitglied des Schleswig-Holsteinischen Landtags 2009 bis 2012. - MdB seit Okt. 2013.', 'Luise', '11004243');
