	Mitglied des Parlamentarischen Beirates', 'Facharbeiterlehre und Tätigkeit als Elektromechaniker bei der Deutschen Bundesbahn. 1974 Abitur am Erzbischöflichen Friedrich-Spee-Kolleg in Neuss. Studium der Geschichte, Politik, Erziehungswissenschaft und Kunstgeschichte in Marburg, Staatsexamen und Politikwissenschaftliche Promotion. 1981 Arbeit für die IG Metall in Stuttgart. Seit 1987 Politikberater des Vorstandes der IG Metall Frankfurt, 2001/09 Leiter der Abteilung Gesellschaftspolitik beim Bundesvorstand des Deutschen Gewerkschaftsbundes in Berlin. Seit 1971 Mitglied der SPD. - MdB seit Okt. 2013; stellv. Vors. der Deutsch-Griechischen Parlamentariergruppe.
