	Mitglied des Parlamentarischen Beirates, ehrenamtlich (bis 09.11.2015)', 'Abitur 1986. Wehrdienst. Studium der Wirtschaftswissenschaft und Geographie Ruhr-Univ. Bochum, 1994 Diplom-Geograph. 1994/99 Projektassistent bei einer Entwicklungsagentur. 1999/04 Oberbürgermeister der Stadt Gelsenkirchen. 2005 Leiter Vertrieb bei der Montan-Grundstücksgesellschaft. Juni 2005/Febr. 2009 Minister für Bauen und Verkehr des Landes NRW. 2009/10 Mitgl. der Geschäftsführung der Hellmich-Gruppe in Duisburg. Mitgl. der CDU seit 1982, seit 2008 Bezirksvors. der CDU Ruhr, seit 2013 Kreisvors. der CDU Gelsenkirchen, 2001/10 stellv. Landesvors. und 2010/12 Generalsekretär der CDU Nordrhein-Westfalen. Mitgl. Rat der Stadt Gelsenkirchen 1989/95. 2003/04 Stellv. der Präsidentin des Deutschen Städtetages. MdL Nordrhein-Westfalen Juni 1995/Sept. 1999, Dez. 2007/Juni 2010 und Mai 2012/Okt. 2013. - MdB seit Okt. 2013.', 'Oliver', '11004445');
