	Mitglied des Präsidiums (bis 31.03.2015)', '1960/68 Volksschule Stemwede-Oppenwehe, 1968/74 Söderblom-Gymnasium der ev. Landeskirche in Espelkamp. 1974/75 Wehrdienst. 1975/80 Studium an der Tierärztlichen Hochschule Hannover (TIHO), 1981 dort Promotion zum Dr. med. vet. 1980/81 wissenschaftl. Assistent an der Tierärztlichen Hochschule Hannover, 1981/84 Praxisassistent. 1984 Niederlassung als Tierarzt in Dassel-Markoldendorf, Niedersachsen. Seit 1970 Mitgl. der SPD, als Jungsozialist versch. Ämter auf Unterbezirks- und Bezirksebene, an der TIHO Asta-Vors., 1975/80 Mitgl. Konzil und Senat der TIHO. 1991/03 Mitgl. Stadtrat Dassel, 1996/03 Mitgl. im Kreistag Northeim. Mitgl. Freiwillige Feuerwehr Markoldendorf, Mitgl. Kuratorium QS Qualität und Sicherheit GmbH, Mitgl. Deutscher Ultraleichtverband e. V., Fördermitgl. Fachagentur Nachwachsende Rohstoffe e. V. (FNR). Englisch (f). - MdB seit Okt. 2002; seit 2009 Sprecher für Ernährung, Landwirtschaft und Verbraucherschutz , seit  Jan. 2014 für Ernährung und Landwirtschaft der SPD-Fraktion.', 'Wilhelm', '11003611');
	Mitglied des Präsidiums', 'Dipl.-Verwaltungswirt (FH). 1975/97 im rheinland-pfälzischen Landesdienst, u. a. Bezirksregierung Trier, Verteidigungslastenverwaltung, Ministerium des Innern und für Sport Rheinland-Pfalz und in der Gesundheitsverwaltung. 1997/02 direkt gewählter hauptamtlicher Bürgermeister der Verbandsgemeinde Trier-Land. Seit 1976 Mitgl. der CDU. 1989/97 Mitgl. Stadtrat Trier. Mitgl. Bundesvorst. der KPV. Mitgl. Präsidium Dt. Städte- und Gemeindebund (DStGB). Mitgl. und Mitarbeit Malteser Hilfsdienst, Freundschaftskreis Region Trier/Podolsk, Russland, und zahlreicher kultureller Institutionen und Vereine, Mitgl. Vorstand Deutsch-Russisches Forum e. V. - MdB seit Okt. 2002; seit Nov. 2005 Parl. Geschäftsführer der CDU/CSU-Fraktion, Obmann der CDU/CSU-Fraktion im Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung; Mitgl. des Ältestenrates; Vors. Dt.-Russische Parlamentariergruppe.', 'Bernhard', '11003562');
