	Mitglied des Präsidiums, ehrenamtlich', '1986/12 Hauptamtlicher Geschäftsführer für die SPD in Dortmund, Düsseldorf, Unna, Hamm und für die Ruhr-SPD; 2002/08 Geschäftsführer einer Grundstücksgesellschaft in Dortmund. Mitgl. der IG BCE, IG Metall. Mitgl. AWO, DRK, VdK, SjD-Die Falken, Förderkreis Heer, Gesellschaft für Wehr- und Sicherheitspolitik jetzt Gesellschaft für Sicherheitspolitik (GfW, Sektion Lippstadt), Mitgl. Präsidium der DWT Deutsche Gesellschaft für Wehrtechnik, Mitgl. Reservistenverband, Deutscher Bundeswehrverband, Sozialwerk der Bundeswehr; Mitgl. Borussia Dortmund, Bürgerschützenverein Bad Sassendorf, Förderverein Archi-Gymnasium und Förderverein Aldegrever Gymnasium. 1976 Eintritt in die SPD, von da an ständig ehrenamtlich in der Kommunalpolitik in Welver, Münster, Soest und Bad Sassendorf sowie im Ruhrgebiet tätig. - MdB seit Juni 2012; seit Mai 2015 Vors. Verteidigungsausschuss.', 'Wolfgang', '11004226');
	Mitglied des Präsidiums, ehrenamtlich', 'Abitur 1980 in Bensheim. 1980/85 Studium der Mathematik und Informatik an der TH Darmstadt, Diplom. 1986/88 Wissenschaftl. Mitarbeiter TH Darmstadt, 1988 Promotion Dr. rer. nat. 1989/90 Grundwehrdienst. April 1990/Jan. 1995 im Operationszentrum der Europ. Raumfahrtbehörde in Darmstadt. 1991 Eintritt in die CDU, 1991/94 Vors. CDU Bensheim, seit 1994 Kreisvors. der CDU Bergstraße, seit Dez. 1999 Bezirksvors. der CDU Südhessen und Mitgl. des Präsidiums der CDU Hessen, 2010 Mitgl. Bundesvorst. der CDU Deutschlands. Ortsbeirat in Bensheim-Zell 1983/94, Ortsvorsteher Bensheim-Zell 1985/94, 1989/97 Stadtverordneter in Bensheim, 1993/94 Fraktionsvors. der CDU in Bensheim. Englisch (f), Französisch (G). - MdB seit 1994; Okt. 2002/Dez. 2004 Vors. AG Finanzen der CDU/CSU-Fraktion, 2004/13 stellv. Vors. der CDU/CSU-Fraktion, seit Dez. 2009 Vors. der CDU-Landesgruppe Hessen; seit Dez. 2013 Parl. Staatssekretär beim Bundesminister der Finanzen..', 'Michael', '11002733');
	Mitglied des Präsidiums, ehrenamtlich', 'POS, 1979 Abschluss. Ausbildung am Zentralinstitut der Pionierorganisation Droyßig, 1983 Abschluss als Freundschaftspionierleiterin und Lehrerin für Deutsch und Kunsterziehung. 1983/85 Pionierleiterin, Lehrerin. Studium an der Parteihochschule "Karl Marx", 1988 Dipl.-Gesellschaftswissenschaftlerin. 1988/90 Mitarbeiterin für Aus- und Weiterbildung in der Pionierorganisation/Zentralrat der FDJ; Jan. 1991/Nov. 1995 hauptamtl. Tätigkeit bei der PDS. 1983/89 Mitgl. der SED; seit 1990 Mitgl. der PDS, Jan./Okt. 1991 PDS-Bezirksvors. Hellersdorf, Okt. 1991/Okt. 1992 stellv. Landesvors., Okt. 1992/Dez. 2001 Landesvors. Berlin der PDS, Okt. 2000/Okt. 2002 stellv. Parteivors. der PDS. 1990/95 BVV Hellersdorf. MdA Nov. 1995/98. Seit Nov. 2010 Mitgl. Präsidium Stiftung "Neue Verantwortung" e. V., Mitgl. Heimatverein Hellersdorf, Mahlsdorf, Kaulsdorf, Kuratorium "Stiftung Denkmal für die ermordeten Juden Europas", Verein der Förderer des Tierparks Friedrichsfelde e. V. und Dt. Vereinigung für Parlamentsfragen, seit Mai 2009 Mitgl. Kuratorium Gesellschaft für Christlich-Jüdische Zusammenarbeit in Berlin e. V., seit Nov. 2009 Mitgl. Kuratorium der Heinz-Galinski-Stiftung, seit 2009 Vizepräsidentin Dt. Parlamentarische Gesellschaft. - MdB seit 1998; Okt. 2000/Okt. 2002 stellv. Vors. der PDS-Fraktion; Okt. 2005 bis Feb. 2008 stellv. Vors. Fraktion Die Linke; Vizepräsidentin des Deutschen Bundestages, Mitgl. des Ältestenrates.', 'Petra', '11003206');
