	Mitglied des Rates der Stadt, ehrenamtlich (bis 20.08.2015)', 'Gymnasium Petrinum in Brilon, 2003 Abitur. Studium der Rechtswissenschaften Philipps-Univ. in Marburg und  Westfälische Wilhelms-Univ. in Münster, 2008 erstes jur. Staatsexamen; Referendariatszeit im Bezirk des OLG Hamm; Aufenthalt an der Deutschen Botschaft in New Delhi, 2010 zweites jur. Staatsexamen. 2010/13 Referent und Wissenschaftl. Mitarbeiter von Franz Müntefering (MdB) im Deutschen Bundestag in Berlin. Seit 2003 Mitgl. der SPD, seit 2006 Vors. der SPD Brilon, seit 2008 stellv. Vors. der SPD im Hochsauerlandkreis, seit 2012 Vors., seit 2012 stellv. Sprecher der Südwestfalen-SPD. Ab 2004 Sachkundiger Bürger im Rat, 2009/15 Mitgl. im Rat der Stadt Brilon. - MdB seit Okt. 2013; seit Jan. 2017 Parl. Staatssekretär bei der BMin. für Wirtschaft und Energie.', 'Dirk', '11004444');
