	Mitglied des Senats', 'Abitur am Gymnasium am Silberkamp Peine. Zivildienst beim Paritätischen Wohlfahrtsverband Peine. Studium der Politikwissenschaft und Soziologie an der Univ. Potsdam, Abschluss an der FernUniv. Hagen. Mitarbeiter im Landtag Brandenburg, 1998 Mitarbeiter einer Bundestagsabgeordneten. Herausgeber der Zeitschrift "Berliner Republik". Mitgl. AWO, IG Metall, Mitgl. VfB Peine, TSV Bildung Peine, KfW Bank, Stiftung Neue Verantwortung, Friedrich-Ebert-Stiftung, Leibniz-Gemeinschaft, Deutsch-Chinesisches Dialogforum. 1988 Eintritt in die SPD, Mitgl. der SGK; Nov. 2005/Nov. 2009 und seit Juni 2017 Generalsekretär der SPD, seit Dez. 2009 Vors. des SPD-Bezirks Braunschweig, seit Dez. 2011 Mitgl. SPD-Parteivorstand. - MdB seit 1998; seit Okt. 2009 stellv. Vors. der SPD-Fraktion.', 'Hubertus', '11003142');
