	Mitglied des Stadtrates', '1978 Realschulabschluss. 1978/81 Handwerkslehre zum Glaser. 1982/83 Wehrdienst. 1986 Meisterprüfung zum Glasermeister, 1991 Qualifikation "Betriebswirt des Handwerks". Bis Dezember 1995 Arbeitnehmer, ab Januar 1996 selbstständig als Glasermeister/Glaserei. 1996/10 Obermeister und seit 2010 Ehren-Obermeister der Glaserinnung Lüneburg-Stade. Mit 16 Jahren Eintritt in die JU, mit 18 Jahren in die CDU; zwischenzeitlich stellv. JU-Vors. Seit Dez. 2007 Ratsherr im Stadtrat der Hansestadt Lüneburg. - MdB seit Okt. 2009.', 'Eckhard', '11004131');
	Mitglied des Stadtrates', '1983/87 Berufsausbildung zum Maschinenschlosser bei der Deutschen Bundesbahn, 1987/89 Ausbildung zum Werkmeister (mittlere technische Beamtenlaufbahn). 1996/98 Studium zum gehobenen technischen Dienst an der FH Karlsruhe Fachrichtung Maschinentechnik und Elektrotechnik. 1990/91 Werkmeister in Würzburg und Nürnberg. 1991/94 Vors. der Jugend- u. Auszubildendenvertretung beim Präsidenten der Bundesbahndirektion Nürnberg, 1994/95 stellv.  Betriebsratsvors. in Würzburg. 1998/99 Einkauf und Materialwirtschaft in Nürnberg, 1999/04 Lehrer für Wagen- und Bremstechnik und Verladeberater in Nürnberg, 2004/08 Gruppenleiter Technische Wagenbehandlung in Nürnberg, 2008/11 Leiter Planungsgrundlagen bei DB Schenker Rail in Frankfurt am Main, 2011/13 Leiter Infrastruktur und Leiter des Railport Darmstadt bei DB Schenker Rail in Frankfurt am Main. 1992 Eintritt in die SPD, 1992/96 Mitgl. SPD-Ortsverein Rieneck, seit 1996 Mitgl.  SPD-Ortsvorst. Gemünden, seit 2004 Mitgl. SPD-Kreisvorst., seit 2008 stellv. SPD-Kreisvors. und Stadtrat in Gemünden am Main, 2009/13 1. Vors. SPD-Ortsverein Gemünden, seit 2010 Mitgl. im SPD-Bezirksvorst. Unterfranken und SPD-Unterbezirksvors. Main-Spessart/Miltenberg, ab 2012 stellv. Vors. der Unterfranken-SPD, seit 2014 Vors.; 2012/14 Vors. der AfA Unterfranken. Seit 2014 Mitgl. Kreistag Main-Spessart. - MdB seit Okt. 2013.
