	Mitglied des Stiftungsrates der Wissenschaftsstiftung Ernst Reuter,
	Mitglied des Stiftungsrates', '1980/82 Berufsfachschule für Sozialpädagogik, Ernährung und Hauswirtschaft, Ausbildungsgang zum Krankenpfleger; 1982/85 Ausbildung zum Bergmechaniker auf dem Bergwerk Friedrich-Heinrich in Kamp-Lintfort. 1985/91 Hydraulikschlosser unter Tage, 1991/97 Industriegewerkschaft Bergbau und Energie, Bezirk Ruhr-Nord Recklinghausen, Jugendsekretär für Bildung und Arbeitsrecht. 1994 Studium Sozial- u. Arbeitsrecht an der Sozialakademie in Dortmund. 1998/2000 Industriegewerkschaft Bergbau, Energie, Chemie (IG BCE), Bezirk Münster-Bielefeld, Betriebsbetreuung, Sozial- und Arbeitsrecht, Jugend, Bildung und Öffentlichkeitsarbeit, 2000/03 stellv. Bezirksleiter der IG BCE im Bezirk Hamm, seit 2003 Bezirksleiter im Bezirk Münster-Bielefeld. Seit 1982 Mitgl. der SPD. Englisch (G). - MdB seit Okt. 2013.', 'Ulrich', '11004290');
	Mitglied des Stiftungsrates', '1984 Hauptschulabschluss mit Fachoberschulreife. 1985/87 Ausbildung zur Bürogehilfin bei der DVG Duisburg. 1994/97 Ausbildung zur Sozialversicherungsfachangestellten; 2000/02 Berufsbegleitende Fortbildung zur Krankenkassenbetriebswirtin, 2003 Erwerb der Ausbildereignung. 2005/07 Abendstudium zur Personalmanagement-Ökonomin (VWA). 1986/88 Jugend- und Auszubildendenvertreterin bei der Duisburger Verkehrsgesellschaft (DVG), 1988/98 Mitgl. im Betriebsrat und Arbeitnehmervertreterin im Aufsichtsrat der DVG, 1987/01 Sachbearbeiterin bei der DVG, später bei der BKK DVG, 2002/06 stellv. Vorstand der BKK EVS. Mitgl. bei ver.di, SJD-Die Falken Duisburg, AWO Duisburg, Frauen helfen Frauen, DRK-Kreisverband Duisburg, DRK Stiftung Duisburg (Kuratorium), Bürgerverein Neudorf, MSV Duisburg, AIDS-Hilfe Duisburg/Kreis Wesel, zebrakids e. V., KG Rote Funken, Obdachlosenhilfe Duisburg e. V., Vorsitzende Förderverein Klinikum Duisburg, Schirmherrin Malteser Hospiz St. Raphael, Mitgl. Aufsichtsrat der Hüttenwerke Krupp Mannesmann GmbH (Arbeitnehmerseite). 1988 Eintritt in die SPD Duisburg. 1990/98 Juso-Vors. der SPD Duisburg, seit 1990 im Vorst. der SPD Duisburg und seit 2006 stellv. Vors., seit 2004 Mitgl. im SPD-Regionalvorstand Niederrhein und seit 2009 im Sprecherkreis der Ruhr SPD, seit 2010 Vors. Parteirat der NRWSPD. 1994/02 Mitgl. im Rat der Stadt Duisburg. Englisch (G). - MdB seit Okt. 2009; seit 2011 Mitgl. im erw. Vorstand der SPD-Fraktion, seit Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion und im geschäftsführenden Vorst. der SPD-Fraktion.', 'Bärbel', '11004006');
	Mitglied des Stiftungsrates', 'Abitur 1964 am Ostseegymnasium Timmendorfer Strand. 1964/66 Wehrdienst bei der Bundeswehr, z. Z. Oberleutnant d. R. Studium an der Univ. Hamburg, Rechtswissenschaftl. Fakultät, 1975 1., 1978 2. jur. Staatsexamen. 1978/80 Justitiar in einem Großhandelsunternehmen. Seit 1982 Zulassung als Rechtsanwalt. Seit 1967 Mitgl. der CDU und der JU, 1970/77 Landesvors. der JU Hamburg; seit 1972 Mitgl. CDU-Landesvorst. in Hamburg, 1976/92 stellv. CDU-Landesvors., 1974/96 Kreisvors. der CDU Hamburg-Nord, 1992/07 Landesvors. der CDU Hamburg und Mitgl. CDU-Bundesvorst. 1970/81 Mitgl. der Hamburger Bürgerschaft. Englisch (f), Französisch (f), Portugiesisch (G). - MdB seit 1980; ab 1989 Vors. Arbeitsgruppe Verkehr der CDU/CSU-Fraktion, ab 1998 Vors. AG Verkehr, Bau- und Wohnungswesen, ab Nov. 2005 Vors. AG Verkehr, Bau und Stadtentwicklung, Aufbau Ost, Nov. 2009/Jan. 2014 Vors. AG Verkehr, Bau und Stadtentwicklung.', 'Dirk', '11000549');
	Mitglied des Stiftungsrates', 'Rechtsanwalts- und Notargehilfin. 1979 Eintritt in den Polizeidienst, Ausbildung in Hannoversch Münden. 1981/83 Polizeibeamtin, zunächst in Syke, dann in Delmenhorst, Arbeitsbereich Eigentumsdelikte, 2000/05 Vors. Personalrat der Polizei; 2001 Eintritt gehobener Dienst, 2004/09 Pressesprecherin Polizei. Seit 1988 Mitgl. der SPD, stellv. Vors. der SPD Weser-Ems. 1996/16 Mitgl. im Stadtrat Delmenhorst, 2006/11 Vors. SPD- Stadtratsfraktion Delmenhorst. - MdB seit Okt. 2013.
