	Mitglied des Stiftungsrates, ehrenamtlich (bis Mai 2014)', '1966 Grundschule, 1969 Hauptschule, 1975 Gymnasium, 1978 Allg. Hochschulreife. 1979 Studium der Politikwissenschaft, Geschichte und der Wirtschaftswissenschaft, 1990 Diplom, 1991 Promotion. Seit 1979 Mitarbeiter bei versch. MdB, 1991/93 und 1998/01 Referatsleiter bei der Landesregierung NRW, 1993/98 Wiss. Referent bei der SPD-Landtagsfraktion NRW, 2001/02 Leiter Präsidialbüro im Landtag NRW. Mitgl. der SPD seit 1975 und seit 1977 versch. Funktionen bei den Jungsozialisten, der SJD - "Die Falken" und der SPD Köln. Mitgl. ver.di, Kindernöte e. V.; Mitgl. Vorst. Friedrich-Ebert-Stiftung, ehrenamtlich, seit Okt. 2011 Vors. Kuratorium des Max-Planck-Instituts für Gesellschaftsforschung in Köln, Vorstandsmitgl. des Arbeitskreises für das ausländische Kind e. V. und des Arbeiter-Samariter-Bundes Köln, Kuratoriumsmitgl. Stiftung Entwicklung & Frieden (sef), Bonn  (alle ehrenamtl.). - MdB seit Okt. 2002; 2004/09 nahost- und abrüstungspol. Sprecher, 2009/13 außenpol. Sprecher der SPD-Fraktion, seit Dez. 2013 stellv. Vors. der SPD-Fraktion.
	Mitglied des Stiftungsrates, ehrenamtlich', '1973/78 kaufm. Angestellter in der Bauwirtschaft. Seit 1972 Gemeinderat in Künzing, 1978/02 2. Bürgermeister der Gemeinde Künzing und seit 1978 Mitgl. Kreistag Deggendorf. 1978/86 MdL Bayern. - MdB seit 1987.', 'Bartholomäus', '11001055');
	Mitglied des Stiftungsrates, ehrenamtlich', '1982 Abitur in Bremen. Ausbildung in Würzburg, 1985 Abschluss der Dolmetscherschule als staatlich geprüfte Übersetzerin mit Schwerpunkt Wirtschaft;  während dessen ein Trimester Studium an der Universität von Salford in Manchester. Fremdsprachenkorrespondentin in Bremen bei Europa Carton und Siemens Ltd. in London, 1988/90 bei John Kaldor Fabrikmaker als European Sales Coordinator in London; anschl. Fremdsprachenkorrespondentin in Mailand und bei der Weberei Fossati Lamperti in Monza. 2009/13 Leiterin des Regionalbüros von Barbara Lochbihler, MdEP. Beisitzerin im Vorstand der Münchner Grünen, Delegierte zum Bundesfrauenrat, 2011/13 Sprecherin der Bundesarbeitsgemeinschaft Frauenpolitik, seit 2009 Sprecherin des Landesarbeitskreises Frauen- und Gleichstellungspolitik. - MdB seit Okt. 2013.', 'Doris', '11004436');
	Mitglied des Stiftungsrates, ehrenamtlich', '1990/94 Grundschule Maitenbeth, 1994/03 Gymnasium Gars, Abschluss Abitur. 2003/08 Studium Politikwissenschaften Ludwig-Maximilians-Univ. München, Abschluss M.A. Bis Sept. 2013 stellv. Leiterin Planungsstab der CSU-Landtagsfraktion, 2009/13  Referentin im Planungsstab der CSU-Landtagsfraktion, 2007 wiss. Mitarbeiterin im Büro des Generalsekretärs der CSU. 2010/11 Lehrbeauftragte an der Ludwig-Maximilians-Universität München. 2006/07 Assistentin des Direktors für Europäische Forschungspolitik und Innovation der Degussa Konzernrepräsentanz Brüssel. Seit 2004 Mitgl. CSU, Mitgl. der Grundsatzkommission der CSU, Mitgl. Landesvorst. des AK Außen- und Sicherheitspolitik der CSU, Schriftführerin im Kreisverb. der Frauen Union München West; 2007/15 Beisitzerin im Kreisvorst. der CSU Mühldorf am Inn, 2007/15 CSU-Ortsvors. Maitenbeth, 2009/15 stellv. Kreisvors. der Frauen Union Mühldorf am Inn, 2011/15 Beisitzerin im Bezirksvorst. der CSU Oberbayern, 2009/15 stellv. Kreisvors. der JU Mühldorf am Inn, 2013/15 Schriftführerin im Bezirksvorst. der Frauen Union Oberbayern, 2007/13 Vorstandsmitgl. der JU Oberbayern, 2009/11 Mitgl. im Landesvorst. JU Bayern. 2008/15 Gemeinderätin Maitenbeth, 2014/15 Kreisrätin in Mühldorf am Inn. Seit April 2014 Bischöfliche Beauftragte für die Prüfung von Vorwürfen sexualisierter Gewalt, Mitgl. Deutsche Härtefallstiftung. - MdB seit Okt. 2013.', 'Julia', '11004249');
	Mitglied des Stiftungsrates, ehrenamtlich', 'Studium der Medizin in Aachen, Texas (USA) und Düsseldorf, Promotion zum Dr. med. Studium der Epidemiologie und Gesundheitsökonomie (Health Policy and Management), Promotion an der Harvard Universität in Boston, USA. 1998/05 Direktor des Instituts für Gesundheitsökonomie und Klinische Epidemiologie (IGKE) der Universität zu Köln, seit 2008 Adjunktprofessor an der Harvard School of Public Health in Boston. 1999/05 Mitgl. im Sachverständigenrat zur Begutachtung der Entwicklung im Gesundheitswesen, 2003/05 Mitgl. der Kommission für die Nachhaltigkeit in der Finanzierung der Sozialen Sicherungssysteme (Rürup-Kommission). Mitgl. der Programmkommission der SPD Köln, 2004 Mitgl. der AG Bürgerversicherung des SPD-Parteivorst. Mitgl. bei ver.di. - MdB seit Okt. 2005; seit Dez. 2013 stellv. Vors. SPD-Fraktion.', 'Karl', '11003797');
	Mitglied des Stiftungsrates, von Amts wegen
