	Mitglied des Stiftungsrates, von Amts wegen', '1987 Abitur in Bamberg. 1987/92 Studium der Rechtswissenschaften in Erlangen, München und Bayreuth, 1992 1. jur. Staatsexamen, 1994 2. jur. Staatsexamen. 1994/2000 wissenschaftl. Assistent Univ. Bayreuth, seit 2001 Rechtsanwalt (Tätigkeit ruhend). 1985/03 Mitgl. der JU, 1995/03 Mitgl. Landesausschuss JU Bayern, 1998/02 Mitgl. Bundesvorst. JU Deutschland; seit 1987 Mitgl. der CSU, seit 2009 Kreisvors. CSU Bamberg-Land, seit 2005 stellv. Bezirksvors. CSU Oberfranken, 2001/05 und 2007/09 CSU-Parteivorst. Seit 2002 Mitgl. Kreistag Bamberg. Englisch (f), Französisch (f). - MdB seit Okt. 2002; Jan./Feb. 2014 stellv. Vors. der CDU/CSU-Fraktion. Seit Feb. 2014 Parl. Staatssekretär beim BMin für wirtschaftl. Zusammenarbeit und Entwicklung.', 'Thomas', '11003636');
	Mitglied des Stiftungsrates, von Amts wegen', '1987 Abitur in Hamburg. 1987/93 Studium der Politikwissenschaften an der FU Berlin, 1993 Diplom-Politologe. 1994/98 wissenschaftlicher Mitarbeiter im Deutschen Bundestag, 1998/02 Redaktionsdirektor. Seit 1986 Mitgl. der SPD, 1998/08 Vors. der SPD Spandau. 1998/02 Bezirksverordneter in Berlin-Spandau. Mitgl. u.a. Vorstand AWO Spandau, Berliner Komitee für Unesco-Arbeit e. V., Gegen Vergessen - Für Demokratie e. V., Institut für soziale Demokratie, Sozialverband Deutschland e. V. (Reichsbund); Mitgl. Parlamentarischer Beirat Bundesverband Deutscher Stiftungen e. V. - MdB seit Okt. 2002.
