	Mitglied des Verbandsrates (bis 30.04.2014)', '1974 Theodor-Heuss-Gymnasium in Nördlingen, 1983 Abitur. 1983 Studium Lehramt für Hauptschule Englisch/Geschichte, Deutsch, Musik Univ. Augsburg, 1989 erstes Staatsexamen; 1989/91 Lehramtsanwärterin in Wemding, 1991 zweites Staatsexamen. 1991/93 Hauptschullehrerin in Monheim und Wemding, 1993 bis 2013 Hauptschullehrerin in verschiedenen Augsburger Schulen, darunter viele Jahre Albert-Einstein-Schule, zuletzt Goethe Mittelschule als Stammschule. 1987 Eintritt in die SPD, Mitgl. im Vorst. Ortsverein Jakobervorstadt/Bleich, 2009/12 dort Ortsvereinsvors., seit 2008 Mitgl. im Unterbezirksvorst. SPD Augsburg, seit 2010 Vors., stellv. Vors. der SPD Schwaben, 2015 Mitgl. Landesvorst. SPD Bayern. 2002/14 Stadträtin in Augsburg, 2008/14 stellv. Fraktionsvors. 1995/13 Vors. GEW Augsburg und Vorstandsmitgl. DGB Region Augsburg, 1998/13 Personalrätin beim Staatl. Schulamt der Stadt Augsburg, 2002/08 Vorstand VHS Augsburg, 2005/14 Steuerungsgruppe Bürgerschaftliches Engagement Stadt Augsburg (Bündnis für Augsburg), Mitgl. AWO, seit 2015 Mitgl. Kuratorium der Hochschule Augsburg. Englisch (f), Französisch (G), Latein. - MdB seit Okt. 2013.
