	Mitglied des Verwaltungsrates und Stellv. Mitglied der Vergabekommission', 'Paderborner Gymnasium Theodorianum, Abitur. Studium der Politik, Geschichte, Soziologie, Pädagogik und Sozialwissenschaften in Münster, Magister und Staatsexamen für die Sekundarstufe I. Mitgl. Kuratorium Bundeszentrale für pol. Bildung, Bonn, stellv. Mitgl. Verwaltungsrat Dt. Nationalbibliothek, Frankfurt/Main, Mitgl. Hörfunkrat Deutschlandradio, Berlin, Mitgl. Verwaltungsrat FFA - Filmförderungsanstalt, Berlin, Mitgl. AWO, ver.di und Gegen Vergessen - Für Demokratie e. V. Seit 1994 an verschiedenen Stellen in der SPD tätig, unter anderem als Geschäftsführer im Hochsauerlandkreis. Seit 2002 stellv. Vors.  Kreisverband Paderborn, seit 2011 Vors., seit 2008 Mitgl. im Regionalvorstand OWL der SPD. - MdB seit Okt. 2013.', 'Burkhard', '11004254');
	Mitglied des Verwaltungsrates', 'Abitur 1981. Studium der Rechtswissenschaften Univ. Regensburg, 1989 1. und 1992 2. jur. Staatsexamen. Bundesvors. der Kath. Landjugendbewegung (KLJB), dann Landesgeschäftsführerin der KLJB bis zur Wahl in den bayerischen Landtag 1994. 1990 Mitgl. der SPD, seit 1993 SPD-Ortsvereinsvors. Wernberg-Köblitz, 2001/10 SPD-Kreisvors. im Landkreis Schwandorf, bis Nov. 2008 stellv. Vors. und seit Nov. 2008 Vors. SPD-Unterbezirk Schwandorf-Cham, stellv. Vors. SPD-Bezirk Oberpfalz, Mitgl. Präsidium BayernSPD. Seit 1996 Markträtin in Wernberg-Köblitz, Kreisrätin und bis April 2014 stellv. Landrätin. 1994/05 Mitgl. des bayerischen Landtages, 2002/Okt. 2005 bildungspolitische Sprecherin der SPD-Fraktion. Seit 2015 Mitgl. im Beirat des Deutsch-Tschechischen Gesprächsforums. Mitgl. KLJB, ver.di, ACE, AWO, BRK, VdK, KAB, KdFB, div. Frauenvereine und -initiativen, Lebenshilfe für geistig Behinderte e. V. Cham, Amnesty International, Gegen Vergessen - für Demokratie e. V., Naturfreunde, LBV, Bergwacht, Siedlerbund, div. Sport- und Schützenvereine, div. Feuerwehrvereine, Oberpfälzer Waldverein, div. Heimatpflege- und Kulturvereine, div. Kleintierzucht-, Obst- und Gartenbauvereine, div. Fördervereine, Eine-Welt-Hadel, Unicef und Leiterin des BDKJ-Zeltlagers Voithenberg (Furth i. W.). Englisch (f), Französisch (G). - MdB seit 2005.
