	Mitglied des Verwaltungsrates, ehrenamtlich', '1955 Abitur. Studium Naturwissenschaften und Volkswirtschaft, 1961 Dipl.-Chemiker, 1965 Dr. rer. nat. 1962/65 wiss. Assistent Univ. Frankfurt; Patentanmeldungen. 1966/71 Erzgesellschaft mbH im Haus Metallges. AG, Frankfurt, 1968/71 als Geschäftsf. 1971/82 Geschäftsf. bei Synthomer Chemie GmbH Frankfurt. 1982/93 Bmin. für Forschung und Technologie. Seit 1995 Honorarprof. Univ. Frankfurt. Dr. h. c. des Weizmann-Instituts in Rehovot, Israel, der Berg- und Hüttenakademie Krakau, der Univ. Surrey, England, und der Univ. Göttingen. Mitgl. in Aufsichtsräten und Beiräten von Unternehmen in Deutschland und im Ausland. 1996/98 Vors. Deutsch-Amerikanisches Akademisches Konzil, 1994/02 Ko-Vors. Deutsch-Japanischer Kooperationsrat für Hochtechnologie und Umwelttechnik. Seit 2006 Präs. Dt. Parlamentarische Gesellschaft. Vors. Hess. Multiple Sklerose-Stiftung, Frankfurt. Mitgl. Verwaltungsrat SGN (Senckenberg Ges. f. Naturforschung), seit 2015 Mitgl. Senatskollegium acatech, seit 2014 Ehrensenator AiF Arbeitsgem. industrieller Forschungsvereinigungen e.V. 1961 JU und CDU; 1965/69 Landesvors. JU Hessen, 1968 stellv. Bundesvors. JU; seit 1979 Bezirksvors. CDU Frankfurt RheinMain, 1965 Mitgl. Landesvorst., seit 1968 Mitgl. Präsidium der CDU Hessen. 1973/78 Kreisvors. CDU Frankfurt, 1977/82 Vors. Bundesfachausschuss Energie und Umwelt der CDU Deutschland, Mitgl. Bundesvorst. Wirtschaftsrat der CDU. Englisch (f). - MdB seit 1976; 1980/82 energiepol. Sprecher der CDU/CSU-Fraktion, Vorstandsmitgl. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, 2001/02 Vors. Ausschuss für Wirtschaft und Technologie. Alterspräsident des 17. und 18. Deutschen Bundestages.', 'Heinz', '11001849');
