	Mitglied des Vorstandes (bis 17.07.2014)', '1978/84 Grundschule und Orientierungsstufe Ostercappeln, 1984/91 Gymnasium Bad Essen. 1991/92 Grundwehrdienst in der Barbara-Kaserne in Delmenhorst. 1992/95 Ausbildung im gehobenen allgemeinen Verwaltungsdienst beim Landkreis Osnabrück. 1995/2000 Studium der Rechtswissenschaften Univ. Osnabrück; 2000/02 Referendariat; 2003/04 Promotion Univ. Osnabrück bei Prof. Dr. Jörn Ipsen am Institut für Kommunalrecht / Thema der Arbeit: Kommunale Vertretungsorgane und Parlamentsrecht. 2004/06 Dezernent für Finanzen und Wirtschaft bei der Stadt Melle, Nov. 2006/Okt. 2013 Hauptamtlicher Bürgermeister der Stadt Melle. 1996 Eintritt in die CDU, seit Okt. 2012 stellv. Kreisvors. der CDU im Landkreis Osnabrück, seit 2006 Mitgl. MIT der CDU/CSU. 1996/01 Mitgl. im Gemeinderat in Ostercappeln für die CDU. Seit 2006 Mitgl. Verwaltungsrat Kreissparkasse Melle, Dez. 2011/Dez. 2013 Landschaftsrat der Landschaft des ehemaligen Fürstentums Osnabrück. - MdB seit Okt. 2013.', 'André', '11004252');
	Mitglied des Vorstandes und der Konferenz der DFB-RV/LV-Vorsitzenden, ehrenamtlich
	Mitglied des Vorstandes', '1968 Abitur in Geisenheim. 1968/69 Wehrdienst. 1970/74 Jurastudium Universität Mainz, 1974/76 Referendariat am Landgericht in Wiesbaden. Seit 1976 Rechtsanwalt, seit 1983 auch Notar in Eltville. 1978 Promotion zum Dr. jur. 1973/83 Mitgl. Bundesvorst. JU Deutschland, 1981/83 stellv. Bundesvors. JU Deutschland;1987/91 Generalsekretär der CDU Hessen, 1998/14 stellv. Landesvors. CDU Hessen, seit 1998 Mitgl. Bundesvorstand CDU Deutschland, 2012/14 Vors. Medienpolitischer Expertenkreis der CDU Deutschlands. 1972/87 Kreistagsabg. Rheingau-Taunus-Kreis; 1983/Nov. 2005 Mitgl. des Hessischen Landtags, 1987/99 Parlamentarischer Geschäftsführer CDU-Fraktion, April 2003/Nov. 2005 CDU-Fraktionsvors.; 1999/2000 Hessischer Minister für Bundes- und Europaangelegenheiten und Chef der Staatskanzlei; 1989 Mitgl. der 9., 1994 der 10., 1999 der 11., 2004 der 12. und 2009 der 13., 2010 der 14. und 2012 der 15. Bundesversammlung. Seit Okt. 2015 Vorstandsmitgl. des "Petersburger Dialogs", seit Nov. 2015 Vors. der Bundesarbeitsgemeinschaft für Soldatenbetreuung. 2010 Autor des Buches "Die letzten Tage der Teilung". - MdB seit Okt. 2005; 2005/Okt. 2009 Bundesminister der Verteidigung und Okt./Nov. 2009 Bundesminister für Arbeit und Soziales; 2013/Jan. 2014 stellv. Vors. für Landwirtschaft und Ernährung der CDU/CSU-Fraktion, seit Jan. 2015 stellv. Vors. für Außen- und Sicherheitspolitik der CDU/CSU-Fraktion, seit Febr. 2014 Beauftragter der CDU/CSU-Fraktion für Kirchen und Religionsgemeinschaften.', 'Franz Josef', '11003781');
	Mitglied des Vorstandes', '1982 Abitur an der Meldorfer Gelehrtenschule. 1982/86 Zeitsoldat der Bundeswehr, Major d. R. 1986/91 Studium Rechtswissenschaften an der Univ. Kiel, 1991 1. jur. Staatsprüfung, 1993/95 Referendar Landgerichtsbezirk Kiel, 1995 große jur. Staatsprüfung. 1996 Promotion zum Dr. jur. Univ. Kiel. Selbstständiger Rechtsanwalt in Kiel, Fachanwalt für Medizin- und Sozialrecht. Vors. Berufungsausschuss für Zahnärzte im Zulassungsbezirk SH, Vors. Beschwerdeausschuss der Vertragsärzte und Krankenkassen in SH. 1982 Eintritt in die CDU und JU, 1992/96 Landesvors. JU Schleswig-Holstein, 1997/2000 Generalsekretär CDU SH, 2000/02 Landesvors. CDU SH, seit Januar 2006 Vors. CDU-Kreisverb. Rendsburg-Eckernförde, seit Nov. 2010 Mitgl. Bundesvorst. der CDU Deutschlands, 2014/16 stellv. Landesvors. der CDU Schleswig-Holstein. 2000/09 MdL in Schleswig-Holstein, 2005/09 Vors. CDU-Fraktion. Englisch (f). - MdB seit Okt. 2009; seit Jan. 2014 Vors. Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung, altern. Vors. Vermittlungsausschuss von Bundestag und Bundesrat.', 'Johann', '11004182');
	Mitglied des Vorstandes', '1987 Abitur in Norderstedt. 1987/92 Mitarbeiter der Organisations- und Datenverarbeitungsabteilung, Philips-Medizin-Systeme GmbH in Hamburg. 1989/94 Studium der Physik Univ. Göttingen, Abschluss Diplom-Physiker. 1993/96 Wissenschaftlicher Mitarbeiter am Department für Medizinische Physik und Akustik, Carl von Ossietzky Universität Oldenburg. Seit 1996 Geschäftsführender Gesellschafter der Hörzentrum Oldenburg GmbH, An-Institut der Univ. Oldenburg und des Ev. Krankenhauses; seit 2001 Geschäftsführer des Kompetenzzentrums HörTech gGmbH. Seit 2007 Senator des Bundesverbandes für Wirtschaftsförderung und Außenwirtschaft, seit 2010 Vizepräsident. Seit 2007 geschäftsführender Vorstand Cluster "Auditory Valley" Hannover/Oldenburg; 2008/13 Prokurist des Medizinischen Versorgungszentrums (MEVO) am Ev. Krankenhaus Oldenburg GmbH. Seit 2013 stellv. Vors. CDU-Kreisverband Ammerland, seit 2009 stellv. Vors. CDU-Gemeindeverband Bad Zwischenahn, seit 2014 Leiter Fachausschuss "Wissenschaft, Kultur, Kirche" des CDU-Landesverbandes Oldenburg, seit 2014 Mitgl. Fachausschüsse "Wissenschaft und Kultur" sowie "Gesundheit" der CDU in Niedersachsen, seit 2014 Mitgl. CDU-Bundesfachausschuss "Bildung, Forschung und Innovation, seit 2009 Mitgl. des Wirtschaftsrates der CDU, Bundesfachkommission "Wachstum und Innovation", Berlin. Seit 2010 Beirat der Landesinitiative "BioRegioN Netzwerkinitiative Life Sciences - Niedersachsen" des Niedersächsischen Wirtschaftsministeriums in Hannover. Seit 2012 Leitung des Translational Research Center (TRC) im Rahmen des Exzellenzclusters "Hearing4All". - MdB seit Okt. 2013.', 'Stephan', '11004241');
	Mitglied des Vorstandes', 'Abitur. 1986 1. jur. Staatsexamen. 1987/88 Angestellte in der Bundestagsverwaltung. 1988/92 Referendariat einschl. Erziehungsurlaub, 1992 2. jur. Staatsexamen. 1992 Richterin Landgericht Bonn und Amtsgericht Siegburg. 1978 Beitritt JU, 1980 CDU, 1984 CDA, seit 2002 CDU-Kreisvorstand, seit 2010 CDU-Kreisvorsitzende, seit 2012 stellv. Landesvors. der CDU NRW. Vors. Förderverein Amare e. V. - Verein zur Unterstützung eines Kinderhilfsprojektes in Nordost-Brasilien. Mitgl. Kuratorium Bundeszentrale für politische Bildung; Bundesvors. katholischer Arbeitskreis für Familienerholung e. V., Vors. der BAG Familienerholung, Mitgl. Vorstand Stiftung Christlich-Soziale Politik e. V. (CSP), Königswinter. - MdB seit Okt. 2005; seit Jan. 2014 Vors. der AG Recht und Verbraucherschutz der CDU/CSU-Fraktion.', 'Elisabeth', '11003865');
	Mitglied des Vorstandes', 'Abitur. Grundwehrdienst. Studium an der Hochschule für Ökonomie, Berlin-Karlshorst. Aspirantur an der Akademie für Gesellschaftswissenschaften beim ZK der KPdSU in Moskau zum Dr. oec., 1990/91 Geschäftsführer Verlag Junge Welt, 1991/97 Schatzmeister der PDS, 1997/02 Bundesgeschäftsführer der PDS, 2003/04 Unternehmensberater, 2004/05 Geschäftsführer der Neues Deutschland Druckerei und Verlag GmbH, 2005/07 Bundesgeschäftsführer Linkspartei.PDS, 2007/10 Bundesgeschäftsführer DIE LINKE. Mitgl. Rosa-Luxemburg-Stiftung und Stiftung Denkmalschutz. Russisch (G), Englisch (G). - MdB 1998/02 und seit 2005; 2010/2013 und wieder Okt. 2013/Okt. 2015 2. stellv. Vors. der Fraktion DIE LINKE., seit Okt. 2015 Vors. der Fraktion DIE LINKE.', 'Dietmar', '11003034');
	Mitglied des Vorstandes', 'Ausbildung zur Industriekauffrau. Studium der Betriebswirtschaft an der Verwaltungs- und Wirtschaftsakademie in Dortmund, Betriebswirtin (VWA) für Grundsatzfragen und Vertragsrecht, Pressesprecherin und zuletzt Regionalmanagerin. Mitgl. bei ver.di, IGBCE, AWO,1985 Eintritt in die SJD. Seit 1985 Mitgl. der SPD, 2010/14 Vors. des Stadtbezirks Aplerbeck; seit 2012 Mitgl. des SPD-Unterbezirksvorstandes Dortmund. 1999/09 Mitgl. des Rates der Stadt Dortmund, 2004/09 stellv. Fraktionsvors. der SPD im Rat der Stadt Dortmund. Beirat des Bundesverbands Unternehmervereinigung e. V. - MdB seit Okt. 2013; seit 2014 Beauftragte der SPD-Fraktion für den Mittelstand und das Handwerk, seit 2015 stellv. Sprecherin der Arbeitsgruppe Wirtschaft und Energie der SPD-Fraktion, 2015/Ende 2016 Leiterin der Projektgruppe "Neue Erfolge - Vorsprung durch Innovation" der SPD-Fraktion; Mitgl. Mittelstandsbeirat beim BMWi; Mitgl. der Dt.-Türkischen Parlamentariergruppe.', 'Sabine', '11004377');
	Mitglied des Vorstandes', 'Buchhändlerin mit Fachhochschulabschluss. Seit 1997 in Bremen beschäftigt als Sachbearbeiterin. Seit 1978 Gewerkschaftsmitgl. Aktives Mitglied im Bremer Friedensforum, seit Nov. 2006 in der Bremischen Stiftung für Rüstungskonversion und Friedensforschung, seit Okt. 2007 im Vorstand. 1981 Eintritt in die SED und Mitgl. aller Nachfolgeparteien, zwei Jahre Schatzmeisterin im PDS-Kreisverband Suhl,  viele Jahre Mitgl. des Vorstands oder der Revisionskommission sowohl in Suhl als auch in Bremen. Seit 1999 Fraktionsmitgl. und sachkundige Bürgerin im Beirat Östliche Vorstadt (Bremen). - MdB seit März 2015.
	Mitglied des Vorstandes', 'Fachoberschulreife 1979. Berufsausbildung, 1983 Energieanlagenelektroniker. 1983/84 Wehrdienst. Qualitätsmanager Netze, seit 1979 bei den Stadtwerken Düsseldorf. 1998 Eintritt in die SPD, 2007/11 stellv. Vors. SPD Düsseldorf, seit April 2011 Vors. der SPD Düsseldorf, seit 2012 Mitgl. Landesvorst. NRWSPD. 2009/13 Ratsmitgl. in Düsseldorf. Mitgl. AWO, ver.di - Vertrauensmann, 2002/13 Betriebsrat der Stadtwerke Düsseldorf seit 2002, Mitgl. Friedrichstädter Reserve, Närrisch Welthus, Bilker Heimatfreunde, Martinsfreunde Bilk, Förderverein Bonifatius-Schule und Hulda-Pankok-Gesamtschule, Kleingartenverein An der Südbrücke, Mitgl. ASB Arbeiter-Samariter-Bund und Mitgl. Hospizverein Caritas Garath. Seit 2014 Mitgl. im parl. Beirat des Bundesverbandes Elektromobilität, seit 2014 Mitgl. im Aufsichtsrat der Flughafen Düsseldorf GmbH, seit 2015 Beisitzer im Vorst. des Dt. Mieterbundes NRW. - MdB seit Okt. 2013.
