	Mitglied des Vorstandes, ehrenamtlich', '1967 Abitur am Erzbischöflichen Gymnasium in Brühl. Studium der Psychologie Univ. Köln, 1972 Diplom-Psychologin. Ab 1972 als Diplompsychologin tätig bei der Forschungsgemeinschaft "Das körperbehinderte Kind" e.V., Köln, danach am Zentrum für Frühförderung und Frühbehandlung Köln. Seit 1972 Mitgl. der SPD, stellv. Vors. Arbeitsgem. SozialdemokratInnen im Gesundheitswesen. Seit 2002 Präsidentin Bundesvereinigung Prävention und Gesundheitsförderung e.V. (BVPG), Bonn, Mitgl. Präsidium AWO-Bundesver., Vors. Regionalverband AWO Rhein-Erft Kreis & Euskirchen e.V., seit 1992 Vorstandsmitgl. AWO-Bezirksverb. Mittelrhein e.V.; Vors. Forschungsgemeinschaft "Der Körperbehinderte Mensch" e.V. (FKM), Vorstandsmitgl. Zentrum für Frühbehandlung und Frühförderung, Köln, Vorstandsmitgl. Institut für Sozialarbeit und Sozialpädagogik e.V. (I.S.S.); Vorstandsmitgl. Verein Aktion Psychisch Kranke; Mitgl. Kuratorium Elly Heuss-Knapp Stiftung-Dt. Müttergenesungswerk, Berlin, Vorstandsmitgl. Hospizverein Brühl e.V.; stellv. Vors. und Geschäftsführerin Brühler Museumsgesellschaft e.V.; Mitgl. Kinderschutzbund und bei der Lebenshilfe; Kuratoriumsmitgl. Stiftung Männergesundheit; Mitgl. Deutscher Verein für öffentl. und private Fürsorge, Beirat im Projekt "Zugewandert und geblieben" des DOSB. 2004/09 Beauftragte der BReg. für die Belange der Patientinnen und Patienten. Englisch (f), Französisch (f), Italienisch (f), Spanisch (G). - MdB  1996/2009 und seit Okt. 2013; Mitglied im Ältestenrat, Beauftragte der SPD-Fraktion für die Belange von Patienten und Pflegebedürftigen.
	Mitglied des Vorstandes, ehrenamtlich', '1967/71 Studium für das Lehramt an Unterstufen am Institut für Lehrerbildung Weißenfels. 1971/79 Lehrerin, 1979/82 Leiterin "Haus der Pioniere" in Spremberg. 1982 Direktstudium an der Bezirksparteischule Cottbus, 1983/85 externes Studium der Staatsbürgerkunde an der Pädagogischen Hochschule "Ernst Schneller" in Zwickau, Abschluss Diplom-Lehrerin. 1983/87 Lehrerin, 1987/88 stellv. Schulleiterin, 1988/90 Schulleiterin. Erweiterungsstudium Deutsch für die Sekundarstufe I an der Pädagogischen Hochschule Potsdam, 1994 Abschluss. Mitgl. der SED seit 1976, seit 1989 Mitgl. der PDS, seit Juli 2005 Die Linkspartei.PDS, seit Juni 2007 DIE LINKE. Seit 1998 Mitgl. Kreistag Spree-Neiße, seit 1990 Mitgl. der Stadtverordnetenversammlung Spremberg. MdL Brandenburg Okt. 2004/Okt. 2013, Nov. 2007/Okt. 2009 Vors. Ausschuss für Arbeit, Soziales, Gesundheit und Familie, ab Dez. 2009 Vors. Ausschuss für Arbeit, Soziales, Frauen und Familie. - MdB seit Okt. 2013.', 'Birgit', '11004446');
	Mitglied des Vorstandes, ehrenamtlich', '1972 Abitur. Studium der Betriebswirtschaft und Rechtswissenschaft an der TU und FU Berlin, 1978 1., 1980 2. jur. Staatsexamen, 1981/85 pers. Referent des Senators für Wissenschaft und Forschung sowie Gesundheit und Soziales. Seit 1985 Rechtsanwalt, seit 1997 Notar. 1972 Eintritt in die CDU, 1979/80 Mitgl. JU-Bundesvorstand, seit 2001 Vors. CDU Ortsverband Dahlem, stellv. Kreisvors. CDU Steglitz-Zehlendorf. 2001/05 Mitgl. Abgeordnetenhaus Berlin, Sprecher Stadtentwicklung der CDU-Fraktion. Stellv. Vors. Dt.-Ukrainisches Forum, Mitgl. Freundeskreis der Musikschule und des Städtepartnerschaftsvereins Steglitz-Zehlendorf e. V., Mitgl. Verein der Freunde Domäne Dahlem e. V., Vors. Verein Berlin-Hilft e. V, Mitgl. Hertha BSC. Englisch (f). - MdB seit Okt. 2005; Hauptberichterstatter der CDU/CSU-Fraktion für Russland, Ukraine und Belarus, Mitgl. der Parl. Versammlung der OSZE (OSZE-PV) und des Europarats, Vors. der Deutsch-Ukrainischen Parlamentariergruppe, Mitgl. der Dt.-Belarussischen und Dt.-Russischen Parlamentariergruppe.', 'Karl-Georg', '11003862');
	Mitglied des Vorstandes, ehrenamtlich', '1988 Abitur. 1988/94 Studium Rechtswissenschaften in Osnabrück und Leiden (NL), 1994 1. jur. Staatsexamen, 1995/96 Wiss. Mitarbeiterin Universität Osnabrück, 1997 Promotion, 1997/99 Referendariat OLG Oldenburg, 1999 2. jur. Staatsexamen. 1999/06 Referentin BMin. für Arbeit und Soziales, 2006/09 Referatsleiterin "Europ. Beschäftigungs- und Sozialpolitik, Europabeauftragte" BMin. für Arbeit und Soziales. Seit 1987 Mitgl. der SPD, 1991/95 stellv. Juso-Bundesvors., 1993/97 Mitgl. Parteirat, 1997/01 und 2009/11 Mitgl. SPD-Parteivorst., seit 2007 Landesvors. der Arbeitsgemeinschaft sozialdemokratischer Frauen Berlin und Mitgl. des SPD-Landesvorst. Berlin. Vizepräsidentin der Europa Union Deutschlands, Vors. Dt. Vereinigung für Parlamentsfragen, Vorst. Förderkreis Denkmal für die ermordeten Juden Europas, Mitgl. Dt.-Arabische Freundschaftsgesellschaft, stellv. Mitgl. Kuratorium der Stiftung des Dt. Historischen Museums. Mitgl. AWO, ver.di, Deutscher Juristinnenbund, Transparency International, Deutsch-Britische Gesellschaft, Pro Asyl, Marie-Schlei-Verein, Lebenshilfe, Gegen Vergessen - für Demokratie, Förderverein Willy-Brandt-Zentrum Jerusalem. Englisch (f), Niederländisch (f), Französisch (G), Italienisch (G). - MdB seit Jan. 2009; seit Dez. 2013 stellv. Vors. der SPD-Fraktion.
	Mitglied des Vorstandes, ehrenamtlich', 'Abitur am Eduard-Spranger-Gymnasium in Landau. 2007 Magister Artium Politikwissenschaft, Öffentliches Recht, Wirtschafts- und Sozialgeschichte/Neuere Geschichte, Univ. Mannheim. 2008/10 Referent des Oberbürgermeisters der Stadt Landau; 2010 bis 2013 persönlicher Referent des Präsidenten der Struktur- und Genehmigungsdirektion Süd und Leiter des Einheitlichen Ansprechpartners. Mitherausgeber des Magazins Berliner Republik und stellv. Vors. des Vereins Berliner Republik. Seit 2010 Vors. des SPD-Unterbezirks Südpfalz, Vorstandsmitgl. SPD Pfalz. Mitgl. im Kreistag des Landkreises Südliche Weinstraße. Mitgl. u. a. ver.di, Naturfreunde, 1. FC Kaiserslautern, Europa Union, Reservistenverband, Bundeswehrsozialwerk, Vorstandsmitgl. Netzwerk Berlin und AWO Pfalz. - MdB seit Okt. 2013; stellv. Sprecher der rheinland-pfälzischen Landesgruppe.
	Mitglied des Vorstandes, ehrenamtlich', 'Abitur am Gymnasium Essen Nord-Ost. Ab 1979 Helfer im Katastrophenschutz. Jurastudium in Würzburg und Bochum. Seit 1987 Geschäftsführer beim Arbeiter-Samariter-Bund in Essen, heute Regionalverband Ruhr e.V. 2009/13 Mitgl. und sozialpolitischer Sprecher der SPD-Fraktion im Rat der Stadt Essen, 2010/13 Mitgl. der SPD-Fraktion im Landschaftsverband Rheinland (LVR). Mitgl. im Beirat des JobCenter Essen. Vors. Paritätischer Wohlfahrtsverband in Essen, Mitgl. Vorstand des ASB Betreuungsvereins Ruhr e.V., stellv. Vors. der PSAG Essen. Mitgl. der AWO, Mitgl. der IG BCE. - MdB seit Okt. 2013.', 'Dirk', '11004295');
	Mitglied des Vorstandes, ehrenamtlich', 'Abitur in Lützen. Anschl. Tätigkeit als Turbinenmaschinist im Braunkohlekombinat Deuben. 1974/75 Grundwehrdienst. 1976/80 Studium der Elektrotechnik an der TU Dresden. 1980/90 Netzingenieur im Energiekombinat Erfurt, Betriebsteil Bleicherode. Okt. 1990/Juni 1994 1. Kreisbeigeordneter und Dezernent in der Kreisverwaltung Heiligenstadt. Bis 1990 ohne parteipolitische Bindung. Herbst 1989 Sprecher der Bürgerinitiative Heiligenstadt. Eintritt in die CDU Jan. 1990. Englisch (f), Russisch (G). - MdB seit 1994; seit Okt. 1998 Parl. Geschäftsführer der CDU/CSU-Fraktion; Mitgl. PKGr; Mitgl. des Ältestenrates; Mitgl. dt. Delegation in der PV der OSZE; Vors. Dt.-Zentralasiatische Parlamentariergruppe, Mitgl. Schwarzmeerwirtschaftskooperation.', 'Manfred', '11002667');
	Mitglied des Vorstandes, ehrenamtlich', 'Ausbildung als Dipl.-Verwaltungswirtin beim Landschaftsverband Rheinland. 1988/93 Studium Rechtswissenschaften an der Univ. Köln. 1990/93 Mitarbeiterin einer überörtlichen Sozietät in Köln und Brüssel; 1995 2. jur. Staatsexamen. Seit 1995 Rechtsanwältin und Dozentin in Köln und Mecklenburg-Vorpommern; seit August 2004 Fachanwältin für Familienrecht; seit 2004 eigene Anwaltskanzlei in Stralsund. Seit 2002 Mitgl. der SPD, seit 2011 Mitgl. Kreisvorst. der SPD Vorpommern-Rügen. Englisch (G), Französisch (G). - MdB seit Okt. 2009.
	Mitglied des Vorstandes, ehrenamtlich', 'Deutsche Staatsbürgerschaft seit 1997. Grundschule in Istanbul, ab 1979 in Senden, 1982/92 Gymnasium Weißenhorn. Studium an den Univ. Konstanz und Wien. Seit 1988 Mitgl. BÜNDNIS 90/DIE GRÜNEN, Ehrenmitgl. des grünen Jugendverbandes in Bayern. Vorstandsmitgl. UNICEF Deutschland, Vorstandsmitgl. und stellv. Vors. Gegen Vergessen - Für Demokratie e. V., der Vertretervers. der Ulmer Volksbank e. G. Englisch (f), Türkisch (f), Französisch (G). - MdB seit 1998; 2002/05 Parl. Geschäftsführerin und Nov. 2009/Okt. 2013 Koordinatorin Arbeitskreis V - Wissensgesellschaft und Generation der Fraktion BÜNDNIS 90/DIE GRÜNEN; 	stellv. Vors. Rechnungsprüfungsausschuss, Mitgl. Haushaltsausschuss.', 'Ekin', '11003068');
	Mitglied des Vorstandes, ehrenamtlich', 'Studium der Betriebswirtschaftslehre. Wissenschaftlicher Tutor für Politische Ökonomie und Wissenschaftstheorie an der Freien Universität Berlin; Tätigkeiten als Übersetzer lateinamerikanischer Literatur, Buchhändler, Taxifahrer, Feingeräteelektroniker und Schweißer. 1989/99 Umweltdezernent und 1993/97 gleichzeitig Kämmerer in Frankfurt am Main; 1999/02 Stellvertreter des Sondergesandten der Vereinten Nationen im Kosovo, 2002/04 Sondergesandter der Vereinten Nationen in Guatemala und 2006/07 in Afghanistan; 2005 Beauftragter der Bundesregierung für Menschenrechtspolitik und Humanitäre Hilfe. 2008/14 im Vorstand von UNICEF Deutschland (ehrenamtl.). - MdB seit Okt. 2009; 2009/13 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe, seit Jan. 2014 Menschenrechtspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen; seit April 2015 Beauftragter des Bundesministers des Auswärtigen zur Unterstützung des Friedensprozesses in Kolumbien (ehrenamtl.).', 'Tom', '11004077');
	Mitglied des Vorstandes, ehrenamtlich', 'Suitbertus-Gymnasium in Kaiserwerth. Studium der Romanistik und Anglistik Univ. Düsseldorf. Seit 1994 betriebliche Umweltfachkraft, freiberuflich tätig im familieneigenen Ingenieurbüro. Seit 1978 Mitgl. der CDU, 1996/99 Mitgl. der BV Kalk, stellv. Vors. der CDU Köln; stellv. Landesvors. der Frauen Union NRW, Vors. der Frauen Union Köln. 2000/13 Mitgl. Rat der Stadt Köln, 2006/13 Vors. des Ausschusses für Schule und Weiterbildung. Seit Mai 2015 Vors. der Kath. Arbeitsgemeinschaft für Soldatenbetreuung e. V. (KAS). - MdB seit Okt. 2013.', 'Gisela', '11004348');
