	Präsident, ehrenamtlich (bis 02.07.2015)
	Präsident, ehrenamtlich (bis 10.07.2015)', '1995 Abitur. 1995/96 Wehrdienst im 2./Panzergrenadierbataillon 391 Bad Salzungen. 1996/02 Studium Rechtswiss Univ. Bayreuth, 1. jur. Staatsexamen. 2001 Abschl. Zusatzstudium als Wirtschaftsjurist Univ. Bayreuth. 2003/05 Referendariat in Mainz und 2. jur. Staatsexamen. 2004 Ergänzungsstudium Dt. Hochschule für Verwaltungswiss. Speyer. 2005/09 wiss. Mitarbeiter Institut für Rechtswiss. TU Ilmenau. Seit 2006 Rechtsanwalt. Seit 1999 versch. Vorstandsämter bei Rotaract und Rotary. Seit 1994 versch. Vorstandsämter bei JU, RCDS und CDU, seit 2012 Kreisvors. der CDU Ilm-Kreis. - MdB seit Okt. 2009.', 'Tankred', '11004143');
	Präsident, ehrenamtlich (bis 28.06.2016)
	Präsident, ehrenamtlich (bis 29.04.2015)
	Präsident, ehrenamtlich (bis Januar 2014)
	Präsident, ehrenamtlich', '1967 Abitur. 1971 Abschluss Agrarwissenschaftliches Universitätsstudium, 1976 Dr. agr. 1974/90 wissenschaftlicher Mitarbeiter am Institut für Biochemie der Pflanzen der AdW der DDR. 1993/94 Ministerpräsident des Landes Sachsen-Anhalt. 1991/94 stellv. Landesvors. der CDU Sachsen-Anhalt, 1995/98 stellv. Bundesvors. der CDU. 1990/April 2002 MdL Sachsen-Anhalt, 1991/93 und 1994/01 Vors. der CDU-Landtagsfraktion. Vors. Deutsch-Rumänisches Forum e. V., Präs. Sportverein Halle e. V. Englisch (f), Russisch (G). - MdB seit Okt. 2002; Nov. 2005/Dez. 2013 Parl. Staatssekretär beim BMin. des Innern, Febr. 2006/Dez. 2013 Bundesbeauftragter für Aussiedlerfragen und nationale Minderheiten, März 2011/Dez. 2013 Beauftragter der Bundesregierung für die Neuen Bundesländer.', 'Christoph', '11003505');
	Präsident, ehrenamtlich', '1990 Abitur mit Auszeichnung in Köln. 1992/95 Fachhochschule für öffentliche Verwaltung in Brühl/Rheinland, Studium zum Diplom-Verwaltungswirt (FH). 1996/02 REFA-Institut Darmstadt/Dortmund, Studium zum REFA-Betriebswirt, Schwerpunkte Produktivitätssteigerung und Prozessoptimierung; 2007/09 Freie Universität Berlin, Masterstudium zum Politologen M. A. Ausbildung zum Elektroanlageninstallateur und Energieanlagenelektroniker. Lokomotivführer bei der Bundesbahn, Geschäftsführer der Firma C.I.P. Kommunale EDV-Lösungen mbH in Erfurt, versch. berufliche Stationen, seit 2013 Leitung der Verwaltungsgemeinschaft "Bergbahnregion/Schwarzatal" in Oberweißbach bis zum Eintritt in den Deutschen Bundestag im September 2013. Mitgl. der CDU, seit 2010 Vors. CDU-Ortsverband "Gebirge/Milda". Ehrenamtl. Bürgermeister der Gemeinde Milda seit 2004, seit 2014 Mitgl. Kreistag Saale-Holzland-Kreis; stellv. Vors. Wasser/Abwasserzweckverband JenaWasser. Seit 2015 Präs. Deutsch-Armenisches Forum. - MdB seit Okt. 2013.', 'Albert', '11004439');
	Präsidentin', '1966 Abschluss der Realschule, bis 1974 Ausbildung und Tätigkeit als Buchhändlerin in Göttingen. Bis 1979 Studium an der ev. FH für Sozialpädagogik in Hannover. Bis 1990 Tätigkeit als Dipl.-Sozialpädagogin und Sozialarbeiterin in Isernhagen, bis 1993 Tätigkeiten in der Erwachsenenbildung/Gesundheitsförderung in Hameln-Pyrmont und bis 1995 Familienarbeit. Ab 1995 selbstständige Tätigkeit als Trainerin und Organisationsberaterin. 1972 Eintritt in die SPD; Funktionen auf Unterbezirks- und Landesebene. 1997/2015 Vors. des Unterbezirks Hameln-Pyrmont, 1999/11 Vorstandsmitgl. des SPD-Bezirks Hannover, 2003/April 2016 Mitgl. des Landesvorstandes, seit Dez. 2011 Mitgl. Parteivorst. 1996/Nov. 2011 Kreistagsabgeordnete im Landkreis Hameln-Pyrmont. Mitgl. ÖTV und AWO. - MdB seit Nov. 2001; Sept. 2011/Sept. 2013 Vors. der Landesgruppen Niedersachsen/Bremen; seit Dez. 2013 Parl. Staatssekretärin bei der Bundesministerin für Arbeit und Soziales.
	Präsidentin, ehrenamtlich
	Präsidentin, ehrenamtlich
	Präsidentin, ehrenamtlich (bis 20.12.2013)', 'Polytechn. Oberschule Schleusingen; im Anschluss daran Bauzeichnerlehre. Studium an der Fachschule in Gotha. Projektantin im VEB Stadtbau Suhl, Angestellte im Stadtbauamt Schleusingen, zuletzt Bereichsingenieurin in der Flurneuordnungsbehörde Südthüringen. Mitgl. IG Bau, AWO, Mitgl. Präsidium ASB, Mitgl. weiterer überregionaler Vereine und Initiativen; Vors. Thüringer Mieterbund. 1990 (Gründungs-)Mitgl. der SDP/SPD Schleusingen. Fraktionsvors. und Vors. des Bauausschusses sowie Mitgl. des Sozialausschusses im Rat der Stadt Schleusingen Mai/Dez. 1990. - MdB seit 1990; Nov. 1998/Okt. 2002 stellv. Vors. der SPD-Fraktion. Okt. 2002/Nov. 2005 Parl. Staatssekretärin beim Bundesminister für Verkehr, Bau- und Wohnungswesen; Nov. 2005/Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion, Nov. 2006/Dez. 2013 Sprecherin der Landesgruppe Ost der SPD-Fraktion, Jan. 2012/Sept. 2013 stellv. Mitgl. 2. Untersuchungsausschuss "Terrorgruppe NSU". Dez. 2013/Jan. 2017 Parl. Staatssekretärin beim BMin. für Wirtschaft und Energie und seit Jan. 2017 bei der BMin. für Wirtschaft und Energie, Beauftragte der BReg. für die neuen Länder, Beauftragte der BReg. für Mittelstand und Tourismus.
	Präsidentin, ehrenamtlich', 'Abitur am Matthias-Grünewald-Gymnasium in Tauberbischofsheim. 1998/02 Studium der Rechtswissenschaft in Heidelberg, 2003 erstes jur. Staatsexamen; anschl. Rechtsreferendariat am Landgericht Mosbach; 2005 zweites jur. Staatsexamen. Seit 2006 zugelassen als Rechtsanwältin, Mitarbeiterin in mittelständischen Anwaltssozietäten mit Schwerpunkten im Verwaltungs- und Sozialrecht sowie im gewerblichen Rechtsschutz. Seit 2000 Mitgl. der CDU, 2006/14 stellv. Bundesvors. der Jungen Union Deutschlands, Mitgl. im Bezirksvorstand der CDU, Mitgl. im Landes- und Bezirksvorstand der Frauen Union. Seit 2015 Präsidentin der THW-Landeshelfervereinigung Baden-Württemberg. Seit 2004 Mitgl. im Stadtrat Tauberbischofsheim, seit 2014 Mitgl. im Kreistag des Main-Tauber-Kreises. - MdB seit Okt. 2013; seit Febr. 2015 Obfrau der CDU/CSU-Fraktion im 1. Untersuchungsausschuss (NSA).', 'Nina', '11004437');
