	Studienrätin am Gymnasium', '1977/86 Grund- und Hauptschule Thurmansbang. 1986/90 Ausbildung zur Damenschneiderin im Handwerk in Grafenau. 1990/97 Erziehungszeit. 1997/2000 Abendschule in Passau, Abitur am Adalbert-Stifter-Gymnasium in Passau. 2000/05 Studium Lehramt Gymnasium Deutsch und Geschichte, Zweitstudium Politikwissenschaften; 2006/08 Referendariat am Comenius-Gymnasium in Deggendorf. Seit Februar 2008 Lehrerin am Gymnasium Freyung.  - MdB seit Okt. 2013.
