	Ständiger Bevollmächtigter des Vorsitzenden der SPD-Bundestagsfraktion in der Mitgliederversammlung, ehrenamtlich', '1987 Abitur in Freigericht. 1987/89 Zivildienst bei der Selbsthilfe Köperbehinderter Hanau/Gelnhausen e. V. 1989/94 Studium der Politischen Wissenschaften an der Goethe-Univ. Frankfurt, Promotion. 1994/96 Studium der Rechtswissenschaften an der Goethe-Univ. Frankfurt. 1990 Eintritt in die SPD. 1995/96 wissenschaftlicher Mitarbeiter von MdB Bernd Reuter. 1996/2002 Hauptamtlicher Bürgermeister von Rodenbach/Main-Kinzig-Kreis. Mitgl. AWO, der Freiwilligen Feuerwehr sowie div. sozialer und kultureller Organisationen und Sportvereine. Englisch (f). - MdB seit Okt. 2002; 2005/14 entwicklungspolitischer Sprecher der SPD-Fraktion.', 'Sascha', '11003614');
