	Technologie Holding Christian Stetten GmbH, Künzelsau', 'Während des Studiums der Betriebswirtschaftslehre 1994 Schritt in die Selbstständigkeit und Unternehmensgründung 1996, geschäftsführender Gesellschafter und seit 2009 Aufsichtsratsvorsitzender der eigenen Unternehmen. 1990/02 verschiedene Vorstandsfunktionen innerhalb der JU Deutschlands; seit 2003 Bundesvorstandsmitgl. der Mittelstands- und Wirtschaftsvereinigung der CDU/CSU (MIT); seit 2015 Präsidiumsmitgl. des CDU Wirtschaftsrats e. V.; seit 2005 Mitgl. im Bundesvorst. der Kommunalpolitischen Vereinigung der CDU/CSU (KPV). Seit 1994 Stadtrat in Künzelsau, und erster stellv. Bürgermeister und seit 1994 Kreisrat des Hohenlohekreises. Vorstands- und Beiratsmitgl. zahlr. kultureller und soz. Vereine und Stiftungen. - MdB seit Okt. 2002; mittelstandspol. Sprecher der CDU/CSU-Fraktion und Vors. Parlamentskreis Mittelstand (PKM).', 'Christian', '11003639');
	Tectum Holding GmbH, Berlin', '1988 Abitur in Krumbach. 1993 Abschluss des Studiums der Wirtschafts- und Sozialwissenschaften an der Univ. Augsburg; 1998 berufsbegl. Promotion zum Doktor der Rechtswissenschaften an der Univ. Augsburg. Seit 1993 berufstätig im Bereich Bank- und Finanzwesen, Bankhaus Reuschel & Co. Privatbank in München; bis 2000 nebenberuflich Dozent an der Bankakademie in Frankfurt. 1994/01 Kreisvors. der JU, 1995/97 Mitglied im JU-Deutschlandrat und Mitgl. im Landesausschuss der JU Bayern, 1997/01 stellv. Bezirksvors. der JU Schwaben. Seit 1996 Marktrat in Münsterhausen; 1996/02 und seit 2008 Kreisrat im Landkreis Günzburg. - MdB seit 2002; 2005/08 energiepol. Sprecher der CSU-Landesgruppe; 2005/13 stellv. Vors. des Energiekoordinationskreises der CDU/CSU Fraktion; 2008/Okt. 2009 stellv. Vors. Ausschuss für Wirtschaft und Technologie; 2008/12 wirtschafts- und energiepol. Sprecher der CSU-Landesgruppe; 2009/13 Beauftragter der CDU/CSU-Fraktion für IT-,Kommunikations- und Postpolitik; Obmann der CDU/CSU-Fraktion in der Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; 2012/13 wirtschafts-, energie- und verkehrspol. Sprecher der CSU-Landesgruppe; seit 2014 stellv. Vors. der CDU/CSU-Fraktion.', 'Georg', '11003602');
