	Tierärztin', '1978 Abitur am Helmholtz-Gymnasium in Bonn. 1979 freiwilliges Soziales Jahr. 1981 Studium der Tiermedizin an der Tiermedizinischen Hochschule Hannover mit Approbation im Jahre 1987. 1988/90 Assistenztierärztin, 1991 Praxis-Niederlassung. 2003 Erwerb der Zusatzbezeichnung "Verhaltenskunde und -therapie"; 2008 Promotion. Seit 1993 amtliche Tierärztin bis Februar 2014 im Kreis Steinburg, im Anschluss bis Mai 2015 im Kreis Borken. 2008/14 Mitgl. der Ratsversammlung Itzehoe. 2013/15 stellv. Kreisvors., seit Mai 2015 Kreisvors. der SPD Steinburg, seit 2013 Mitgl. des SPD-Landesparteirats Schleswig-Holstein und stellv. Landesvors. der Arbeitsgemeinschaft der Sozialdemokraten im Gesundheitswesen; aktives Mitgl. der Arbeitsgemeinschaft sozialdemokratischer Frauen. Weitere Mitgliedschaften: ver.di, Tierärztliche Vereinigung Tierschutz (TVT), Tierärztliches Forum für verantwortbare Landwirtschaft, Frauen in die Aufsichtsräte (FidAR) e. V. - MdB seit Mai 2015.
