	Vizepräsident, ehrenamtlich (bis 31.12.2014)
	Vizepräsident, ehrenamtlich (bis Januar 2014)', '1978/82 Braith-Grundschule Biberach, 1983/91 Pestalozzi-Gymnasium Biberach. 1991/93 Ausbildung zum Redakteur, Radio 7 Biberach. 1994/02 Studium der Politikwissenschaft, Geschichte und Volkswirtschaftslehre an der Johannes-Gutenberg-Universität Mainz, Magister Artium. 1993/02 Freier Journalist u. a. für die Schwäbische Zeitung, Radio 7 und ZDF. 1999/01 Mitarbeit beim Democratic National Commitee in Washington D. C. und "Hillary Clinton for Senate" in New York. Landtagswahlkampf für Ute Vogt, SPD in Baden-Württemberg, 2002/05 parlamentarischer Berater im Landtag Baden-Württemberg (Bereiche Schule, Bildung und Sport). 1990 Eintritt in die SPD, seit 2001 Vors. des Kreisverbandes Biberach. Englisch (f), Französisch (G), Spanisch (G), Italienisch (f). - MdB seit Okt. 2005.
	Vizepräsident, ehrenamtlich', '1990 Abitur am Ernst-Barlach-Gymnasium. 1990/91 Wehrdienst. Anschl. Studium der Volkswirtschaftslehre sowie Studium der Landespflege, Geschichte, Politikwissenschaften und Soziologie. Tätigkeit als Mitarbeiter bei einem Bundestagsabgeordneten und einer Europaabgeordneten. Gästeführer an verschieden industriekulturellen Orten im Ruhrgebiet. 1991 Eintritt in die SPD, 2002/10 Vors. des Stadtverbandes der SPD Castrop-Rauxel, seit 2010 Vors. des Kreisverbandes der SPD Recklinghausen. 2004/10 Mitgl. im Rat der Stadt Castrop-Rauxel, 2004/05 Mitgl. im Kreistag Recklinghausen. Mitgl. beim BUND, der IGBCE, der AWO sowie des Deutsch Österreichischen Knappenvereins und FC Schalke 04. Seit 2015 Mitgl. im Aufsichtsrat der Evangelischer Verbund Ruhr gGmbH. - MdB seit Okt. 2005.', 'Frank', '11003846');
	Vizepräsident, ehrenamtlich', 'Seit 1998 Mitgl. von Bündnis 90/Die Grünen-GAL Hamburg, 1999/01 Mitgl. im Vorst. des KV Hamburg-Harburg, 2001/04 als Vorstandssprecher, 2008/11 Beisitzer im Landesvorst. Bündnis 90/Die Grünen Hamburg, 2011/15 stellv. Vors.  im Landesvorst. von Bündnis 90/Die Grünen Hamburg. 2004/08 Mitgl. der Hamburgischen Bürgerschaft. 2006/15 stellv. Landesvors. EUROPA UNION Hamburg e. V., seit 2010 Mitgl. im Vorst. Help e. V.; 2010/15 Mitgl. im Vorst. deutsch-zypriotisches Forum e. V., seit 2012 Mitgl. im Kuratorium des Instituts für Europäische Politik, seit Feb. 2014 Vizepräsident der Südosteuropa-Gesellschaft, seit Juni 2014 EBD-Vorstandsmitgl., Europäische Bewegung Deutschland e. V.. - MdB seit Mai 2008; seit 2009 Sprecher und Obmann für Europapolitik der Fraktion Bündnis 90/Die Grünen; seit 2010 Vors. der Parlamentariergruppe EUROPA UNION.', 'Manuel', '11003889');
	Vizepräsidentin
	Vizepräsidentin
	Vizepräsidentin, ehrenamtlich
	Vizepräsidentin, ehrenamtlich', '1981 Abitur in Menden. Ab 1982 Studium der Kath. Theologie und Geschichte in Münster, Jerusalem, Tübingen und Rom, 1987 Diplom in Theologie. 1988 Staatsexamen für Lehramt/Sek II in Theologie und Geschichte. 1992 Promotion. 1991/97 Referentin im Cusanuswerk (Begabtenförderung der kath. Kirche) in Bonn. 1997/04 Abteilungsleiterin bei Misereor (Hilfswerk für Entwicklungszusammenarbeit) in Aachen. 2004/13 Generalsekretärin des Cusanuswerks in Bonn. Mitgl. der CDU seit 2004, stellv. Kreisvors. der CDU Bonn; Mitglied der CDA. Seit 2012 Vorstandsvors. Arbeitsgemeinschaft für Entwicklungshilfe e. V. (AGEH), Köln; seit 2005 Vizepräsidentin Zentralkomitee der deutschen Katholiken (ZdK), Bonn; Mitgl. Stiftungskuratorium Kath. Deutscher Frauenbund (KDFB), Köln; Mitgl. des Kuratoriums der Stiftung Haus der Geschichte der Bundesrepublik (Bonn, Leipzig, Berlin); Kuratoriumsvors. Dt. Gesellschaft für Internationale Zusammenarbeit GmbH; Kuratoriumsmitgl. Don Bosco Mondo, Bonn, Mitgl. Programmbeirat ASA-Programm, stellv. Mitgl. Kuratorium der Bundeszentrale für politische Bildung; Leiterin Gemeinschaft Kath. Männer und Frauen (KMF), Köln; Mitgl. Kuratorium Exposure und Dialog e. V., Bonn. - MdB seit Okt. 2013; stellv. Vors. der Gruppe der Frauen der CDU/CSU-Fraktion, Mitgl. Arbeitnehmergruppe der CDU/CSU-Fraktion, Mitgl. Stephanuskreis und Kardinal-Höffner-Kreis der CDU/CSU-Fraktion; Mitgl. Dt.-Israelischen und Dt.-Indische Parlamentariergruppe sowie Parlamentariergruppe SADC-Staaten (Southern African Development Community).', 'Claudia', '11004345');
