	Vorsitzende des Kuratoriums, von Amts wegen', '1982 Abitur in Waldshut. 1983/89 Studium der Wirtschaftswissenschaften in Freiburg/Brsg. und Zürich/Schweiz, Lizenziat der Wirtschaftswissenschaften, Dipl.-Betriebswirtin Univ. Zürich. 1992/96 Marketing-Assistentin, 1997/05 Beratung und Kommunikation für Karin Rehbock-Zureich, MdB, März/Nov. 2010 Unternehmensberaterin. Seit 1994 Mitgl. SPD, seit 1999 stellv. Vors. des Kreisverb. Waldshut der Arbeitsgemeinschaft Sozialdemokratischer Frauen (ASF), seit 2001 Vors. SPD-Kreisverb. Waldshut, seit 2007 Mitgl. Landesvorst. SPD Baden-Württemberg. Seit 2004 Mitgl. Kreistag Landkreis Waldshut. Mitgl. bei ver.di, AWO, KLAR - Kein Leben mit atomaren Risiken e. V., Hospitzdienst e. V., Gegen Vergessen - Für Demokratie e. V., Eurosolar - Europäische Vereinigung für Erneuerbare Energien e. V. - MdB 2005/09 und seit Okt. 2010; seit Dez. 2013 Parl. Staatssekretärin bei der Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit; von Amts wegen Vors. Kuratorium der Dt. Bundesstiftung Umwelt (DBU) und Vors. Aufsichtsrat der Gesellschaft für Anlagen- und Reaktorsicherheit (GRS) mbH sowie Mitgl. des Mittelstandsrates der Kreditanstalt für Wiederaufbau (KfW).
