	Vorsitzende', '1971 Abitur und Abschluss der Berufsausbildung zur Chemiefaserfacharbeiterin. 1972/90 Arbeit in der Gastronomie, 1976/80 Kindererziehungszeit. 1991/93 Geschäftsstellenleiterin CDU-Kreisverband Rudolstadt, 1993/94 Mitarbeiterin MdB, 1992/97 Angestelltenlehrgang I und II. 1990/2010 und seit 2014 Kreistagsmitgl. 1995/11 stellv. Landesvors. KPV der CDU Thüringen, seit 1996 stellv. Bundesvors. KPV der CDU/CSU, Mitgl. CDA, Mitgl. MIT. 1994/99 Bürgermeisterin der Gemeinde Rohrbach, 1995/04 Vors. Verwaltungsgemeinschaft "Mittleres Schwarzatal", 1978/94 und 2009/14 Gemeinderatsmitgl., 2004/09 MdL in Thüringen. Vors. Thüringer Porzellanstraße e. V. Englisch (G), Russisch (G). - MdB seit Okt. 2009.', 'Carola', '11004162');
	Vorsitzende', 'Nach dem Studium bis 1983 bei der Bezirksregierung Köln in der Abteilung Städtebau tätig. Mitgliedschaften (Auswahl): Vorstand Aidshilfe Köln, Kreisvorsitzende des Paritätischen Wohlfahrtsverbandes Köln, Vorsitzende Zentrum für Frühbehandlung und Frühförderung e. V., Vorsitzende Kulturforum e. V., Vorsitzende Comedia Förderkreis e. V., Mitgl. gemeinsames Kuratorium der Max-Planck-Institute für Biologie des Alterns und für Stoffenwechselforschung, Mitgl. Kölner Runder Tisch für Integration und Runder Tisch für Flüchtlingsfragen, Vors. Kuratorium der Rhein-Flanke gGmbH. Mitgl. ver.di, Mitgl. Aufsichtsrat der KölnKongress GmbH, Region Köln/Bonn e. V., Zentral-Dombau-Verein zu Köln von 1842, Förderverein der Stadtbibliothek Köln, Mitgl. Verein "Tatort" e. V., Verbandsversammlung des Zweckverbands Sparkasse KölnBonn, Mitgl. Kuratorium SK-Stiftung Kultur und Stiftungsrat RheinEnergieStiftung Kultur. Seit 2004 im Rat der Stadt Köln, seit 2004 ehrenamtl. Bürgermeisterin der Stadt Köln, seit 2009 1. Stellvertreterin der Oberbürgermeisterin, Mitgl. in den Ratsausschüssen Kunst und Kultur sowie Schule und Weiterbildung und AG Lesben, Schwule und Transgender. - MdB seit Okt. 2015.
