	Vorsitzende, ehrenamtlich', '1978 Abitur. Ausbildung zur evangelischen Religionspädagogin und Diakonin in Ludwigsburg; 1982/92 Jugendreferentin und Diakonin in Stuttgart. 1992/97 Studium der Linguistik und Soziologie Univ. Stuttgart (M.A.); 2004 Promotion Univ. Mannheim. Während des Studiums Religionslehrerin in Stuttgart. Büroleiterin am Institut für Linguistik/Germanistik der Universität Stuttgart. Vier Jahre Referentin im Türkischen Generalkonsulat in Stuttgart.  Ab 2002 wissenschaftliche Mitarbeiterin der SPD-Fraktion, danach Büroleiterin von Abgeordneten im Landtag von Baden-Württemberg. 2011 Persönliche Referentin des Staatssekretärs im Kultusministerium. Kreisrätin Neckar-Odenwald-Kreis. Aufsichtsratsmitgl. Abfallwirtschaftsgesellschaft (AWN), Vors. Sportkreis Mosbach e. V., Vorstandsmitgl. Landesverband der Schulfördervereine Baden-Württemberg e. V., Mitgl. AWO. - MdB seit Okt. 2013; Mitgl. der Deutsch-Nordischen, Deutsch-Baltischen und der Deutsch-Türkischen Parlamentariergruppe.', 'Dorothee', '11004399');
	Vorsitzende, ehrenamtlich', '1979/82 Ausbildung Erzieherin in Tübingen. 1982 Anerkennungsjahr Tübinger Verein für Sozialtherapie. 1984/88 Studium, Abschl. Dipl.-Sozialpädagogin (FH) in Reutlingen. 1983 Anna Catharina, heilpäd. Jugendheim zur See, Spanien; 1986/90 Mitarbeiterin Talheimer Verlag Mössingen; 1990/96 Familienzeit; 1997/02 Kreisgeschäftsführerin BÜNDNIS 90/DIE GRÜNEN Reutlingen. Seit 2002 selbst. Sozialpädagogin, Projektmanagement und ESF-Begleitung. Seit 2003 1. Vors. Förderverein offene Jugendarbeit in Pliezhausen. Mitgl. ver.di. Seit 1997 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, seit 1998 Mitgl. Vorst. Kreisverb. Reutlingen, 2002/09 Basisvertreterin Bundesfinanzrat, 2003/09 und seit 2015 Mitgl. Landesvorst. BÜNDNIS 90/DIE GRÜNEN Baden-Württemberg, 2007/09 Mitgl. Sprecherteam LAG Wirtschaft, Finanzen und Soziales; seit 2003 Mitgl. und 2009 Sprecherin GewerkschaftsGrün. 1994 bis 2014 Gemeinderätin in Pliezhausen, 2004/09 Kreisrätin im Landkreis Reutlingen. - MdB seit Okt. 2009.', 'Beate', '11004117');
