	Vorsitzender der Stiftungskommission', 'Grundschule in Obrigheim/Pfalz, 1987/97 Gauß-Gymnasium Worms, Abitur. 1997/98 Zivildienst im Bereich Umweltschutz. 1998 Studium der Rechtswissenschaften Univ. des Saarlandes in Saarbrücken, 2000 Fortsetzung des Jura-Studiums in Mainz; 2003 erstes jur. Staatsexamen in Mainz, 2006 zweites jur. Staatsexamen in Mainz, Zulassung als Rechtsanwalt. 1995/03 freier Mitarbeiter bei der Wormser Zeitung und der Allgemeinen Zeitung; während des gesamten Studiums studentische Hilfskraft beim Bundestagsabgeordneten Klaus Hagemann; 2001 studentische Hilfskraft in der Staatskanzlei Rheinland-Pfalz in Mainz, Geschäftsstelle Tag der Deutschen Einheit; 2007 Persönlicher Referent von Landrat Ernst Walter Görisch bei der Kreisverwaltung Alzey-Worms; 2009 Wechsel zur Gemeinnützigen Wohnungsbaugenossenschaft Oppenheim eG, Bestellung als Vorstandsvorsitzender.
