	Vorsitzender des Stiftungsrates', '1967/74 Gymnasium Sigmaringen, Mittlere Reife. 1974/79 Verwaltungsausbildung Stadt Überlingen, Verwaltungsprüfungen I und II. 1982/86 Abendstudium Verwaltungs- und Wirtschaftsakademie Konstanz, Abschluss Betriebswirt VWA, 1982/86 Abendstudium Verwaltungs- und Wirtschaftsakademie Freiburg, Abschluss Verwaltungsdiplom. 1979/82 Sachbearbeiter Stadtverwaltung Pfullendorf, 1982/86 Krankenhausverwalter in Meersburg, 1986/90 Amtsleiter Verwaltung Krankenhäuser Landratsamt Waldshut. 1990/09 Bürgermeister Gemeinde Herdwangen-Schönach. Vors. Stiftungsrat Bürgerstiftung Herdwangen-Schönach. Seit 1981 Mitgl. der CDU, seit 1991 Vorstandsmitgl. CDU-Gemeindeverb. Herdwangen-Schönach. Englisch (G). - MdB seit Okt. 2009; stellv. Vors. der AG Kommunales der CDU/CSU-Fraktion.', 'Lothar', '11004135');
	Vorsitzender des Stiftungsrates', 'Abitur 1999. 1999/2001 Ausbildung zum Bankkaufmann, anschließend Studium der Politikwissenschaft, 2008 Bachelor of Arts (B. A.). Mitgl. der JU seit 1995, Mitgl. der CDU seit 1997, seit 2005 Vors. des CDU-Kreisverb. Borken, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschlands, seit Dez. 2014 Mitgl. Präsidium der CDU Deutschlands. 1999/09 Mitgl. im Rat der Stadt Ahaus, 2009/15 Mitgl. Kreistag Kreis Borken. Mitgl. der Katholischen Jungen Gemeinde (KJG), Mitgl. in diversen Vereinen und Verbänden. - MdB seit Okt. 2002; 2005/09 Obmann und 2009/15 Vors. der AG Gesundheit der CDU/CSU-Fraktion; seit Juli 2015 Parl. Staatssekretär beim Bundesminister der Finanzen.', 'Jens', '11003638');
	Vorsitzender des Stiftungsrates, ehrenamtlich', 'Die Eltern wurden aus Oberschlesien vertrieben. 1978 Abitur. Eintritt in die Bundeswehr, Offiziersanwärter, 1983 ausgeschieden, seit 2014 Oberstleutnant d. R. 1983/87 wissenschaftl. Mitarbeiter des CDU-MdB Sauer (Salzgitter), daneben Studium der Geschichte und der Pol. Wissenschaft. 1987/91 Generalsekretär des Bundes der Vertriebenen. Stellv. Stiftungsratsvors. der Stiftung zur Aufarbeitung der SED-Diktatur; 1998/08 Mitgl. Beirat beim Bundesbeauftragten für die Unterlagen der Staatssicherheit der ehemaligen DDR. 1994/14 Bundesvors. Verein für Dt. Kulturbeziehungen im Ausland e. V., seit 2009 Vors. Stiftungsrat "Stiftung Verbundenheit mit den Deutschen im Ausland", 2003/12 Präs. der Dt.-Koreanischen Gesellschaft. Seit 1978 Mitgl. der CSU, seit 1999 Kreisvors. CSU-Kreisverb. Bayreuth-Land, seit 1997 stellv. Vors. CSU-Bezirksverb. Oberfranken. - MdB seit 1990; Sprecher der CDU/CSU-Fraktion in den Enquete-Kommissionen "Aufarbeitung von Geschichte und Folgen der SED-Diktatur in Deutschland des 12. BT und "Überwindung der Folgen der SED-Diktatur im Prozess der deutschen Einheit" des 13. BT; 1990/05 Vors. Gruppe Vertriebene und Flüchtlinge der CDU/CSU-Fraktion, in der 15. WP Vors. AG Innen der CDU/CSU-Fraktion, Nov. 2005/Okt. 2009 Stellv. des 1. Parl. Geschäftsführers der CDU/CSU-Fraktion und Parl. Geschäftsführer der CSU-Landesgruppe. 1998/09 und ab Mai 2014 Vors. der Dt.-Koreanischen Parlamentariergruppe, ab 2006 Ko-Vors. Deutsch-Koreanisches Forum. Okt. 2009/Dez. 2013 Parl. Staatssekretär beim Bundesminister der Finanzen; seit Jan. 2014 Beauftragter der Bundesregierung für Aussiedlerfragen und nationale Minderheiten.', 'Hartmut', '11001186');
	Vorsitzender des Vorstandes', '1972 Abitur Stiftisches Gymnasium Düren. 1972/79 Medizinstudium RWTH Aachen, 1979 Approbation als Arzt. Seit 1988 Facharzt für Innere Medizin, seit 1988 Oberarzt der Klinik für Hämatologie/Onkologie am St.-Antonius-Hospital Eschweiler. Seit 1988 Vorstandsmitgl. und seit 2011 Präsident Ärztekammer Nordrhein, 1989/07 2. Vors. und ab 2007 1. Vors. Marburger Bund, Bundesverb., 1991/13 1. Vors. Marburger Bund, Landesverb. NRW/Rheinland-Pfalz; seit 1995 Vorstandsmitgl. Bundesärztekammer. U. a. Vors. Dt.-Jap. Kulturges. Aachen e. V., Vors. "Ärzte helfen Obdachlosen" e. V., Dt.-Israel. Ges. Aachen e. V., Förderverein Marienhospital Aachen e. V., Förderverein Region. Onkolog. Schwerpunkt Eschweiler e. V., Ges. der Freunde und Förderer der Nordrhein-Westf. Akademie der Wissenschaften e. V., Medizinische Ges. Aachen e. V.,  Bauverein der Kath. Kirchengem. St. Adalbert, Kuratorium AIDS-Hilfe NRW, St. Vincenz-Bogenschützenges. Niederforstbach 1891 e. V., seit 2000 Mitgl. Vorst. AG berufsständ. Versorgungseinrichtungen. Delegierter des Weltärztebundes, seit 2011 Mitgl. Dt. Ges. f. Gesetzgebung e. V., Mitgl. Förderverein Kinderseele e. V., Mitgl. Gesellschaft zum Studium strukturpolitischer Fragen e. V. Seit 1992 Mitgl. der CDU; 1997/13 Mitgl. CDU-Kreisvorst. Stadt Aachen, seit 1999 Mitgl. Landesvorst. CDU NRW, 1999/03 Mitgl. CDU-BFA Forschung und Innovation und 2010/14 Mitgl. CDU-BFA Arbeit, Soziales und Gesundheit, ab 2014 Mitgl. CDU-BFA Gesundheit und Pflege, 1999/13 stellv. Vors. CDU Aachen. 1994/04 Mitgl. Sozial- und Gesundheitsaussch. Rat der Stadt Aachen. 1995/09 MdL Nordrhein-Westfalen, dort u. a. Mitgl. Ausschuss für Arbeit, Gesundheit und Soziales, 2005/09 stellv. Vors. der CDU-Fraktion. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Rudolf', '11004055');
