	Vorsitzender', '1993 Realschulabschluss. 1994/96 Fachschule für Sozialpädagogik. 1996/97 Zivildienst. 1997/05 tätig als staatlich anerkannter Erzieher bzw. als Fachkraft für Berufs- und Arbeitsförderung bei Diakonie-Hilfswerk Schleswig-Holstein - heute Norddeutsche Gesellschaft für Diakonie, 2002/05 auch als Mitarbeitervertreter. Seit 2000 ehrenamtl. Betreuer beim Amtsgericht Eckernförde. Seit 1992 Mitgl. der SPD; 1994/05 Ratsherr in Eckernförde; 2002/03 Mitgl. im SPD-Landesvorst. Schleswig-Holstein, seit 2002 Vors. der SPD Rendsburg-Eckernförde, seit 2011 Vors. des SPD-Landesparteirates Schleswig-Holstein. - MdB seit 2005; 2005/14 Obmann der SPD-Fraktion im Unterausschuss Bürgerschaftliches Engagement, 2009/14 Sprecher der AG "Strategien gegen Rechtsextremismus" der SPD-Fraktion, seit 2014 Sprecher der SPD-Fraktion für Familie, Senioren, Frauen und Jugend, seit 2014 Mitgl. Fraktionsvorst.
