	Vorsitzender, ehrenamtlich', '1982 Abitur in Ellwangen/Jagst. 1982/2009 Bundeswehr. 1983/86 Studium der Wirtschaftswissenschaften in München und Austin/Texas. 1995/97 Generalstabsausbildung (Heusingerpreis). Berufliche Stationen u. a. EU-Rat Brüssel, NATO HQ in Brüssel und Mons, Bundesministerium der Verteidigung, Bataillonskommandeur, mehrere Auslandseinsätze. Mitgl. u. a. DRK, VdK, Lions. Stellv. Vors. Beirat BAKS, IPK GASP/GSVP. Bis 2016 Präsident VdRBw e. V. Seit 1981 Mitgl. der CDU, Vors. CDU-Kreisverband Ostalb; Vors. Bundesfachausschuss Außen-, Sicherheits-, Entwicklungs- und Menschenrechtspolitik CDU Deutschland. Vors. Volkshochschule Aalen und Mitgl. im Regionalverband Ostwürttemberg. Englisch (f), Französisch (f), Italienisch (G). - MdB seit Okt. 2009; Leiter dt. Delegation in der Euromediterrane Parl. Versammlung; Obmann der CDU/CSU-Fraktion für Außenpolitik.', 'Roderich', '11004068');
	Vorsitzender, ehrenamtlich', 'Abitur. Zivildienst. Studium der Rechtswissenschaften, erstes juristisches Staatsexamen, Rechtsreferendariat am Landgericht Paderborn, 1995 zweites juristisches Staatsexamen. Notarassessor. 1998 Geschäftsführer der Notarkammer Sachsen-Anhalt. 2006 bis Oktober 2009 Staatssekretär im Ministerium für Justiz des Landes Sachsen-Anhalt. Seit 1989 Mitgl. der SPD, seit 2006 Mitgl. im Landesvorst. und seit April 2016 Vors. der SPD Sachsen-Anhalt. Seit 2004 Stadtrat in Magdeburg. - MdB seit Okt. 2009; seit Mai 2011 rechtspol. Sprecher der SPD-Fraktion, seit Okt. 2011 Mitgl. im Vorst. der SPD-Fraktion, bis Sept. 2014 Sprecher der SPD-Fraktion für Recht und Verbraucherschutz, seit Sept. 2014 innenpolitischer Sprecher; seit 2014 Obmann der SPD-Fraktion im PKGr.
	Vorsitzender, ehrenamtlich', 'Gymnasium in Berlin-Steglitz. Studium der Geschichte, slavischen Sprachen und Politik FU Berlin und Albert-Ludwigs-Univ. in Freiburg 1963/67, Staatsexamen 1967. Verlagsredakteur 1968/69. Wissenschaftl. Assistent und wissenschaftl. Mitarbeiter am Seminar für osteuropäische Geschichte der Univ. Freiburg 1969/79. Verlagsleiter in Freiburg 1980/87. Mitgl. ver.di, AWO, Öko-Institut Freiburg. Vors. West-Ost-Gesellschaft Südbaden, Deutsch-Bulgarisches Forum und Präsident der Südosteuropa-Gesellschaft. SPD-Mitgl. seit 1970, Ortsvereinsvors. in Freiburg-Tiengen 1973/77, Kreisvors. der Freiburger SPD 1977/87. 1976/84 Ortschaftsrat in Freiburg-Tiengen. Englisch (f), Russisch (f), Französisch (G). - MdB seit 1987; Nov. 1998/Nov. 2005 und Okt. 2009/Dez. 2013 stellv. Vors. der SPD-Fraktion für die Bereiche Außenpolitik, Sicherheitspolitik, Menschenrechte und Entwicklungspolitik, 2003/06 Koord. für deutsch-russ. zwischengesell. Zusammenarbeit im AA, Nov. 2005/Okt. 2009 Staatsminister beim BMin. des Auswärtigen, seit Jan. 2014 Koord. für die zwischengesell. Zusammenarbeit mit Russland, Zentralasien und den Ländern der Östlichen Partnerschaft, 2015/16 Sonderbeauftragter der BReg. für den OSZE-Vorsitz.
