	Vortrag 2, 2015, Stufe 1 (Moderation "Führungsklausur")', '1995/2000 Studium der Politik, Mittlere und Neuere Geschichte und Öffentliches Recht in Heidelberg, Mannheim und San Francisco; 2008 Promotion in Darmstadt. Stipendiat der Friedrich-Ebert-Stiftung, der Fulbright-Kommission und der Erich-Becker-Stiftung; 2000/13 Mitarbeiter IFOK Kommunikations- und Strategieberatung in Bensheim. Seit Sommersemester 2013 Professur für Nachhaltiges Management an der Hochschule der Wirtschaft für Management in Mannheim. Seit 1991 Mitgl. der SPD, 1995/01 Ortsvereinsvors. der SPD Wiesloch, 2001/09 Kreisvors. der SPD Rhein-Neckar, seit 2005 stellv. Vors. der SPD Baden-Württemberg. 1999/13 im Stadtrat der Stadt Wiesloch, 2001/13 dort Vors. der SPD-Fraktion. 2009/13 Kreisrat im Rhein-Neckar-Kreis. Beirat der Beschäftigungsinitiative Wiesloch und Umgebung e.V. und Stiftungsratsvorsitzender  der Bürgerstiftung Wiesloch. - MdB seit Okt. 2013. Vorsitzender der AG Demokratie der SPD-Fraktion; stellv. Vors. Parl. Beirat für nachhaltige Entwicklung.', 'Lars', '11004257');
