   - Universität Basel, Basel, Schweiz, 2015, Stufe 1', 'Abitur am Königlichen Athenäum in Eupen (Belgien). Volontariat bei der Tageszeitung Grenz-Echo (Eupen/Belgien). Studium der Sozial- und Kommunikationswiss., Romanistik und Kunstpädagogik an der RWTH Aachen, am Institut Supérieur des Beaux Arts Saint Luc de Liège in Belgien und an der Georg-August-Univ. Göttingen; Promotion als Wirtschafts- und Sozialwissenschaftlerin Univ. Osnabrück. Redakteurin bei der Göttinger Woche. Wissenschaftl. Assistentin, Leiterin der Gleichstellungsbüros und hauptamtl. Gleichstellungsbeauftragte an den Universitäten Göttingen, Lüneburg, Osnabrück sowie an den Fachhochschulen Nordost-Niedersachsen (Lüneburg) und Osnabrück (einschließlich Campus Lingen); Projektleiterin bei einem Beratungsunternehmen in Gütersloh; seit 2012 freiberufliche Unternehmensberaterin. 1992 Eintritt in die SPD, 2008/11 Vors. der ASF im Landkreis Osnabrück, 2009/11 Beisitzerin im Kreisvorst. für den Landkreis Osnabrück, 2011 Landratskandidatin für SPD, Bündnis 90/Die Grünen und Bürgerforum Emlichheim im Landkreis Grafschaft Bentheim, 2011/14 SPD-Kreisvors. der Grafschaft Bentheim. Mitgl. der Arbeiterwohlfahrt (AWO), der Katholischen Arbeitnehmer-Bewegung (KAB), des Förderkreises der Städtischen Galerie Nordhorn, Mitgl. der Kunsthalle Lingen und des Meppener Kunstkreises. Auszeichnung der deutschsprachigen Gemeinschaft Belgiens, Promotionspreis von Arbeit und Leben. - MdB seit Okt. 2013.', 'Daniela', '11004386');
