Beamter', '1982 Allgemeine Hochschulreife Gymnasium Philippinum. 1983/85 Wehrdienst als Sanitäter in Marburg. 1985/88 Studium Fachhochschule des Bundes in Köln, Abschluss Diplom-Verwaltungswirt. 1988/91 Statistisches Bundesamt, Wiesbaden, 1991/99 Statistisches Bundesamt, Zweigstelle Berlin, 1999/13 im Bundesministerium des Innern. Mitgl. ver.di, Greenpeace, Arbeiterwohlfahrt, Sozialdemokratische Gemeinschaft für Kommunalpolitik (SGK). 2006/13 Bezirksverordneter/Fraktionsvors. in Berlin-Treptow-Köpenick. Mitgl. im Kuratorium der Bundeszentrale für politische Bildung (bpb). - MdB seit Okt. 2013; stellv. Sprecher der Landesgruppe Ost der SPD-Fraktion, stellv. sportpolitischer Sprecher.
