Beisitzer des Präsidiums', '1966/74 Gesamtschule in Kroatien, 1975/76 Hauptschule Gundelsheim, 1976/77 Berufsfachschule Metall Neckarsulm. 1977/79 Kfz-Mechaniker-Lehre in Bad Rappenau. 1981/83 tätig als Kfz-Mechaniker in Mannheim, 1983/2000 tätig als Fließbandarbeiter und in der Qualitätssicherung bei Audi Neckarsulm, 2000/05 Betriebsrat bei Audi Neckarsulm. 1982 Eintritt SPD, 1984/91 Ortsvereinsvors. in Gundelsheim, 1986/89 stellv. Juso-Kreisvors., 1993/2011 stellv. Kreisvors. SPD Heilbronn-Land, seit 2011 Kreisvors., 1997/13 Mitgl. Landesvorstand SPD Baden-Württemberg. 2004 Stadtrat Gundelsheim, 2009/11 Mitgl. Kreistag und seit 2009 Mitgl. Regionalversammlung Heilbronn-Franken. Mitgl. IG Metall, NABU, BUND, AWO, VdK. 1995 Gründung der Friedensinitiative "Neue Brücke" ehemaliger Jugoslawen in der IG Metall, 2005 Gründung der "Initiative Berufsabschluss - Jugendlichen eine Chance geben". Kroatisch/Serbisch (f), Englisch (G). - MdB seit 2005; seit 2014 Integrationsbeauftragter der SPD-Fraktion.
Beisitzer im Rechtsausschuss
Beisitzer', '1993/01 staatl. Musikinternat Max-Reger-Gymnasium in Amberg, Abitur 2001. 2001/05 Studium der Betriebswirtschaftslehre Ludwigs-Maximilians-Univ. (LMU) München sowie Univ. Passau, Abschluss Diplom-Kaufmann; Univ.-Schwerpunktsetzung Revisions- und Treuhandwesen, Bilanzanalyse, externe Rechnungslegung, Steuerrecht, Organisation und Personalwesen. 2005/09 Tätigkeit in der Wirtschaftsprüfung und Transaktionsberatung bei der PricewaterhouseCoopers AG (PwC), München. Seit April 2009 Referent des Kaufmännischen Geschäftsführers bei der Stadtwerke München GmbH.  Mitgl. der SPD, 2005/09 Vors. SPD-Ortsverein Leuchtenberg, 2007/08 Organisationsleiter des Kommunalwahlkampfes in Leuchtenberg sowie des Kreistagswahlkampfes in Neustadt a.d. Waldnaab, 2011/12 Kassier SPD-BWK München Nord. Mitgl. der Deutsch-Israelischen Gesellschaft e.V., Verein gegen betrügerisches Einschenken e.V., Arbeiterwohlfahrt München (AWO), ver.di Vereinte Dienstleistungsgewerkschaft, Förderverein NS-Dokumentationszentrum München. - MdB seit Okt. 2013.
Beisitzerin des Kuratoriums (bis 18.08.2014)
Beisitzerin des Präsidiums', '1987 Abitur am Städtischen Gymnasium Goch. Studium der Biotechnologie an der TU Braunschweig, 1993 Diplom. 1994 Wiss. Hilfskraft am Institut für Technologie an der Bundesforschungsanstalt für Landwirtschaft (FAL) in Braunschweig. 1995/99 Promotion. 1998/99 Referentin im Bereich Public Health, 2000 Projektleiterin medizinisches Marketing. Seit 1986 Mitgl. der SPD, 1990/97 Vors. und stellv. Vors. der Jusos im Unterbezirk Braunschweig, 2002/11 Vors. des SPD-Unterbezirks Braunschweig, seit 2011 stellv. Vors. SPD-Bezirk Braunschweig, seit 2008 Mitgl. des Landesvorst. der SPD Niedersachsen. Seit 2016 Beisitzerin des Präsidiums des AWO-Unterbezirks Braunschweig. - MdB seit Febr. 2000; 2005/09 gesundheitspol. Sprecherin der SPD-Fraktion, 2009/13 Vors. Ausschuss für Gesundheit, seit Dez. 2013 stellv. Vors. der SPD-Fraktion, zuständig für Arbeit und Soziales, Familie, Senioren, Frauen und Jugend.', 'Carola', '11003434');
