Beratendes Mitglied des Vorstandes', '1997 Einritt in die SPD, ab  2005 stellv. SPD-Unterbezirksvors., seit 2014 SPD-Unterbezirksvors. Mönchengladbach. 2002/Okt. 2013 Mitgl. im Rat der Stadt Mönchengladbach, 1995/2014 Mitgl. im Integrationsrat (vormals Ausländerbeirat), 1997/2014 Vors. Integrationsrat der Stadt Mönchengladbach, 2000/14 im Vorstand Landesintegrationsrat NRW (früher LAGA NRW). 2003/13 Mitgl. WDR-Rundfunkrat. Mitgl. IGBCE. - MdB seit Okt. 2013; Vors. des Fanclubs "Fohlen des Bundestages" (Borussia Mönchengladbach).', 'Gülistan', '11004448');
