Gutting Steuerberater und Rechtsanwälte GbR, Oberhausen-Rheinhausen', '1990 Abitur am Copernikus-Gymnasium Philippsburg. 1990/92 Studium der Rechtswissenschaften an der Univ. Mannheim, 1992/93 des Internationalen Rechts und Soziologie Stetson University, USA, 1993/97 der Rechtswissenschaften Univ. Heidelberg, 1997 1. jur. Staatsexamen, 1997/99 Referendariat am Landgericht Leipzig, 1999 2. jur. Staatsexamen. 2000 Rechtsanwalt Kanzlei Ritterhaus, Mannheim, seit 2001 Rechtsanwalt und Sozius in der Kanzlei Gutting, Steuerberater und Rechtsanwälte, Oberhausen-Rheinhausen. Mitgl. der JU seit 1987, Mitgl. der CDU seit 2001. Stellv. Vors. Institut Mittelstand und Compliance e. V., stellv. Vors. der Weltliga für Freiheit und Demokratie. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2002; Mitgl. im Vorstand der CDU/CSU-Fraktion.', 'Olav', '11003544');
