INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (10736, '', '', '', 'Chef des Bundeskanzleramtes, Bundesministerfür besondere Aufgaben, Jurist', '', '18.06.1958', '', 'Ensdorf', 'männlich', '', '10.11.1994', 'Altmaier', '', 'CDU', '', 'katholisch', '', 'Keine veröffentlichungspflichtigen Angaben', '1978 Abitur. Studium der Rechtswissenschaft, 1./2. jur. Staatsprüfung 1985/1988. Aufbaustudium "Europäische Integration". Grundwehrdienst. 1985/87 Wiss. Mitarbeiter am Lehrstuhl für Staats- und Völkerrecht Univ. Saarland in Saarbrücken, 1988/90 am dortigen Europa-Institut; 1990/94 Beamter der Europäischen Kommission, Brüssel, seither beurlaubt; 1993/94 außerdem Generalsekretär der EG-Verwaltungskommission für die soziale Sicherheit der Wanderarbeitnehmer. Mitgl. der CDU seit 1976, 2000/08 Vors. des CDU-Kreisverb. Saarlouis, seit 2008 stellv. Landesvors. der CDU Saar, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschlands. 2006/10 Präs. Europa-Union Deutschlands, seither Ehrenpräs. Englisch (f), Französisch (f), Niederländisch (f). - MdB seit 1994; Dez. 2004/Nov. 2005 Justiziar der CDU/CSU-Fraktion, Nov. 2005/Okt. 2009 Parl. Staatssekretär beim Bmin. des Innern, Okt. 2009/Mai 2012 1. Parl. Geschäftsführer der CDU/CSU-Fraktion. Mai 2012/Dez. 2013 Bundesminister für Umwelt, Naturschutz und Reaktorsicherheit. Seit Dez. 2013 Bundesminister für besondere Aufgaben und Chef des Bundeskanzleramtes.', 'Peter', '11002617');
