INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (12015, '', '', '', 'Beigeordnete a. D., Dezernentin', 'verheiratet, 2 Kinder', '13.08.1951', '', 'Jüterbog', 'weiblich', '', '26.10.1998', 'Krüger-Leißner', '', 'SPD', '', 'ohne Angaben', '', 'Keine veröffentlichungspflichtigen Angaben', 'POS und EOS in Jüterbog, 1970 Abitur und Eisenbahnfacharbeiterabschluss. 1970/74 Hochschulstudium in Leipzig, Diplomlehrerin für Kunsterziehung und Geschichte. 1974/87 Fachlehrertätigkeit in Jüterbog und Schönwalde. 1988/89 Studium für Jugendhilfe mit Abschluss. 1990/94 Beigeordnete und Dezernentin für Soziales, Familie, Jugend, Sport im Landkreis Nauen, 1992/98 stellv. Landrätin, 1994/98 Beigeordnete und Dezernentin für Soziales, Jugend, Kultur, Sport und Gesundheit im Landkreis Havelland. Seit 1990 Mitgl. SPD, 1992/93 Mitgl. Kreisvorst. Nauen, 1993/05 Mitgl. Unterbezirksvorst. Havelland, 1998/Juni 2002 Mitgl. Landesvorst. der SPD Brandenburg. 1990/94 Mitgl. Kreistag Nauen, 1994/08 Mitgl. Kreistag Havelland. Stellv. Vors. "Jugendaufbauwerke Nauen e. V.", Vorstandsmitgl. Dt.-Chinesische Gesellschaft - Freunde Taiwans; Mitgl. Verwaltungsrat und Vergabekommission der Filmförderungsanstalt Berlin, Vors. dt.-franz. Filmabkommenskommission, Mitgl. Vorauswahlkommission für den Dt. Filmpreis, Mitgl. Verein "Das Deutsch-Französische Filmtreffen", Gründungsmitgl. "Förderverein Deutsch-Russische Filmakademie e. V.".  - MdB 1998/2013 und seit Feb. 2017; Nov. 2009/2013 stellv. Vors. Ausschuss für Kultur und Medien; filmpol. und stellv. arbeitsmarktpol. Sprecherin der SPD-Fraktion,  stellv. Vors. Parlamentariergruppe "Freundeskreis Taipei" und der Parlamentariergruppe AWEPA.
