INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (12096, '', '', '', 'Agraringenieurin', 'verheiratet, 2 Kinder', '07.12.1958', '', 'Bad Frankenhausen / Kyffheuserkreis, Thüringen', 'weiblich', '', '28.09.2009', 'Steinke', '', 'DIE LINKE.', '', 'ohne Angaben', '', 'Keine veröffentlichungspflichtigen Angaben', '1965/75 Besuch der POS. 1975/78 Berufsausbildung zum Agrotechniker/Mechanisator mit Abitur. Fernstudium mit Abschluss Agraringenieurin der Tierproduktion. 1981/83 Futterökonom in der LPG (T) Bad Frankenhausen, 1983/89 Sekretär des Kreisvorstandes des Verbandes der Kleingärtner, Siedler und Kleintierzüchter (VKSK) Artern, 1991/93 arbeitslos, 1993/94 Anzeigenberaterin beim "Echo-Verlag" Wiehe, 1994/95 und 2002/03 arbeitslos, 2003/04 politische Mitarbeiterin im Landesverband der PDS. Mitgl. Jugendweihe Sömmerda und Umland e. V., seit 2005 Mitgl. VVN/BdA Thüringen. Seit 2008 Mitgl. Kreisvorstand der Volkssolidarität. 1981/89 Mitgl. der SED, danach der PDS/Die Linkspartei.PDS, 1995/98 stellv. Landesvors. der PDS Thüringen, seit 1998 Mitgl. und 1998/06 Sprecherin des Bundesparteirates der PDS, 2006/10 Mitgl. Parteivorst. und Juni 2008/Mai 2010 Mitgl. geschäftsführender Vorst. DIE LINKE. 1990/10 und seit 2014 Mitgl. Kreistag Kyffhäuserkreis, 2004/05 Mitgl. des Thüringer Landtags. - MdB 1998/02 und seit 2005; seit Nov. 2005 Vors. Petitionsausschuss.', 'Kersten', '11003197');
