INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (12316, '', '', '', 'Lehrer', 'verheiratet, 3 Kinder', '03.04.1945', '', 'Ehingen- Berkach', 'männlich', '', '26.10.1998', 'Wiese', '(Ehingen)', 'CDU', '', 'römisch-katholisch', '', 'Keine veröffentlichungspflichtigen Angaben', 'Humanistisches Gymnasium in Ehingen, 1964 Abitur. 1964/66Studium an der Pädagogischen Hochschule Weingarten. 1966/98 Lehrer an Grund- und Hauptschulen, Sonderschulen und Förderschulen, davon 1966/76 in der Piuspflege Oggelbeuren, Heim für erziehungsschwierige Kinder und Jugendliche, 1976/86 an der Sonderschule für Lernbehinderte in Blaubeuren und 1986/88 in Munderkingen, 1988/98 und 2002/10 an der Förderschule Erbach. Mitgl. der GEW, Verkehrswacht, der Kolpingfamilie, bei den Maltesern und in versch. Vereinen, zahlreiche Ehrenämter. 1965/66 stellv. Vors. RCDS Weingarten, 1966/79 Vors. der Jungen Union Ehingen/Donau, 1973/81 Bezirksvors. der JU Württemberg-Hohenzollern und Mitgl. Landesvorst. der JU Baden-Württemberg, seit 1974 Bezirks- und Kreisvorst. von CDU und CDA, seit 1970 Mitgl. im Bezirks- und Landesfachausschuss Bildungspolitik, 1981/87 Beisitzer im Landesvorst. der CDU Baden-Württemberg, 1982/87 Mitgl. CDU-Bundesfachausschuss "Jugendpolitik", seit 1986 Vors. der CDU Ehingen. Seit 1971 Stadtrat der Großen Kreisstadt Ehingen, 1994/09 und seit 2014 ehrenamtl. Stellvertreter des Oberbürgermeisters; seit 1978 Kreisrat im Alb-Donau-Kreis; seit 2004 stellv. Landesvors. der CDA Baden-Württemberg, seit 2005 Beisitzer im Bundesvorstand der CDA. - MdB 1998/02 und seit Okt. 2013.', 'Heinz', '11003261');
