INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (12479, '', 'Dr.', 'Dr.', 'Professor, Arzt, Staatsminister im Bundeskanzleramt', 'verheiratet', '18.10.1972', '', 'Gießen', 'männlich', '', '17.10.2002', 'Braun', '', 'CDU', '', 'römisch-katholisch', '', 'Keine veröffentlichungspflichtigen Angabenöffentlichungspflichtigen Angaben.', '1992 Abitur an der Liebigschule in Gießen. 1993/94 Wehrdienst bei der Bundeswehr, Koblenz. 1994/01 Studium der Humanmedizin an der Justus-Liebig-Universität Gießen, 2007 Promotion zum Dr. med. 2001/09 Wiss. Mitarbeiter am Universitätsklinikum Gießen. Seit 2015 Honorarprofessor an der Universität Frankfurt. 1989 Eintritt in die JU und in die CDU, 1992/97 JU-Kreisvors. und 1998/01 JU-Bezirksvors., seit 2004 Vors. des CDU Kreisverbandes Gießen, seit 2007 Vors. CDU-Bezirksverband Mittelhessen. 1997/09 Stadtverordneter in der Gießener Stadtverordnentenvers., 2006/09 Mitgl. Kreistag im Landkreis Gießen und Vors. der CDU Kreistagsfraktion. Englisch (f), Spanisch (G). - MdB 2002/05 und seit Okt. 2009; in der 15. WP Sprecher der CDU/CSU-Fraktion im Parl. Beirat für nachhaltige Entwicklung, 2003/05 und seit 2011 stellv. Vors. der Landesgruppe Hessen der CDU/CSU-Fraktion. Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung. Seit Dez. 2013 Staatsminister bei der Bundeskanzlerin.', 'Helge', '11003510');
