INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13185, '', '', '', 'Gewerkschaftssekretärin, Handelsfachwirtin', 'Lebensgemeinschaft', '28.08.1957', '', 'Stuttgart', 'weiblich', '', '18.10.2005', 'Binder', '', 'DIE LINKE.', '', 'konfessionslos', '', 'Keine veröffentlichungspflichtigen Angaben', '1974 Mittlere Reife. 1975/77 Ausbildung zur Einzelhandelskauffrau. 1980/82 Abendschule zur Handelsfachwirtin IHK. 1977/80 Kaufm. Angestellte im Einzelhandel, 1980/2000 Sachbearbeiterin in einem Verlagsunternehmen in Stuttgart, 2001/03 Sachbearbeiterin einer Firma für Außenwerbung in Konstanz, 2003/05 Hauptamtl. Vors. DGB-Region Mittelbaden in Karlsruhe. 1975/98 SPD-Mitgl. in versch. Funktion auf Orts-, Kreis- u. Landesebene, 1990/92 Stadträtin in Stuttgart. Seit 2005 Mitgl. der Linkspartei und WASG, seit 2007 Mitgl. DIE LINKE, 2007/16 Kreissprecherin DIE LINKE Karlsruhe. Seit 1975 Gewerkschaftsmitgl. bei ver.di (früher HBV) und NGG, 1976/78 Jugendvertreterin, 1987/2000 Betriebsrätin, Betriebsratsvors. im Verlagsunternehmen, 2001/03 Vors. ver.di-Kreisverb. Konstanz. 2000/03 Sprecherin Konstanzer Netzwerk gegen Rechts, 2003/05 alternierende Vors. Verwaltungsaussch. der Agentur für Arbeit Karlsruhe, 2003/05 Mitgl. Berufsbildungsaussch. IHK Karlsruhe, 2005/16 Mitgl. Bezirksrat AOK Karlsruhe. Mitgl. u. a. Kuratorium QS, Kuratorium Deutsche Stiftung Verbraucherschutz, Parlamentarischer Beirat der Fernuniversität Hagen, BUND, Aktionsbündnis Gentechnikfreie Region Mittlerer Oberrhein, Greenpeace, VVN-BdA, DFG-VK, amnesty international, AIDS-Hilfe, Fördermitgl. Linksjugend [''solid], Englisch (G), Französisch (G). - MdB seit 2005; Parlamentarische Geschäftsführerin und Mitgl. der Mitarbeiterkommission des Ältestenrates.', 'Karin', '11003738');
