INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13297, '', '', '', 'Dipl.-Betriebswirtin', '1 Kind', '29.10.1950', '', 'Diepholz', 'weiblich', '', '21.12.2006', 'Höger', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1957/65 Volksschule Haldem, 1965/67 Handelsschule Rahden. 1967/69 Ausbildung zur Speditionskauffrau. 1970/73 Studium an der Hochschule für Wirtschaft Bremen; danach Beschäftigung in versch. Unternehmen im betriebl. Rechnungswesen, seit 1994 Angestellte bei der AOK Westfalen-Lippe, Regionaldirektion Herford, Minden-Lübbecke. Seit vielen Jahren aktiv in Gewerkschaften, sozialen Bewegungen und in der Frauenbewegung. 1990/95 Sprecherin Stadtelternrat Herford, 1993/05 Vors. DGB-Frauenausschuss, 1996/05 Personalrätin AOK, 1997/05 Mitgl. der ver.di-Bundestarifkommission für die AOK, 2000/05 im Gesamtpersonalrat AOK Westfalen-Lippe. Mitgl. der ÖTV, Mitgl. seit Gründung von ver.di, dort bis 2005 im Landesfachbereichsvorstand Sozialversicherung und stellv. Vors. der Landesfachgruppe gesetzliche Krankenversicherung; Mitgl in Friedensgruppen und der DFG-VK. Gründungsmitgl. der WASG Nordrhein-Westfalen, seit Juni 2005 Mitgl. Linkspartei.PDS, nun DIE LINKE. Mitgl. attac, Bildungsgemeinschaft SALZ, DFG-VK, Förderverein gewerkschaftlicher Arbeitslosenarbeit, Kuratorium "Erinnern-Forschen-Gedenken" Herford, Informationsstelle Millitarisierung Tübingen, Naturfreunde Herford, pro asyl, Rosa-Luxemburg-Stiftung NRW, Rote Hilfe e. V., Vereinigung der Verfolgten des Naziregimes VVN-BdA, Welthaus Bielefeld und HERFORD-CONTEGA-Freundschaftsverein. - MdB seit 2005.', 'Inge', '11003773');
