INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13720, '', '', '', 'freiberufliche Redakteurin, wissenschaftliche Mitarbeiterin', 'verheiratet, 2 Kinder', '02.04.1971', '', 'Hamburg', 'weiblich', '', '27.10.2009', 'Buchholz', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1990 Abitur. 1991/98 Studium Erziehungswissenschaften, Religion, Sozialwissenschaften mit Schwerpunkt Politik in Hamburg, Staatsexamen. 1995/05 Assistentin für Behinderte, 2002/05 freiberufliche Redakteurin, 2005/09 wiss. Mitarbeiterin bei MdBs der Linksfraktion. Seit 1994 aktiv in versch. sozialen Bewegungen, u. a. Studierendenproteste, Anti-Nazi-Bewegung, Friedensbewegung, Globalisierungskritische Bewegung. Mitgl. der Strömung Sozialistische Linke und Unterstützerin des Netzwerks Marx21, Mitgl. bei ver.di, attac und der Rosa-Luxemburg-Stiftung. 1994/99 Mitgl. der SPD, seit 2004 Mitgl. der WASG, später der Partei DIE LINKE, seit 2007 Mitgl. im geschäftsführenden Parteivorstand. - MdB seit Okt. 2009; Sprecherin für Verteidigungspolitik und für Religionspolitik der Fraktion DIE LINKE.', 'Christine', '11004022');
