INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13823, '', '', '', 'Angestellter', '', '29.09.1963', '', 'München', 'männlich', '', '27.10.2009', 'Hunko', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1983 Abitur in Aachen. 1983/85 Zivildienst. 1985/91 Medizinstudium Freiburg. 1991/99 LKW-Fahrer, Drucker, Krankenpfleger, Publizist, in Freiburg, Aachen, Berlin. 1999/04 Ausbildung/Arbeit als Mediengestalter, Aachen. 2007/09 Mitarbeiter bei MdEP Tobias Pflüger, DIE LINKE, Brüssel. Seit 1981 aktiv in Friedens-, Umwelt- und sozialen Bewegungen, 1986/89 Bunte Liste Freiburg, 2004/06 Sprecher der Montagsdemos Aachen, 2006/07 Sprecher Kreisverband Aachen WASG, 2007/09 Mitgl. Landesvorstand DIE LINKE.NRW., seit 2014 Mitgl. Parteivorstand DIE LINKE. Mitgliedschaften: ver.di, Anti-Kriegs-Bündnis Aachen, Informationsstelle Militarisierung e. V., VVN-BdA Aachen, Mehr Demokratie e. V., attac. Englisch (f), Französisch (G), Spanisch (G). - MdB seit 2009; seit 2016 europapol. Sprecher Fraktion DIE LINKE. Parlamentarier/innengruppen: Ukraine, Zypern (Vors.), Belarus (stellv. Vors.); seit 2010 Mitglied Parl. Versammlung Europarat und dort stellv. Vors. der UEL (Linksfraktion) sowie Mitgl. Pol. Ausschuss, Sozialausschuss, Monitoring Ausschuss und Unterausschuss für die Europäische Sozialcharta. Schwerpunkte: Europa- und Außenpolitik.', 'Andrej', '11004060');
