INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13839, '', '', '', 'Diplom-Volkswirt (Universität)', '2 Kinder', '09.10.1953', '', 'Mittelberg', 'männlich', '', '27.10.2009', 'Kekeritz', '', 'BÜNDNIS 90/DIE GRÜNEN', '', 'konfessionslos', '', 'Keine veröffentlichungspflichtigen Angaben', '1976 Fachabitur Fachoberschule Nürnberg. 1977 Studienaufenthalt in London, Studium der Englischen Sprache. Studium VWL, Abschluss Dipl.-Volkswirt Univ. Nürnberg. 1982/88 selbstständig tätig. 1988/90 Mathematik- und Englischunterricht an einer Secondary School und päd. Trainer für Junglehrer (on the job Training) in Kamerun. 1990/2000 Hausmann und Betreuung der Kinder, daneben Beratung von Existenzgründern und EDV-Beratung für Kleinunternehmer. Ab 1994 freiberufl. Dozent bei versch. priv. und öff. Bildungsträgern im Bereich EDV und Reintegration von Arbeitssuchenden, spez. Kurse für Jugendliche und Menschen ab 50. Seit 2001 tätig im Bereich der berufl. Rehabilitation im Berufsförderungswerk Nürnberg. Langjähriges Mitgl. im Bund Naturschutz Bayern, Landesbund für Vogelschutz, ver.di und Attac. Seit 1972 Mitgl. der SPD, Austritt auf Grund des NATO- Doppelbeschlusses unter Helmut Schmidt. 1977 Mitbegründer der Nürnberger Anti-Atominitiative und aktives Mitgl. der Grünen. Seit 1990 pol. Arbeit in der Kommunalpolitik, 1996/09 und seit Mai 2014 im Kreistag Neustadt/Aisch-Bad Windsheim, bis Sept. 2009 im Stadtrat in Uffenheim. Englisch (f). - MdB seit Okt. 2009; seit 2013 Sprecher für Entwicklungspolitik der Fraktion Bündnis 90/Die Grünen.', 'Uwe', '11004066');
