INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13908, '', '', '', 'Werkzeugmacher, staatlich geprüfter Techniker für Maschinenbau', '', '09.05.1967', '', 'Apolda', 'männlich', '', '27.10.2009', 'Lenkert', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1973/83 Polytechnische Oberschule. 1983/86 Ausbildung als Werkzeugmacher bei Carl Zeiss Jena. 1986/88 Grundwehrdienst. 1991/95 Fernstudium, Abschluss als staatlich geprüfter Techniker für Maschinenbau. 1986/91 Werkzeugmacher bei Carl Zeiss Jena, 1991/96 Programmierer und Einrichter von CNC Fräsmaschinen bei der Firma Günther, 1996/99 stellv. Leiter der Musterfertigung Achsfedern bei Mubea Weißensee, 2000/02 Leiter der Qualitätssicherung bei Mubea-HZP, 2002/06 Technologe für Entwicklung, Vorserien und Serienanlauf für optische Produkte bei Carl Zeiss Jena, 2006/07 Technologe für Entwicklung, Vorserien und Serienanlauf, 2007/09 Leiter der Kleinserienmontage bei der Sypro Optics GmbH. 1983 Eintritt in die Gewerkschaft, Mitgl. der IG Metall, 2005/11 Initiator und Sprecher des Volksbegehrens "Für eine bessere Familienpolitik"; 2005 Mitgl. im Thüringer Landesförderverein Kindertagesstätten; seit 2007 Vorstandsmitgl., 2007 Mitbegründer des Betriebsrats der Sypro Optics GmbH. Seit 2010 Mitgl. "mehr Demokratie". Englisch (G). - MdB seit Okt. 2009; umweltpol. Sprecher und Sprecher für Forschungs- und Technologiepolitik der Fraktion DIE LINKE.', 'Ralph', '11004091');
