INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13940, '', '', '', 'Angestellter', 'verheiratet', '23.08.1969', '', 'Elsterwerda', 'männlich', '', '27.10.2009', 'Lutze', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1986 Abschluss der allgemeinbildenden Oberschule. 1989 Abschluss Berufsausbildung Maschinenbauer mit Abitur in einer Leipziger Gießerei. 1991/95 Studium an der Universität des Saarlandes (Konstruktions- und Fertigungstechnik). 2003/05 betriebliche Umschulung in einem Saarbrücker Einrichtungshaus zum Bürokaufmann (IHK). Nach der Berufsausbildung Weiterbeschäftigung als Reparaturschlosser, 1990/91 Montageschlosser bei einer Leiharbeitsfirma. 1995/02 Regionalbüromitarbeiter der PDS-Bundestagsfraktion in Saarbrücken und ab 2005 Wahlkreismitarbeiter von Oskar Lafontaine in Saarlouis. Mitgl. ver.di, im Beirat der Aktion 3. Welt Saar, im Vorstand der Peter-Imandt-Gesellschaft, der Gesellschaft für nachwachsende Rohstoffe und im ADFC. Bis 1994 parteilos, aber nicht unpolitisch, seit März 1995 Mitgl. der PDS, heute DIE LINKE. - MdB seit Okt. 2009.', 'Thomas', '11004103');
