INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13960, '', 'Dr.', 'Dr.', 'Rechtsanwalt', '', '14.12.1964', '', 'Osnabrück', 'männlich', '', '27.10.2009', 'Middelberg', '', 'CDU', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', 'Abitur am Carolinum. Jurastudium und Referendariat in Osnabrück, Bonn und Speyer. 1993 Rechtsanwalt. 1994/96 Syndikus PreussenElektra (E.ON Energie) AG, Hannover. 1997/2000 Büroleiter des Bremer Wirtschaftssenators und Aufsichtsratsvorsitzenden der Deutschen Post AG. 2001/02 Promotion zum Dr. iur. 2002/04 Leiter Unternehmensentwicklung Mitteldeutsche Flughafen AG, Leipzig. 2004/05 Beteiligungsmanager EWE AG, Oldenburg. 2005/09 Leiter Ressortkoordinierung Wirtschaft, Arbeit und Verkehr, Niedersächs. Staatskanzlei. Seit 1983 Mitgl. CDU, Vors. CDU-Bezirksverband Osnabrück-Emsland. - MdB seit Okt. 2009; stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, Vors. der Landesgruppe Niedersachsen.', 'Mathias', '11004110');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (13963, '', '', '', 'Diplom-Sozialökonomin', 'verheiratet, 1 Kind', '09.01.1960', '', 'Hamburg-Altona', 'weiblich', '', '27.10.2009', 'Möhring', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', 'Ausbildung Industriekauffrau. Über 2. Bildungsweg Studium an der Hochschule für Wirtschaft und Politik, Schwerpunkte Organisationssoziologie und Sozialpsychologie, Aufbaustudium Sozialökonomie mit Schwerpunkt "Feministische" Forschung und Frauenarbeit. Selbständige Beraterin für Betriebs- und Personalräte. Seit Juni 2007 Mitgl. der Partei DIE LINKE. - MdB seit Okt. 2009; 2009/11 und wieder seit Okt. 2013 frauenpolitische Sprecherin, Nov. 2011/Okt. 2013 1. stellv. Vors. und erneut seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE, seit 2014 stellv. Vors. Ausschuss für Familie, Senioren, Frauen und Jugend.', 'Cornelia', '11004111');
