INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14155, '', '', '', 'Soziologe', '', '13.02.1957', '', 'Bad Godesberg', 'männlich', '', '27.10.2009', 'Weinberg', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', '1969/76 in den Niederlanden, dort erste pol. Aktivitäten (Anti-Vietnamkriegskampagne). 1976 Schulsprecher, 1977 Abitur in Dieburg. Ab 1978 Studium Gesellschaftswiss. in Marburg, 1979 Eintritt in die GEW. Bis 1980 Zivildienst, aktiv im Bonner Friedensforum; ab 1980 wieder Studium in Marburg. Bis 1991 Projektleiter Markt-/Meinungsforschung GfK, Mitgründer Betriebsrat; gewerksch. aktiv in der Bildungsarbeit für Betriebsräte, 1991/03 selbst. geschäftsführender Gesellschafter Markt-/Meinungsforschungsinstitut, aktiv in der Bildungsarbeit der Gewerkschaft hbv, 2003 Regionalleiter Bayern ver.di Bildung+Beratung gGmbH. Mitgl. ver.di. 1980 Eintritt in den Sozialistischen Hochschulbund (SHB) und die SPD, bis 1986 Bundesvors. SHB, Beteiligung Friedensdemos, 2004 Austritt aus der SPD und Kontakt zur ASG später WASG, danach Eintritt, ab 2005 Kreisvors. WASG Nürnberg/Fürth und später Wahl in den geschäftsf. Landesvorst. der WASG Bayern, 2007/08 Landessprecher DIE LINKE. Bayern, 2007/14 Mitgl. Landesvorst. DIE LINKE. Bayern. 2008/09 Stadtrat der Stadt Nürnberg. Englisch (f), Niederländisch (f), Französisch (G). - MdB seit Okt. 2009; 2009/13 Obmann im Gesundheitsausschuss, 2013/15 Gesundheitspol. Sprecher, seit Anfang 2016 Sprecher für Krankenhauspolitik und Gesundheitsökonomie der Fraktion DIE LINKE.', 'Harald', '11004186');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14158, '', '', '', 'Rechtsanwältin, Bürgermeisterin a. D.', 'geschieden', '26.05.1958', '', 'Duisburg', 'weiblich', '', '27.10.2009', 'Weiss', '(Wesel I)', 'CDU', '', 'römisch-katholisch', '', 'Keine veröffentlichungspflichtigen Angaben', 'Bischöfliches Abteigymnasium und Leibniz-Gymnasium in Duisburg Hamborn, Abitur. Freiwilliges soziales Jahr. Studium der Rechtswissenschaften an der Ruhr-Univ. Bochum, 1. und 2. juristisches Staatsexamen. Rechtsanwältin in Duisburg-Hamborn und später in Dinslaken. 1992 Gründung Verein "Pangasian e. V.". Seit 1980 Mitgl. der CDU, Vors. des Duisburger CDU-Ortsverbandes Obermarxloh und danach stellv. Vors. der Kreis-CDU und Frauenunion Duisburg, 1989/98 Mitgl. der Bezirksvertretung Hamborn und dort Vors. der CDU-Fraktion, 1998 Wechsel zur CDU Dinslaken. 1999/09 direkt gewählte Bürgermeisterin der Stadt Dinslaken. 2010/16 Vors. der Frauen Union im Kreisverb. Wesel, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschland, seit 2016 Kreisvors. der CDU im Kreis Wesel. - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion.', 'Sabine', '11004187');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14161, '', '', '', 'Kauffrau im Einzelhandel', '1 Kind', '25.05.1973', '', 'Berlin', 'weiblich', '', '27.10.2009', 'Werner', '', 'DIE LINKE.', '', '', '', 'Keine veröffentlichungspflichtigen Angaben', 'Abitur. Ausbildung zur Kauffrau im Einzelhandel. Mitgl. der Gewerkschaft ver.di. Landesvors. DIE LINKE. Rheinland-Pfalz. Mitgl. Aufsichtsrat der Stadtwerke Trier. - MdB seit Okt. 2009; Mitgl. der parlamentarischen Versammlung des Europarates.', 'Katrin', '11004188');
