INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14173, '', 'Dr.', 'Dr.', 'Professor, Hochschullehrer', 'verheiratet, 2 Kinder', '03.05.1961', '', 'Marburg/Lahn', 'männlich', '', '27.10.2009', 'Zimmer', '', 'CDU', '', 'römisch-katholisch', '', 'Keine veröffentlichungspflichtigen Angaben', '1980 Abitur in Traben-Trarbach. 1980/86 Studium Politikwiss., Neuere Geschichte, Völkerrecht in Trier, Indiana/Pennsylvania und München, 1986 M. A. 1988/91 Promotionsstudium, Promotion zum Dr. rer. pol. Univ. der Bundeswehr Hamburg, 2006 Habilitation, Univ. Köln. 1986/87 wiss. Mitarbeiter Sozialwiss. Institut der Bundeswehr, 1990/93 wiss. Mitarbeiter Forschungsinstitut der Konrad-Adenauer-Stiftung St. Augustin; 1994/98 DAAD Associate German Studies Professor, Univ. of Alberta; 1998/99 Lehrbeauftragter Politikwiss. TU Darmstadt, 1999/09 Angestellter, Stadt Frankfurt am Main, 2013 Ernennung zum Honorarprofessor, Univ. zu Köln. Seit 1979 Mitgl. der CDU, Beisitzer Kreisvorst. CDU Frankfurt/M.; seit 2005 Kreisvors. CDA Frankfurt/M., seit 2011 Landesvors. CDA Hessen und stellv. Bundesvors. CDA, seit 2012 Mitgl. Präsidium der CDU Hessen. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit 2014 Mitgl. Fraktionsvorst. der CDU/CSU-Fraktion; seit Jan 2017 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe.', 'Matthias', '11004192');
