INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14675, '', '', '', 'Versicherungskaufmann', 'geschieden', '10.01.1955', '', 'Duisburg', 'männlich', '', '20.07.2015', 'Mosblech', '', 'CDU', '', 'römisch-katholisch', '', '', '1976 Abitur, anschl. Studium der Wirtschaftswissenschaften an der Univ. Duisburg und der Rechtswissenschaften an der Univ. Bonn. 1976/82 und 1983/86 Werkstudent bei den Niederrheinischen Gas- und Wasserwerken Duisburg. 1986/87 Lektor und 1988/92 freier Verlagsmitarbeiter des Sinusverlages in Krefeld. Seit 1989 selbständiger Versicherungsfachmann und Partner der Victoria Versicherung AG und der D.A.S. Versicherung AG, heute Partner der ERGO Versicherungsgruppe AG. Seit 1972 Mitgl. der CDU, 1976/79 Vors. JU-Ortsverband Duisburg-Hamborn und 1987/89 Vors. JU-Kreisverband Duisburg, 1978/87 stellv. Vors. JU-Bezirk Rheinisches Ruhrgebiet, seit 1993 stellv. Vors. CDU-Kreisverband Duisburg und seit 1997 Vors. des CDU-Ortsverband Duisburg-Alt-Hamborn, 1991/02 und 2004/08 stellv. Vors. OMV-Landesverbandes NRW. 1989/94 Mitgl. der Bezirksvertretung Duisburg-Hamborn, seit 1994 Mitgl. im Rat der Stadt Duisburg, zuletzt zweiter Bürgermeister. 2004/05 Mitgl. im Landtag von Nordrhein-Westfalen. - MdB seit Juli 2015.
