INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14691, '', '', '', 'Gross- und Aussenhandelskaufmann', 'verheiratet, 3 Kinder', '25.01.1945', '', 'Wilhelmshaven', 'männlich', '', '01.11.2016', 'Hajek', '', 'CDU', '', 'evangelisch-lutherisch', '', 'Keine veröffentlichungspflichtigen Angaben', 'Acht Jahre Volksschule, zweijährige Handelsschule. Ausbildung zum Groß- und Außenhandelskaufmann. 1964/66 Bundeswehr, Grundausbildung in Budel, zahlreiche Lehrgänge und anschließend in Aurich beim Fernmelderegiment und im SOC dienstlich eingesetzt. Kaufmännischer Angestellter im Großhandel, ab 1981 Handlungsbevollmächtigter. 1972/73 berufsbegleitend betriebswirtschaftliches Seminar "Praktischer Betriebswirt" mit bestandener Abschlussprüfung in Oldenburg, 1993 Ausbildereignungsprüfung vor der Handelskammer in Bremen. Seit Nov. 2009 Rentner. 2009/16 Vors. VdK Ortsverband Bockhorn. Seit Mai 1996 Mitgl. der CDU, seit Frühjahr 2007 Vors. der Senioren-Union Friesland, ab 2010 Landesvors. der Senioren-Union der CDU in Niedersachsen, Mitgl. im Bundesvorst. der Senioren-Union, Mitgl. im Landesvorst. der CDU in Niedersachsen, Mitgl. im Landesvorst. der CDU Oldenburg. - MdB seit Nov. 2016.
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14693, '', 'Dr.', 'Dr.', 'Kieferorthopäde', 'verheiratet, 4 Kinder', '29.03.1967', '', 'Lank-Latum (jetzt Meerbusch)', 'männlich', '', '07.12.2016', 'Höschel', '', 'CDU', '', 'ohne Angaben', '', 'Keine veröffentlichungspflichtigen Angaben', '1986 Abitur am Städtischen Mataré-Gymnasium Meerbusch-Büderich. 1986/91 Studium der Zahnheilkunde an der RWTH Aachen, 1994 dort Promotion; 1995/99 Weiterbildung zum Fachzahnarzt Kieferorthopädie. 2009/11 Studium BWL am IWW-Institut der Fernuniversität Hagen, 2011 Examen Betriebswirt (IWW). 1992/93 Zeitsoldat, Stabsarzt bei der Bundeswehr und nebenberuflich Assistent in einer Praxis in Neuss. 1994/95 Angestellter Zahnarzt in Mönchengladbach, 1995/97 Weiterbildungsassistent für Kieferorthopädie in einer Gemeinschaftspraxis in Herten, 1997/99 Weiterbildungsassistent in der Abteilung für Kieferorthopädie an der Uni-Klinik Frankfurt, seit 1999 freiberufliche Tätigkeit als Kieferorthopädie mit Praxen in Düsseldorf, Mönchengladbach und Meerbusch. 1986/02 Junge Union Meerbusch, seit 2000 CDU Düsseldorf und MIT der CDU, seit 2004 Vors. des gesundheitspol. Arbeitskreises der CDU NRW und damit Gast im Landesvorst. der CDU, seit 2008 Mitgl. Bundesfachausschuss Gesundheit und Pflege der CDU Deutschlands. Seit Dez. 2008 Mitgl. des Vorstandes und seit Dez. 2012 Vors. des Vereins PVS rhein-ruhr, seit Dez. 2016 Vors. des Bundesverbandes Verrechnungsstellen Gesundheit i. G. - MdB seit Dez. 2016.
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14695, '', '', '', 'Rechtsanwalts- und Notarfachangestellte', 'verheiratet, 2 Kinder', '20.10.1958', '', 'Kiel', 'weiblich', '', '28.06.2017', 'Herdan', '', 'CDU', '', 'evangelisch', '', '', 'Ricarda-Huch-Schule in Kiel, 1977 Abitur. Ausbildung zur Rechtsanwalts- und Notarfachangestellten, Prüfung 1981. Seit 1998 in der Kommunalpolitik, seit 2003 Kreistagsabgeordnete Kreis Rendsburg-Eckernförde, seit 2013 stellv. Landrätin, 2009/12 Mitgl. im Schleswig-Holsteinischen Landtag. - MdB seit Juni 2017.
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14697, '', '', '', 'Immobilienmakler', 'verheiratet, 2 Kinder', '19.03.1973', '', 'Flensburg', 'männlich', '', '03.07.2017', 'Jepsen', '', 'CDU', '', 'evangelisch', '', '', '1992 Abitur. 1995 Bankkaufmann. 1995/04 Wehrersatzdienst, Bundesanstalt Technisches Hilfswerk. 1992/95 Ausbildung zum Bankkaufmann, 1995/02 Sparkassenangestellter: Privatkundenberater, stellvertretender Filialleiter, Kreditsachbearbeiter, stellv. Filialdirektor, Filialleiter, Firmenkundenbetreuer; 1997 Sparkassenfachwirt, 2000 Sparkassenbetriebswirt, 2000 Entwicklungsprogramm zur Führungskraft, 2001/02 Fachseminar Firmenkundenbetreuung; seit 2003 Immobilien- und Finanzierungsmakler, seit 2006 selbstständig. Mitgl. Heimatverein der Landschaft Angeln e. V., stellv. Vors. Förderverein Landschaftsmuseum Angeln Unewatt, 2005/10 und 2015/20 ehrenamtlicher Richter am Schleswig-Holsteinischen Verwaltungsgericht. 
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (14699, '', '', '', 'Dipl.-Kaufmann', 'verheiratet', '31.10.1979', '', 'Köln', 'männlich', '', '18.07.2017', 'Uhl', '', 'CDU', '', 'römisch-katholisch', '', '', 'Grundschule Luitpold, Homburg-Erbach, Abitur am Saarpfalz-Gymnasium, Homburg. Studium der Betriebswirtschaftslehre und der Angewandten Informatik mit Schwerpunkt "Information and Business Management" an der Univ. des Saarlandes, Abschluss Dipl.-Kaufmann, "Speech Communication and Rhetoric" an der Univ. Regensburg (berufsbegleitend). Wehrdienst in Germersheim und Trier. 2012/17 Staatskanzlei des Saarlandes, zuletzt Referatsleiter in der Abteilung A (Personal, Organisatrion und Haushalt) und stellv . Chief Information Officer (CIO) der Saarländischen Landesregierung. 2009/12 Projektleiter eGovernment und elektronisches Dokumentenmanagement beim IT -Innovationszentrum. Mitgl. Europa Union Deutschlands, Gesellschaft für Informatik ( GI) e. V., Bundesverband Deutscher Volks- und Betriebswirte (bdvb), Deutsche Gesellschaft für Sprechwissenschaft und Sprecherziehung (DGSS), Gewerkschaft Deutscher Verwaltungsverband Saar (dvv). Seit 2015 Vors. CDU-Ortsverband Erbach- Reiskirchen, seit 2015 Mitgl. "Netzwerk Digitalisierung" der CDU Deutschlands, 2014/16 Mitgl. der Internationalen Kommission der Jungen Union Deutschlands, seit 2014 Vors. AK "Netzpolitik und Digitalisierung" von CDU und JU Saar, 2010/15 Vors. der JU Saar, seit 2010 Mitgl. Landesvorst. der CDU Saar, seit 2007 stellv. Vors. CDU-Stadtverband Homburg, 2005/10 Kreisvors. JU Saarpfalz, seit 2005 Mitgl. Kreisvorst. CDU Saarpfalz, 2001 bis 2005 Vors. JU-Stadtverband. Homburg, 2000/07 Gründung und Vors.JU-Ortsverband Erbach-Reiskirchen, seit 1998 Mitgl. CDU Saar, 1996/16 Mitgl. JU Saar. Seit 2004 Mitgl. Stadtrat Homburg/Saar. - MdB seit Juli 2017.
