INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (9347, '', '', '', 'Pfarrer, Baufacharbeiter', 'verheiratet, 3 Kinder', '17.10.1959', '', 'Lauchhammer / Kreis Senftenberg', 'männlich', '', '20.12.1990', 'Stübgen', '', 'CDU', '', 'evangelisch', '', 'Keine veröffentlichungspflichtigen Angaben', '1966/76 POS Lauchhammer, Herzberg, Zahna. Ausbildung als Baufacharbeiter. 1978/81 Kirchliches Proseminar Naumburg, Abitur 1981. 1981/87 Studium der Theologie in Berlin, Naumburg/Saale, 1987 1. Theologisches Staatsexamen, 1987/89 Vikariat, 1989 2. Staatsexamen. Ordination zum Pfarrer in der ev. Landeskirche, Kirchenprovinz Sachsen; Entsendung in Parochie Großthiemig/Brößnitz und Hirschfeld. Beitritt zur CDU im Febr. 1990, seit 1999 Kreisvors. der CDU Elbe-Elster. Englisch (f). - MdB seit 1990; Vors. der Landesgruppe Brandenburg der CDU/CSU-Fraktion, seit Nov. 2005 Vors. der AG Angelegenheiten der Europäischen Union und europapolitischer Sprecher der CDU/CSU-Fraktion; Vors. der Deutsch-Ungarischen Parlamentariergruppe.', 'Michael', '11002280');
