Illertisser Sonnenschein GmbH & Co KG, Babenhausen', 'Schule in Lindau (Bodensee). Betriebswirtschaftlehre, Rechtspflege- und Management-Studium in Reutlingen, München, Starnberg und Preßburg; 2002/05 Postgraduiertenstudium Komenius-Univ. Preßburg, Abschluss Doktor in Philosophie (doktor filozofie). 1978/90 Amtsgericht und Staatsanwaltschaft Kempten (Allgäu). 1990/02 Bürgermeister der Stadt Illertissen. Seit 2005 selbstständiger Wirtschaftsberater, Verwalter und Rechtsdienstleister, geschäftsführender Gesellschafter einer Solarkraftwerksgesellschaft; seit 2012 nebenamtliche Lehrtätigkeit an der Hochschule Biberach. Mitgl. der SPÖ in Wien-Ottakring und der Tschechischen Sozialdemokratischen Partei (CSSD), Mitgl. AWO, Ortsvorstand, Kreisvorstand, Bezirks- und Landesrevisor, Mitgl. Bayerisches Rotes Kreuz, davon 14 Jahre Bereitschaftsleiter, Mitgl. Deutsche Verkehrswacht, fünf Jahre Leiter der Gebietsverkehrswacht; Mitgl. und Vors. Freundeskreis Städtepartnerschaft Illertissen - Elbogen/Loket n.O., Verein für Landesbau und Gartenpflege Illertissen, Obst- und Gartenbauverein Au/Iller und Schwabenbühne Roth- und Illertal, Mitgl. Gebirgsjägerkameradschaft. 1982 Eintritt in die SPD, 1985/90 Ortsvereinsvors. Kempten-Nord, 1988/90 Kreisvors. Kempten (Allgäu) und stellv. Unterbezirksvors. Allgäu-Bodensee, seit 2008 stellv. Bezirksvors. der Schwaben-SPD, seit 2013 Mitgl.  Landesparteirat. Seit 1996 Kreisrat Landkreis Neu-Ulm, davon 1998/12 Fraktionsvors. Seit 1998 Aufsichtsrat für die SPD im Nahverkehrsverbund DING. Englisch (G), Französisch (G), Italienisch (G).  - MdB seit Okt. 2013; Obmann Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung.
