Industrie-Contact AG, Hamburg', '1968 Abitur, altsprachlich-humanistische Ausbildung. 1969/76 Studium der Rechtswissenschaften an der Univ. Hamburg. Journalistisches Volontariat, Journalist. Vorstand einer Agenturgruppe für Öffentlichkeitsarbeit. 1970 Eintritt in die CDU. 1974/82 Mitgl. der Bezirksvers. Wandsbek, 1982/02 Mitgl. Hamburgische Bürgerschaft, 1985/02 Parl. Geschäftsführer der CDU-Bürgerschaftsfraktion. Vors. Gesellschaft der Freunde Marokkos e. V.; stellv. Vors. des Beirates der Laotisch-Deutschen Gesellschaft für Innovation und Entwicklung, stellv. Bundesvors. der DGVN, stellv. Vors. Beirat des Dt. Evaluierungsinstituts der Entwicklungszusammenarbeit gGmbH, Vorstand Euro-Mediterranean Association für Cooperation and Development e. V. Englisch (f). - MdB seit Okt. 2002; seit 2009 Obmann der CDU/CSU-Fraktion im Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung, Obmann der CDU/CSU-Fraktion im Unterausschuss Vereinte Nationen, Internationale Org. und Globalisierung, Vors. der AG Elbe der CDU/CSU-Fraktion, Sprecher der CDU/CSU-MdBs der PV der OSZE, stellv. Mitgl. Ostseeparlamentarierkonferenz (BSPC).', 'Jürgen', '11003565');
