Landesvorsitzender, ehrenamtlich', '1987 Abitur am Syker Gymnasium. 1996 Magisterabschluss der Politologie, Schwerpunkt Kommunalwissenschaften an der Universität Bonn, Nebenfächer Neuere Geschichte und Psychologie. 1987 Wehrpflicht, Eintritt in die Bundeswehr, Pressereserveoffizier, Oberstleutnant d. R. 1996 Referent für Vertriebsmarketing bei der Deutschen Telekom AG, seit 2000 Marketingfachmann im Zentralbereich des Vorstandsvorsitzenden, Hauptstadtrepräsentanz. Stellv. Vors. des Kreissportbundes Diepholz, Fachwart Boxen im Kreissportbund Diepholz, Spartenleiter Boxen im TuS Syke e. V., stellv. Vors. Sportförderverein im Landkreis Diepholz, Vors. THW-Landeshelfervereinigung in Niedersachsen, seit 2013 Mitgl. Stiftungsrat der "Stiftung Kinderhospiz Löwenherz" und seit 2016 Mitgl. Gesellschafterversammlung der Wirtschaftsförderungsgesellschaft mbH für den Kreis Diepholz. 1983 Mitgl. der Jungen Union, 1986 Mitgl. der CDU, seit 2014 Vors. CDU-Kreisverband Diepholz, seit 2011 Mitgl. Bundesvorst. CDA Deutschland. Bis 1997 Stadtratsmitgl. in Bassum, 1991/01 und seit 2011 Kreistagsabgeordneter im Landkreis Diepholz; seit 2001 Mitgl. im Samtgemeinderat Kirchdorf, seit 2011 Ratsvors. des Samtgemeinderats Kirchdorf, seit 2011 Mitgl. im Verwaltungsrat der Kreissparkasse Diepholz; 2001/06 Mitgl. im Gemeinderat Kirchdorf. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Axel', '11004073');
