MiDa Parkverwaltungs- und Werbegesellschaft mbH, Nürnberg', '1973 Abitur. Jurastudium Friedrich-Alexander-Univ. Erlangen-Nürnberg, 1. und 2. Staatsexamen. Seit 1987 Rechtsanwältin und Unternehmerin. 1995/03 Landesschatzmeisterin der CSU, 1995/13 Präsidiumsmitgl. der CSU, Vors. der CSU-Finanzkommission, Mitgl. im Präsidium des Wirtschaftsbeirates der Union. 1990/94 Stadträtin in Nürnberg, wohnungspol. Sprecherin, Schwerpunkte: Wirtschaft, Recht, Stadtplanung und Stadtentwicklung. Präs. Tierschutzverein Nürnberg-Fürth, Stiftungsrätin Emanuel-Stiftung, Kuratoriumsmitgl. der Bayerischen Aids-Stiftung, Mitgl. Dt. UNESCO-Kommission, Mitgl. der Vollversammlung der IHK Nürnberg. - MdB seit 1994; in der 14. WP wirtschaftspol. Sprecherin und Vors. des Arbeitskreises Wirtschaft und Technologie der CSU-Landesgruppe, 15. WP wirtschaftspol. Sprecherin der CDU/CSU-Fraktion; 16. WP Parl. Staatssekretärin beim Bundesminister für Wirtschaft und Technologie, Koordinatorin der Bundesregierung für die Maritime Wirtschaft; seit Nov. 2009 Vors. Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung.', 'Dagmar G.', '11002829');
MiDa Parkverwaltungs- und Werbegesellschaft mbH, Nürnberg', '1984 Abitur am Willstätter Gymnasium. Studium der Rechtswissenschaften an der Friedrich-Alexander-Universität Erlangen-Nürnberg, 1. und 2. Staatsexamen. 1993 Mitarbeiter der SIEMENS Zentrale-Nordamerika, Legal Department - New York, USA. Seit 1994 Rechtsanwalt, 1996/2009 Syndikusanwalt, seit 2002 Geschäftsführer. Vizepräsident  Verband Deutscher Konzertchöre, Bayern, Vizepräsident Deutscher Kniggebund e. V., Gründungsvorst.  Fränkische Gesellschaft für Kultur, Politik und Zeitgeschichte, Gründungsmitgl. Deutsch-Israelische Gesellschaft Nürnberg-Mittelfranken. Mitgl. Kuratorium der Bundeszentrale für politische Bildung. Seit 2009 stellv. Bezirksvors. der CSU Nürnberg-Fürth-Schwabach. 1996/09 Stadtrat der Stadt Nürnberg, 2003/09 Fraktionsvors. der CSU-Stadtratsfraktion Nürnberg. - MdB seit Okt. 2009; 2011/14 Integrationsbeauftragter der CDU/CSU-Fraktion, seit Jan. 2014 Demografiebeauftragter der CDU/CSU-Fraktion, seit Okt. 2013 innen- und rechtspol. Sprecher der CSU-Landesgruppe, stellv. Vors. des 2. Untersuchungsausschusses.', 'Michael', '11004034');
