Ministerialrätin', '1976 Abitur am Amplonius Gymnasium in Rheinberg. Studium der Rechtswissenschaften in Bonn, 1. Staatsexamen Mainz, 2. Staatsexamen Hannover. Seit 1986 Beamtin im  Landesdienst Niedersachsen, 1986/04 Dezernentin in der Agrarstrukturverwaltung des Landes Niedersachsen, seit 2005 Referentin in der Regierungsvertretung Oldenburg und seit 2006 deren stellv. Leiterin. Seit 1982 Mitgl. der CDU, seit 1999 stellv. Landesvors. im CDU-Landesverb. Oldenburg, 2008/12 Beisitzerin im Landesvorst. der CDU Niedersachsen und 2008/13 Vors. LFA Europa und Regionalentwicklung, seit 2013 Beisitzerin im Kreisvorst. der CDU Ammerland, im Kreisvorstand Frauen Union Ammerland und im Landesvorstand der Frauen Union Oldenburg, seit 2015 Beisitzerin im Bundesvorstand der Frauen-Union. 2001/11 und seit Okt. 2016 Mitgl. im Kreistag Landkreis Ammerland und im Rat der Gemeinde Bad Zwischenahn, dort Fraktionsvorsitzende und Beigeordnete. 2001/11 Aufsichtsratsvorsitzende der gemeindeeigenen Reha-Klinik. - MdB seit Okt. 2013.', 'Barbara', '11004447');
