Mitarbeiterin im landwirtschaftlichen Familienunternehmen', '1987 Abitur am Gymnasium in Haltern. 1987/90 Ausbildung zur Fleischerin und Tätigkeit in dem Beruf. 1990/93 Ausbildung zur Postbeamtin im mittleren Dienst und Tätigkeit in dem Beruf; seit 1993 Mitarbeit im landwirtschaftlichen Betrieb des Ehemanns, incl. Weiterbildungsmaßnahmen im landwirtschaftlichen Bereich. Mitgl. im Verein "Behinderte wohnen in Haltern"; Mitgl. der Kath. Frauengemeinschaft Deutschland (kfd) und Mitgl. im Landfrauenverband, ehrenamtlich tätig in der Kirche am Ort. Seit März 2003 Mitgl. der CDU, sieben Jahre Vors. der Frauen Union Haltern, bis Nov. 2013 stellv. Vors., Vors. der Frauen Union Kreis Recklinghausen, Vors. im Ortsverband Haltern am See - Flaesheim. März 2011/Mai 2014 Mitgl. im Rat der Stadt Haltern am See, Mitgl. im Bau- und Verkehrsausschuss, stellv. Mitgl. im Stadtentwicklungsausschuss und im Umweltausschuss. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Rita', '11004419');
