Mitglied der Bremischen Bürgerschaft, Bremen', '2002/09 Studium der Politikwissenschaft an der Univ. Bremen, Dipl.-Politologin, Nebenfach Geographie. Seit 2001 Mitgl. der SPD, 2006/08 Mitgl. im Landesvorstand der Jusos Bremen, 2008/12 Juso-Landesvors., seit 2010 stellvertretende SPD-Landesvors., Sprecherin des Themenforums Verbraucherpolitik der SPD. 2009/11 Stadtteilmanagerin in den Bremer Stadtteilen Osterfeuerberg und Woltmershausen. 2011/15 Mitgl. der Bremischen Bürgerschaft, ordentliches Mitgl. im Ausschuss für die Gleichstellung der Frau, im Parl. Untersuchungsausschuss Krankenhauskeime sowie in der städtischen Deputation für Gesundheit und der staatlichen Deputation für Wirtschaft, Arbeit und Häfen, Sprecherin für Verbraucherpolitik der SPD-Bürgerschaftsfraktion. Mitgl. der Gewerkschaft ver.di, Vorstandsmitgl. im Verwaltungsrat der Verbraucherzentrale Bremen, stellv. Mitgl. im Beirat Finanzmarktwächter. - MdB seit Juli 2015.
Mitglied der Bundesfachkommission Verkehr, Logistik und Infrastruktur, ehrenamtlich', '1987 Abitur. 1987/88 Grundwehrdienst. 1988/95 Studium Rechtswissenschaften in Bonn, 1995/97 Rechtsreferendar. 1998 Zulassung als Rechtsanwalt, 1999/09 Bürgermeister Verbandsgemeinde Arzfeld. Seit 2001 Vors. DRK-Ortsverein Arzfeld, seit 2007 Mitgl. Vorstand des Freundes- und Förderkreises des St. Joseph-Krankenhauses Prüm e. V., seit 2007 Mitgl. Verwaltungsrat des luxemburgischen Kulturzentrums CUBE 521, seit Mai 2011 Mitgl. Wiss. Beirat der Dt. Gesellschaft für Finanz- und Haushaltspolitik e. V. 2010/12 Bezirksvors. CDU Trier, seit Nov. 2011 Generalsekretär der CDU Rheinland-Pfalz. Seit 1999 Mitgl. Kreistag Bitburg-Prüm, seit 2009 Mitgl. Verwaltungsrat der KSK Bitburg-Prüm. - MdB seit Okt. 2009; seit 2014 Beisitzer im Vorstand der CDU/CSU-Fraktion; seit 2014 Vors. Dt.-Belgisch-Luxemburgische Parlamentariergruppe.', 'Patrick', '11004146');
Mitglied der Bundesfachkommission Wachstum und Innovation', '1989 Abitur am Solitude-Gymnasium Stuttgart-Weilimdorf. 1990/91 Zivildienst im Diakonischen Werk Württemberg. 1991/98 Studium der Rechtswissenschaften in Tübingen und Leiden/Niederlande, 1994/97 Stipendiat der Konrad-Adenauer-Stiftung (1995/96 Sprecher). 1995/96 Tätigkeit beim Europ. Parlament als Assistent der bildungspol. Sprecherin, Doris Pack MdEP. 1998/2000 wiss. Mitarbeiter bei Prof. Dr. George Turner, Univ. Hohenheim, 1998/01 Doktorarbeit bei Prof. Dr. Thomas Oppermann, Eberhard Karls Univ. Tübingen, 2000/02 Referendariat in Stuttgart und London. Seit 2002 Rechtsanwalt. Seit 2011 Kreisvors. der CDU Stuttgart, Vors. LFA Medien und Medienpolitik der CDU Baden-Württemberg, Mitgl. BFA Bildung, Forschung und Innovation der CDU Deutschlands, Mitgl. Bundesfachkommission Wachstum und Innovation des Wirtschaftsrats der CDU e. V., Vors. Vorstand der Freunde und Förderer des Stuttgarter Oratorienchors e. V., Vors. Kuratorium des Stuttgarter Barockorchesters Il Gusto Barocco e. V.; Mitgl. Kuratorium Max-Planck-Institut für Festkörperforschung Stuttgart, Mitgl. Kuratorium der Theodor-Heuss-Stiftung, Kuratorium des Deutsch-Türkischen Forums Stuttgart e. V., Kuratorium der Bundesstiftung Magnus Hirschfeld, Kuratorium des Deutschen Studentenwerks e. V., Parl. Beirat des Bundesverbands Deutscher Stiftungen e. V., Beirat von Jugend gegen AIDS e. V. - MdB seit Okt. 2009; seit 2014 Obmann der CDU/CSU-Fraktion im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.', 'Stefan', '11004065');
