Mitglied der Gemeinschaftsversammlung, ehrenamtlich', '1987/96 Mathematisch-Naturwissenschaftliches Johann-Schöner Gymnasium Karlstadt, Abitur 1996. 1997/03 Studium der Rechtswissenschaften an der Bayerischen Julius-Maximilians-Univ. Würzburg, 1. jur. Staatsexamen 2002, 2. jur. Staatsexamen 2005. Seit 2006 Juristischer Staatsbeamter des Freistaates Bayern in der inneren Verwaltung,  Angestellter der Regierung von Unterfranken. Seit 2006 Regierungsrat am Landratsamt Miltenberg,  Leiter der Abteilung 5 Bauaufsicht, Bauleitplanung, Wohnbauförderung und Denkmalschutz, zudem seit Sept. 2006 Leiter der Abteilung 4 Wasserrecht, Bodenschutz, Immissionsschutz, staatliches Abfallrecht und kommunale Abfallwirtschaft. Seit Nov. 2009 Leiter des FB ABD bei der Stadt Würzburg, Oberrechtsrat. Seit 2010 versch. Lehraufträge, u. a. bei der Bayerischen Verwaltungsschule und der Bayerischen Akademie für Verwaltungswissenschaften. Mitgl. in sieben Vereinen der Heimatgemeinde. Seit 2008 Marktgemeinderat in Zellingen. Seit 2006 Mitgl. der CSU, Vors. der CSU Retzbach, stellv. Kreisvors. der CSU Main Spessart. - MdB seit Okt. 2013.', 'Alexander', '11004304');
