Mitglied der Mitgliederversammlung (bis 21.08.2014)', 'Clara-Schumann-Gymnasium in Bonn, Abitur. Zivildienst in einer Bildungseinrichtung. Studium der Rechtswissenschaften Univ. Köln; Stipendiat der Friedrich-Ebert-Stiftung. Freiberufliche Tätigkeit als Personal- und Organisationsberater. Ab 2011 Mitarbeiter des Europaabgeordneten und Präsidenten des europäischen Parlaments, Martin Schulz. Seit 1993 Mitgl. der SPD, Vors. der Jusos im Rhein-Sieg-Kreis, 2004 Vors. der SPD in Bornheim und 2005 Vors. der SPD im Rhein-Sieg-Kreis, seit 2014 Regionalvors. der SPD Mittelrhein. Seit 1999 Mitgl. Kreistag Rhein-Sieg, 2007/14 Vors. der SPD-Kreistagsfraktion. Ab 2014 stellv. Landrat des Rhein-Sieg-Kreises. Seit 2014 Mitgl. im Eisenbahninfrastrukturbeirat der Bundesnetzagentur. - MdB seit Okt. 2013.
