Mitglied der Pflegschaft, ehrenamtlich', '1997 Abitur in Essen. 1997/98 Wehrdienst in Essen. 1998/03 Studium der Rechtswissenschaften an der Ruhr-Univ. Bochum, 2003 Erstes Jur. Staatsexamen. 2003/05 Rechtsreferendariat am Landgericht Essen sowie juristische Nebentätigkeit. 2005 Zweites Jur. Staatsexamen und Zulassung als Rechtsanwalt. Seit 2005 Rechtsanwalt und seit 2009 Partner in der Sozietät Esch & Kramer Rechtsanwälte, 2010 Fachanwalt für Bank- und Kapitalmarktrecht. 1993 Eintritt in die JU, 2000/07 Mitgl. Landesvorst. JU NRW, zuletzt Landesjustitiar, 2003/07 Kreisvors. JU Essen, 2007/10 Bezirksvors. JU Ruhrgebiet; 1994 Eintritt in die CDU, seit 2007 Mitgl. Kreisvorst. CDU Essen, 2009/15 Stadtbezirksvors., 2011/15 stellv. Kreisvors. CDU Essen, seit 2015 Kreisvors. der CDU Essen. 1999/04 Mitgl. der Essener Bezirksvertretung IX (Werden/Kettwig/Bredeney), 2004/13 Mitgl. Rat der Stadt Essen, zuletzt ordnungs- und personalpol. Sprecher sowie Mitgl. Fraktionsvorstand. - MdB seit Okt. 2013.', 'Matthias', '11004292');
