Mitglied der Stadtverordnetenversammlung (bis Ende 2013)', '1983 Abitur in Darmstadt. Ausbildung zur Groß-und Außenhandelskauffrau, Weiterbildung zur Handelsfachwirtin. 1984/2000 Angestellte in einem Großhandelsunternehmen, 2000/02 Mitgl. der Geschäftsleitung eines mittelständischen Betriebes. 1993 Eintritt in die CDU. 1993/13 Stadtverordnete in Rödermark, 1997/01 Fraktionsvors., 2001/02 Stadtverordnetenvorsteherin. Seit 2005 Vors. der CDU Rödermark, seit 2011 stellv. Kreisvors. der CDU Offenbach-Land; seit 2003 Vors. der Mittelstandsvereinigung der CDU im Kreis Offenbach, seit 2009 Mitgl. im Landesvorst. Hessen, seit 2013 stellv. Bundesvors. der Mittelstandsvereinigung der CDU/CSU. Seit 2011 Mitgl. im Verwaltungsrat Sparkasse Dieburg. Vorstandsmitgl. Vereinsring Rödermark. - MdB seit Okt. 2002; seit 2014 Vors. Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.', 'Patricia', '11003582');
Mitglied der Stadtverordnetenversammlung', 'Max-Planck-Gymnasium Groß-Umstadt, 2001 Abitur. 2001/02 Zivildienst in der ambulanten Pflege. 2002/07 Studium der Betriebswirtschaft KU Eichstädt-Ingolstadt und Regents College London, Abschluss Dipl.-Kaufmann; 2007/13 Promotion am Lehrstuhl für Dienstleistungsmanagement bei Prof. Dr. Dr. h.c. Bernd Stauss, Abschluss Dr. rer. pol. 2002/07 versch. Tätigkeiten u. a. bei der Deutschen Lufthansa AG, der Merck KGaA und als wiss. Hilfskraft, 2007/11 wiss. Mitarbeiter am Lehrstuhl für Dienstleistungsmanagement an der KU Eichstädt-Ingolstadt. Anschl. freiberufliche Tätigkeit als Dozent und Berater. Mitgl. u. a. ZDS, bdvb, DAV, INKontakt, THW und der AWO. Mitgl. der SPD, stellv. Vors. Unterbezirksvorst. der SPD Darmstadt-Dieburg, Mitgl. im Bezirksbeirat der SPD Hessen-Süd, Delegierter der SPD Hessen-Süd für Bundesparteitag und Parteikonvent. Seit 2006 Stadtverordneter in Groß-Umstadt, seit 2011 Mitgl. der SPD-Fraktion in der Stadtverordnetenversammlung Groß-Umstadt, seit 2011 Vors. Ausschuss für Energieangelegenheiten. - MdB seit Okt. 2013; stellv. Vors. der Youngsters der SPD-Fraktion, stellv. Vors. der hessischen Landesgruppe der SPD-Fraktion; stellv. Vors. dt.-britische Parlamentariergruppe, Mitgl. dt.-irische und dt.-portugiesische Parlamentariergruppe.
Mitglied der Stadtverordnetenversammlung, ehrenamtlich', '1987 Lehre zum Werkzeugmacher im Armaturenwerk Prenzlau. 1990 Wehrdienst in der Vermessungseinheit II Prenzlau. 1991 Werkzeugmacher im Armaturenwerk Prenzlau. 1991 Lehre zum Reiseverkehrskaufmann (IHK Potsdam). 1993 Reiseverkehrskaufmann/Expedient bei BAF Reisen Prenzlau; 1994 Leiter der Reisebüros der Volksbank Uckermark eG. 1997 Studium zum Touristikfachwirt (IHK zu Berlin). 2003 Geschäftsführer des Tourismusverbandes Uckermark e.V. 2005 Geschäftsführer tmu Tourismus Marketing Uckermark GmbH. Mitgl. SPD-Ortsverein Prenzlau, 2015 Unterbezirksvors. SPD Uckermark. Mitgl. Stadtverordnetenversammlung Prenzlau - Fraktion der SPD. - MdB seit Okt. 2013; Sprecher der Landesgruppe Brandenburg und Vors. der Landesgruppe Ost der SPD-Fraktion.
Mitglied der Stadtverordnetenversammlung, ehrenamtlich', '1997 Abitur an der Altkönigschule Kronberg. 1997/98 Zivildienst in der Evangelischen Versöhnungsgemeinde in Oberursel (Taunus). 1998/05 Studium der Politikwissenschaft (Hauptfach), Öffentliches Recht und Privatrecht (Nebenfächer) an der Johannes Gutenberg-Univ. in Mainz. 2006/12 Persönlicher Referent des Landrats des Hochtaunuskreises, 2012/13 Pressesprecher des Hochtaunuskreises. 1993 Eintritt in die Junge Union, 1995 Eintritt in die CDU, stellv. Vors. der CDU Oberursel, Beisitzer im Kreisvorstand der CDU Hochtaunus. Stadtverordneter der Stadt Oberursel (Taunus). - MdB seit Okt. 2013.', 'Markus', '11004331');
