Mitglied der Verbandsversammlung (bis Mai 2014)', '1990 hauptamtliche Gewerkschaftssekretärin der IG Bergbau, Chemie, Energie; 2001 Bezirksleiterin der IG Bergbau, Chemie, Energie in Karlsruhe und Rhein/ Main. Mitgl. IG Bergbau, Chemie, Energie, Arbeiterwohlfahrt, Naturfreunde e. V., Stolpersteine,  regionale Vereine. Bis Mai 2014 Mitgl. des Beirates der Agentur für Arbeit, Mannheim, bis Mai 2014 Mitgl. der Verbandsversammlung des Verbands Region Rhein-Neckar, Mannheim. Seit 1989 Mitgl. der SPD. 2009/ 13 Stadträtin in Mannheim, arbeitsmarkt- und wirtschaftspolitische Sprecherin der Fraktion. - MdB seit Okt. 2013.
Mitglied der Verbandsversammlung und Vorsitzender des Rechnungsprüfungsausschusses', 'Grund- und Hauptschule Haibach. 1980/83 Ausbildung zum Metzger. 1983/84 Grundwehrdienst. 1986 Meisterprüfung, 1987 Übernahme des elterlichen Betriebes. 1996/14 Erster Bürgermeister der Gemeinde Haibach, seit 2002 Kreisrat des Landkreises Straubing-Bogen, Mitgl. Kreisausschuss. Seit 1999 Mitgl. Kreisvorst. der CSU, seit 2015 Bundeswahlkreisvorsitzender, seit 2005 Ortsvors. CSU-Ortsverband Haibach, seit 2005 Kreisvors. der Mittelstandsunion; seit 2009 Bezirksvors. der KPV Niederbayern, seit 2012 stellv. Landesvors. der KPV. Seit 2008 Verbandsrat ZTS Tierkörperbeseitigung, seit 2009 Vors. im Rechnungsprüfungsausschuss ZTS. Seit 2013 Vors. der Gebietsverkehrswacht Bogen. 2000/13 ehrenamtl. Richter am Verwaltungsgericht Regensburg. - MdB seit Okt. 2013.', 'Alois', '11004384');
