Mitglied der Verbandsversammlung', '1961/73 Schulausbildung mit Abitur. 1973/76 Wehrdienst. 1976/82 Studium der Humanmedizin in Rostock mit Staatsexamen und Diplom. 1982/87 Ausbildung zum Facharzt für Pathologie, 1987 Promotion, seit 1998 Oberarzt am Institut für Pathologie der Universität Rostock. Seit Okt. 1989 Mitgl. Neues Forum, über die Wendezeit als Mitgl. des Republiksprecherrates; seit 2006 Mitgl. Bündnis 90/Die Grünen. Mitgl. Kammerversammlung und Vorstand der Ärztekammer Mecklenburg-Vorpommern und beim DRK. Englisch (G), Französisch (G), Russisch (G). - MdB seit Okt. 2005.', 'Harald', '11003854');
Mitglied der Verbandsversammlung', '1978/82 Ausbildung zum Energieanlagenelektroniker, 1982/84 Technikerausbildung an der Technikerschule der Stadt Braunschweig, 1984 Fachhochschulreife. Techniker, seit 1985 bei der heutigen Braunschweiger Versorgungs-AG & Co. KG, 1986/04 Technischer Angestellter, 2004/05 Regulierungsmanager, 2005/13 Betriebsratsvors., 2007/13 Konzernbetriebsratsvors. BS ENERGY, 2006/13 Mitgl. Aufsichtsrat der Braunschweiger Versorgungs-Verwaltungs-AG und zweiter stellv. Aufsichtsratsvors. 2006/12 stellv. Vors. und 2012/13 Vors. der Arbeitsgemeinschaft der Betriebsräte der VEOLIA Wasser GmbH. Seit 1994 Mitgl. der CDU, seit 2000 der CDA, 1997/02 Vors. CDU-Ortsverband Destedt, 2001/11 Vors. im CDU-Gemeindeverband Cremlingen (Landkreis Wolfenbüttel), seit 2001 stellv. Vors. CDU-Kreisverband Wolfenbüttel, seit Febr. 2016 Mitgl. Bundesfachausschuss Arbeit und Soziales der CDU Deutschlands; seit 2014 Vors. CDA-Kreisverb. Wolfenbüttel, seit 2015 Vors. CDA-Landesverb. Braunschweig. 1991/2013 im Ortsrat Abbenrode, 2001/11 Ortsbürgermeister in Abbenrode, seit 2001 im Rat der Gemeinde Cremlingen und Vors. der CDU-Fraktion. Seit 2001 Kreistagsabgeordneter im Landkreis Wolfenbüttel, 2011/12 Vors. Ausschuss für Umwelt, Landwirtschaft und Klimaschutz, seit 2012 Vors. der CDU-Kreistagsfraktion, seit 2009 in der Asse-II-Begleitgruppe. Seit 1985 Mitgl. ver.di. Mitgl. der Freiwilligen Feuerwehr, div. Mitgliedschaften in Vereinen und Verbänden. - MdB seit Okt. 2013.', 'Uwe', '11004335');
