Mitglied der Vertreterversammlung, ehrenamtlich (bis 01.01.2016)', '1981 Abitur. 1982/85 Ausbildung zur Kauffrau für Bürokommunikation, 1988/92 Ausbildung zur Verwaltungsfachwirtin. 1996/99 berufsbegleitendes Studium, Schwerpunkt Volks- und Betriebswirtschaft. Mitgl. ver.di und IG BCE. Seit 1995 Mitgl. der SPD, stellv. Vors. SPD-Unterbezirk Pirmasens-Zweibrücken, Vorstandsmitglied der AsF im SPD-Unterbezirk Pirmasens-Zweibrücken, Vors. der SPD Pirmasens. - MdB seit Nov. 2014.
Mitglied der Vollversammlung', 'Studium der Mathematik, Physik, Politikwissenschaft und Pädagogik, 1971 Staatsexamen, 1974 Promotion. 1982 Habilitation in Pädagogik, Forschungsaufenthalte an den Univ. Cambridge und Augsburg. Professorin an der Pädagogischen Hochschule Heidelberg. Mitgl. Zentralkomitee der deutschen Katholiken, bis 2016 stellv. Vors. des ZDF-Fernsehrates, Mitgl. des Kuratoriums der Deutschlandstiftung Integration, seit 2014 Senatorin der Leibniz-Gemeinschaft, seit 2015 Mitgl. Kuratorium Stiftung Lesen, seit 2015 Ehrenbürgerschaft der Stadt Antakya, seit 2016 Vors. Kuratorium der START-Stiftung. Mitgl. im Bundesvorst. der CDU; bis 2015 Bundesvors. der Frauen Union, seit 2014 Mitgl. Bundesfachausschuss Außen-, Sicherheits-, Entwicklungs- und Menschenrechtspolitik der CDU.  - MdB seit 1990; Febr. 2000/Nov. 2005 stellv. Vors. der CDU/CSU-Fraktion, 2005/13 Staatsministerin bei der Bundeskanzlerin, Beauftragte der Bundesregierung für Migration, Flüchtlinge und Integration. Seit 2013 Staatsministerin im Auswärtigen Amt.', 'Maria', '11002630');
