Mitglied der Vollversammlung, ehrenamtlich', 'Studium Germanistik, Kunstgeschichte u. Politikwissenschaft, Stipendiatin Institut für Begabtenförderung der Konrad-Adenauer-Stiftung. 1990/91 Museum für Verkehr und Technik, 1991/92 Verlags-und Buchhandelsgesellschaft Bouvier, 1992/95 Pressesprecherin Senatsverwaltung für Wissenschaft und Forschung Berlin; 1995/05 Mitglied Abgeordnetenhaus von Berlin, wissenschafts- und kulturpolitische Sprecherin der CDU-Fraktion. Seit 2009 erste stellv. Landesvors. CDU Berlin. 1998/13 Vorstand Stiftung "Brandenburger Tor", 1991/99 Lehrbeauftragte für Kulturmanagement, seit 1999 Honorarprofessorin, FU Berlin. Seit Nov. Mitgl. 2012 Zentralkomitee der deutschen Katholiken, Mitgl. Kuratorium Internationale Journalisten-Programme e. V. (IJP), Königstein/Taunus. Englisch (f), Italienisch (G). - MdB seit 2005; 2009/13 Vors. Ausschuss für Kultur und Medien. Seit Dez. 2013 Staatsministerin, Beauftragte der BReg. für Kultur und Medien.', 'Monika', '11003761');
