Mitglied des Arbeitskreises Politische Grundfragen, ehrenamtlich', '1982 Abitur am Neusprachl. Gymnasium Pirmasens. Danach Studium Politikwiss., Soziologie und deutschen Volkskunde Johannes-Gutenberg-Univ. Mainz, Stipendiat der Friedrich-Ebert-Stiftung. 1995/99 Referent beim SPD-Landesverb., dort u. a. zuständig für die Betreuung der Untergliederungen und Kommissionen und Beratung bei Kommunal- und Urwahlen. 1999/02 Sprecher des rheinland-pfälzischen Innenministers Walter Zuber. 1983 Eintritt in die SPD; bei den Jungsozialisten an der Joh.-Gutenberg-Univ. und im Bezirk Rheinhessen in unterschiedl. Funktionen aktiv. 1988/93 Vors. SPD-Ortsverein Wackernheim, Vors. SPD-Verb. Heidesheim, versch. Ämter im SPD-Unterbez. Mainz-Bingen, 1999/2014 Vors., 1996/05 Vors. der SGK im Landkreis Mainz-Bingen; seit 2004 Mitgl. des Vorst. und des Präs. der SPD Rheinland-Pfalz. Fraktionsvors. der SPD im Verbandsgemeinderat Heidesheim bis 1994, 1. Beigeordneter der Ortsgemeinde Wackernheim 1994/99, dann 1999/04 Fraktionsvors. im dortigen Gemeinderat und 2004/12 Mitgl. des Gemeinderates. Mitgl. Kreistag seit 1999. Seit 2005 Mitgl. AK Politische Grundfragen des ZdK. 2009/15 Vors. Förderkreis MS-Kranke in Rheinland-Pfalz. Mitgl. in zahlr. Vereinen und der AWO; 2007/14 Präsident Dt. Baseball und Softball Verband e. V. - MdB seit Okt. 2002; in der 16. WP stellv. innenpol. Sprecher der SPD-Fraktion und Obmann im 1. Untersuchungsausschuss der 16. WP; in der 17. WP bis Okt. 2011 Obmann im Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung, Okt. 2011/Juli 2014 innenpol. Sprecher der SPD-Fraktion; Mitgl. PKGr, stellv. Mitgl. G 10-Kommission bis Juli 2014.
