Mitglied des Aufsichtsrates (bis Ende Februar 2014), jährlich, Stufe 3', 'Aufgewachsen in Hamburg. 1966 Mittlere Reife. Ausbildung zum Drucker. Zivildienst. 1973 Wechsel nach Westberlin, bis 1980 Studium zum Druck-Ingenieur, Studium VWL FU Berlin. Verlagshersteller, 1980 Wechsel nach Stuttgart, bis 2001 in der Tarifpolitik der IG Druck und Papier, ab 1989 der IG Medien. In den achtziger Jahren beteiligt an Kämpfen zur Durchsetzung der 35-Stunden-Woche, 1990/91 verantw. Beauftragter für die Tarifpolitik in der DDR bzw. den neuen Bundesländern. Seit 2001 Chefvolkswirt beim ver.di-Bundesvorstand Berlin. 1980/82 Beteiligung am Aufbau der Demokratischen Sozialisten (DS), 1982 Eintritt in die SPD nach Scheitern der DS; 2004 Unterstützung Wahlalternative 2006 bzw. WASG, 2005 Austritt aus der SPD und Eintritt in die WASG, 2006 Wahl zum Mitgl. in den Bundesvorst. der WASG, Juni 2007/Mai 2014 Mitgl. Parteivorst. Partei DIE LINKE. - MdB seit Okt. 2009.', 'Michael', '11004144');
