Mitglied des Aufsichtsrates', '1968 Abitur. Wehrdienst. Studium der Geschichte und Geographie Univ. Köln, 1975 1. Staatsexamen. Nach dem 2. Staatsexamen seit Anfang 1977 Lehrer am Gymnasium, Anfang 1989 stellv. Schulleiter in Brühl, Oktober 1992 Schulleiter des Maximilian-Kolbe-Gymnasiums in Porz-Wahn. Mitgl. im Vorstand der Kölner CDU, 2004/07 Vors. CDU-Stadtbezirk Rodenkirchen und 2008/12 stellv. Vors. CDU-Kreisverband Köln. 1999/2013 Mitgl. Rat der Stadt Köln, verkehrspolitischer Sprecher der CDU-Ratsfraktion. 2004/13 Vors. Nahverkehrszweckverbandsversammlungen von VRS und NVR. 2004/13 Mitgl. Regionalrat bei der Bezirksregierung Köln, seit 2000 verkehrspol Sprecher der CDU in der Verkehrskommission des Regionalrats. - MdB seit Okt. 2013.', 'Karsten', '11004356');
Mitglied des Aufsichtsrates', '1993 Abitur Gymnasium Mittweida. 1994/02 Studium Soziologie, Recht, Politik an der TU Chemnitz und der TU Dresden, 2002 Abschluss als Dipl.-Soziologe an der TU Dresden. 1999/04 Mitarbeiter der MdL Katja Kipping. Seit 1991 Mitgl. der PDS, 1998/99 Landesjugendkoordinator der PDS Sachsen, 1999/05 stellv. Landesvors. der PDS Sachsen. Mitgl. ver.di, der Rosa-Luxemburg-Stiftung Sachsen, bundesweites Netzwerk Grundeinkommen und im kommunalpolitischen Forum Sachsen. Englisch (G), Russisch (G). - MdB seit 2005; 2005/09 menschenrechtspolitischer Sprecher der Fraktion DIE LINKE, Vors. der Deutsch-Mexikanischen Parlamentariergruppe.', 'Michael', '11003800');
