Mitglied des Aufsichtsrates, ehrenamtlich', '1959/69 Polytechnische Oberschule. 1972/74 Grundwehrdienst. 1969/72 Berufsausbildung zum Betriebsschlosser mit Abitur. 1974/78 Studium des Allgemeinen Maschinen- und Fahrzeugbaus an der Ingenieur-Hochschule Zwickau, Abschluss Diplom-Ingenieur (FH), 1997/2000 Studium an der VWA Schwerin, Abschluss Verwaltungsbetriebswirt (VWA). 1979/92 Montage- und Abteilungsleiter im Landtechnischen Anlagenbau Rostock, Betriebsteil Wusterhusen, 1992/2006 Technischer Angestellter. Seit 1995 Mitgl. der CDU. 1990/92 Gemeindevorsteher im Seebad Lubmin, 1992/04 dort Bürgermeister, 1994/09 Mitgl. im Kreistag Ostvorpommern, 1999/09 Präsident des Kreistags; 2004/08 stellv. Vors. des Landkreistages Mecklenburg-Vorpommerns, 2008/09 Vors.; 2006/09 Mitgl. des Landtages von Mecklenburg-Vorpommern, dort Vors. Ausschuss für Landwirtschaft, Umwelt und Verbraucherschutz und Sprecher der CDU-Fraktion für Kommunal- und Umweltpolitik. Englisch (G), Russisch (G). - MdB seit Okt. 2009.', 'Matthias', '11004094');
Mitglied des Aufsichtsrates, ehrenamtlich', '1998 Abitur am Marie-Curie Gymnasium Dresden. 1999 Zivildienst. 2000/08 Studium der Soziologie an der Technischen Universität Dresden. 2008/09 Referent der Fraktion BÜNDNIS 90/DIE GRÜNEN im Sächsischen Landtag. 1992/2000 Mitarbeit in der UNICEF-Arbeitsgruppe Dresden. 1997/98 aktiv im Stadtschülerrat. Mitglied u.a. im Umweltverband GRÜNE LIGA, Verkehrsclub Deutschland (VCD), ROBIN WOOD, Deutsches Komitee für UNICEF e.V., arche noVa - Initiative für Menschen in Not, Radio-Initiative Dresden e.V. Seit 1998 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, 2001/10 Mitgl. im Vorstand Kreisverband Dresden, davon 2003/05 und 2008/10 Sprecher des Kreisverbandes, 2007/08 Mitgl. im Landesvorstand von BÜNDNIS 90/DIE GRÜNEN Sachsen, 2010/12 und 2014/16 Mitgl. im Landesparteirat von BÜNDNIS 90/DIE GRÜNEN Sachsen. 2004/10 Mitgl. im Stadtrat von Dresden. - MdB seit Okt. 2009, seit Juni 2011 Sprecher für Verkehrspolitik der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Stephan', '11004085');
Mitglied des Aufsichtsrates, ehrenamtlich', 'Bischöfliche Marienschule Münster, Abitur. Lehre im Garten- und Landschaftsbau, 1982/86 Studium der  Landespflege an der FH Weihenstephan mit den Schwerpunkten Landschaftsbau und Freiraumplanung, Abschluss Diplom-Ingenieurin. Praxisjahr in der Schweiz. Mitarbeiterin in einem Landschaftsarchitekturbüro in Düsseldorf. Studium der Geographie (Landschaftsökologie) an der WWU Münster, Abschluss Diplom-Geographin. 1990/93 Auslandsaufenthalt in Paris, freiberufliche Tätigkeit als Landschaftsplanerin. Seit 2001 Mitgl. der CDU, seit 2003 stellv. Vors. der CDU Roxel, stellv. Vors. CDU-Bezirksverband Münsterland. 2002 Sachkundige Bürgerin im Ausschuss für Umwelt und Bauwesen, 2004 direkt gewähltes Mitgl. im Rat der Stadt Münster, Mitgl. und stellv. Mitgl. in versch. Ratsausschüssen, 2004/13 stellv. Vorsitzende der CDU-Ratsfraktion, 2008/13 planungspolitische Sprecherin der CDU-Ratsfraktion. - MdB seit Okt. 2013.', 'Sybille', '11004251');
