Mitglied des Beirates (bis 31.01.2016)', '1997/98 Ausbildung mit Abschluss zur Kinderpflegerin. 2000 Abitur an der Hiberniaschule Herne. 2000/02 Freie Mitarbeiterin Lokalredaktion. 2002/07 Studium, "Journalismus und PR", Schwerpunkt Wirtschaft, Februar 2007 (B. A.). 2003/08 selbstständig tätig im Bereich Presse und PR, u. a. als Referentin für Verbände und soziale Organisationen, zunächst studienbegleitend. 2008/09 Wissenschaftl. Mitarbeiterin, Deutscher Bundestag; 2008/10 Volontariat bei der Berliner vorwärts Verlagsgesellschaft mbH, Berlin. Seit 2010 Freie Journalistin. Seit 1999 Mitgl. der SPD, 1999/04 stellv. Vors. der Jungsozialisten in Herne, seit 2000 Mitgl. Vorst. der SPD Herne, 2004/14 Mitgl. im Vorstand des SPD-Landesbezirks NRW, seit 2002 stellv. Vors. der SPD Herne, 2004/14 Mitgl. Landesvorst. der NRW SPD. 2004/13 Stadtverordnete im Rat der Stadt Herne. - MdB seit Okt. 2013.', 'Michelle', '11004359');
