Mitglied des Beirates für Bildung, Forschung und Technikfolgenabschätzung, ehrenamtlich', '1979/88 Augustinus-Gymnasium Weiden i. d. Oberpfalz, Abitur. Wehrdienst bei der Marine. 1989/95 Studium Volkswirtschaft in Regensburg, Dipl.-Volkswirt, 1990/93 paralleles Zweitstudium, Vordiplom Soziologie. Mitgl. der CSU und der Mittelstandsunion, 1995/99 stellv. Bezirksvors. JU Oberpfalz, seit 1997 CSU-Kreisvorstandsmitgl. Neustadt, 1999/03 Bezirksvors. der JU Oberpfalz, seit Juni 2003 Mitgl. CSU-Bezirksvorst. Oberpfalz. Seit dem 14. Lebensjahr ehrenamtl. Engagement bei einer Vielzahl von Vereinen und Verbänden. - MdB seit Okt. 2002; Nov. 2005/Dez. 2007 stellv. Vors. Ausschuss für Wirtschaft und Technologie, Nov. 2008/Okt. 2009 Vors. Gremium gem. § 10 a Finanzmarktstabilisierungsgesetz (Soffinkontrollgremium); seit Nov. 2009 Vors. der AG Bildung und Forschung der CDU/CSU-Fraktion.', 'Albert', '11003620');
Mitglied des Beirates für Sicherheit und Verteidigung, ehrenamtlich
Mitglied des Beirates für die grafische Gestaltung der
Mitglied des Beirates für sparkassenpolitische Grundsatzfragen
Mitglied des Beirates und des Modellprogramms "Engagement braucht Leadership" (bis 23.12.2013)
Mitglied des Beirates', '1977 Realschulabschluss. 1977/84 Ausbildung- und Fahrenszeit als Soldat auf Zeit bei der Marine. 1984 bis 2014 Berufssoldat. Verwendung im Führungsdienst, Truppenfachlehrer, stellv. Leiter und Dienststellenleiter der Marineortungsstellen Westermarkelsdorf und Staberhuk auf Fehmarn. Mitgl. CDA, KPV und Europa Union, Mitgl. im Beirat des Deutschen Feuerwehrverbandes. 1988 Eintritt in die CDU,1991/09 Vors. CDU-Ortsverband auf Fehmarn, 1991/03 stellv. Kreisvors., seit 2003 Kreisvors. der CDU Ostholstein, seit 2004 Beisitzer in Landesvorst. CDU Schleswig-Holstein. 1990/09 Stadtvertreter der Stadt Burg/Fehmarn. 1994/98 Stadtrat, 2003/08 Erster Stadtrat und stellv. Bürgermeister Stadt Fehmarn, 2005/13 Kreistagsabg. Ostholstein, 2008/09 1. stellv. Landrat des Kreises Ostholstein. Englisch (G). - MdB seit Okt. 2009; seit 2013 Obmann der CDU/CSU-Fraktion im Verteidigungsausschuss; Mitgl. der PV der NATO, stellv. Mitgl. der Ostseeparlamentarier-Konferenz.', 'Ingo', '11004036');
Mitglied des Beirates', '1987/96 Kepler-Gymnasium Tübingen, Abitur. 1996/01 Studium der Volkswirtschaftslehre Eberhard Karls Univ. in Tübingen, Abschluss Diplom-Volkswirt. 2006 Promotion. 2002/06 Wissenschaftl.  Referent; 2007/13 Lehrbeauftragter Hochschule Pforzheim. 2006/11 Projektleiter Institut für Angewandte Wirtschaftsforschung e.V. (IAW) in Tübingen, seit 2011 Leiter des Berliner Büros ISG Institut für Sozialforschung und Gesellschaftspolitik GmbH, Köln/Berlin. 1996/2000 stellv. Ortsvereinsvors. SPD Tübingen, 2000/03 Landesvors. Juso-Landesverband Baden-Württemberg, 2003/07 Kreisvors. SPD-Kreisverband Tübingen, 2001/05 und seit 2007 Mitgl. Landesvorst. SPD Baden-Württemberg,  seit 2007 dort Mitgl. Präsidium, seit 2010 Vors. der Antragskommission der SPD Baden-Württemberg. 2004/11 Mitgl. Gemeinderat Stadt Tübingen, 2004/07 stellv. Fraktionsvors. der SPD-Fraktion und 2007/11 Fraktionsvors. - MdB seit Okt. 2013.
Mitglied des Beirates', '1993 Abitur in Detmold/Lippe. Studium der Politologie, Jura und Medienwissenschaften in Marburg/Lahn, 2001 Diplom-Politikwissenschaftler. 2000/02 Mitarbeiter des hessischen Landtagsabgeordneten Ernst-Ludwig Wagner. 1990 Eintritt in die SPD, seit 2010 Unterbezirksvors. der SPD Marburg-Biedenkopf. Seit 2001 Mitgl. im Kreistag Marburg-Biedenkopf. Beiratsmitgl. Verband Wohneigentum, Mitgl. ver.di, AWO, ai, Gegen Vergessen - Für Demokratie e. V., der Schulstiftung der Ev. Kirche von Kurhessen-Waldeck und der Freiwilligen Feuerwehr Cappel, Mitgl. Politisch-Parlamentarischer Beirat des Instituts Privater Bauherren e. V., seit 2016 stellv. Mitgl. der Landessynode der Ev. Kirche Kurhessen-Waldeck, seit Sept. 2016 stellv. Vorstandsvors. Terra Tech Förderprojekte e. V. - MdB seit Okt. 2002; 2004/11 stellv. Sprecher und  bis 2013 Sprecher der Arbeitsgruppe Verkehr, Bau und Stadtentwicklung der SPD-Fraktion und Mitgl. im Fraktionsvorst., seit Dez. 2013 stellv. Vors. der SPD-Fraktion; Mitgl. Parlamentsgruppe Schienenverkehr; stellv. Mitgl. der Kommission des Ältestenrates für Bau- und Raumangelegenheiten.', 'Sören', '11003496');
Mitglied des Beirates', '1994/03 Gymnasium an der Schweizer Allee Dortmund. 2003/04 Zivildienst in der Diakonie Dortmund. 2004/09 Studium der Betriebswirtschaft Westfälische Wilhelms Univ. Münster, Abschluss als Diplom-Kaufmann. Seit 2008 Mitarbeiter der Gelsenwasser AG im Bereich Projektentwicklung. 2002 Eintritt in die Junge Union, 2005 Eintritt in die CDU, seit 2003 Mitgl. Kreisvorst. der Jungen Union Dortmund, seit 2005 Kreisvors. der Jungen Union Dortmund, seit 2007 stellv. Kreisvors. der CDU Dortmund, seit 2009 Kreisvors., seit Nov. 2012 stellv. Vors. der CDU Ruhr, seit 2017 Schatzmeister der CDU Nordrhein-Westfalen; seit Sept. 2015 Bezirksvors. der MIT-Ruhrgebiet. - MdB seit Okt. 2013.', 'Steffen', '11004320');
Mitglied des Beirates', '1999 Abitur in Göppingen. Zivildienst beim Sozialen Friedensdienst Göppingen. 2000/09 Studium der Politikwissenschaft und Soziologie an der Eberhard-Karls-Univ. Tübingen, Abschluss Magister Artium.2004/09 Mitarbeiter bei Winfried Hermann MdB, 2009 bis 2010 Mitarbeiter in der Verwaltung der Fakultät für Wirtschaftswissenschaften an der Eberhard-Karls-Univ. Tübingen. Mitgl. im Beirat von Pro RegioStadtbahn, NABU Baden-Württemberg, LTT Freunde!, VfB Stuttgart, Natur- und Vogelschutzverein Ergenzingen.Seit 1996 aktiv bei der Grünen Jugend (damals: Grün-Alternatives Jugendbündnis), seit 1998 Mitgl. Bündnis 90/Die Grünen, 2002/09 Mitgl. Kreisvorst. Bündnis 90/Die Grünen Tübingen, seit 2007 Mitgl. Landesvorst. Bündnis 90/Die Grünen Baden-Württemberg, 2009/13 Landesvors. Bündnis 90/Die Grünen Baden-Württemberg. 2009/11 Mitgl. im Bezirksbeirat Mitte der Stadt Tübingen. - MdB seit Okt. 2013.', 'Christian', '11004333');
Mitglied des Beirates', '2004/10 Studium der Volkswirtschaftslehre Univ. Köln. Referentin im Ministerbüro des NRW-Umweltministeriums. Seit 2000 Mitgl. von BÜNDNIS 90/DIE GRÜNEN, 2002/06 Sprecherin der Grünen Jugend NRW, 2009/14 Kreisvors. BÜNDNIS 90/DIE GRÜNEN Köln. - MdB seit Okt. 2013.', 'Katharina', '11004263');
Mitglied des Beirates', 'Abitur 1988. Studium der Volkswirtschaftslehre an der Albert-Ludwigs-Univ. Freiburg, Abschluss als Diplom-Volkswirtin 1996. 1996/97 medikur, Agentur für Gesundheits- und Kurtechnologie, Hamm. 1998/2000 Projektmanagement beim Sozialwissenschaftlichen Frauenforschungsinstitut der ev. Fachhochschule Freiburg. 2001/02 Mitarbeit in "Das Grüne Emissionshaus", Finanzdienstleister im Bereich Windenergie, Freiburg. 1991/93 Landesvorst. der Grün-Alternativen Jugend Baden-Württemberg, 1992/99 Kreisvorst. Bü90/Die Grünen Freiburg, 1999/01 Landesvorst. Bü90/Die Grünen Baden-Württemberg. 1999/02 Gemeinderätin in Freiburg. Mitgl. Beirat der Albert-Ludwigs-Univ. Freiburg, Mitgl. Kuratorium Aids-Hilfe Freiburg e. V., Mitgl. im Förderverein wohnungsloser Frauen OFF. Mitgl. Kuratorium UWC Robert Bosch College, Schirmherin der UNICEF Gruppe Freiburg, Mitgl. im Trinationalen Atomschutzverband TRAS. - MdB seit Okt. 2002; bis März 2012 Wirtschaftspol. Sprecherin und seit Feb. 2012 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Kerstin', '11003493');
Mitglied des Beirates', 'Abitur am GTO Osterburken. Studium der Anglistik, evang. Theologie und BWL an der J.M. Univ. Würzburg, Erasmusstipendiatin, Auslandsstudium an der University of Wales, Swansea, Auslandssemester an der State Univ. New York/SUCO; Studium an der FH Steuern und Finanzen, Ludwigsburg. Ausbildung beim Finanzamt Calw. Sachbearbeiterin bei den Finanzämtern Mosbach, Heidelberg und Walldürn; Beauftragte für Chancengleichheit und Co-Ansprechpartner für das AGG beim Finanzamt Mosbach. 2002/06 Elternbeiratsvors KiGa St. Josef und Gründungsmitgl. der Kulturkommode Osterburken, Mitgl. im Jugendhilfeausschuss des Neckar-Odenwald-Kreises, Mitgl. Schöffenwahlausschuss, Mitgl. Kulturausschuss Osterburken, Mitgl. Dt. Steuergewerkschaft, Mitgl. Beirat Trägerverein Das Internationale Jugendprogramm in Deutschland e. V. - "The Duke of Edinburgh''s Imternational Award Germany". Ehrenamtl. Mitgl. Stiftungsräte der Ev. Stiftung Pflege Schönau (ESPS) und der Ev. Pfarrpfründestiftung Baden (EPSB). 1994 Eintrit in die CDU und Junge Union Osterburken, seit 1994 Vorstandsmitgl. Frauen Union des NOK und CDU-Stadtverb. Osterburken, seit 1995 Mitgl. Bezirksvorst. der Frauen Union Nordbaden, seit 2000 Kreisvors. der Frauen Union NOK, seit 1999 Mitgl. Landesvorst. der Frauen Union Baden Württemberg, seit 2006 Mitgl. CDU-Bezirksvorst. Nordbaden, seit 2007 Mitgl. CDU-Landesfachausschuss Europa, seit 2008 Vors. CDU-Stadtverband Osterburken und Vors. Arbeitskreis Steuern und Finanzen der CDU Nordbaden. Mitgl. der Europa-Union. Englisch (f), Französisch (G), Russisch (G), Latinum. - MdB seit Okt. 2013; seit 2013 Mitgl. Stephanuskreis der CDU/CSU-Fraktion.', 'Margaret', '11004306');
Mitglied des Beirates', 'Berufsausbildung zum Erzieher. Studium der Sozialpädagogik an der Evangelischen Fachhochschule für Sozialwesen in Reutlingen, 1994 Abschluss. 2003 Transatlantic Fellow beim amerikanischen Think Tank "German Marshall Fund of the United States" in Washington und Brüssel. Mitgl. Pol. Beirat des Bundesverb. Mittelständische Wirtschaft (BVMW), Gründungsmitgl. des Europ. Council on Foreign Relations (ECFR), Mitgl. Beirat des Berliner Büros des American Jewish Committee (AJC), Mitgl. Kuratorium des Dt.-Türkischen Forums Stuttgart e. V. und im Kuratorium der Theodor-Heuss-Stiftung. Mitgl. der Partei DIE GRÜNEN bzw. BÜNDNIS 90/DIE GRÜNEN seit 1981, 1989/94 im Landesvorstand Baden-Württemberg, seit Nov. 2008 Bundesvorsitzender. Mitgl. Europäisches Parlament für Deutschland Juli 2004/Juli 2009, Januar 2006/Februar 2007 stellv. Vors. des nichtständigen Ausschusses zu CIA-Aktivitäten in Europa. - MdB Nov. 1994/Okt. 2002 und seit Okt. 2013.', 'Cem', '11002746');
Mitglied des Beirates', 'Schulbesuch in Bonn und Gehrden bei Hannover, 1968 Abitur. Grundwehrdienst. Studium Physik TU Darmstadt, 1976 Diplom in Physik, 1981 Promotion zum Dr. rer. nat. Wissenschaftl. Tätigkeit an der University of California, San Diego, USA; 1982 Technologieberater am VDI Technologiezentrum Berlin. 1984 Eintritt bei SCHOTT, Otto Schott Forschungszentrum in Mainz, 1990 kaufm. Leitung des Werkes Landshut von SCHOTT, Gründung und Aufbau von Produktionsstätten in Tschechien, Singapur und USA, 1996/06 CEO "SCHOTT Electronic Packaging", 2000 Senior Vice President NEC SCHOTT Components Corp, (Minakuchi, Japan). Seit Anfang 2007 selbstständiger Unternehmer, Gründung und Aufbau der MSG Lithoglas GmbH, Dresden. 2012 Gründung der "Bürgerenergie Isar e.G.". Mitgl. im Kuratorium der FH Landshut. Seit 2004 Mitgl. der Partei Bündnis 90/Die Grünen. 2008/11 Stadtrat der Stadt Landshut. - MdB seit Okt. 2009; seit 2009 Mittelstandsbeauftragter der Fraktion Bündnis 90/Die Grünen; seit 2010 Vorsitzender der ASEAN-Parlamentariergruppe.', 'Thomas', '11004037');
