Mitglied des Beirates, ehrenamtlich (bis Januar 2014)', '1983 Mittlere Reife. 1983/86 Banklehre. 1987 Fachhochschulreife (Zweiter Bildungsweg), 1987/92 Informatikstudium an der FH Rosenheim, 1992/96 Studium der Sprachwissenschaften, Russisch und Spanisch an der Univ. Salzburg. 1998 Promotion Dr. phil. 1986/87 Bankangestellte. 1996/99 Angestellte einer Salzburger Tourismusfirma, 1999/01 DAAD-Lektorin in Moskau, 2001/02 Sprachlehrerin Deutsch als Fremdsprache, Russisch. 2002/04 Dozentin an einer Zivildienstschule. Gewerkschaftsmitgl. seit 1986, z. Zt. GEW, IG Metall und IG BCE; Mitgl. der AWO. 1991 Eintritt in die SPD, stellv. Bezirksvors.  SPD Oberbayern, seit Juni 2015 Vors. SPD-Kreisverband Traunstein. Seit Mai 2014 Mitgl. Kreistag Traunstein. - MdB seit Sept. 2004; Mitgl. im Vorst. der SPD-Fraktion, stellv. Vors. der Landesgruppe Bayern der SPD-Fraktion. Seit März 2016 Beauftragte der BReg für Menschenrechtspolitik und Humanitäre Hilfe.
Mitglied des Beirates, ehrenamtlich (bis Mitte Januar 2014)
Mitglied des Beirates, ehrenamtlich', '1970 Abitur und Facharbeiterabschluss als Schlosser. 1970/74 Studium Technologie der Metallverarbeitung an der TH Magdeburg, Abschluss als Dipl.-Ingenieur. Tätigkeiten in der techn. Überwachung der Chemie- und Braunkohlenindustrie. Seit 1999 Fachreferent der DEKRA Automobil GmbH. Seit Okt. 1989 Mitgl. der CDU, 1990/10 Kreisvorstandsmitgl. der CDU Gräfenhainichen und Wittenberg, 1998/08 Vors. CDU-Kreisverb. Wittenberg. - MdB 1990/98 und seit Okt. 2002; Okt. 2002/Okt. 2005 stellv. Vors. Ausschuss für Umwelt, Naturschutz und Reaktorsicherheit; in der 17. WP Vors. der CDU-Landesgruppe Sachsen-Anhalt, in der 18. WP stellv. Vors. der CDU-Landesgruppe Sachsen-Anhalt.', 'Ulrich', '11001700');
Mitglied des Beirates, ehrenamtlich', '1972 Abitur in Hameln. 1972/77 Studium Maschinenbau in Hannover, Abschluss Dipl.-Ingenieurin, 1981 Promotion im Fach Maschinenbau in Hamburg zum Dr.-Ing.; 1981/83 Ingenieurin in der Konstruktion in Hamburg, 1983/06 Technische Aufsichtsbeamtin Berufsgenossenschaft Bahnen; seit 2004 Lehrbeauftragte der Hochschule für Technik und Wirtschaft Dresden; seit 2006 freiberufl. Tätigkeit als Autorin und Ingenieurin. Seit Juli 2012 Mitgl. Parlamentarischer Beirat des Bundesverbandes eMobilität e.V., 2013/16 Vors. Beirat Förderkreis Abgasnachbehandlungstechnologien für Dieselmotoren e. V. (FAD), Dresden, seit 2013 Mitgl. Beirat Stiftung Schifffahrtsstandort Deutschland, Hamburg, seit 2014 Vors. Beirat Verkehr der Gesellschaft für Studium strukturpolitischer Fragen e. V., seit 2014 Vors. Aufsichtsrat Stadtwerke Lübeck GmbH/Netz Lübeck. - MdB seit Okt. 2009.', 'Valerie', '11004190');
Mitglied des Beirates, ehrenamtlich', '1974 Abitur am Alten Gymnasium Bremen. Studium der Mathematik mit Nebenfach Physik in Erlangen und Tübingen, 1981 Diplom; Promotion zum Dr. rer. nat. im Fach Mathematik 1986. Zuletzt Referentin im Presse- und Informationsamt der Bundesregierung. Mitgl. u. a. ver.di, AWO, Bund für Soziale Verteidigung, Plattform Zivile Konfliktbearbeitung, Öko-Institut, taz Genossenschaft. Seit 1972 Mitgl. der SPD. - MdB seit Okt. 2013; seit März 2014 Obfrau im Unterausschuss Zivile Krisenprävention, Konfliktbearbeitung und vernetztes Handeln und Sprecherin der AG Zivile Krisenprävention, seit Mai 2014 stellv. Vors. Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung, Mitgl. der dt. Delegation der PV des Europarats.
Mitglied des Beirates, ehrenamtlich', '1977 Abitur. Kaufmännische Berufsschule, Kaufmannsgehilfenbrief IHK, 1977/79 Ausbildung zur Datenverarbeitungskauffrau bei LKS Datenservice AG in Saarbrücken. 1979/84 Programmiererin bei ASKO Deutsche Kaufhaus AG, 1985/90 bei den Saarbrücker Stadtwerken. 1998/2000 Staatssekretärin im Bundesministerium für Verkehr, Bau- und Wohnungswesen. Mitgl. der SPD seit 1983, 1997/07 stellv. Vors. der SPD Saarbrücken, 2003/07 stellv. Vors. der saarländischen SPD, Nov. 2005/Okt. 2007 stellv. Vors. der SPD, Mitgl. SPD-Parteivorst., bis 2011 Mitgl. im SPD-Präsidium; 1991/99 Vors. der ASF Saar, Mitgl. ASF-Bundesvorst. und seit 2004 Bundesvors. der ASF, seit Juni 2015 Mitgl. im Vorst. der SPE-Frauen. 1984/89 Mitgl. Bezirksrat Mitte der Landeshauptstadt Saarbrücken. Mitgl. ver.di, Pro Familia, AWO, Marie Schlei Verein e. V., Gegen Vergessen für Demokratie e. V., Eurosolar, VCD, Verein zur Förderung einer Städtepartnerschaft Saarbrücken-Diriamba, Verein Miteinander leben und lernen e. V., Verein für Frauenkultur und Frauenbildung e. V. und Verein gegen sexuelle Ausbeutung von Mädchen e. V. (Nele), Karnevalsges. Daarler Dabbesse. - MdB 1990/94, Nov. 1994/98 und seit Okt. 2002; 1994/98 verkehrspol. Sprecherin der SPD-Fraktion, 2005/13 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretärin bei der BMin für Familie, Senioren, Frauen und Jugend.
Mitglied des Beirates, ehrenamtlich', '1977/84 Studium der Soziologie, Politikwissenschaft und Pädagogik an der Westfälischen Wilhelms-Universität Münster, Magister der Soziologie. 20 Jahre in leitender Position in der Erwachsenenbildung, 2002/09 wissenschaftliche Referentin für Arbeit, Soziales und Gesundheit und dann für Arbeitsmarkt- und Kommunalpolitik in der Grünen Landtagsfraktion NRW. Mitgl. der Grünen, seit 1986 im Kreisverband in Münster. 1993/09 Mitgl. im Rat der Stadt Münster, 1995/09 Fraktionssprecherin. - MdB seit Okt. 2009; Sprecherin für Gesundheitspolitik der Fraktion Bündnis 90/Die Grünen.', 'Maria', '11004072');
Mitglied des Beirates, ehrenamtlich', '1980 Eintritt in den Polizeidienst. 1982 Fachprüfung für den mittleren Polizeivollzugsdienst, 1990 Fachprüfung für den gehobenen Polizeivollzugsdienst (Dipl.-Verwaltungswirt). 1999 Eintritt in die CDU. 2004/09 Mitglied in der Bezirksvertretung Dortmund Hombruch, 2011 Vors. der CDU im Stadtbezirk Dortmund Hombruch, 2014 Vors. der CDU Ortsunion Dortmund Kirchhörde. Seit 2009 Mitgl. im Rat der Stadt Dortmund, dort Mitgl. in den Ausschüssen Soziales und Wirtschaft sowie Mitgl. im Integrationsrat. Mitgl. der AWO, Gartenfreunde Kirchhörde, Siedlergemeinschaft, Schwimmverein SV Westfalen 1896, Beirat Stadtfeuerwehrverband Dortmund e.V., Mitgl. Verein Deutsche Sprache e.V. - MdB seit Jan. 2015; Mitgl. der Arbeitnehmergruppe und der AG Kommunalpolitik.
Mitglied des Beirates, ehrenamtlich', '1994 Abitur am Wirtschaftsgymnasium in Albstadt-Ebingen. 1994/95 Wehrdienst. 1995/98 Studium Betriebswirtschaftslehre an der Berufsakademie in Ravensburg. 1998/99 Praktika und Auslandserfahrung in Izmir (Türkei), bei Industrieunternehmen in Phoenix, USA, und einer Steuerberatungs- und Wirtschaftsprüfungskanzlei in Stuttgart. 1999/05 Leiter Controlling sowie Leiter des Bereichs EDV und Organisation bei einem mittelst.Textilunternehmen. 1990 Eintritt in die Junge Union und seit 1994 Mitgl. der CDU. 1997/03 Kreisvors. der JU Zollernalb, 2002/06 Landesvors. der JU Baden-Württemberg, 2007/12 Kreisvors. der CDU Zollernalb, seit Okt. 2011 Vors. CDU-Bezirksverb. Württemberg-Hohenzollern, seit 2002 Mitgl. im Landesvorst. der CDU Baden-Württemberg. 1999/08 Mitgl. im Gemeinderat Meßstetten, 2004/13 Mitgl. im Kreistag Zollernalb. Mitgl. Beirat der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, Mitgl. Verwaltungsrat der Johanniter-Schwesternschaft e.V. - MdB seit 2005; Energiebeauftragter der CDU/CSU-Fraktion.', 'Thomas', '11003734');
Mitglied des Beirates, ehrenamtlich', '1994 Magister-Abschluss, Hauptfach Anglistik, Nebenfächer Spanisch und Betriebswirtschaftslehre/Personalwirtschaft. Seit 1994 wiss. Mitarbeiterin der Körber-Stiftung (ruht). Seit 2004 Mitgl. der SPD, seit Dez. 2011 stellv. Vors. der SPD. 2001/08 MdHB, Fachsprecherin für Integration und Zuwanderung; 2004/08 Mitgl. Integrationsbeirat Hamburg. Stellv. Mitgl. Kuratorium Initiative "Ein Netz für Kinder", Mitgl. Kuratorium Avicenna-Studienwerk e. V. Osnabrück, Mitgl. Kuratorium Deutsches Youth for Understanding Komitee e. V. Hamburg, Kuratoriumsmitgl. der Dt.-Türkischen Gesellschaft e. V., stellv. Vors. Familienplanungszentrum Hamburg e. V., Mitgl. Beirat Hamburger Stiftung für Migranten, seit 2012 Mitgl. Kuratorium Internationaler Bund Verbund Nord, Mitgl. Marie-Schlei-Verein, seit März 2012 Mitgl. Kuratorium Stiftung "Bildung! Egitim!", Mitgl. Beirat Verband der Migrantenwirtschaft VMW. - MdB seit Okt. 2009; März 2010/Okt. 2013 Integrationsbeauftragte der SPD-Fraktion; seit Jan. 2014 Staatsministerin bei der Bundeskanzlerin, Beauftragte der BReg. für Migration, Flüchtlinge und Integration.
Mitglied des Beirates, ehrenamtlich', '1998 Abitur. 2005 Diplom Umweltwissenschaften, Univ. Lüneburg, 2012 Promotion zum Dr. phil., Titel der Dissertation: "Energieeffizienzpolitik als Beitrag zum Klimaschutz - Analyse der Umsetzung der EU-Gebäude-Richtlinie in Deutschland (Bereich Wohngebäude)". 2005/06 Kreisgeschäftsführerin Bündnis 90/Die Grünen im Kreisverband Lüneburg. 2006/13 Wissenschaftl. Angestellte am Umweltbundesamt, Jan./Okt. 2013 Leitung des Fachgebiets "Energieeffizienz". 1998 Eintritt in die Partei Bündnis 90/Die Grünen, 1999/01 Mitgl. Landesvorst. der Grünen Jugend Niedersachsen, 2003/05 Beisitzerin im Landesvorstand Bündnis 90/Die Grünen Niedersachsen, 2005/07 und seit Nov. 2013 Mitgl. im Parteirat Bündnis 90/Die Grünen Niedersachsen. 2002/06 Ratsfrau im Stadtrat Lüneburg, 2006/11 Abgeordnete im Kreistag Lüneburg. Mitgl. u. a. Bund für Umwelt und Naturschutz Deutschland (BUND), The Compensators, der Gewerkschaft verdi, Verein zur Förderung politischen Handelns (v.f.h.), im Verkehrsclub Deutschland (VCD). - MdB seit Okt. 2013; Sprecherin für Energiepolitik der Fraktion Bündnis 90/Die Grünen, Vorstandsmitgl. Parlamentskreis Energieeffizienz des Bundestages.', 'Julia', '11004429');
Mitglied des Beirates, ehrenamtlich', 'Abitur 1969. Studium der Volkswirtschaftslehre in München und Regensburg, Diplomprüfung 1975. 1975/87 Mitarbeiterin bei der Bundesanstalt für Arbeit, zuletzt Leiterin der Abteilung Berufsberatung im Arbeitsamt Deggendorf. Seit 1969 Mitgl. der CSU; in versch. Vorstandsgremien der Frauen-Union und der CSU tätig, 1978/89 Kreisrätin im Kreis Regen, 1995/05 Kreisvors. der CSU Fürstenfeldbruck, 1996/04 Kreisrätin im Kreis Fürstenfeldbruck. - MdB seit März 1987; April 1989/Jan. 1991 BMin. für Raumordnung, Bauwesen und Städtebau, Jan. 1991/Mai 1992 BMin. für Gesundheit. 1995/02 Vors. AG Finanzen der CDU/CSU-Fraktion, 2002/05 stellv. Vors. der CDU/CSU-Fraktion, 2005/11 Vizepräsidentin des Deutschen Bundestages, seit März 2011 Vors. der CSU-Landesgruppe und 1. stellv. Vors. der CDU/CSU-Fraktion.', 'Gerda', '11000825');
Mitglied des Beirates, ehrenamtlich', 'Abitur 1975. Studium an der Univ. Bayreuth für das Lehramt an Volksschulen, 1. Staatsexamen 1978, 2. Staatsexamen 1981. Lehrerin an Volksschulen; 1990/94 Dozentin an der Univ. Bayreuth als wissenschaftl. Mitarbeiterin, Schwerpunkt Grundschulpädagogik/Grundschuldidaktik am gleichnamigen Lehrstuhl. Bis 1994 Frauenbeauftragte der kulturwissenschaftl. Fakultät der Univ. Bayreuth. Mitgl. der SPD seit 1990, 1992/05 Vors. Unterbezirk Hof/Saale. Mitgl. der IG BCE, Mitgl. AWO, des BRK (Bayrisches Rotes Kreuz), Mitgl. im BLLV (Bayerischer Lehrer- und Lehrerinnenverband e. V.) und in weiteren Vereinen und Organisationen. Trägerin des Bundesverdienstkreuzes am Bande, des Bayerischen Verdienstordens und des deutsch-tschechischen Kunstpreises. - MdB seit 1994; seit Nov. 2004 Parl. Geschäftsführerin der SPD-Fraktion; Mitgl. des Ältestenrates.
Mitglied des Beirates, ehrenamtlich', 'Abitur. 2006 Jura Studium in Hannover, 2010 Studium als Diplom-Jurist abgeschlossen, 2011/13 Referendariat, 2013 2. jur. Examen. Rechtsanwalt. Mitgl. der SPD seit 2002. Ratsherr der Gemeinde Wiefelstede, Ammerländer Kreistagsabgeordneter, Mitgl. der Verbandsversammlung der EWE. Mitgl. der Arbeiterwohlfahrt und des Gesamtvorstandes der AWO Weser-Ems, Mitgl. ver.di, SoVD, Verein Daheim statt Heim. - MdB seit Okt. 2013.', 'Dennis', '11004388');
Mitglied des Beirates, ehrenamtlich', 'Abitur. Studium der Politikwissenschaften und öffentliches Recht in Trier. Mitarbeiterin eines Landtagsabgeordneten. Auslandsaufenthalte in USA und England. Seit 1998 Mitgl. BÜNDNIS 90/DIE GRÜNEN, 10 Jahre Sprecherin des Grünen Kreisverbandes in Trier. Mitgl. des Trierer Stadtrates. Mitglied Multikulturelles Zentrum Trier e. V., Trierer Arbeitskreis für Montessori-Pädagogik e. V. - MdB seit Okt. 2013.', 'Corinna', '11004390');
Mitglied des Beirates, ehrenamtlich', 'Erweiterter Sekundarabschluss I. 1978 Ausbildung zum Chemielaboranten. 1982/83 Wehrdienst beim Sanitätsbataillon 1. Nach der Ausbildung Angestellter auf dem Kalibergwerk Siegfried-Giesen. Weiterbildung zum Betriebsstatistiker, 1992/93 Studium an der Sozialakademie in Dortmund. Ab 1993 hauptamtlicher Gewerkschaftssekretär bei der IG Bergbau und Energie (IG BE) in Recklinghausen und Bochum, 1997/05 Industriegruppensekretär für Bergbau- und Energiepolitik bei der IG Bergbau, Chemie, Energie (IG BCE), 2005/13 Vorstandssekretär in der IG BCE Hauptverwaltung Hannover, zuständig für Sozialpolitik, Mitbestimmung, Betriebsverfassung, Migration/Integration. Seit 1984 Mitgl. der SPD, Vors. der SPD in der Gemeinde Giesen, stellv. Vors. SPD-Unterbezirk Hildesheim. Mitglied des Gemeinderates. Mitgl. IG BCE, AWO, Verein "Mach meinen Kumpel nicht an", Präs. Deutsch-Französische Partnerschaft Chabanais-Giesen e. V. - MdB seit Okt. 2013; seit Okt. 2015 wirtschafts- und energiepolitischer Sprecher der SPD-Fraktion.', 'Bernd', '11004442');
