Mitglied des Bezirksrates', 'Seit 1991 Gewerkschaftssekretär in verschiedenen Leitungsfunktionen in Baden-Württemberg; 2009/14 DGB-Vors. Region Nordbaden. 1988 Eintritt in die SPD, 2006/09 Mitgl. SPD-Landesvorst. Baden-Württemberg, 2007/09 SPD-Führungsakademie, Vors. SPD Mannheim-Rheinau. Mitgl. IG Metall, Kath.-Arbeitnehmer-Bewegung, Freundeskreis Willy-Brandt-Zentrum Jerusalem, AWO, Naturfreunde, VVN/BdA, SC Rot-Weiß Rheinau, Bürgerverein Mannheim-Gartenstadt, Kuratorium IB Mannheim, BASF-Siedlergemeinschaft Mannheim-Rheinau-Süd, Vors. Förderverein Herschelbad Mannheim e. V., Kulturverein Mannheim-Waldhof e. V., Heimatverein Rheinau-Pfingstberg e. V. Seit 2004 AOK Bezirksrat Rhein-Neckar-Odenwald, seit 2011 Verwaltungsrat AOK Baden-Württemberg. - MdB seit Mai 2011.
Mitglied des Board of Trustees, ehrenamtlich', '1983/87 Studium Fahrzeugtechnik, Fachrichtung Luftfahrzeuge an der FH München, Abschluss Dipl.-Ing.; 1987/95 jur. Studium mit zweitem Staatsexamen an der Ludwig-Maximilians-Univ. München, 1998 Zulassung als Rechtsanwalt. Bis 1999 Mitarbeiter, zuletzt als Abteilungsleiter, eines intern. Unternehmens in der Informations- und Telekommunikationsbranche. Mitgl. CSU Orts- und Bezirkvorst.; seit 2002 Bezirksvors. Mittelstandsunion Oberbayern, Mitgl. im MU-Landesvorstand; 2005/11 Schatzmeister der CSU, Mitgl. des CSU-Parteivorstandes, seit 2014 Vors. des Versorgungswerks und Mitgl. des CSU-Parteivorstandes, seit 2014 Vors. der CSU-BWK-Konferenz für den Wahlkreis 224 (Starnberg), seit 2014 Kreisvors. der CSU Miesbach, seit 2002 Mitgl. Präsidium und seit 2015 Vors. des Forums Berlin des Wirtschaftsbeirats der Union e. V., seit 2014 Vors. Bundeswahlkreiskonferenz für den WK 224 (Starnberg). Seit 2002 Kreisrat in Miesbach. 1999/08 MdEP, 2004/08 wirtschaftspolitischer Sprecher EVP-ED-Fraktion, 2002/08 Vors. Parl. Arbeitskreis Mittelstand der EVP-ED-Fraktion;  MdL Bayern 2008/13. Seit 2013 Bundesleiter Wasserwacht (ehrenamtl.), seit 2013 Vors. Stiftungsrat der Pfarrer Walter-Waldschütz-Stiftung, Holzkirchen (ehrenamtl.), seit 2004 Geschäftsführender Vorstand der Studiengesellschaft für Mittelstandsfragen e. V. (ehrenamtl.), seit 2014 kooptiertes Mitgl. im Vorst. der Deutsch-Arabischen Freundschaftsgesellschaft e. V. (DAFG) (ehrenamtl.), seit 2016 Mitgl. im Board of Trustees bei der Initiative Young Egyptian Economic Leaders (YEEL) (ehrenamtl.), seit 2016 koopt. Mitgl. Freundeskreis Krankenhaus Agatharied e. V., seit 2016 Einzelpersönlichkeit in der Versamml. des Diözesanrates der Katholiken der Erzdiözese München und Freising. - MdB seit Okt. 2013.', 'Alexander', '11004383');
