Mitglied des Datenschutzbeirates (bis 31.12.2013)', '1981/91 Freiherr-vom-Stein-Schule Frankfurt. 1991/92 Zivildienst Bahnhofsmission Hauptbahnhof Frankfurt. 1993/98 Jura-Studium in Heidelberg, 1998 1. Staatsexamen, Dissertation im Evangelischen Kirchenrecht, 2001/04 Referendariat und 2. Staatsexamen. Seit 2004 Rechtsanwalt in Mölln. Mitgl. Transparency International (TI) Deutschlands. Seit 1995 Mitgl. bei Bündnis 90/Die Grünen, 2002/11 Sprecher der LAG Demokratie und Recht von Bündnis 90/Die Grünen in Schleswig-Holstein, seit 2005 Mitgl. Parteirat Schleswig-Holstein, 2007/Anfang 2011 Sprecher Kreisverb. Lauenburg von Bündnis 90/Die Grünen. Seit 2004 Mitgl. für Bündnis 90/Die Grünen in der Möllner Stadtvertretung, seit Juni 2013 3. stellv. Bürgermeister der Stadt Mölln. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Vors. der Fraktion Bündnis 90/Die Grünen, Obmann für Bündnis 90/Die Grünen im 1. Untersuchungsausschuss/NSA, Obmann im Ausschuss Digitale Agenda.', 'Konstantin', '11004123');
Mitglied des Deutschen Lenkungsausschusses
Mitglied des Ehrenhofes, ehrenamtlich', 'Grund- und Hauptschule, Mittlere Reife 1974. Ausbildung und Berufstätigkeit als Chemielaborant 1975/87. 1987/98 Wahlkreismitarbeiter. Seit 1975 Mitgl. der SPD, Gründungsmitgl. Ortsverein Zellertal, seit 1991 Vors. Unterbezirk der SPD Donnersberg. Gemeinderat Zellertal seit 1984, 1999/04 ehrenamtlicher Bürgermeister. 1984/89 und seit 2009 Mitgl. Kreistag Donnersbergkreis. Mitgl. einer DGB-Gewerkschaft seit 1976. Mitgl. und Mitarbeit in versch. regionalen kulturellen Einrichtungen. - MdB seit 1998; Sprecher der Landesgruppe Rheinland-Pfalz der SPD-Fraktion; Mitgl. parlamentarisches Weinforum, Sprecher in der Parlamentsgruppe Binnenschifffahrt.
Mitglied des Ehrensenats', '1973 Abitur in Templin. Physikstudium Univ. Leipzig 1973/78. Wissenschaftl. Mitarbeiterin am Zentralinstitut für Physikalische Chemie der Akademie der Wissenschaften 1978/90; Promotion 1986. Stellv. Regierungssprecherin der Regierung de Maizière 1990; Referentin im BPA 1990. 1989 Mitgl. des "Demokratischen Aufbruchs". Seit Okt. 1990 Mitgl. der CDU, Dez. 1991/Nov. 1998 stellv. Vors. der CDU Deutschlands, Juni 1993/April 2000 Vors. der CDU Mecklenburg-Vorpommern. Ab Nov. 1998 Generalsekretärin, seit 10. April 2000 Vorsitzende der CDU Deutschlands. - MdB seit 1990; Jan. 1991/Nov. 1994 BMin. für Frauen und Jugend, Nov. 1994/Okt. 1998 BMin. für Umwelt, Naturschutz und Reaktorsicherheit. Sept. 2002/Nov. 2005 Vors. der CDU/CSU-Fraktion; seit 22. Nov. 2005 Bundeskanzlerin der Bundesrepublik Deutschland, 28. Okt. 2009 und 17. Dez. 2013 Wiederwahl zur Bundeskanzlerin.', 'Angela', '11001478');
