Mitglied des Fernsehrates (bis 04.03.2014)', 'Abitur am Gymnasium Weilheim. Studium an der Ludwig-Maximilians-Univ. München, Diplom-Soziologe. 1996/01 Kaufm. Leiter im Maschinenbau, 2001/05 Geschäftsführer im Maschinenbau. 1986 Eintritt in die JU, 1990/97 JU-Kreisvors.; seit 1990 Mitgl. der CSU, 1999/11 Ortsvors. der CSU, seit 2009 Kreisvors. der CSU Weilheim-Schongau. Seit 1996 Kreisrat in Weilheim/Schongau, 1996/11 Marktgemeinderat in Peißenberg. Febr. 2009/Dez. 2013 Generalsekretär der CSU. - MdB seit Okt. 2002; in der 15. WP stellv. Vors. des Ausschusses für Wirtschaft und Arbeit; in der 16. WP wirtschaftspol. Sprecher der CSU-Landesgruppe und bildungs- und forschungspol. Sprecher der CDU/CSU-Fraktion; seit Dez. 2013 Bundesminister für Verkehr und digitale Infrastruktur.', 'Alexander', '11003516');
Mitglied des Fernsehrates (bis 31.12.2013)
Mitglied des Fernsehrates', 'Gymnasium Rodenkirchen in Köln, 1987 Abitur. Anschließend Studium der Rechtswissenschaften  Philipps-Univ. Marburg, 1990 Austauschstudium  an der Université Paris XI; 1993 Erste Juristische Staatsprüfung; 1993/95 wissenschaftl. Hilfskraft an der Westfälischen Wilhelms-Universität Münster; 1995 Referendardienst in Trier; 1998 Promotion. Rechtsanwältin in einer Hamburger Großkanzlei. 1999 Wissenschaftlicher Dienst des Landtags Rheinland-Pfalz. 2001 Wissenschaftliche Mitarbeiterin am Bundesverfassungsgericht. Elternzeit. 2003 deutsche Vertreterin im Haus der Großregion, Luxemburg, 2005 Richterin am Landgericht Trier und am Amtsgericht Wittlich; seit 2008 Referentin im Ministerium der Justiz und für Verbraucherschutz in Mainz. Seit 1994 Mitgl. der SPD, seit 2005 Mitgl. Kreisvorst. Trier-Saarburg, 2010/16 Kreisvors. der SPD, Dez. 2015/Juni 2017 Generalsekretärin der SPD. - MdB seit Okt. 2013; 2013/16 Justiziarin der SPD-Fraktion; 2014/16 Mitgl. Ältestenrat. Seit Juni 2017 Bundesministerin für Familie, Senioren, Frauen und Jugend.
