Mitglied des Gemeinderates und des Kreistages', '1986/90 Grundschule in Velden, 1990/99 Maximilian-von-Montgelas Gymnasium in Vilsbiburg, 1999 Abitur. 1999/2000 Grundwehrdienst bei der Luftwaffe in Germersheim und Freising. 2000/05 Studium der Diplom-Volkswirtschaftslehre Univ. Regensburg, Schwerpunkte Ökonomie des öffentlichen Sektors/Finanzierung/Statistik, 2003/04 Auslandsstudium an der Handelshochschule in Göteborg/Schweden mit den Schwerpunkten Ökonometrie/Umweltökonomie, 2005 Abschluss Dipl.-Volkswirt (Univ.). 2005 Diplomarbeit im Forschungs- und Innovationszentrum der BMW AG München & BMW Financial Services GmbH. Seit 2005: Risikomanagement beim internationalen Baumaschinenhersteller CATERPILLAR. 1997/11 Ortsvors. der Jungen Union Velden, 2005/12 Kreisvors. der Jungen Union im Landkreis Landshut, 2005/12 stellv. Kreisvors. der CSU im Landkreis Landshut, 2011/15 Ortsvors. der CSU Velden, 2011/13 Bezirksvors. der Jungen Union Niederbayern, seit 2012 Kreisvors. der CSU im Landkreis Landshut. Seit 2008 Marktrat, seit 2008 Kreisrat, Mitgl. Kreisausschuss. Mitgl. u. a. zahlreicher Sportverbände, Feuerwehr, Technisches Hilfswerk (THW), Kreiskrieger- und Soldatenkameradschaft, Mitgl. Kuratorium Hochschule Landshut. Englisch (f), Französisch (G), Schwedisch (G). - MdB seit Okt. 2013.', 'Florian', '11004366');
Mitglied des Gemeinderates', '1969/79 POS in Weißkeißel und Sagar. 1979/82 Ausbildung zum Funkmechaniker. 1982/86, 1988/90 beschäftigt bei der PGH Elektro-Rundfunk-Fernsehen Weißwasser, 1986/88 Wehrdienst. Seit 1989 Mitgl. der SPD, 1998/09 Mitgl. SPD-Landesvorst. Sachsen, 2004/09 SPD-Landesvors. 2004/09 Staatsminister für Wirtschaft und Arbeit und stellvertretender Ministerpräsident des Freistaats Sachsen. MdL Sachsen Okt. 1990/Okt. 2013, Nov. 2009/Okt. 2013 Vors. Ausschuss für Umwelt und Landwirtschaft. - MdB seit Okt. 2013.
Mitglied des Gemeinderates', 'Polytechnische Oberschule und anschl. Berufsausbildung mit Abitur zum Landmaschinenschlosser. 1988/90 Offiziershochschule der Grenztruppen der DDR in Suhl, 1992 Beginn der Ausbildung zum mittleren Polizeivollzugsdienst, Dez. 1996/Dez. 1998 Studium an der Verwaltungsfachhochschule FB Polizei in Meiningen, Abschluss Diplomverwaltungswirt (FH). 1990/91 Projekttätigkeit im Bereich Jugendsozialarbeit in Suhl (Arbeitsbeschaffungsmaßnahme-ABM), 1991/92 Tätigkeit als Berufskraftfahrer und Schlosser, Okt. 1993/Dez. 1996 Polizeivollzugsdienst in Saalfeld, seit 1999 Kriminalbeamter im gehobenen Dienst,u. a. drei Jahre im Bereich Wirtschaftskriminalität/ Korruption. 1995/02 aktive Mitarbeit in der GdP, darunter zwei Jahre Landesvors. der Jungen Gruppe der GdP. 1990 Kandidatur bei der Landtagswahl Thüringen auf der Linken Liste/PDS für die FDJ, seit 2002 wieder Mitgl. der PDS, Mitgl. Kreisverb. Altenburger Land, seit 2014 Mitgl. im Parteivorst. DIE LINKE. Seit 2004 Mitgl. Kreistag Altenburger Land, Mitgl. Werksausschuss, bis 2014 Fraktionsvors. DIE LINKE im Kreistag. - MdB seit Sept. 2009; seit 2014 stellv. Vors. Innenausschuss, seit Nov. 2015 Leiter AK V "Demokratie, Recht und Gesellschaftsentwicklung" und stellv. Vors. der Fraktion DIE LINKE.', 'Frank', '11003899');
