Mitglied des Gemeinderates, jährlich, Stufe 3', '1948/52 Volksschule in Sulzdorf a. L., 1952/61 Gymnasium in Bad Königshofen, 1961 Abitur. 1961/65 Studium an der Universität Saarbrücken, Anglistik, Romanistik, Phonetik und Pädagogik; 1965/68 Forschungsstipendiat am Max-Planck-Institut für Bildungsforschung in Berlin, 1969 Promotion zum Dr. phil.; 1969/76 Lehrbeauftragter, Wissenschaftlicher Assistent, Akademischer Rat sowie Akademischer Oberrat an verschiedenen Hochschulen in Heidelberg, Mainz, Worms und Mannheim, 1976/07 Professor an der Universität der Bundeswehr München. 1975/2016 Vors. der Gemeinnützigen Bürgervereinigung Mannheim-Sandhofen, seit 1998 Mitgl. des Sudetendeutschen Rates, 1979/96 Präsident der Deutsch-Japanischen Gesellschaft Rhein-Neckar, 2004/08 Vizepräs. der Deutsch-Arabischen Gesellschaft. Seit 1972 Mitgl. der CDU, 1995/02 Kreisvors. der CDU Mannheim. 1980/84 Bezirksbeirat in Mannheim, seit 1984 mit Unterbrechungen Stadtrat in Mannheim. Englisch (f), Schwedisch (f), Französisch (G), Italienisch (G), Spanisch (G). - MdB 1990/98, 2002/05 und seit Okt. 2009.', 'Egon', '11001036');
