Mitglied des Hauptausschusses, ehrenamtlich', '1976/85 Kardinal-Frings-Gymnasium Bonn. 1985/87 Zivildienst beim Caritasverband Bonn. 1987/93 Studium der Politikwissenschaft an der FU Berlin. 1994/97 wissenschaftl. Mitarbeiter am Fachbereich Soziologie der Heinrich-Heine-Univ. Düsseldorf. 1997/98 Arbeitslosigkeit, Politikberatung. 1998/2000 wissenschaftl. Mitarbeiter beim Initiativkreis Emscherregion, polit. Schwerpunkte Regionalentwicklung im Ruhrgebiet, Arbeitsmarkt- und Sozialpolitik, Wohnungspolitik. 2000/02 Bildungsmanager bei der Heinrich-Böll-Stiftung NRW. 2000/03 Kreisvors. Bündnis 90/Die Grünen in Dortmund, Landes-, Bundes- und Bezirksdelegierter, Mitgl. in der NRW-Landes- und Bundesarbeitsgemeinschaft Sozialpolitik. Mitgl. der Heinrich-Böll-Stiftung NRW, Mitgl. im Beirat der BAG Integrationsfirmen, Mitgl. Hauptausschuss Deutscher Verein für öffentliche und private Fürsorge. - MdB seit Okt. 2002;  Sprecher für Rentenpolitik der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Markus', '11003578');
Mitglied des Hauptausschusses, von Amts wegen
Mitglied des Herausgeber-Beirates, ehrenamtlich
Mitglied des Herausgeberbeirates, ehrenamtlich', '1976 Abitur. Studium an der PH Ruhr-Dortmund, Lehramt Sekundarstufe I Deutsch und Geschichte, Dez. 1983 2. Staatsexamen. 1984/95 Lehrerin an der Polizeischule Selm/Bork, seit 1995 Lehrerin an der Erich-Fried-Gesamtschule Herne. 1990 Mitgl. der CDU, 1999/07 Kreisvors. CDU Herne, 2001/11 stellv. Landesvors. und seit 2011 Landesvors. der Frauen-Union NRW, bis Dez. 2012 Mitgl. CDU-Bundesvorstand. 1994/98 Mitgl. Rat der Stadt Herne. - MdB seit 1998; 2009/13 stellv. Vors. der CDU/CSU-Fraktion; seit Dez. 2013 Parl. Staatssekretärin beim Bundesminister für Gesundheit, seit Juni 2017 Beauftragte der Bundesregierung für die Belange der Patientinnen und Patienten sowie Bevollmächtigte für Pflege.', 'Ingrid', '11003117');
