Mitglied des Kreistages und des Kreisausschusses', '1984 Abitur am St. Ursula Gymnasium in Brühl. 1984/90 Studium der Haushalts- und Ernährungswissenschaften an der Friedrich-Wilhelm-Univ. Bonn, Abschl. Diplom-Oecotrophologin. 1990/09 leitende Tätigkeit im Familienunternehmen, seit 2011 Geschäftsführerin der Grotelüschen Immobilien GmbH. 2010 Niedersächsische Landwirtschaftsministerin. Seit 2000 Mitgl. der CDU, seit 2002 stellv. Kreisvors. der CDU Oldenburg-Land, seit 2010 Mitgl. Landesvorst. und seit 2014 Mitgl. Präsidium der CDU Niedersachsen; seit 2012 Kreisvors. der CDU Mittelstands- und Wirtschaftsvereinigung (MIT) Oldenburg-Land. Seit 2001 Mitgl. Gemeinderat Großenkneten, seit 2006 Mitgl. Kreistag des Landkreises Oldenburg. Seit 2011 Mitgl. Aufsichtsrat der Wirtschaftsförderungsgesellschaft des Landkreises Oldenburg. Englisch (f). - MdB 2009/April 2010 und seit Okt. 2013.', 'Astrid', '11004046');
Mitglied des Kreistages', '1987 Abitur, Jugenddorf-Christophorusschule in Braunschweig. 1987/94 Studium Rechtswissenschaften Univ.Regensburg, Göttingen und Bonn, 1994 1. jur. Staatsexamen, Justizprüfamt beim Oberlandesgericht Köln; 1997 2. jur. Staatsexamen, Landesjustizprüfamt in Nordrhein-Westfalen. Rechtsanwältin hauptsächlich im Bereich Familienrecht. Bis 2012 Beisitzerin im Stadtsportverband der Stadt Sankt Augustin, seit 2011 ehrenamtlich in einem Frauenhilfeverein tätig. Mitgl. der SPD, Feb. 2005/März 2006 stellv. Ortsvereinsvors. und 2006/10 Ortsvereinsvors. der SPD Sankt Augustin, seit Okt. 2011 Kreisvors. der AsF im Rhein-Sieg-Kreis, 2008/10 Mitgl. im Kreisvorstand der SPD Rhein-Sieg, dort seit Okt. 2011 beratendes Mitgl. 2009/14 im Rat der Stadt Sankt Augustin, seit 2009 Kreistagsabgeordnete im Rhein-Sieg-Kreis. - MdB seit Okt. 2016.
Mitglied des Kreistages', '1990/97 Beschäftigung als Werkzeugmacher bei der Opel AG. Seit 1998 2. Bevollmächtigter und Geschäftsführer der IG Metall. Ehrenamtlicher Arbeitsrichter. 1998/04 Mitgl. der SPD; seit 2004 Gründungsmitgl. der Wahlalternative Arbeit und Soziale Gerechtigkeit (WASG), 2007/10 und Nov. 2012 bis Nov. 2016 Landesvors. der Partei DIE LINKE. Rheinland-Pfalz. Mitgl. Kreistag Landkreis Kaiserslautern, Verbandsgemeinderat Weilerbach sowie Mitgl. Verwaltungsrat der Kreissparkasse Kaiserslautern. - MdB seit Okt. 2005; seit der 17. WP Parl. Geschäftsführer der Fraktion DIE LINKE. und Obmann im Ausschuss für die Angelegenheiten der Europäischen Union; stellv. Vors. der Dt.-Kanadischen und der Dt.-Brasilianischen Parlamentariergruppe.', 'Alexander', '11003858');
Mitglied des Kreistages', 'Abitur 1985 in Winsen. 1985/88 Studium der Finanzwissenschaften in der niedersächsischen Finanzverwaltung, 1988 Dipl.-Finanzwirt. Seit 1991 Finanzverwaltung des Landes Sachsen-Anhalt. Mitgl. der CDU seit 2005, 2007/11 Mitgl. Vorst. der CDU Havelland, seit 2011 stellv. Vors. der CDU Havelland und seit Juni 2015 Landesvors. der MIT Brandenburg. Mitgl. der Gemeindevertretung Havelaue 2008/12, Mitgl. Kreistag Havelland seit 2008. - MdB seit Okt. 2013.', 'Uwe', '11004271');
Mitglied des Kreistages', 'Berufsausbildung (Schriftsetzer) mit Abitur. 1984/89 Studium als Lehrer für Deutsch/Geschichte Humboldt-Univ. Berlin, anschl. Forschungsstudium Politikwissenschaft, 1994 Promotion zum Dr. rer. soc. 1991/94 Wissenschaftlicher Mitarbeiter der Fraktion LL/PDS im Sächsischen Landtag. Mitgl. der SED 1985/89 und der PDS (jetzt DIE LINKE) seit 1990, 1990 Mitgl. des Zentralen Runden Tisches der DDR (AG Bildung, Erziehung, Jugend), 1991 Mitgl. Bundesvorst., 1991/95 Mitgl. Landesvorst. Sachsen, 1992/99 Mitgl. Bundesparteirat der PDS. 1994 /08 Fraktionsvors. der PDS im Kreistag Sächsische Schweiz, seit 2008 Mitgl. im Kreistag Sächsische Schweiz-Osterzgebirge, 1999/02 Stadtrat in Heidenau. Mitgl. der GEW. MdL Sachsen Dez. 1994/Okt. 2013, 1995/Juli 2007 Parl. Geschäftsführer, August 2007/Juli 2012 Vors. der Fraktion DIE LINKE. - MdB seit Okt. 2013; Parl. Geschäftsführer, stellv. Vors. Parl. Kontrollgremium, sportpolitischer Sprecher der Fraktion DIE LINKE.', 'André', '11004288');
Mitglied des Kreistages', 'Grundschule Kirchberg, Hauptschule Gutenzell, Erolzheim und Kirchberg. 1975/78 Ausbildung zum Landwirt. 1978/80 Fachschule für Landwirtschaft Biberach. 1980/81 Grundwehrdienst in Großengstingen und Laupheim. 1983 Bauernschule Bad Waldsee. Realschulabschluss Abendrealschule in Biberach. 1984 Meisterprüfung. 1985 Landjugendakademie Bonn. Lange Jahre im Vorst. des Grünen Kreises der Landjugend in Biberach, Jugendvertreter im Bauernverb. Biberach, 1994/10 stellv. Vors. Bauernverband Biberach bzw. Biberach-Sigmaringen. 1978/95 Mitglied der JU, seit 1985 Mitgl. der CDU; 1978/92 Ortsvors. JU Illertal, 1992/94 Kreisvors. JU Biberach, 1994/95 stellv. Bezirksvors. JU Württemberg-Hohenzollern; seit 1996 Vors. CDU-Gemeindeverb. Kirchberg, seit 1999 Kreisvors. CDU Landkreis Biberach, seit 2007 Mitgl. CDU-Landesvorst. 1989/99 und seit 2001 Mitgl. Gemeinderat Kirchberg, 1994/99 1. stellv. Bürgermeister von Kirchberg, seit 2002 Mitgl. Kreistag. - MdB seit Okt. 2009.', 'Josef', '11004136');
Mitglied des Kreistages', 'Sachbearbeiterin beim Senator für Finanzen bei der Freien Hansestadt Bremen, stellv. Referatsleiterin an der Universität Bremen, stellv. Ortsamtsleiterin im Ortsamt Vegesack bei der Freien Hansestadt Bremen. Mitgl. ver.di, in der AWO und im SoVD. Aktive Kommunalpolitikerin seit 2006 im Gemeinderat der Gemeinde Schwanewede, seit Nov. 2016 Mitgl. des Kreistages Osterholz. Seit 2012 Vors. der SPD im Landkreis Osterholz, Finanzverantwortliche Bezirk Nord-Niedersachsen. - MdB seit Okt. 2013; Tierschutzbeauftragte der SPD-Fraktion.
Mitglied des Kreistages', 'Schulbesuch in Cottbus, Abitur in Dresden. Wehrdienst im Erzgebirge und in Stahnsdorf. 1983 Studium Pädagogische Hochschule "Karl Liebknecht" in Potsdam, 1988 Abschluss als Diplomlehrer für Musik und Deutsch; anschl. Forschungsstudium in Musikwissenschaften. Lehramtsstudium für das Fach Politische Bildung; Referendariat in Königs Wusterhausen. Bis 2005 Lehrer an der Immanuel-Kant-Gesamtschule in Falkensee. Anschließend Büroleiter MdB Dr. Kirsten Tackmann, 2009 Mitarbeiter bei MdB Sabine Stüber. Seit 2010 Referent im Ministerium für Wirtschaft und Europaangelegenheiten des Landes Brandenburg. 1990/99 MdL Brandenburg. 1999/2005 stellv. Landesvors. der PDS Brandenburg, 2005/09 Mitgl. Landesvorst. DIE LINKE in Brandenburg, Stadtvors. der LINKEN in Falkensee. Seit 2003 Mitgl. Kreistag Havelland. Mitgl. Kuratorium der Bundesstiftung Magnus Hirschfeld. - MdB seit Okt. 2013.', 'Harald', '11004374');
