Mitglied des Kreistages, ehrenamtlich', 'Grundwehrdienst in Dornstadt. Studium an der FH Ludwigsburg, 1991 Abschluss als Diplom-Verwaltungswirt (FH). 1999/13 Bürgermeister von Römerstein. Ehrenamtlicher Richter am Amtsgericht Reutlingen. Mitgl. Aufsichtsrat Kreiskliniken Reutlingen, Lektor und Kommunionhelfer der katholischen Kirchengemeinde. Mitgl. der CDU seit 1989, Mitgl. im Kreis- und Bezirksvorstand der CDU. Mitgl. Kreistag Reutlingen seit 1999, 2007/13 Vors. der CDU-Fraktion. - MdB seit Okt. 2013.', 'Michael', '11004262');
Mitglied des Kreistages, ehrenamtlich', 'Mittlere Reife, Landwirtschaftsschule Roth, 1981 Meisterprüfung in der ländlichen Hauswirtschaft. 1983 Übernahme des landwirtschaftlichen Betriebes der Eltern in Lauf/Dehnberg. Seit 1990 Kreisrätin im Nürnberger Land. Seit 1996 Mitgl. der Frauen Union Bayern, seit Juni 2009 stellv. Vors. des CSU Bezirksverbands Mittelfranken, seit Okt. 2011 Mitgl. im CSU-Parteivorstand, seit Nov. 2011 Landesvors. der Arbeitsgemeinschaft Landwirtschaft der CSU, seit Feb. 2014 Mitgl. im Landesvorstand der Frauen Union Bayern. - MdB seit 2002; 2004/05 agrar- und verbraucherpol. Sprecherin der CSU-Landesgruppe; 2006/09 Vors. Ausschuss für Tourismus; 2009/14 tourismuspol. Sprecherin der CDU/CSU-Fraktion; seit 2010 Mitgl. der Dt.-Maltesischen Parlamentariergruppe; seit Jan. 2014 Drogenbeauftragte der Bundesregierung; seit Jan. 2014 Vors. des Arbeitskreises VI (Ernährung, Landwirtschaft, Umwelt, Naturschutz, Bau und Reaktorsicherheit) der CSU-Landesgruppe und stellv. Vors. der CSU-Landesgruppe.', 'Marlene', '11003596');
Mitglied des Kreistages, ehrenamtlich', 'Oberschule in Annaberg-Buchholz, Berufsausbildung mit Abitur in Glauchau. Studium an der TU Dresden, 1971 Abschluss als Diplomingenieur für Textiltechnologie. 1971/90 Werkleiter in einem Posamentenbetrieb. 1990/98 Bürgermeister in Jöhstadt. Seit 1972 Mitgl. der CDU. 1990/2014 Mitgl. Kreistag Erzgebirgskreis. 2001/11 Landesvors. Sachsen und Thüringen des THW. - MdB seit 1998; Vors. der Arbeitsgruppe Petitionen der CDU/CSU-Fraktion.', 'Günter', '11003035');
Mitglied des Kreistages, ehrenamtlich', 'POS. 1977/80 Fachschulstudium zur Krippenpädagogin, 1994/95 Anschlussqualifizierung staatl. anerkannte Erzieherin/Sozialarbeiterin. 1991/94 berufsbegleit. Studium Wirtschafts- und Verwaltungswissenschaften (VWA). 1995 Studium Rechts-, Kommunikations- u. Politikwissenschaft TU Dresden, 2000/02 berufsbegleit. Aufbaustudium Fachkauffrau für Marketing und Vertrieb (VWA). 1980/92 Krippenerzieherin, Gruppenleiterin, 1992/94 Sozialarbeiterin. 1995/02 Assistentin der Geschäftsleitung der Sita-Entsorgung GmbH Sachsen. 1989 Gründungsmitgl. Bürgerinitiative, bis 1990 parteilos. Seit 1990 Mitgl. der CDU, u. a. seit 2008 stellv. Vors. CDU Mittelsachsen. 1990/94 stellv. CDU-Fraktionsvors. im Kreistag Flöha, seit Aug. 2008 Mitgl. Kreistag Mittelsachsen. 1994/02 MdL Sachsen, Mitgl. Präsidium. Mitgl. in den Fördervereinen der Gedenkstätte Hohenschönhausen, der Konrad-Adenauer-Stiftung, des Schlosses Augustusburg, der Peter-Apian-Mittelschule Leisnig, der Wilhelm-Walther Grundschule Neuhausen-Cämmerswalde sowie des Samuel-von-Pufendorf-Gymnasiums Flöha, Mitgl. in zahlreichen örtl. Vereinen sowie der Freiberger Tafel, dem Oederaner Hospiz, dem Falkenauer Genossenschaftsladen der Trade Fair Freiberg eG und dem Bürgerkraftwerk "Tivoli". Englisch (G), Russisch (G). - MdB seit Okt. 2002.', 'Veronika', '11003501');
