Mitglied des Kuratoriums zur Vorbereitung des Reformationsjubiläums 2017
Mitglied des Kuratoriums zur Vorbereitung des Reformationsjubiläums 2017, ehrenamtlich
Mitglied des Kuratoriums', '1964/71 Europäische Schule Brüssel, 1971/76 Mathematisch-naturwiss. Gymnasium Lehrte. 1977/80 Studium Volkswirtschaft in Göttingen und Münster, 1978 London School of Economics; 1980/87 Studium Medizin, Medizinische Hochschule Hannover (MHH), 1987 Staatsexamen und Approbation, 1991 Promotion, 2001 Magister Public Health (M.P.H.). 1988/92 Assistenzärztin Frauenklinik der MHH; 1992/96 Aufenthalt in Stanford, Californien/USA, 1993 Auditing guest Stanford University, Grad. School of Business, 1995 Marktanalyse, Stanford Health Services Hospital Administration; 1998/02 wiss. Mitarbeiterin MHH. Seit 1990 Mitgl. der CDU, 2001/04 kommunalpol. Mandate Region Hannover, seit Dez. 2004 Mitgl. Präsidium der CDU Deutschlands, seit Nov. 2010 stellv. Vors. der CDU Deutschlands. 2003/05 MdL Niedersachsen; 2003/05 Ministerin für Soziales, Frauen, Familie und Gesundheit in Niedersachsen. Englisch (f), Französisch (f). - MdB seit Okt. 2009; Nov. 2005/Nov. 2009 BMin. für Familie, Senioren, Frauen und Jugend, Nov. 2009/Dez. 2013 BMin. für Arbeit und Soziales, seit Dez. 2013 BMin. der Verteidigung.', 'Ursula', '11004092');
Mitglied des Kuratoriums', '1972 Abitur. Wehrdienst. 1974/79 Studium Rechtswissenschaften und Geschichte in Münster und Freiburg, Referendarexamen; 1982 Assessorexamen; 1986 Promotion zum Dr. jur. an der Univ. Münster. 1983 Mitarbeiter der Reg. Bürgermeister von Berlin, von Weizsäcker und Diepgen, 1985/89 Leiter Grundsatzreferat der Senatskanzlei des Landes Berlin; Pressesprecher der CDU-Fraktion im Berliner Abgeordnetenhaus; 1990 Mitaufbau des Amtes des Ministerpräsidenten der letzten DDR-Regierung, Mitgl. Verhandlungsdelegation für den Einigungsvertrag; 1990/94 Staatssekretär im Kultusministerium Mecklenburg-Vorpommern, 1994/98 Chef der Staatskanzlei in Mecklenburg-Vorpommern; 1999 Berater und ab Okt. 1999 Staatsminister und Chef der Sächsischen Staatskanzlei, 2001/02 Staatsminister der Finanzen in Sachsen, 2002/04 Staatsminister der Justiz in Sachsen, 2004/05 Staatsminister des Innern in Sachsen. 2004 bis 2005 MdL in Sachsen. Seit Sept. 2003 Mitgl. Landesvorst. CDU Sachsen, seit Dezember 2012 Mitglied des Bundesvorstands der CDU Deutschlands. Seit Okt. 2010 Honorarprof. für Staatsrecht an der TU Dresden. - MdB seit Okt. 2009; Nov.2005/Okt. 2009 BMin. für besondere Aufgaben und Chef des Bundeskanzleramtes, März 2011/Dez. 2013 BMin. der Verteidigung, Okt. 2009/März 2011 und seit Dez. 2013 BMin. des Innern.', 'Thomas', '11004105');
Mitglied des Kuratoriums', '1974/85 Grund- und Oberschule in Berlin-Kreuzberg. 1985/89 Ausbildung Informationselektronik an der TU Berlin. 1989 Fachabitur. 1989/93 Studium an der TFH Berlin, Diplom-Ing. Nachrichtentechnik. 1992 Studium und Praktikum in Nebraska - USA. 1993/99 Planungsingenieur bei der Fa. E-Plus Mobilfunk GmbH. Seit 1990 Mitgl. Bündnis 90/Die Grünen, Landes- und Bundesparteitagsdelegierter. 1992/99 Mitgl. Bezirksverordnetenversammlung Kreuzberg. Mitgl. Abgeordnetenhaus Berlin 1999/Nov. 2013, bildungspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen. 2008 World-Young-Leader der BMW Quandt-Stiftung, 2007 Israeli-German-Young-Leader der Bertelsmann Stiftung, 2006 Marshall-Memorial-Fellow des German-Marshall-Funds, 2000 Young Leader der Atlantik-Brücke; Mitgl. BSC Rehberge, Mitgl. Kuratorium Stiftung Lesen, Mitgl. und Mitgründer Förderverein der Aziz-Nesin-Grundschule, Gründungsmitgl. Förderverein der Dt.-Türkischen Europaschule sowie Partnerschaftsverein Kreuzberg-Kadiköy e. V. - MdB seit Okt. 2013; Sprecher für Bildungs- und Sportpolitik der Fraktion Bündnis 90/Die Grünen.', 'Özcan', '11004360');
Mitglied des Kuratoriums', '1981 Abitur am St.-Anna-Gymnasium. 1981/88 Studium der Betriebswirtschaftslehre mit Schwerpunkt Steuern und Bankwirtschaft an der Ludwig-Maximilians-Univ. München; 1993 Steuerberaterin, 1994 Wirtschaftsprüferin und Prokuristin. 1988/90 Wirtschaftsprüfungsgesellschaft Deloitte & Touche GmbH in München, 1990/04 Wirtschaftsprüferin und Steuerberaterin für das gleiche Unternehmen in Halle (Saale), Schwerpunkt Prüfung und betriebswirtschaftliche Beratung von insbesondere kommunalen Unternehmen in Sachsen und Sachsen-Anhalt, seit 1999 Director. Kuratoriumsmitgl. des ifo-Instituts für Wirtschaftsforschung der Univ. München, Mitgl. des Instituts für Wirtschaftsprüfer Düsseldorf und im Beirat der Sparkassenversicherung Sachsen in Dresden. 2004/05 Stadtkämmerin der Stadt Rosenheim; 2005/09 Bürgermeisterin und Beigeordnete für Finanzen der Stadt Leipzig. - MdB seit Okt. 2009.', 'Bettina', '11004084');
Mitglied des Kuratoriums', '1981 Abitur. Zivildienst bei der Arbeiterwohlfahrt Köln. Studium der Rechtswissenschaften in Köln und Bonn. 1992/98 Mitarbeiter bei Bundestagsabgeordneten. 1997/99 Rechtsreferendar am Landgericht Köln. 1999/03 Tätigkeit als Rechtsanwalt. Mitgl. der SPD seit 1979, 1997/07 stellv. Vors. der Kölner SPD. 1989/94 Mitgl. der Bezirksvertretung Köln-Rodenkirchen. - MdB seit Okt. 2002.', 'Martin', '11003517');
Mitglied des Kuratoriums', '1982 Abitur in Duisburg-Homberg. 1982/88 Studium der Psychologie in Düsseldorf und Hamburg. 1989/97 angestellte Psychologin im interkulturellen Jugendaustausch. Seit 1995 Mitglied von Bündnis 90/Die Grünen, 2000/01 Beisitzerin im Landesvorst. GAL Hamburg, 2002/08 Landesvors. 1997/02 Mitgl. der Hamburgischen Bürgerschaft, Parl. Geschäftsführerin der GAL-Fraktion, haushalts- und kulturpolitische Sprecherin; 2011/13 Mitgl. der Hamburgischen Bürgerschaft, stellv. Vors. der Fraktion Bündnis 90/Die Grünen, haushaltspol. Sprecherin. 2008/10 Senatorin für Stadtentwicklung und Umwelt der Freien und Hansestadt Hamburg. Englisch (f), Französisch (G). - MdB 2002/08 und seit Okt. 2013; 2002/04 stellv. Vors. Haushaltsausschuss, 2004/08 haushaltpolitische Sprecherin der Fraktion Bündnis 90/DIE GRÜNEN, 2007/08 stellv. Mitgl. Kommission zur Modernisierung der Bund-Länder-Finanzbeziehungen (Föderalismuskommission II); seit Okt. 2013 Parl. Geschäftsführerin der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Anja', '11003547');
Mitglied des Kuratoriums', '1982/86 Astrid-Lindgren-Grundschule Gebhardshain, 1995 Abitur am Privaten Katholischen Gymnasium Marienstatt. Studium der Politikwissenschaften, des Öffentlichen Rechts und der Literaturwissenschaften in Bonn, York und Edinburgh; 2000 Abschluss Magistra Artium. 2003/09 Wissenschaftliche Referentin bei der nordrhein-westfälischen Landtagsfraktion Bündnis 90/Die Grünen, dort bis 2005 zuständig für den Bereich "Kinder, Jugend und Familie" sowie anschl. "Schule und Weiterbildung", 2001/03 persönliche Referentin der Fraktionsvorsitzenden. Mitgl. bei Amnesty International, Bonner Spendenparlament e. V., Frauen helfen Frauen e. V., Kulturverein Nordstadt e. V., MediNetz Bonn e. V., Ausbildung statt Abschiebung e. V., Mitgl. Versammlung der Heinrich-Böll-Stiftung, Vorst. Mieterbund Bonn und Vorst. Dt. Kinderhilfswerk. Mitglied Kuratorium Plan Deutschland, Mitgl. Hauptausschuss Deutscher Verein für öffentliche und private Fürsorge. Seit 1992 aktiv bei den Grünen, seit 1998 Mitgl., 2006/10 Mitgl. im Landesvorstand der nordrhein-westfälischen Grünen, seit 2007 Sprecherin des Bezirksverbandes Mittelrhein. 2002/09 Mitgl. der grünen Ratsfraktion in Bonn. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Katja', '11004030');
Mitglied des Kuratoriums', '1983 bis 1989 Besuch der Evangelischen Grundschule Neukölln; 1989 bis 1996 Besuch des Albert-Schweitzer-Gymnasiums mit Abschluss Abitur; 1996 bis 1999 Ausbildung zur Rechtsanwalts- und Notarfachangestellten. 1999 bis 2007 Rechtsanwaltsfachangestellte in einer mittelständigen Rechtsanwaltskanzlei in Berlin-Wedding; 2002 bis 2005 Wahlkreismitarbeiterin von Verena Butalikakis, MdB. 2007/13 Property Manager in einer internationalen Immobilienberatungsfirma in Berlin. Mitgl. im Unionshilfswerk, Lebenshilfe e. V. und Verein Freunde Neuköllns e. V.; Mitgl. in folgenden Fördervereinen: Förderverein der Evangelischen Schule Neukölln e.V.; Förderverein Annedore-Leber Berufsbildungswerk Berlin e. V.; Verein zur Förderung des Britzer Weinguts e. V.; Förderverein der Freiwilligen Feuerwehr Rudow e. V. Mitgl. cnetz-Verein für Netzpolitik, seit 2015 stellv. Sprecherin im cnetz, Kuratoriumsmitgl. Trägerwerk Soziale Dienste AG und Müttergenesungswerk. Mitgl. der CDU Neukölln seit 1996; Mitgl. des Vorstandes des Kreisverbandes Neukölln seit 2001; Delegierte der CDU Berlin zum Bundesparteitag seit 2011; 1999 bis 2005 Mitgl. im Vorst. der Jungen Union Neukölln; 2003 bis 2005 Mitgl. des Landesvorst. der Jungen Union Neukölln; 2003 bis 2005 Kreisvors. der Jungen Union Neukölln; 2013/15 Kreisvors. der Frauen Union Neukölln, seit 2015 stellv. Landesvors. der Lesben und Schwulen in der Union Berlin. 1999/Okt. 2013 Mitglied der Bezirksverordnetenversammlung von Berlin-Neukölln, 2006 bis 2009 stellv. Fraktionsvors., 2009/Okt. 2013 Fraktionsvors. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Christina', '11004408');
Mitglied des Kuratoriums', '1984 Abitur. Ausbildung zum Groß- und Außenhandelskaufmann. Tätigkeit bei der Firma Klöckner & Co. in Duisburg, 1996/08 Kemira Konzern, seit Januar 2008 bei der Firma Yara. Seit 1985 Mitgl. der CDU, 1999 Vors. der CDU Duisburg. Bis 1994 Mitgl. der Bezirksvertretung Duisburg-Süd, stellv. Fraktionsvors. der CDU. 1995/05 MdL Nordrhein-Westfalen, familien- und jugendpolitischer Sprecher der CDU. - MdB Okt. 2008/09 und seit Okt. 2013.', 'Thomas', '11003893');
Mitglied des Kuratoriums', '1992 Abitur. 1992/2000 Studium der Rechtswissenschaften in Hamburg, 2001/03 Referendariat. 2000/01 FAVORIT Unternehmens-Verwaltungs GmbH. 2003 bis heute Rechtsanwalt. Mitgl. der CDU. Seit 2011 Mitgl. des Kreistages Ostprignitz-Ruppin, seit 2014 Fraktionsvors. im Kreistag. Mitgl. Deutscher Anwaltverein, Haus und Grund OPR, Verschönerungsverein Neuruppin. - MdB seit Okt. 2013.', 'Sebastian', '11004417');
Mitglied des Kuratoriums', '1992 Abitur. 1992/99 Studium der Soziologie, Politik und Frauenforschung in Marburg, Frankfurt am Main, Pennsylvania, USA und Berlin, Abschluss Diplom-Soziologin. 1999/2000 wissenschaftliche Mitarbeiterin an der Freien Universität Berlin; 2000/03 Wissenschaftliche Beraterin in der PDS-Fraktion im Sächsischen Landtag; 2003/04 zunächst Redenschreiberin, dann Referentin für Verbraucherschutz im Bundesministerium für Verbraucherschutz, Ernährung und Landwirtschaft. Mitgl. Naturschutzbund BUND, ver.di, Volkssolidarität, VVN-BdA und attac. Seit 2004 Mitgl. der PDS, 2006/07 Mitgl. Parteivorst. der Linkspartei.PDS, seit 2007 Mitgl. Parteivorst. der Partei DIE LINKE, Mai 2010/Juni 2012 Bundesgeschäftsführerin und seit Juni 2012 stellv. Vors. DIE LINKE. 2004/09 Mitgl. des Sächsischen Landtags, dort stellv. Fraktionsvors. der Linksfraktion und Arbeitsmarktpolitische Sprecherin, 2007/09 Parlamentarische Geschäftsführerin der Fraktion DIE LINKE im Sächsischen Landtag. Englisch (f), Französisch (f). - MdB seit Okt. 2009; bis 2015 verbraucherpolitische Sprecherin der Fraktion DIE LINKE., seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE. und Leiterin Arbeitskreis "Struktur- und Regionalpolitik", seit 2016 Sprecherin für Mieten-, Bau- und Wohnungspolitik der Fraktion DIE LINKE.', 'Caren', '11004088');
Mitglied des Kuratoriums', '1992 Abschluss Realschule. Ausbildung zum Bankkaufmann. 1995/96 Wehrdienst. Berufsbegleitendes Studium an der Bankakademie. Mehrjährige Tätigkeit im Bankgewerbe. Vors. des Kreisverb. des Bayerischen-Roten-Kreuz Erlangen-Höchstadt. Mitgl. im Kuratorium der Friedrich-Alexander-Universität Erlangen-Nürnberg. Mitgl. der Jungen Union und der CSU seit 1990/1991, Nov. 2007/Nov. 2011 Landesvors. der Jungen Union Bayern, seit 2011Kreisvors. der CSU im Landkreis Erlangen-Höchstadt. Mitgl. des Kreistages Erlangen-Höchstadt. - MdB seit Okt. 2002; 2009/Dez. 2013 Parl. Geschäftsführer der CSU-Landesgruppe und Mitgl. des Ältestenrates, seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung.', 'Stefan', '11003597');
Mitglied des Kuratoriums', '1993 Abitur am Scheffelgymnasium in Bad Säckingen. 1993/94 Grundwehrdienst bei der Deutsch-Französischen Brigade. 1994/99 Studium der Rechtswissenschaften Univ. Freiburg, 1. Staatsexamen; 1999/01 Juristisches Referendariat am Landgericht Waldshut-Tiengen, 2. Staatsexamen. 1999/02 Lehrbeauftragter für Wirtschaftsrecht an der Dualen Hochschule Baden-Württemberg in Lörrach. 2001/02 Rechtsanwalt. 2002/04 Regierungsrat im Staatsministerium Baden-Württemberg, Persönlicher Referent des Staats- und Europaministers. 2004/13 Oberbürgermeister von Donaueschingen. 2006/16 Landesvors. der Kommunalpolitischen Vereinigung der CDU Baden-Württemberg,  seit 2007 stellv. Landesvors. der CDU Baden-Württemberg. 1999/2004 Stadtrat und CDU-Fraktionsvors. im Gemeinderat der Stadt Bad Säckingen; 2000/04 Mitgl. der Verbandsversammlung des Regionalverbandes Hochrhein-Bodensee, seit 2009 Mitgl. Kreistag Schwarzwald-Baar-Kreises, seit 2011 Vors. der CDU-Fraktion. - MdB seit Okt. 2013.', 'Thorsten', '11004276');
Mitglied des Kuratoriums', 'Abitur in Marl/Westfalen. Studium der Rechts- und Pol. Wissenschaft in Heidelberg und FU Berlin, Referendariat in Berlin. Wehrdienst Luftwaffe in Aurich, Kanonier d. R. Seit 1969 Rechtsanwalt in Berlin, 10 Jahre "Sozialistisches Anwaltskollektiv", 30 Jahre Verteidiger in pol. Strafverfahren. Engagement in der Studentenbewegung Ende der 60er Jahre. 1970/74 Mitgl. der SPD. Mitwirkung bei der Gründung der "Alternativen Liste für Demokratie und Umweltschutz", späterer Landesverband der Grünen in Berlin, Mitgl. der Alternativen Liste seit 1985, zeitweise Sprecher im Bundesvorst. und Landesverb. Die Grünen. - MdB 1985/87 und seit 1998; Okt. 2002/Okt. 2009 stellv. Fraktionsvors. und Koordinator des Arbeitskreises III Demokratie, Recht und Gesellschaftspolitik der Fraktion BÜNDNIS 90/DIE GRÜNEN; Mitgl. Parl. Kontrollgremium.', 'Hans-Christian', '11002273');
Mitglied des Kuratoriums', 'Abitur. Studium der Rechtswissenschaften. Selbstständige Unternehmerin/Veranstaltungs- und Marketingbüro. Kreisgeschäftsführerin der CDU Mülheim an der Ruhr. Mitgl. in diversen kulturellen und sozialen Vereinen. Seit 1998 Mitgl. der CDU, 2000/14 Ortsverbandsvors., 2005/13 stellv. CDU-Kreisschatzmeisterin; 2005/14 Kreisvors. EAK, 2007/13 Mitgl. Landesvorst. EAK NRW. 2004/14 Ratsmitgl., 2004/09 stellv. Fraktionsvors., 2007/09 Vors. Bau-, Verkehr-, Stadtplanungs- und Wirtschaftsförderungsausschuss, 2007/09 Fraktionsgeschäftsführerin, 2009/12 Vors. Bau- und Verkehrsausschuss, 2009/14 stellv. Bürgermeisterin. Seit Okt. 2015 Kreisvors. CDU Mülheim an der Ruhr. - MdB seit Okt. 2013.', 'Astrid', '11004425');
Mitglied des Kuratoriums', 'Gymnasium am Hochrad in Hamburg, Abitur. Studium der Theologie, Romanistik und Pädagogik Univ. Kiel und Hamburg. 1975/93 Freie Journalistin und Publizistin, Herausgabe von zahlreichen Publikationen zu familien- und frauenpolitischen Themen, sowie Reportagen aus der Dritten Welt u. a. im Auftrag der Kindernothilfe Duisburg. 1986/93 freie Mitarbeiterin beim Axel-Springer-Verlag sowie 1986/91 als freie Mitarbeiterin beim Norddeutschen Rundfunk tätig. 1977/87 Mitarbeit in versch. Gremien der CDU Schleswig-Holstein, z. B. Mitgl. Landesvorst. CDU Schleswig-Holstein, stellv. Landesvors. CDU-Frauen Union Schleswig-Holstein, 1990/2006 stellv. Landesvors. CDU Bremen, seit 2012 stellv. Landesvors. CDU Bremen, 2015 Spitzenkandidatin der CDU zur Bürgerschaftswahl in Bremen, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschlands. 1991/99 stellv. Fraktionsvors. der CDU-Bürgerschaftsfraktion. 1999/07 Staatsrätin für Kultur. 2007/13 Mitgl. der Bremischen Bürgerschaft, 2007/11 Vors. Ausschuss für Bundes- und Europaangelegenheiten, internationale Kontakte und Entwicklungszusammenarbeit, ab Juli 2007 Vors. Petitionsausschuss, ab Juni 2011 Fraktionssprecherin der CDU-Fraktion für Kirchliche Angelegenheiten, Medien, Datenschutz, Informationsfreiheit und Petitionen. - MdB seit Okt. 2013.', 'Elisabeth', '11004357');
Mitglied des Kuratoriums', 'Gymnasium in Siegburg, Abitur. Studium der Politischen Wissenschaft Rheinische Friedrich-Wilhelms-Univ. in Bonn; Promotion 2004. 2000/02 und 2004 Auslandstätigkeit in der Organisation für Sicherheit und Zusammenarbeit in Europa (OSZE) im ehemaligen Jugoslawien. Seit 2006 Referent für Sicherheitspolitik bei der Bundestagsfraktion DIE LINKE. - MdB seit Okt. 2013; Obmann der Fraktion DIE LINKE im Verteidigungsausschuss.', 'Alexander S.', '11004361');
Mitglied des Kuratoriums', 'Hochschulreife. Studium der Film- und Fernsehwissenschaften, Politikwissenschaften, Neuere Geschichte, Abschluss Magistra Artium. Qualifikation Zusatzausbildung in Film- und Medienmanagement. Tätig bei Film- und Fernsehproduktionsfirmen in den Bereichen Redaktion, Dreharbeiten und Dramaturgie für TV und Kino, bei Bildungsträgern im Rheinland, Studien zur Arbeitsmarktlage, SOS Kinderdorf Niederrhein - Beratung und Betreuung. Fraktionsgeschäftsführerin. Ehrenamtl. tätig im Vorstand der Frauenberatungsstelle Krefeld e.V.; Sprecherin des Bezirksverbandes der Grünen Niederrhein-Wupper. Kommunalpolitisches Mandat bis 2009, sachkundige Bürgerin im Sozial- und im Kulturausschuss Krefeld. - MdB seit Okt. 2013.', 'Ulle', '11004395');
Mitglied des Kuratoriums', 'Nach Schulbesuch Lehre im Handwerk als Konditor. 1978/79 Wehrdienst. 1979/82 Studium an der TH Leipzig, Abschluss Dipl.-Ing. (FH). 1989 Tätigkeit als Projektmanager für Investitionsprojekte in der Industrie. 1991/92 Referatsleiter Grundsatzfragen im Sächsischen Staatsministerium für Wirtschaft und Arbeit. 1993/94 Abteilungsleiter Unternehmensansiedlung bei der Wirtschaftsförderung Sachsen GmbH. 1990 Geschäftsführer des NEUEN FORUM, später des CDU-Kreisverb. Dresden. 1994/05 Mitgl. des Sächsischen Landtags, zuletzt Vors. Ausschuss für Wirtschaft. Seit Juni 2010 Mitgl. im Beirat der Bundesnetzagentur, seit Nov. 2010 Mitgl. im Vorstand der Deutschen Afrika Stiftung e. V. - MdB seit Okt. 2005; seit Okt. 2009 Obmann der CDU/CSU-Fraktion im Ausschuss für Wirtschaft und Technologie, jetzt Ausschuss für Wirtschaft und Energie, seit Nov. 2011 stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, seit Nov. 2013 Vors. Arbeitskreis Afrika der CDU/CSU-Fraktion.', 'Andreas G.', '11003796');
Mitglied des Kuratoriums', 'Studium Deutsche Philologie, Politikwissenschaft, Philosophie und Rechtswissenschaft (ohne Abschluss) in Mainz. Seit 2010 Mitgl. Vorstand Atlantik-Brücke, Mitgl. Vorst. Dt. Atlantische Gesellschaft e. V., seit 2012 Vors. Eintracht-Fanclub im Bundestag "bundesAdler", seit 2013 Mitglied im Stiftungsrat der Stiftung Wissenschaft und Politik, seit 2014 Mitglied Kuratorium World Vision e.V., seit 2015 Beisitzer im Vorstand der Deutschen Afrikastiftung. Weitere Mitgliedschaften auf www.nouripour.de. Englisch (f), Französisch (f), Farsi (f). - MdB seit September 2006.', 'Omid', '11003881');
Mitglied des Kuratoriums', 'Studium Sozialwissenschaften, Publizistik und Germanistik, 1978 Dipl.-Sozialwissenschaftler, Studienaufenthalte in Italien, Frankreich und den USA, 1985 Promotion. 1984/88 Redakteur der Zeitschrift "Südostasien Informationen", seit 1989 Mitherausgeber der Zeitschrift "Weltwirtschaft und Entwicklung" in Luxemburg, 2006/12 Mitherausgeber der Wochenzeitung "Der Freitag" in Berlin. 1988 Eintritt in die Partei Bündnis 90/Die Grünen, 1989/92 Geschäftsführer der Europagruppe der Grünen im EP; 1992/94 Referent für Internationale Politik des Bundesvorst. Bündnis 90/Die Grünen, 1994/96 Sprecher der Bundesarbeitsgem. Friedens- und Internationale Politik von Bündnis 90/Die Grünen, 1996/98 Mitgl. Bundesvorst., 2000/02 Mitgl. Grundsatzprogramm-Kommission, 2000/04 Vorstandsmitgl. Europäische Grüne Partei (EGP), 2000/06 Vors. Landesverb. NRW von Bündnis 90/Die Grünen. 2004/09 Mitgl. des Europäischen Parlaments, Vizepräs. Einwicklungsausschuss des EP. Englisch (f), Französisch (f), Italienisch (G). - MdB seit Okt. 2009; seit Nov. 2009 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Frithjof', '11004145');
Mitglied des Kuratoriums', 'Studium der Politik mit Nebenfach Volkswirtschaft Univ. Augsburg sowie an der australischen University of Adelaide, Abschluss Diplom. Bildungsreferentin in der CSU-Landesleitung. Pressereferentin bei der E.ON AG, seit Ende 2011 Sprecherin bei den Stadtwerken Ulm/Neu-Ulm GmbH. Seit 2003 Mitgl. der Jungen Union, seit 2005 Mitgl. der CSU, 2009/11 stellv. Landesvors. der Jungen Union Bayern, 2011/13  Landesvors. der Jungen Union Bayern, seit 2014 stellv. Bundesvors. der Jungen Union Deutschlands. 2008/12 Gemeinderätin in Elchingen, seit 2008 Kreisrätin in Neu-Ulm, seit 2014 Stadträtin in Neu-Ulm. - MdB seit Okt. 2013.', 'Katrin', '11004242');
Mitglied des Kuratoriums', 'Volksschule und Gymnasium in München, Abitur. Studium der Pol. Wissenschaft mit den Nebenfächern Soziologie und Geschichte an der Ludwig-Maximilians-Univ. München; Magister Artium. Zivildienst. Div. berufl. Aushilfstätigkeiten. Gewerkschaftssekretär, Schwerpunkte Jugend und berufl. Bildung bei der ÖTV, Bezirksverwaltung Bayern. Mitgl. in DGB-Gewerkschaften seit 1977, derzeit ver.di; 2007/08, 2015/16 Vors. und 2008/10 stellv. Vors. Beirat Bundesnetzagentur. 1975 Eintritt in die SPD, div. Funktionen seit 1976, 1983/88 Mitgl. SPD-Bezirksvorst. Südbayern, 1991/2000 und 2005/13 stellv. Vors. SPD-Bezirk Oberbayern, seit 2007 Mitgl. SPD-Landesvorst., seit 2009 des Landespräsidiums, ab April 2011 Mitgl. SPD-Parteirat, dann Parteikonvent; seit 2009 Landesvors. der AfA, 2010/12 stellv. Bundesvors. und seit April 2012 Bundesvors. der AfA; 1983/88 Vors. der südbayer. Jungsozialisten. Seit 2002 Kreisrat Lkr. Bad Tölz-Wolfratshausen. Ab Mai 2014 Mitgl. Senat bei der AIF. Seit Sept. 2012 Träger Bayer. Verdienstorden. Englisch (f), Französisch (G). - MdB seit 1994; 1998 Vors. Ausschuss für Post und Telekommunikation (13. WP), 1998/02 Vors. Unterausschuss für Telekommunikation und Post, 2009/13 stellv. Sprecher der SPD-Fraktion für Wirtschaft und Technologie, seit 2013 stellv. Vors. Ausschuss für Wirtschaft und Energie, seit 2009 Vors. Gesprächskreis Lateinamerika der SPD-Fraktion, seit 2014 Vors. Dt.-Südamerikanische Parlamentariergruppe, 2009 stellv. Vors. und seit 2011 Vors. AG Weltwirtschaft, seit 2015 Sprecher AG für Arbeitnehmer/innen-Politik der SPD-Fraktion; seit 2015 Mitgl. Außenwirtschaftsbeirat beim BM für Wirtschaft und Energie.
