Mitglied des Kuratoriums, ehrenamtlich (bis 31.08.2016)', 'Realschule, Aufbaugymnasium. Rheinisch-Westfälische TH Aachen und Fernuniversität Hagen. Lehrerin für Sonderpädagogik, Rehabilitation lernbehinderter und erziehungsschwieriger Kinder. Mitgl. der AWO, der IG BCE, des DRK sowie in örtl. Vereinen. Mitgl. Atlantik-Brücke e.V., des Goethe-Instituts; seit Sept. 2012 Bundesvors. der Bundesvereinigung Lebenshilfe e.V., Vors. Kuratorium Hospizstiftung Region Aachen. Mitgl. der SPD seit 1983, Mitgl. des SPD-Unterbezirksvorst. Aachen und des Partekonvents. Ratsfrau der Stadt Aachen bis 1992. - MdB seit 1990; 1991/98 Vors. der Querschnittsgruppe "Gleichstellung von Frau und Mann", ab 1991 Mitgl. geschäftsführender Vorst., Nov. 1998/Jan. 2001 stellv. Vors. der SPD-Fraktion für die Bereiche Arbeit und Soziales, Frauen, Familie und Senioren, März 2010/Nov. 2015 Obfrau der SPD-Fraktion im Unterausschuss für Auswärtige Kultur- und Bildungspolitik. Jan. 2001/Okt. 2009 Bundesministerin für Gesundheit (Okt. 2002/Okt. 2005 Bundesministerin für Gesundheit und Soziale Sicherung). Seit Feb. 2010 Mitgl. Parl. Versammlung der NATO und stellv. Leiterin der dt. Delegation. Seit Okt. 2013 Vizepräsidentin des Bundestages.', 'Ulla', '11002019');
