Mitglied des Kuratoriums, ehrenamtlich', '1968 Mittlere Reife. 1973 Diplom-Verwaltungswirt, 1977 Kommunal-Diplom (VWA). 1968/2002 Beamter der Stadt Moers; 1988/93 Leiter des Personal- und Organisationsamtes, 1994/2002 Personal- und Kulturdezernent in Moers, Städt. ltd. Verwaltungsdirektor a. D. 1970 Eintritt in die SPD, seit 1991 Mitgl. im SPD-Ortsvereinsvorst. Neukirchen-Vluyn, März 2004/Nov. 2013 Vors. des SPD-Stadtverbands Moers. 1984/90 Ratsmitgl. Stadtrat Neukirchen und dort Mitgl. des SPD-Fraktionsvorstands. Seit Anfang der 70er Jahre Mitarbeit in entwicklungs-, friedens- und umweltpolitischen Initiativen. 1974/85 Vors. des CVJM Neukirchen e. V., 1979/84 Mitgl. des ÖTV-Kreisvorstandes, seit Jan. 2009 Präses des Neukirchener Erziehungsvereins. Englisch (G). - MdB seit 2002; 2003/07 Sprecher der SPD-Arbeitsgruppe in der Enquete-Kommission "Kultur in Deutschland", 2006/07 stellv. Vors. Enquete-Kommission "Kultur in Deutschland", 2005/09 stellv. Vors. Ausschuss für Kultur und Medien, Nov. 2009/Febr. 2011 Beauftragter für Kirchen und Religionsgemeinschaften der SPD-Fraktion, 2009/14 Sprecher der SPD-AG Kultur und Medien, seit Jan. 2014 Vors. Ausschuss für Kultur und Medien, seit 2014 Mitgl. SPD-Fraktionsvorst., Beauftragter der SPD-Fraktion für das Reformationsjubiläum, Mitgl. Unterausschuss Auswärtige Bildungs- und Kulturpolitik.
Mitglied des Kuratoriums, ehrenamtlich', '1972 Abitur in Borna. 1972/76 Studium Meliorationswesen Universität Rostock, 1976 Abschluss als Diplom-Ingenieurin. 1976/79 Ingenieurin für Wasserwirtschaft und Umweltschutz im Braunkohlekombinat Borna. 1980/90 Mitarbeiterin in der LPG Pflanzenproduktion Wiederau-Zwenkau. 1991/99 Wiss. Mitarbeiterin bei der Konrad-Adenauer-Stiftung im Bildungswerk Leipzig und 2004/05 im Bildungswerk Dresden. Seit 1988 Mitgl. der CDU. März/Okt. 1990 Mitgl. der freigewählten Volkskammer der DDR, 1999/04 Mitglied des Sächsischen Landtags. - MdB Okt./Dez. 1990 und seit Okt. 2005.', 'Katharina', '11001278');
Mitglied des Kuratoriums, ehrenamtlich', '1972 Abitur. Lehramtsstudium Anglistik und Sportwiss. in Bochum. Realschullehrerin, 1980/92 Realschule Schwerte, 1992/94 Gesamtschule Schwerte. Mitgl. AWO, in diversen Sport- und Fördervereinen, im Deutschen Tierschutzbund und im Tierschutzverein Iserlohn, seit 2001 Vizepräsidentin im Deutschen Leichtathletik-Verband, seit 2014 stellv. Vors. Rundfunkrat Deutsche Welle. Mitgl. der SPD seit 1975. Ratsmitgl. und Vors. des Sportausschusses der Stadt Iserlohn 1989/99. Englisch (f), Französisch (G), Schwedisch (G). - MdB seit 1994; 1998/09 sportpolitische Sprecherin der SPD-Fraktion, seit Nov. 2009 Vors. Sportausschuss, Mitgl. Innere Kommission des Ältestenrates; seit 2014 Mitgl. der Parl. Versammlung der NATO, Mitgl. der deutschen Delegation der Interparlamentarischen Union, 2014/16 Vors. der Parlamentariergruppe SADC-Staaten, seit Okt. 2016 Vors. der Parlamentariergruppe USA.', 'Dagmar', '11002655');
Mitglied des Kuratoriums, ehrenamtlich', '1975 Realschulabschluss, 1979 Abitur. Für 2 Jahre Zeitsoldat. Studium Germanistik, Politik und Soziologie an der Univ. Göttingen, 1987 1. Staatsexamen für das Lehramt an Gymnasien (Deutsch, Gemeinschaftskunde), 1989 2. Staatsexamen. 1983/90 Dozent in der Erwachsenenbildung. 1999/03 Ministerpräs. des Landes Niedersachsen. Eintritt in die SPD 1977, 1976/89 ehrenamtl. Jugendarbeit im SPD nahen Jugendverb. der Falken.  2009/17 Vors. der SPD. 1987/98 Kreistagsabg. im Landkreis Goslar, 1991/99 Ratsherr der Stadt Goslar, 1990/05 Abg. des Niedersächsischen Landtags, dort 1998/99 und 2003/05 Vors. der SPD-Fraktion. Mitgl. AWO, IG Metall, SJD-Die Falken. Englisch (f), Französich (G). - MdB seit Okt. 2005; Nov. 2005/Okt. 2009 BMin. für Umwelt, Naturschutz und Reaktorsicherheit; Nov. 2009/Mrz. 2017 Vors. der SPD, Dez. 2013/Jan. 2017 BMin. für Wirtschaft und Energie und Stellvertreter der Bundeskanzlerin, seit 27. Jan. 2017 Bundesminister des Auswärtigen und Stellvertreter der Bundeskanzlerin.', 'Sigmar', '11003755');
Mitglied des Kuratoriums, ehrenamtlich', '1982/84 Hochschulstudium Univ. in Dakar (Senegal); 1985/86: Deutschkurs am Herder-Institut der Universität Leipzig. 1986/91 Studium der Chemie Martin-Luther-Univ. Halle-Wittenberg, 1992/96 Promotionsstudium Martin-Luther-Univ. Halle-Wittenberg. 1996/01 Projektleiter im Eine-Welt-Haus Halle, 2001/04 Projektleiter Interkulturelle Bildung beim DAA Halle, 2005/08 Bereichsleiter Migration und Integration der Jugendwerkstatt Frohe Zukunft Halle Saalekreis e. V., 2009/11 Leiter des EU-Projektes Empowerment von MigrantInnen zum nachhaltigen Gelingen der Integration und zur Förderung des Interkulturellen Dialogs der Jugendwerkstatt Frohe Zukunft Halle Saalekreis e. V. 2011/13 Referent im Ministerium für Arbeit und Soziales des Landes Sachsen-Anhalt. 2009/15 Mitgl. Stadtrat der Stadt Halle (Saale) für die SPD-Fraktion. 2009/11 Vors. Bundes Zuwanderungs- und Integrationsrates, 2009/11 Leiter des aus dem Europäischen und Integrationsfond finanzierten EU-Projekts "Empowerment von MigrantInnen zum nachhaltigen Gelingen der Integration und zur Förderung des Interkulturellen Dialogs".  - MdB seit Okt. 2013; stellv. Vors. Ausschuss für Menschenrechte und humanitäre Hilfe.
Mitglied des Kuratoriums, ehrenamtlich', '1984 Abitur am Solitude-Gymnasium Stuttgart-Weilimdorf. 1984/85 Wehrdienst. 1985/91 Studium der Rechtswissenschaften in Tübingen, Lausanne, Genf und Heidelberg, 1. und 2. jur. Staatsexamen. 1995/02 selbstständiger Wirtschaftsberater. Mitgl. der CDU seit 1983, seit 2010 Vors. CDU-Kreisverb. Pforzheim/Enzkreis, Mitgl. Wirtschaftsrat und Mittelstandsvereinigung. Mitgl. Atlantik-Brücke e. V., Vorstand der Fondation Robert Schuman (Paris), Vorstand der Europäischen Volkspartei (EVP), Kuratorium des Instituts für Europäische Politik (IEP), BFA Europa der CDU Deutschland und Vorstand der Europa Union Deutschland (kooptiert). Vors. Blasmusik-Kreisverband Pforzheim/Enzkreis und Förderverein Schiller-Gymnasiums Pforzheim. Mitgl. Vorstand Nordstadt-Bürgerverein, Kuratorium der Hochschule Pforzheim und Kirchensynode der ev. Kirche Pforzheim-Land. Mitgl. Lebenshilfe e. V., Förderverein Fachhochschule Pforzheim, Löbliche Singergesellschaft von 1501 Pforzheim, Karnevalsgesellschaften PFG und KGHO und Fußballverein 1. CfR Pforzheim. Englisch (f), Französisch (f). - MdB seit Okt. 2002; seit Juni 2007 Vors. Ausschuss für die Angelegenheiten der Europäischen Union.', 'Gunther', '11003573');
Mitglied des Kuratoriums, ehrenamtlich', '1987/88 freiwilliges soziales Jahr im Hamburger Kinderheim St. Elisabeth. 1999 Abschluss Dipl.-Volkswirtin FU Berlin. 1998/99 wiss. Mitarbeiterin MdEP Frieder Otto Wolf (Grüne). 2005 Lehrbeauftragte VWL an der FHW Berlin. Stellv. Vors. Europa Union Berlin e. V., Genossenschaftsmitgl. Studentendorf Schlachtensee e. G., Mitgl. Attac Deutschland, Berliner Tafel, Osi-Club e.V., DLRG Scharlottenburg-Wilmersdorf, Bildungswerk Berlin der Heinrich-Böll-Stiftung, Forum Ökologisch-Soziale Marktwirtschaft, DGVN Berlin e. V, Beirat Arbeitsgemeinschaft City e. V., Beirat Berliner Steuergespräche e. V., Mitgl. Kuratorium ifst e. V. 1997/99 Mitgl. Landesvorst. Bündnis 90/Die Grünen Berlin, 1997/02 Sprecherin der BAG Wirtschaft und Finanzen, 2005/07 Sprecherin BAG Wissenschaft/Hochschule/Technologie. 1999/Okt. 2009 MdA von Berlin, dort 1999/06 europapolitische Sprecherin, 1999/2000 und 2002/04 Mitgl. Fraktionsvorst., 2001/06 stellv. Vors. Ausschuss für Wissenschaft und Forschung und hochschul- und wissenschaftspolitische Sprecherin, 1999/09 wirtschaftspol. und 2006/09 haushaltspolitische Sprecherin der Fraktion Bündnis 90/Die Grünen im Abgeordnetenhaus. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit Okt. 2013 Obfrau und Mitgl. im Finanzausschuss, Sprecherin für Steuerpolitik der Fraktion Bündnis 90/Die Grünen.', 'Lisa', '11004127');
Mitglied des Kuratoriums, ehrenamtlich', '1998 Abitur am Max-Born-Gymnasium in Backnang. 1998/99 Zivildienst bei der diakonischen Einrichtung Erlacher Höhe. 1999/04 Studium der Rechtswissenschaft an der Eberhard Karls Univ. Tübingen mit Abschluss der Ersten jur. Staatsprüfung, 2004/06 Rechtsreferendariat am Landgericht Stuttgart mit Abschluss der Zweiten jur. Staatsprüfung. 2006/09 tätig bei MVV Energiedienstleistungen GmbH. 2007 Zulassung als Rechtsanwalt. 1996 Eintritt in die CDU und Junge Union, 1998 Landesvors. der Schüler Union Baden-Württemberg, 2002/07 Bezirksvors. der JU Nordwürttemberg, 2006/11 Landesvors. der JU Baden-Württemberg, seit 2011 Bezirksvors. der CDU Nordwürttemberg. Mitgl. Eisenbahninfrastrukturbeirat, Vors. Kuratorium der Bundeszentrale für politische Bildung. - MdB seit Okt. 2009; seit 2014 Vors. der Jungen Gruppe der CDU/CSU-Fraktion, Mitgl. Gemeinsamer Ausschuss und Vermittlungsausschuss; Vors. Parlamentskreis Elektromobilität.', 'Steffen', '11004011');
Mitglied des Kuratoriums, ehrenamtlich', '1998 Abitur. 1998/99 Zivildienst in der Bahnhofsmission Hannover. 1999/04 Studium der Politischen Wissenschaften, Geschichte und Soziologie an der Leibniz Universität Hannover, Abschluss Magister. 2001/04 Stipendiat der Friedrich-Ebert-Stiftung (FES), 2001 Praktika bei der FES in New York und der ARD in New York, 2003 Forschungsaufenthalt bei der FES in Washington, 2004 Forschungsaufenthalt bei der Stiftung Wissenschaft und Politik (SWP) in Berlin. 2001/03 Mitarbeiter im Wahlkreisbüro des damaligen Bundeskanzlers Gerhard Schröder; 2004/05 Jugendbildungsreferent im SPD-Landesverband NRW, 2005/09 Büroleiter des niedersächsischen Bundestagsabgeordneten und SPD-Landesvorsitzenden Garrelt Duin. Mitgliedschaften in der IG Bergbau, Chemie und Energie, AWO, Verkehrswacht. 1996 Eintritt in die SPD; 1996/97 Stadtschülersprecher Munster; seit 2002 Mitgl. im SPD-Bezirksvorst. Nord-Niedersachsen, 2003/07 stellv. Bundesvors. der Jusos in der SPD, seit 2006 SPD-Unterbezirksvors. Soltau-Fallingbostel. Seit 2006 Mitgl. des Kreistages Soltau-Fallingbostel, stellv. Fraktionsvors., seit 2001 Mitgl. des Stadtrates in Munster. - MdB Januar/Okt. 2005 und seit Okt. 2009; ab 2009 netzpolitischer Sprecher der SPD-Fraktion, seit Jan. 2014 Sprecher für digitale Agenda der SPD-Fraktion.
Mitglied des Kuratoriums, ehrenamtlich', '1999/03 Bezirksvors. der CSU München. 2004/07 Vors. und 2007/10 Mitgl. des Beirats bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen. - MdB seit Okt. 1994; 1994/98 Mitgl. der Kinderkommission, zuletzt Vors., 1998/02 Vors. Arbeitskreis Arbeit und Sozialordnung, Gesundheit, Familie, Senioren, Frauen und Jugend der CSU-Landesgruppe, 2002/05 wirtschafts- und arbeitspolitischer Sprecher der CSU-Landesgruppe, 2005/09 Familien-, Senioren-, Frauen- und Jugendpolitischer Sprecher der CDU/CSU-Fraktion und Nov. 2009/Okt. 2013 stellv. Vors. der CDU/CSU-Fraktion für die Bereiche Gesundheit, Ernährung, Landwirtschaft und Verbraucherschutz; seit Okt. 2013 Vizepräsident des Bundestages.', 'Johannes', '11002800');
Mitglied des Kuratoriums, ehrenamtlich', '2002 Abitur am Arnold-Janssen-Gymnasium St. Wendel. 2002/06 Studium der Rechtswissenschaften an den Univ. in Heidelberg und Saarbrücken. 2006 1. jur. Staatsexamen; 2002/06 studienbegleitende journalistische Ausbildung im Rahmen eines Stipendiums der Konrad-Adenauer-Stiftung. 2004/09 Mitgl. Saarländischer Landtag. Seit 2010 Vors. CDU-Gemeindeverband Tholey, seit 2013 Beisitzerin Bundesvorst. der Frauen Union. Seit 2006 Vors. Initiative Sicherer Landkreis St. Wendel e. V., seit 2006 2. Vors. Jochen-Rausch-Zentrum e. V., seit 2011 Mitgl. Kuratorium der Stefan-Morsch-Stiftung, seit 2014 Beirat Bundesnetzagentur. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion für die Bereiche Familie, Senioren, Frauen, und Jugend sowie Digitale Agenda.', 'Nadine', '11004116');
Mitglied des Kuratoriums, ehrenamtlich', '2004 Abitur an der Käthe-Kollwitz-Schule in Hannover. 2004/07 Duales Studium der Betriebswirtschaftslehre an der Leibniz-Akademie Hannover und bei der Bosch Rexroth Pneumatics GmbH, 2007 Studienabschluss als Betriebswirt. 2007/09 tätig im Unternehmenscontrolling der Bosch Rexroth Pneumatics GmbH. Mitgl. BUND, IG Metall, PRO ASYL, Forum Ökologisch-Soziale Marktwirtschaft (FÖS), Attac, Bund der Pfadfinderinnen und Pfadfinder (BdP), Zukunftspiloten, seit 2010 Kuratoriumsmitgl. Institut Solidarische Moderne (ISM), seit 2012 Vizepräsident Dt.-Israelische Gesellschaft (DIG). Seit 2003 aktiv bei Bündnis 90/Die Grünen, 2006/07 Schatzmeister der Grünen Jugend Niedersachsen, 2006/09 Parteirat Bündnis 90/Die Grünen Niedersachsen, 2007/09 Sprecher der Grünen Jugend Niedersachsen, 2013 Mitgl. der grünen Verhandlungskommission für die Koalition mit der SPD in Niedersachsen. - MdB seit 2009; seit 2013 Sprecher der Landesgruppe Niedersachsen der Fraktion Bündnis 90/Die Grünen, seit 2014 haushaltspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen.', 'Sven-Christian', '11004070');
Mitglied des Kuratoriums, ehrenamtlich', '2008 Abitur. Freiwilliges Soziales Jahr in einem Stuttgarter Krankenhaus. 2013 Bachelorabschluss an der Eberhard-Karls-Universität Tübingen, Masterstudium im Fach Volkswirtschaftlehre an der Univ. Hohenheim und an der Univ. degli studi di Pavia, Italien, 2015 Master of Science in Economics. 2012/14 Landesvors. des RCDS Baden-Württemberg; Mitgl. im Landesvorst. der JU, im Bundesvorst. der Frauen Union und im CDU-Bezirksvorst. Württemberg-Hohenzollern. - MdB seit Dez. 2014; nominiert als Direktkandidatin Wahlkreis 291 Ulm für die 19. WP.
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur 1967. Wehrdienst 1967/69. Studium der Politikwissenschaft, Soziologie, Neueren Geschichte und Sozialökonomie Univ. Bochum und Oxford (England) 1969/75; Diplom 1972, Promotion zum Doktor der Sozialwissenschaften 1975. Freiberufl. Dozent in der Erwachsenenbildung; Lehrbeauftragter für Politikwissenschaft; seit Feb. 2008 Honorarprofessor Ruhr-Univ. Bochum. Zahlreiche Veröffentlichungen. Mitgl. CDU seit 1966, stellv. Kreisvors. der CDU Bochum 1977/85, stellv. Landesvors. JU Westfalen-Lippe 1978/84, seit 1986 Mitgl. Landesvorst. CDU NRW, 1986/08 Vors. des CDU-Bezirksverb. Ruhr, seit 2008 Ehrenvors. Mitgl. Rat der Stadt Bochum 1975/80. 2004/2014 Mitglied der Verbandsversammlung des Regionalverbandes Ruhr. - MdB seit 1980; April 1989/Nov. 1994 Parl. Staatssekretär beim BMin. für Bildung und Wissenschaft, Nov. 1994/Mai 1997 beim BMin. für Wirtschaft, Mai 1997/Okt. 1998 beim BMin. für Verkehr. Jan. 1995/Okt. 1998 Koordinator der Bundesregierung für Luft- und Raumfahrt. 1996/06 Vors. Landesgruppe NRW, Nov. 1998/Okt. 2002 kultur- und medienpol. Sprecher der CDU/CSU-Fraktion. Okt. 2002/Okt. 2005 Vizepräsident und seit 18. Okt. 2005 Präsident des Deutschen Bundestages.', 'Norbert', '11001274');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur 1969. Studium der Rechtswissenschaften an der Westf. Wilhelms-Univ. Münster, 1. jur. Staatsexamen in Münster, Dr. jur., 2. jur. Staatsprüfung in Stuttgart. Wiss. Referent am Max-Planck-Institut für ausländisches öffentl. Recht und Völkerrecht in Heidelberg; MinRat im Landtag von Baden-Württemberg, Leiter des Pers. Büros des Landtagspräsidenten und zuständig für die Pflege der internat. Beziehungen. Mitgl. Internat. Institut für Strategische Studien/London (IISS); Mitgl. im Lions-Club Heidelberg-Palatina. 1975/86 Mitgl. der JU, stellv. Landesvors. der JU Baden-Württemberg; seit 1975 Mitgl. der CDU, Kreisvors. der CDU Heidelberg 1985/2003, seit 2003 Ehrenvors. der CDU Heidelberg. - MdB seit 1994; 2003/07 Vors. Unterausschuss "Weiterentwicklung der Inneren Führung" des Verteidigungsausschusses, seit 2006 stellv. Vors. Verteidigungsausschuss. Mitgl. Parl. Vers. (PV) der NATO seit 1998, Leiter der CDU/CSU-Delegation in der NATO PV seit 2003, stellv. Vors. des Politischen Ausschusses 2003/04, Vors. Unterausschuss "NATO-Partnerschaften" 2004/08, Vors. der Gruppe der Konservativen, Christdemokraten und Assoziierten in der NATO PV seit Mai 2005, Leiter der dt. Delegation seit Mai 2006, Vors. Politischer Ausschuss der NATO PV 2008/10, Präsident der NATO PV 2010/12, Vizepräs. der NATO PV 2006/08 und 2012/14, Präsident der Atlantic Treaty Association (ATA) 2008/14.', 'Karl A.', '11002716');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur Christian-Gymnasium Hermannsburg. Ausbildung zum Bankkaufmann bei der Sparkasse Celle. Reserveoffizier Panzerbataillon 333 in Celle. Studium der Rechtswissenschaften Universität Hamburg (bac. jur.). Angestellter bei der Sparkasse Celle; Prokurist in einem mittelständ. Unternehmen. 1994 Eintritt in die CDU, seit 2012 Vors. CDU-Kreisverband Celle, seit 2007 stellv. Vors. CDU-Bezirksverb. Nordostniedersachsen, Mitgl. im Präsidium der CDU in Niedersachsen. Seit 1996 Mitgl. Stadtrat Bergen und Kreistag Celle, u. a. stellv. Landrat und Mitgl. des Verwaltungsrates der Sparkasse. 2006/12 Mitgl. im Vorst. der EVP. Seit 2012 stellv. Präs. der Deutschen Gesellschaft für Wehrtechnik e.V. (DWT). - MdB seit Okt. 2005; Mitgl. des Parlamentskreises Mittelstand, seit Jan. 2014 Vors. der AG Verteidigung und verteidigungspol. Sprecher der CDU/CSU-Fraktion.', 'Henning', '11003821');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Anne-Frank-Gesamtschule. Studium Journalistik, Geschichte und Politikwissenschaft. Freier Journalist. Schülerarbeit, u. a. Schülersprecher ab 1987, Neugründung Juso-Hochschulgruppe 1992, Mitgl. Studierendenparlament Univ. Dortmund, Mitgl. AStA 1992/94, u. a. als stellv. AStA-Vors. Seit 1992 Mitgl. der SPD, 1992/99 Mitgl. im Dortmunder Juso-Vorst., zeitweise Vors., Mitgl. Vorst. SPD Dortmund seit 1996, seit 1999 stellv. Vors. Ortsverein Westfalenhalle Dortmund. Sachkundiger Bürger im Dortmunder Rat 1999/02. Mitgl. AWO, Greenpeace, ver.di, amnesty international, Kunst- und Literaturverein für Gefangene e. V., BVB 09, Verein Steinwache, Eurosolar, Naturfreunde Deutschland, VCD, Kuratorium Dortmunder Aidshilfe, Kuratorium Institut Solidarische Moderne und Netzwerk Recherche, Auslandsgesellschaft Deutschland e.V. (AgD), CORREKT!V, Lobby Control. - MdB seit Okt. 2002; 2005/09 Sprecher der AG Umwelt, Naturschutz und Reaktorsicherheit, 2009/13 stellv. energiepol. Sprecher der SPD-Fraktion und Berichterstatter Atom der SPD-Fraktion.', 'Marco', '11003512');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Carlo-Schmid-Gesamtschule Kamen. Zivildienst im AWO-Seniorenzentrum Unna. Studium für das Lehramt der Sekundarstufen II und I in Geschichte und Sozialwissenschaft an der Universität Bochum, Staatsexamen. Oberregierungsrat im Ministerium für Schule und Weiterbildung des Landes Nordrhein-Westfalen. Vorher Jugendbildungsreferent beim SPD-Landesverband Nordrhein-Westfalen in Düsseldorf; Tätigkeit als freier Mitarbeiter im betrieblichen und außerbetrieblichen Sozialwesen des Steinkohlenbergbaus. Mitgliedschaften in ver.di, Arbeiterwohlfahrt, Förderverein Monopol 2000, Naturfreunde, Verein für Demokratie und Völkerverständigung, Mitgl. Kuratorium Internationales Bildungs- und Begegnungswerk Dortmund und im Beirat des Informations- und Dokumentationszentrums für Antirassismusarbeit e. V., Mitgl. Kuratorium Dt. Studentenwerk, Kuratorium Stiftung Lesen und Kuratorium Evangelisches Studienwerk e. V. 1988 Eintritt in die SPD, seit 1990 Mitgl. im SPD-Ortsvereinsvorst. Kamen-Mitte, seit 1999 Mitgl. im SPD-Unterbezirksvorst. Unna und hier seit 2005 Vors., seit 2006 Mitgl. des SPD-Landesvorst. Nordrhein-Westfalen. - MdB seit Okt. 2009; seit 2014 stellv. bildungspol. Sprecher der SPD-Fraktion, seit 2014 Mitgl. im SPD-Fraktionsvorstand, seit 2014 Vors. der Deutsch-Belarussischen Parlamentariergruppe.', 'Oliver', '11004063');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur. Diplom Sozialarbeiterin. Seit 1989 für die Grünen aktiv, seit 1994 Mitgl. der Partei, Juni 2000/Feb. 2006 Landesvors. Bündnis 90/Die Grünen in Nordrhein-Westfalen. - MdB seit Okt. 2005; seit Okt. 2013 Erste  Parl. Geschäftsführerin der Fraktion Bündnis 90/Die Grünen.', 'Britta', '11003764');
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur. Jurist. Stabsstellenleiter bei der SAGA. Seit 1982 Mitgl. der SPD, seit 2002 SPD-Kreisvors. 1993/98 Mitgl. der Bezirksversammlung Hamburg-Mitte. Mitgl. AWO und ver.di, Mitgl. Deutsche Hilfsgemeinschaft, Mitgl. Bürgerverein zu St. Georg von 1880. Schatzmeister der Dt. Atlantischen Gesellschaft, Mitgl. der Deutsch-Israelischen Gesellschaft, Vors. der Kurt-Schumacher-Gesellschaft, Vors. THW-Landeshelfervereinigung Hamburg, Präsidiumsmitgl. des Deutschen Nationalkomitees für Denkmalschutz; Bundesvors. Reichsbanner Schwarz-Rot-Gold; Aufsichtsratsmitgl. Fröbel e. V., Mitgl. Sozialverband Deutschland e. V., Wingolfbund, LSVD, Guttempler in Deutschland; Mitgl. FC St. Pauli. Englisch (f). - MdB seit 1998; seit 2004 Sprecher des Seeheimer Kreises in der SPD-Fraktion; Vors. der AG Haushalt der SPD-Fraktion.
Mitglied des Kuratoriums, ehrenamtlich', 'Abitur. Studium Germanistik, Geschichte und Pädagogik an der Univ. Hamburg. 1982/87 Redakteurin. 1987/02 Angestellte im öffentl. Dienst an der FH Lübeck, 1987/97 Referentin für Presse- und Öffentlichkeitsarbeit an der FH Lübeck, 1997/02 Leiterin des FH Lübeck/LEONARDO-Büros. 1983 Eintritt in die SPD, Ortsvereinsvors., Vors. ASF Lübeck. 1990/02 Mitgl. Bürgerschaft der Hansestadt Lübeck, dort 1994/99 stellv. Fraktionsvors., 1999/02 Fraktionsvors. 1995/97 Senatorin (e). 1997 Verleihung der Senatsplakette der Hansestadt Lübeck. 1999/02 Vors. AR der Lübecker Hafengesellschaft mbH. Mitgl. IG BCE. - MdB seit Okt. 2002; tourismuspolitische Sprecherin der SPD-Fraktion.', 'Gabriele', '11003556');
Mitglied des Kuratoriums, ehrenamtlich', 'Ausbildung bei der Robert Bosch GmbH. Studium der Wirtschaftswissenschaften an der Universität Hohenheim, danach Referent und Kaufmännischer Leiter in der Industrie, Steuerberaterexamen, Steuerberater bei einer Wirtschaftsprüfungsgesellschaft, seit 2004 selbstständiger Steuerberater in Gütersloh mit Schwerpunkt im internationalen Rechnungswesen. 1998 Eintritt in die CDU, seit 2004 Mitgl. im CDU-Kreisvorst., seit 2009 Kreisvors., seit 2016 Vors. der CDU Ostwestfalen-Lippe und stellv. Landesvors. der CDU in Nordrhein-Westfalen. 2004/Jan. 2012 Mitgl. im Rat der Stadt Gütersloh, davon 2007/09 als Fraktionsvors. - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion für den Bereich Haushalt, Finanzen und Kommunalpolitik.', 'Ralph', '11004021');
Mitglied des Kuratoriums, ehrenamtlich', 'Fachoberschule. 1971/72 Wehr- und Ersatzdienst. 1973/76 Studium Sozialpädagogik FH, 1977/78 berufspraktisches Jahr. 1978/80 Jugendamt Abteilung Jugendpflege, 1981/84 Landesjugendbildungsreferent, 1984/88 Landesjugendsekretär beim DGB Landesbez. NRW, seit 1989 DGB-Kreisvors. Siegen-Wittgenstein. Seit 1976 Mitgl. ver.di. Mitgl. SPD seit 1981, SPD-Unterbezirksvors. Siegen-Wittgenstein. Ab 1994 DGB-Regionsvors. für Siegen-Wittgenstein-Olpe, bis Sept. 2012 DGB-Regionsvors. für Südwestfalen. Bis Sept. 2012 u. a. Vorstandsmitgl. Landesarbeitsgemeinschaft Arbeit und Leben NRW, alternierender Vors. Verwaltungsausschuss Agentur für Arbeit Siegen und im Berufsbildungsausschuss der IHK Siegen und der IHK Arnsberg, Hellweg-Sauerland. Ehrenamtl. Mitgl. der Kreissynode des Ev. Kirchenkreises Siegen, ehrenamtl. Mitgl. Kuratorium der Universität Siegen, ehrenamtl. Ersatzmitgl. Verwaltungsrat Studentenwerk Siegen. - MdB seit 1998.', 'Willi', '11003054');
Mitglied des Kuratoriums, ehrenamtlich', 'Gesamtschule Wetter, Abitur Gymnasium Philippinum Marburg. 1980/85 Studium der Betriebswirtschaftslehre und Soziologie in Marburg. Nach Familienphase 1998/99 Leiterin "Kommunales Marketing" beim Kreis Steinfurt. Mitgl. SPD seit 1983, 1987/92 versch. Funktionen bei Jusos, ASF und Partei im Unterbezirk Würzburg, seit 1992 versch. Funktionen im Unterbezirk Steinfurt. 1985/86 Stadtverordnete in Wetter/Hessen, 1994/97 Kreistagsabg. Kreis Steinfurt. 1980 Eintritt in die GEW, seit 1999 Mitgl. der AWO. - MdB seit Juli 1999; Mitglied im Vorstand der SPD-Fraktion, seit Jan. 2014 Vors. Finanzausschuss.
Mitglied des Kuratoriums, ehrenamtlich', 'Highschool-Diploma, Grayslake, Illinois, USA, Abitur am Franz-Ludwig-Gymnasium in Bamberg. Diplom Politikwissenschaften an der Hochschule für Politik in München und am Otto-Suhr-Institut der Freien Universität in Berlin. 1992 Eintritt in die Junge Union, 1994 Eintritt in die CSU; 2001/03 Landesvors. RCDS in Bayern; 2003/07 stellv. Landesvors. JU Bayern, 2008/12 stellv. Bundesvors. JU Deutschland; seit 2001 Mitglied im CSU Parteivorstand, seit 2011 stellv. Vors. CSU Unterfranken, Febr. 2009/Dez. 2013 stellv. CSU-Generalsekretärin, seit 2010 Vors. CSU-Netzrat, seit 2011 Vors. CSUnet. Seit 2008 Kreisrätin im Landkreis Haßberge. - MdB 2002/05 und seit Nov. 2005; seit Dez. 2013 Parlamentarische Staatssekretärin beim Bundesminister für Verkehr und digitale Infrastruktur, seit 2014 Koordinatorin der BReg für Güterverkehr und Logistik.', 'Dorothee', '11003586');
Mitglied des Kuratoriums, ehrenamtlich', 'Juni 2004 Hochschulreife. Ab Okt. 2004 Studium Rechtswissenschaften Heinrich-Heine-Univ. Düsseldorf, April 2009 Abschluss 1. Staatsexamen. Seit April 2009 Dipl.-Jurist. Juni 2000 Eintritt in den Jugendverband [''solid] - die sozialistische Jugend, 2002/05 Landessprecher [''solid] NRW. Seit Aug. 2000 Mitgl. der PDS, jetzt DIE LINKE, 2003/07 Mitgl. Landesvorst. PDS NRW/Linkspartei.PDS NRW als jugendpolitischer Sprecher, 2006/07 Kreisvorstandsmitgl. Linkspartei.PDS Oberhausen, 2007/08 Mitgl. Landesvorst. DIE LINKE. NRW und zuständig für Inneres, Justiz und Jugend, 2008/10 Mitgl. Parteivorst. DIE LINKE. als jugendpolitischer Sprecher. 2007/09 Bezirksvertreter in Oberhausen-Sterkrade. - MdB seit Okt. 2009; Obmann der Fraktion DIE LINKE im Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung, Sprecher für Welternährung der Fraktion DIE LINKE.', 'Niema', '11004114');
Mitglied des Kuratoriums, ehrenamtlich', 'Studium an der Fachhochschule für öffentliche Verwaltung und Rechtspflege in Bayern, Diplom als Verwaltungswirt (FH). Verwaltungslehre. Beamtenlaufbahn für den gehobenen nichttechnischen Verwaltungsdienst im Freistaat Bayern, zuletzt Regierungsamtsrat; ab 2006 Büroleiter des Bundestagsabgeordneten Horst Seehofer, Bundesminister, seit 2009 Büroleiter des Parteivorsitzenden der CSU, MP Horst Seehofer. Eintritt in die CSU 1973, Vorstandsmitgl. im CSU-Orts- und Kreisverband Tirschenreuth, Mitgl. des CSU-Bezirksvorst. Oberpfalz, 1984 Beisitzer im Landesvorst. Bayern der Christlich Sozialen Arbeitnehmer Union (CSA),Bezirksvorstand Oberpfalz, 1988 stellv. Bezirksvors, Beisitzer im Landesvorstand Bayern der Christlich Sozialen Arbeitnehmer Union (CSA), 1998 CSA Bezirksvors. Oberpfalz, stellv. Landesvors. der CSA Bayern, seit 1988 Mitgl. Vorstand und seit März 2014 Vizepräs. der Europäischen Union (EUCDA), Brüssel, 2012 Vorstandsmitgl. des EZAB (Zentrum für Arbeitnehmerfragen), München. Seit Mai 2014 Mitgl. Kreistag Tirschenreuth. Ehrenamtl. Mitgl. Kuratorium Stiftung Kultur- und Begegnungszentrum Kloster Waldsassen, Mitgl. Kuratorium XertifiX e. V. Europamedaille der EVP-Fraktion. Ehrenvors. der Bayerischen Sportjugend, Kreis Tirschenreuth. - MdB seit Okt. 2013; stellv. Vors. der Arbeitnehmergruppe der CDU/CSU-Fraktion.', 'Reiner', '11004350');
Mitglied des Kuratoriums, ehrenamtlich', 'Volksschule Waidhaus, staatl. Wirtschaftsschule in Weiden, Abschluss 1992 Mittlere Reife. Ausbildung zum Polizeibeamten in Sulzbach-Rosenberg, Nürnberg, München und Bad Reichenhall. Seit 1999 bei der Polizeiinspektion Fahndung in Waidhaus tätig. Seit 1994 Mitgl. der Jusos und der SPD Waidhaus, 1996/02 Vors. der Jusos Waidhaus, 1998/06  Vors. Juso-Unterbezirk Weiden-Neustadt-Tirschenreuth, 2002/12 Vors. SPD-Ortsverein Waidhaus, seit 2003 stellv. Vors. SPD-Kreisverband Neustadt/WN, seit 2010 Mitgl. SPD-Bezirksvorst. Oberpfalz, seit 2013 Vors. SPD-Unterbezirk Weiden-Neustadt-Tirschenreuth, seit 2017 Generalsekretär der BayernSPD. Seit 2002 Marktrat in Waidhaus, seit 2008 Kreisrat im Landkreis Neustadt/WN. Englisch (f) - MdB seit Okt. 2013; seit Juni 2014 Sprecher der SPD-Fraktion im 2. Untersuchungsausschuss (BKA), seit Okt. 2014 Mitgl. PKG, seit Nov. 2015 Sprecher der SPD-Fraktion im 3. Untersuchungsausschuss (NSU II).
