Mitglied des Landtages', 'Abitur 2005. Seit 2005 Studium Univ. Potsdam, Lehramt Geschichte/Lebenskunde, Ethik, Religion; 2006/09 Stipendiat der Rosa-Luxemburg-Stiftung. 2006/07 Mitgl. Studierendenparlament Univ. Potsdam, 2007/08: Mitgl. des Allgemeinen Studierendenausschusses (AStA) Univ. Potsdam. 2008/10 studentischer Mitarbeiter am Zentrum für Zeithistorische Forschung (Potsdam), 2010 Bildungsreferent des Vereins zur Förderung einer solidarischen Wirtschaftsweise und der Völkerverständigung e. V., 2010/13 Mitarbeiter von Sabine Wils, MdEP. Seit 2000 Mitgl. bei [''solid] - die sozialistische jugend / Linksjugend [''solid], 2005/06 Bundesgeschäftsführer, 2007, 2010/11  Mitgl. BundessprecherInnenrates. Mitgl. der PDS/Linkspartei.PDS /Die Linke seit 2002, seit 2012 stellv. Landesvors. DIE LINKE Brandenburg. MdL Brandenburg Okt. 2013/Okt. 2014. Mitgl. GEW, Rote Hilfe, Fördererkreis demokratischer Volks- und Hochschulbildung, attac, Freundeskreis John Heartfield, Bildungspartisanen Brandenburg e. V., SV Babelsberg 03. - MdB seit Nov. 2014.
