Mitglied des Parlamentarischen Beirates', '1994 Abitur, Nellenburggymnasium Stockach. 1994/2000 Studium der Rechtswissenschaften Universität Konstanz, 2000 1. Jur. Staatsexamen Konstanz, 2002 2. Jur. Staatsexamen Freiburg. Seit 2003 Rechtsanwalt, Kanzlei Rittershaus Mannheim. 1991/93 Ortsvors. Junge Union Stockach, 1993/99 JU Kreisvors. in Konstanz, 2000/02 JU Bundesvorstand, 2002/05 Bezirksvors. JU Südbaden; seit 1995 Mitgl. Kreisvorstand CDU Konstanz, 2007/11 Kreisvors., seit 2011 Bezirksvors. CDU Südbaden, seit 2001 Mitgl. Landesvorstand und seit 2011 auch Mitgl. Präsidium CDU Baden-Württemberg. Englisch (f), Französisch (f). - MdB seit 2005; Beauftragter für Klimaschutz, seit 2010 Vors. Parl. Beirat für nachhaltige Entwicklung, seit 2015 Vors. der deutsch-französischen Parlamentariergruppe, seit Juli 2016 Vors. der CDU-Landesgruppe Badan-Württemberg.', 'Andreas', '11003780');
