Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1956/66 Sorbische Oberschule Radibor. 1966/68 Berufsausbildung zum Industriekaufmann. 1969/72 Fachschulstudium Betriebsökonomie, 1976/79 Fernstudium Verkehrshochschule Dresden. 1972/76 Gruppenleiterin im Hauptbuchhalterbereich. 1976/86 Familienarbeit. 1986/90 Sachbearbeiterin im Rechtsanwaltsbüro. 1990 Mitgl. der frei gewählten Volkskammer. 1995 Projektentwickler, 1996/02 Geschäftsführerin eines mittelständischen Unternehmens. Seit 1972 Mitgl. der CDU, seit 1989 Vors. CDU-Ortsverb. Großdubrau, seit 1990 Mitgl. CDU-Kreisvorst. Bautzen, 1992/07 Kreisvors., derzeit stellv. Kreisvors., 1996/01 Landesvors. der Frauen-Union Sachsen, 1996/2012 Mitgl. CDU-Bundesvorst. Seit 2001 Landesvors. "donum vitae" Sachsen e. V., seit 2000 Vors. des Rates für sorbische Angelegenheiten im Freistaat Sachsen, seit 2002 Mitgl. Parl. Beirat der Stiftung für das Sorbische Volk. Seit 2008 Vors. Freundeskreis Kloster St. Marienthal in Ostritz. Sorbisch (f), Russisch (G). - MdB Okt./Dez. 1990, Febr. 1991/94 und seit Okt. 2002; seit Sept. 2015 gesundheitspol. Sprecher der CDU/CSU-Fraktion.', 'Maria', '11001501');
Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1973/74 Grundwehrdienst in München. Präsident des Deutschen Instituts für reines Bier e. V. 1970 Gründungsmitgl. JU-Ortsverband Simbach, 1985/89 JU-Kreisvors. im JU-Kreisverband Dingolfing-Landau; 1972 Eintritt in die CSU, 1987/93 stellv. CSU-Kreisvors., ab 1993 CSU-Kreisvors. im Kreisverb. Dingolfing-Landau. 1978/94 Mitgl. des Marktrates von Simbach, ab 1990 Mitgl. Kreistag Dingolfing-Landau. - MdB seit 1994; 2002/13 stellv. Vors. der CSU-Landesgruppe, Jan. 2005/Dez. 2013 arbeits-, sozial- und gesundheitspolitischer Sprecher der CSU-Landesgruppe und seit Jan. 2006 Mitgl. Vorstand der CDU/CSU-Fraktion, 2009/13 stellv. Vors. Ausschuss für Arbeit und Soziales, seit Dez. 2013 Parl. Geschäftsführer der CSU-Landesgruppe.', 'Max', '11002812');
Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1974 Fachabitur an der Fachoberschule Cham. 1974/91 Bankkaufmann bei der Sparkasse Cham. Stellv. Kreisvors. des Bayerischen Roten Kreuzes, Kreisvors. der Eisstockschützen im Landkreis Cham, Mitgl. in versch. Vereinen und Organisationen. 1974/91 Mitgl. der Jungen Union, seit 1979 Mitgl. der CSU, seit 1989 CSU-Ortsvors., 1993/2015 stellv. CSU-Kreisvors., seit Nov. 2015 Vors. CSU-Kreisverband Cham. Seit 1984 Kreisrat, seit 1998 Vors. der CSU-Kreistagsfraktion. 2002/09 Kreisvors. des Bayerischen Gemeindetages, Kreisverband Cham. Mai/Okt. 2008 Mitgl. des Bayerischen Landtags. - MdB seit Okt. 2009.', 'Karl', '11004059');
Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1995 Abitur am Karl-von-Closen-Gynmasium Eggenfelden. 2001 Diplom Politikwissenschaften an der Hochschule für Politik München. 2001/03 PR-Berater; 2003/05 Referent für interne Kommunikation, Grüne Bayern, 2005/08 Landesgeschäftsführer Grüne Bayern. 2000 Landesschatzmeister der Grünen Jugend Bayern, 2001/03 Vors. Grüne Jugend München, 2006/08 Vors. Grüne Neuhausen-Nymphenburg, 2008/14 Landesvors. Grüne Bayern. 2010/14 Mitgl. im Bezirksausschuss Neuhausen-Nymphenburg, 2008/13 Mitgl. Bezirkstag von Oberbayern. Mitgl. Bund Naturschutz, Verein gegen betrügerisches Einschenken. - MdB seit Okt. 2013.', 'Dieter', '11004312');
Mitglied des Parlamentarischen Beirates, ehrenamtlich', 'Industriekaufmann, Personalfachkaufmann. 1970/73 Mannesmannröhren-Werke, 1973/78 Verbandssekretär KKV - Verband der Katholiken in Wirtschaft u. Verwaltung, 1978/84 Bundessekretär BDKJ, 1984/05 Diözesansekretär Kolpingwerk Diözesanverband Münster. 1972 Eintritt in die CDU und CDA, einige Jahre Vors. CDA Nottuln und Vorstand CDA Kreis Coesfeld, Mitgl. Bundesvorst. der CDA; stellv. Vors. im Bezirksvorst. der CDU Münsterland. Einige Jahre Jugendvertreter in der Bezirksvertretung Essen-Borbeck, 1989/94 und 2004/Anfang 2006 Rat der Gemeinde Nottuln, bis Jan. 2006 Vors. des Ausschusses für Familie, Soziales, Bildung und Freizeit. Seit 1999 alternierender Vors. der Vertreterversammlung DRV Westfalen, Vors. Kolpingwerk NRW und Mitgl. versch. kulturelle und soziale Organisationen. - MdB seit Okt. 2005; arbeitsmarkt- und sozialpolitischer Sprecher der CDU/CSU-Fraktion.', 'Karl', '11003839');
Mitglied des Parlamentarischen Beirates, ehrenamtlich', 'Kriminologin/Polizeiwissenschaftlerin (M.A.). Seit 2006 Mitgl. Bündnis 90/Die Grünen, 2007/09 Mitgl. im Kreisvorstand der Gelsenkirchener Grünen, zunächst als Beisitzerin dann als Vorstandssprecherin, seit 2010 Mitgl. im Landesvorstand von Bündnis 90/Die Grünen NRW. 2009/13 Mitgl. im Rat der Stadt Gelsenkirchen und stellv. Vors. der Grünen-Ratsfraktion. - MdB seit Okt. 2013; Sprecherin der Fraktion Bündnis 90/Die Grünen für Innenpolitik; Obfrau im Innenausschuss; stellv. Vors. Dt.-Kroatische Parlamentariergruppe.', 'Irene', '11004353');
Mitglied des Plenums und der geschäftsführenden Arbeitsgruppe, von Amts wegen
Mitglied des Politisch- Parlamentarischen Beirates', '1978 Abitur mit Facharbeiterausbildung. 1981/86 Fernstudium an der FH "Carl Zeiss" in Jena. 1986/91 Technischer Leiter im Schlachthof Gera. Seit 1991 Abfallwirtschaftszweckverband Ostthüringen, seit 1992 dort Technischer Geschäftsleiter. Seit 1981 Mitgl. der CDU, 1991/10 Kreisvors., seit Jan. 2002 Mitgl. in der Mittelstands- und Wirtschaftsvereinigung der CDU. 1990/99 und seit 2004 Kreistagsmitgl. Landkreis Greiz. Mitgl. Volkssolidarität Kreisverband Altenburger Land e. V., Fördermitgl. der Freiwilligen Feuerwehr in Saara, seit Feb. 2011 Mitgl. im Präsidium des Dt. Nationalkomitees für Denkmalschutz, seit März 2010 Mitgl. des Aufsichtsrats der DEGES - Dt. Einheit Fernstraßenplanungs- und -bau GmbH, seit 2014 stellv. Mitgl. Stiftungsrat Stiftung Berliner Schloss-Humboldtforum, seit 2014 Mitgl. Stiftungsrat Bundesstiftung Baukultur, seit Okt. 2014 Mitgl. im Beirat des Verbandes Wohneigentum. Englisch (G), Russisch (G). - MdB seit Okt. 2002.', 'Volkmar', '11003650');
