Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich
Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich', 'Handelsschule, mittlere Reife. 11 Jahre Fremdsprachensekretärin im Ausland. Acht Jahre Mitarbeiterin des MdB Günter Graf in Cloppenburg, 1994/96 Leiterin der SPD-Geschäftsstelle Cloppenburg/Vechta des SPD-Bezirks Weser-Ems, 2010/12 Leiterin der Regionalgeschäftsstelle Oldenburg. Seit 1988 Mitgl. der SPD; 1991/01 Ratsfrau der Stadt Cloppenburg, 1991/96 stellv. Fraktionsvors. der SPD im Stadtrat Cloppenburg, 1996/01 Vors. der Gruppe SPD-BÜNDNIS 90/DIE GRÜNEN-UWG im Stadtrat Cloppenburg; 1996/06 Mitgl. im Kreistag des Landkreises Cloppenburg, 1996/03 Fraktionsvors. der SPD im Kreistag Cloppenburg; 2003/10 Mitgl. der SGK auf Bundesebene, 2006/10 stellv. Bundesvors. der SGK; 2006/10 Mitgl. im Stadtrat Cloppenburg, in der 13. und 14. WP Mitgl. des Landtages Niedersachsen. Mitgl. Förderverein inhaftierte Frauen Vechta,  Kreisverkehrswacht Cloppenburg, Kinderschutzbund, Malteser Hilfsdienst, Parl. Vereinigung Niedersachsen e. V., AWO und REUNION e.V. Ehrenamtl. Vizepräs. Deutsche Afrika Stiftung e. V., Mitgl. Pol.-Parl. Beirat Brandschutz e. V., Mitgl. Pol.-Parl. Beirat Institut privater Bauherren e. V. Mitgl. Parl. Beirat Europaverband der Selbstständigen (ESD) e. V., ehrenamtl. Vizepräsidentin Dt.-Jordanische Gesellschaft e. V., Vors. Kuratorium Marie-Schlei-Verein e. V. (e), Vizepräs. EMA Euro-Mediterran-Arabischer Länderverein (e). - MdB 2002/09, 2012/13 und seit Feb. 2014; stellv. Vors. PG Arab.-sprachige Staaten des Nahen Ostens, Mitgl. PG östliches Afrika und PG Maghreb-Staaten.
Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich', 'Vermessungstechniker, Fachhochschulreife. Studium, Dipl.-Sozialarbeiter. Referent beim Diakonischen Werk Westfalen, Geschäftsführer des Diakonischen Werkes Steinfurt-Coesfeld-Borken; Leiter des Geschäftsbereichs Kinder-, Jugend- und Familienhilfe im AWO-Unterbezirk Münsterland-Recklinghausen. Mitgl. u. a. ver.di und IG BCE; 2004/09 Aufsichtsratsvors. der Marler Baugesellschaft (NeuMa), Mitgl. der Stiftung Baukultur, Mitgl. im Parl. Beirat Brandschutz. Seit 1978 Mitgl. der SPD, 2005/12 stellv. Kreisverbandsvors. Recklinghausen, SPD-Stadtverbandsvors. in Marl. 1999/09 Stadtratsmitgl., 2004/09 Vors. der Ratsfraktion Marl. - MdB seit Okt. 2009; Vors. der AWO-PG der SPD-Fraktion, Mitgl. AG Demographischer Wandel und AG Kommunales, wohnungs- und baupolitischer Sprecher der SPD-Fraktion.', 'Michael', '11004045');
Mitglied des Politisch/Wissenschaftlichen Beirates
Mitglied des Politisch/Wissenschaftlichen Beirates', '1967/77 Polytechn. Oberschule Georg Schumann in Berlin-Lichtenberg, 1977/80 Berufsausbildung zur Chemielaborantin mit Abitur. 1980/85 Hochschulstudium an der Veterinärmedizinischen Fakultät der Humboldt-Univ. zu Berlin. 1985/86 Pflichtassistenz, 1993 Promotion. Seit 1986 wiss. Mitarbeiterin in einer Forschungseinrichtung, die sich mit wiss. Konzepten zur Verhütung, Überwachung und Bekämpfung von Infektionserregern bei Tieren und solchen, die auf Menschen übertragen werden können, beschäftigt. Ab 1992 wiss. Mitarbeiterin am Institut für Epidemiologie Wusterhausen im Friedrich-Loeffler-Institut. Ab Mitte der 90er Jahre bis 2005 Personalrätin. Mitgl. bei ver.di, Rettungshundestaffel Brandenburg e. V., NABU, Blühende Landschaften e. V. Pionier/FDJlerin. Mitgl. Volkssolidarität, Fördermitgl. der Deutschen Umwelthilfe. Seit 1979 Mitgl. der SED/SED-PDS, Ruhen der Mitgliedschaft von Ende 1990/Juni 2001, dann Reaktivierung der Mitgliedschaft in der PDS, seit 2003 Mitgl. im Landesvorst. Brandenburg der PDS/ LINKE, 2005/12 und seit 2016 stellv. Landesvors. - MdB seit Okt. 2005.', 'Kirsten', '11003853');
