Mitglied des Samtgemeinderates (bis November 2016)', '1998 Realschulabschluss in Langendamm. 1998/01 Ausbildung zum Bankkaufmann bei der Sparkasse Nienburg. 2002/03 Zivildienst im Caritas Altenzentrum in Rodewald. 2005 Fortbildung zum Sparkassenfachwirt. 2006 Studium zum Sparkassenbetriebswirt an der Niedersächsischen Sparkassenakademie in Hannover. Jan. 2009/Okt. 2013 Marktbereichsleiter bei der Sparkasse Nienburg. 2011 Absolvierung der Ausbildereignungsprüfung. Seit 1997 Mitgl. der Jungen Union, seit 2001 Mitgl. der CDU, kooptiert in den JU-Landesvorst. Niedersachsen, kooptiert in den JU-Bezirksvorst. Hannover, in die CDU-Kreisvorst. Nienburg und Schaumburg sowie CDU-Bezirksvorst. Hannover. Seit 2001 Mitgl. Gemeinderat Steimbke, stellv. Bürgermeister, Schulausschussvors., Mitgl. Finanzausschuss. Seit 2016 Mitgl. Kreistag Nienburg und stellv. Landrat. Absolvent der CDU Talentschmiede 2010; Vorstandsarbeit SoVD Ortsgruppe Steimbke, 1. Vors. Schützenverein, Feuerwehr und SG Wendenborstel, ICH international childrenhelp e.V., Spielmannszug Steimbke, Mitgl. Verkehrsverein Stadthagen. - MdB seit Okt. 2013.', 'Maik', '11004250');
Mitglied des Senats
Mitglied des Senats
Mitglied des Senats', '1981/91 Erich-Weinert-Oberschule Görlitz-Weinhübel. Ausbildung zum Büroinformationselektroniker. 1997/98 Fachhochschulreife. 1998/02 Studium an der Hochschule für Technik und Wirtschaft Dresden (FH). 1989 Eintritt in die CDJ Christlich Demokratische Jugend, 1993/02 Mitgl. Landesvorst. der JU Sachsen und Niederschlesien, seit 2003 Mitgl. Landesvorst. CDU Sachsen, seit April 2005 Generalsekretär der CDU Sachsen. 1994/99 Stadtrat der kreisfreien Stadt Görlitz, seit 2008 Mitgl. Kreistag Görlitz. Mitgl. im Senat der Helmholtz-Gemeinschaft, im Senat der Leibniz-Gemeinschaft, im Förderverein des Landesmuseums Schlesien und im Förderverein der Hochschule Zittau/Görlitz, Vors. Förderverein  "Fürst-Pückler-Park Bad Muskau" e. V. - MdB seit Okt. 2002; seit Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, seit Sept. 2013 Vors. CDU-Landesgruppe Sachsen', 'Michael', '11003572');
Mitglied des Senats, ehrenamtlich
