Mitglied des Senats, ehrenamtlich', '1984/88 Fischlaker Grundschule Essen, 1988/97 Geschwister-Scholl-Gymnasium Velbert, Abitur. 1997/98 Zivildienst in der Evangelischen Studierendengemeinde (ESG), Universität Duisburg-Essen. 1998/04 Studium der Sozialwissenschaft, Ruhr-Universität Bochum. Seit 1998 Mitgl. Bündnis 90/Die Grünen (Kreisverband Essen), Gründungsmitgl. Grüne Jugend NRW, 1999/02 im Landesvorstand Grüne Jugend, 2000/02 als Sprecher, 2002/06 Mitgl. im Landesvorstand der Grünen Nordrhein-Westfalen. Mitgl. Deutsche Parlamentarische Gesellschaft, Mitgl. Kuratorium Bundeszentrale für pol. Bildung (BpB), Mitgl. Kuratorium Deutsches Studentenwerk (DSW), Mitgl. Fachbeirat Studienwerk der Heinrich-Böll-Stiftung, Mitgl. Kuratorium Ev. Studienwerk e. V. Villigst, stellv. Vors. Beirat FernUniv. Hagen, Mitgl. Senat der Leibniz-Gemeinschaft, Mitgl. Kuratorium der Stiftung Lesen, Mitgl. Kuratorium Kompetenzzentrum Technik-Diversity-Chancengleichheit, Mitgl. im Lesben- und Schwulenverband in Deutschland (LSVD) e. V., Mitgl. bei amnesty international und Greenpeace. - MdB seit 2005; 2005/11 Sprecher für Jugend- und Hochschulpolitik der Fraktion Bündnis 90/Die Grünen, 2011/13 Sprecher für Bildungs- und Hochschulpolitik, seit 2013 Sprecher für Hochschule, Wissenschaft und Forschung, Obmann im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.', 'Kai', '11003756');
