Mitglied des Stadtrates', '1961/65 Grundschule St. Kastor in Koblenz, 1965/70 Hauptschule Overberg in Koblenz. 1972/74 Ausbildung zum Einzelhandelskaufmann in der Firma Sporthaus Stadion Koblenz, 1974/77 Angestellter der Firma Sporthaus Stadion in Koblenz. 1977/79 Zivildienst auf der Pflegestation im Blinden- und Altenheim Koblenz; 1979/80 Hilfsaltenpfleger im Blinden- und Altenheim, Koblenz, Lagerist Firma Krieger und Co., Lagerarbeiter bei Aldi, Arbeiter der Firma Stabilus, Hilfstechniker der Firma Ingenieurgesellschaft Björnsen, Mitarbeiter der Telekom (Telefonauskunft) und Möbelpacker bei der Firma Büroeinrichtungen Järgen. 1980/81 Berufsbildende Schule Koblenz-Karthause, 1981/83 Fachoberschule für Sozialwesen Koblenz-Karthause. 1983/87 Studium der Religionspädagogik in Mainz; 1987/88 Anerkennungsjahr als Religionspädagoge an der Goethe-Hauptschule Koblenz-Lützel und als Pastoraltheologe in den Gemeinden Maria-Hilf und St. Antonius Koblenz-Lützel; 1988/07 Anstellung als Religionspädagoge in der Hauptschule Koblenz-Lützel und als Pastoraltheologe in den Gemeinden Maria-Hilf/St. Antonius. 2007/10 Personalreferent im Bistum Trier im Generalvikariat Trier; seit 2010 Lehrer an der Julius-Wegeler Schule in Koblenz. Vors. SPD-Ortsverein Koblenz-Güls, stellv. Vors. Stadtverband Koblenz, Mitgl. Beirat der SPD Rheinland-Pfalz. Stadtrat der Stadt Koblenz, Sprecher der SPD-Fraktion für Jugend und Soziales. - MdB seit Okt. 2013.
Mitglied des Stadtrates', '1970 Mittlere Reife. Lehre als Schriftsetzer. 1982 Nichtabiturientenprüfung. 2002 Abschluss Studium der Sozialwissenschaften, Nebenfach Wirtschaftswissenschaften. Arbeit im erlernten Beruf bis 1995; 1995 Selbstständigkeit als Journalist und PR-Arbeiter. 2002 ver.di-Gewerkschaftssekretär im Fachbereich Medien, Kunst und Industrie. 1972 Eintritt in die IG Druck und Papier, bis 2002 durchgehende ehrenamtl. Gewerkschaftsarbeit (IG Medien, IG Metall, DGB, ver.di). Friedensinitiative Bürgeraktion "Garlstedter Heide". Mitgl. attac, AWO, BUND und wikimedia. Ehrenamtl. Arbeitsrichter beim AG Verden. 1970/89 Mitgl. in der DKP. 2005 Mitbegründer der WASG im Landkreis Osterholz; 2015/17 Landesvors. DIE LINKE. Niedersachsen. Mitgl. im Stadtrat Osterholz-Scharmbeck.  - MdB seit Okt. 2009; Vors. 5. Parl. Untersuchungsausschuss "Abgashandel".', 'Herbert', '11004007');
Mitglied des Stadtrates', '1988 Abitur am Fachgymnasium Wirtschaft, Hameln. 1988/90 Ausbildung zum Bankkaufmann bei der Deutschen Bank Hameln. 1990/91 Wehrdienst in Northeim und Hildesheim. 1991/2000 Studium der Wirtschaftswissenschaften an der Universität Hannover, Abschluss zum Diplom-Ökonom. Bereits während des Studiums 1995/2013 Mitarbeiter der ING-DiBa AG, Hannover, 2001/13 Teamleiter im Kundendialog der ING-DiBa AG, Hannover, 2007/13 Mitgl. im Betriebsrat der ING-DiBa AG, Hannover. 1987/2003 Mitgl. der Jungen Union, seit 1988 Mitgl. der CDU, 1997/2013 und seit 2015  Mitgl. im Bezirksvorstand der CDU Hannover, 1999/2004 Vors. CDU-Ortsverband Hameln-West, 2004/14 Vors. CDU-Stadtverband Hameln, seit 2014 Kreisvors. der CDU Hameln-Pyrmont. 2011/16 Mitgl. im Rat der Stadt Hameln, 2011/16 Abgeordneter im Kreistag Hameln-Pyrmont.  - MdB seit Okt. 2013.', 'Michael', '11004431');
Mitglied des Stadtrates', '1992 Abitur am Wilhelm-Diess-Gymmasium Pocking. 1992/93 Volontariat bei unserRadio Passau; 1994/98 Studienbegleitendes Volontariat bei der Passauer Neuen Presse, 1993/98 Studium an der Univ. Passau, 2009 Promotion zur Dr. phil. 1998/10 Journalistin beim Bayerischen Rundfunk, seit 2010 Dozentin für Medienwisssenschaft an der Universität Regensburg. CSU-Mitgl. seit 2004, Stadträtin in Regensburg seit 2008, CSU-Ortsvors. Stadtamhof/Oberer Wöhrd, stellv. CSU-Kreisvors., Mitgl. im CSU-Bezirksvorstand, Mitgl. im FU-Bezirksvorstand und FU-Landesvorstand. - MdB seit 2013.', 'Astrid', '11004277');
Mitglied des Stadtrates', 'Ausbildung zum Bergmann, Elektrohauer. Mitgl. AWO. 1977 Eintritt in die SPD, stellv. Vors. SPD- Ortsverein Boverheide, Unterbezirksvors. SPD Bottrop, Mitgl. AFA-Vorst. SPD-Unterbezirk Bottrop. Mitgl. Rat der Stadt Bottrop. - MdB seit Okt. 2009.', 'Michael', '11004039');
Mitglied des Stadtrates', 'Ausbildung zur Floristin, 1996 Umschulung zur Altenpflegerin, 2007 Ausbildung zur Diakonin. Leiterin der Tagespflege im Saarbrücker Wichernhaus und bis Okt. 2013 Diakonin bei der Seniorenhilfe der kreuznacher diakonie. Seit Aug. 2015 Mitgl. des Vorstandes der Ev. Arbeitsgemeinschaft für Soldatenbetreuung in der Bundesrepublik Deutschland e. V., seit Nov. 2015 Mitgl. des Stiftungsrates der Deutschen Härtefallstiftung. Mitgl. im Kreisvorst. der SPD Neunkirchen, dort Bildungsbeauftragte, seit 2010 Vors. des SPD-Ortsvereins Wellesweiler. 2009/14 Mitgl. im Ortsrat von Wellesweiler und im Stadtrat Neunkirchen. - MdB seit Okt. 2013.', 'Heidtrud', '11004300');
Mitglied des Stadtrates', 'Ausbildung zur Rinderzüchterin. Studium zur Diplom-Ingenieurin (FH). Umschulung zur Floristin. 1998/05 Mitarbeiterin einer Abg. im Landtag Sachsen-Anhalt. Mitgl. Volkssolidarität, Aufsichtsratsmitgl. der TLG FAIRWOHNEN; seit 2005 Mitgl. Verwaltungsrat Kreissparkasse Stendal. 2003/06 Mitgl. des Parteivorstandes der Linkspartei.PDS, stellv. Kreisvors. DIE LINKE Stendal. 1991/94 Mitgl. Kreistag Osterburg, seit 1995 Mitgl. Kreistag Stendal, seit 2009 Mitgl. Stadtrat Stendal. - MdB seit 2005.', 'Katrin', '11003795');
Mitglied des Stadtrates', 'Examinierte Gesundheits- und Krankenpflegerin; bis Sommersemester 2013 Studium an der Univ. Bamberg, Studienfach European Economic Studies; Mitgl. der Bezirksvorstandschaft der CSU Oberfranken; Mitgl. Bezirksvorstandschaft der Jungen Union Oberfranken; Mitgl. im Stadtrat von Lichtenfels; Mitgl. im Kreistag von Lichtenfels; Mitgl. Junge Europäer Bayern. - MdB seit Okt. 2013.', 'Emmi', '11004452');
