Mitglied des Stadtrates, Fraktionsvorsitzende, ehrenamtlich', '1981 Goethe-Gymnasium Ibbenbüren, 1990 Abitur. Ausbildung zur Bankkauffrau bei der Deutschen Bank AG in Osnabrück. 1993 Wechsel in den familieneigenen Hotelbetrieb; Ausbildung zur Hotelfachfrau, seit 1994 leitende Funktion im Hotel Teutoburger Wald. 2003 Studium der Betriebswirtschaftslehre an der FernUniversität in Hagen, 2008 Abschluss Diplom-Kauffrau. Seit 1998 Mitgl. der CDU, seit Januar 2011 Stadtverbandsvors. der CDU Tecklenburg. 2004 Mitgl. im Rat der Stadt Tecklenburg, ab 2009 stellv. Fraktionsvors. - MdB seit Okt. 2013; seit Jan. 2017 Parl. Geschäftsführerin der CDU/CSU-Fraktion.', 'Anja', '11004323');
