Mitglied des Stadtrates, ehrenamtlich', 'Abschluss der mittleren Reife, zweijährige Fachschule Hauswirtschaft, Abschluss staatlich geprüfte ländliche Hauswirtschaftsleiterin. Ausbilderin der ländlichen Hauswirtschaft. Mitarbeit im eigenen landwirtschaftlichen Betrieb. Berufenes Mitgl. der Albrecht-Thaer-Gesellschaft, Mitgl. im Landfrauenverband Gifhorn, ehrenamtliche Richterin am Landwirtschaftsgericht, Mitgl. im Bündnis für Familien. Seit 2001 Mitgl. Rat der Stadt Gifhorn, seit 2006 Beigeordnete im Verwaltungsausschuss, 2011/13 Vors. der CDU-Fraktion im Rat der Stadt Gifhorn. - MdB seit Okt. 2013; Mitgl. Fraktionsvorstand.', 'Ingrid', '11004369');
