Mitglied des Stiftungsrates', '1950/59 Volksschule. 1959/61 Verwaltungslehre. 1961/68 Verwaltungsangest. bei der Bundesanst. für Arbeit, seit 1968 versch. berufl. Tätigkeiten im Verlagswesen und in politischen Funktionen. 1961 Ausschluss aus den FaLKEN, Eintritt in die illegale KPD. Mitinitiator der Ostermarschbewegung und Bewegung gegen die Notstandsgesetze. 1968 Mitbegründer und stellv. Vors., später Vors. der Sozialitischen Dt. Arbeiterjugend (SDAJ). Gründungsmitgl. Der DKP, ab 1973 Mitgl. DKP-Parteivorst. und zeitw. Präsidium, 1981/89 Bezirksvors. der DKP Hamburg, Sprecher der Erneuerungsströmung, 1990 Austritt aus der DKP, Eintritt in die PDS, 1991/93 Bundesgeschäftsführer der PDS, 1993/98 stellv. Bundesvors., Mitgl. Parteivorst. und Sprecher für Außenpolitik und intern. Zusammenarbeit; 2005 Gründungsmitgl. der Partei der Europ. Linken, 2007/16 Mitgl. Parteivorst. DIE LINKE., Mitverantwortung für deren Außenpolitik. 2004/05 MdL Brandenburg. - MdB 1998/02 und seit Okt. 2005; 1998/02 stellv. Vors. PDS-Fraktion, 1998/2002 und 2005/13 Obmann im Auswärtigen Ausschuss, außenpolitischer Sprecher der PDS-Fraktion, dann der Fraktion DIE LINKE., seit April 2011 Mitgl. Fraktionsvorst. u. seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE.; seit 2005 Vors. der Dt.-Mittelamerikanischen Parlamentariergruppe.', 'Wolfgang', '11003130');
Mitglied des Stiftungsrates', '1983/87 Grundschule Georgsmarienhütte, 1987/89 Orientierungsstufe, 1989/97 Gymnasium, 1997 Abitur. 1997/98 Zivildienst. Sommer 1999 Studium der Politischen Wissenschaft, Soziologie und Geschichte Univ. Hannover, Winter 2005 Abschluss als Politikwissenschaftler M. A. 1996/99 Fraktionsvors. von Bündnis 90/Die Grünen im Rat der Stadt Georgsmarienhütte, 1999 Austritt aus BÜNDNIS 90/DIE GRÜNEN. 1999 Eintritt PDS, 2004/Ende 2005 Vors. PDS Hannover, 2004/07 Mitgl. Parteivorstand Linkspartei.PDS, Juni 2007/Mai 2010 Mitgl. Parteivorstand DIE LINKE. Mitgl. bei ver.di und dem Anglerverein Bitterfeld e. V. Englisch (G), Latein (G). - MdB seit Okt. 2005; Datenschutzbeauftragter der Fraktion DIE LINKE; stellv. Vors. der Dt.-Israelischen Parlamentariergruppe, Okt. 2009/Okt. 2011 Leiter des AK "Bürgerrechte und Demokratie" und Nov. 2011/Nov. 2015 Leiter des AK "Demokratie, Kultur, Wissen und Bildung" der Fraktion DIE LINKE, seit Okt. 2009 Mitgl. Fraktionsvorst, seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE.', 'Jan', '11003790');
