Mitglied des Stiftungsrates, ehrenamtlich (bis Juni 2015)', '1974 Abitur. Dramaturgin an den Städtischen Bühnen Dortmund und Mitgl. "Hoffmans Comic Teater", Managerin der Rock-Band "Ton Steine Scherben". 1985/89 Pressesprecherin der GRÜNEN im Bundestag. Mitgl. Humanistische Union, Pro Asyl und Lesben- und Schwulenverband in Deutschland (LSVD), Mitgl. Stiftungsrat "Stiftung für die Internationalen Wochen gegen Rassismus", Kuratorium der DFB-Kulturstiftung, Kuratorium Universität Augsburg. 1971/90 Mitgl. der Jungdemokraten. Seit 1987 Mitgl. von BÜNDNIS 90/DIE GRÜNEN (ehemals: DIE GRÜNEN), 2001/Dez. 2002 und Okt. 2004/Okt. 2013 Bundesvors. von BÜNDNIS 90/DIE GRÜNEN. MdEP 1989/98, ab 1994 Fraktionsvors. der Grünen im EP. Englisch (f), Französisch (f), Italienisch (G). - MdB 1998/März 2001 und seit Okt. 2002; 1998/März 2001 Vors. Ausschuss für Menschenrechte und Humanitäre Hilfe. März 2003/Okt. 2004 Beauftragte der Bundesregierung für Menschenrechtspolitik und Humanitäre Hilfe im Auswärtigen Amt. Seit 22. Okt. 2013 Vizepräsidentin des Bundestages, ord. Mitgl. Interparlamentarische Union IPU in der 18. WP. Sprecherin der Fraktion Bündnis 90/Die Grünen für auswärtige Kulturpolitik', 'Claudia', '11003212');
Mitglied des Stiftungsrates, ehrenamtlich', '1956 Volksschule, 1962 Realschule. 1966/72 Berufsausbildung zum Diplom-Forstingenieur (FH). 1972/94 Förster im Außendienst. 1972/04 Mitgl. Stadtrat in Herrieden, 1974/94 Mitgl. Bezirkstag Mittelfranken, seit 1996 Mitgl. Kreistag Ansbach, 1994/02 MdL Bayern, Direktabgeordneter Stimmkreis Ansbach-Süd. Seit 1991 Vors. Arbeitskreis Umwelt und Landesentwicklung der CSU. 1970 Beitritt zum Bund Naturschutz Bayern, 1986 Gründung des Landschaftspflegeverbandes Mittelfranken, 1993 Gründung des Deutschen Verbandes für Landschaftspflege, 1998 2. Vors. Förderverein "Offene Behinderungsarbeit Ansbach-Süd", 1999 Beitritt zu Eurosolar, 2005 Gründung des Netzwerks Erneuerbare Energien in der Region Westmittelfranken, 2006 Gründung des Zukunftssalons Umwelt, 2012 Mitbegründer Bundesprojekt Bürgerenergie, 2014 Initiierung der Genossenschaft Regionalstrom Franken eG, einer regionalen Stromvermarktung im Raum Nürnberg (Dezentrale Stromerzeuger erhalten nach dem Ende der EEG-Vergütung einen verlässlichen Absatzmarkt). Seit 2011 Mitgl. Parl. Beirat der Dt. Unternehmensinitiative Energieeffizienz (DENEFF e. V.). Seit 2007 Mitgl. der Deutschen Afrika Stiftung e. V. 2010 Adam-Smith-Preis für marktwirtsch. Umweltpolitik. Englisch (f), Französisch (G). - MdB seit Okt. 2002.', 'Josef', '11003537');
Mitglied des Stiftungsrates, ehrenamtlich', '1972/77 Studium der Rechtswissenschaft in Gießen, 1980 2. jur. Staatsprüfung. 1980/85 wiss. Mitarbeiterin Univ. Gießen. 1985/88 Referentin in der Hessischen Staatskanzlei. 1988/90 wissenschaftl. Mitarbeiterin am Bundesverfassungsgericht. Ab 1991 Referatsleiterin und 1995/97 Abteilungsleiterin in der Niedersächsischen Staatskanzlei. 1997/02 Staatssekretärin. Bis 1998 im Niedersächsischen Ministerium für Frauen, Arbeit und Soziales; Nov.1998/Okt. 2002 im Bundesministerium des Innern. Okt. 2002/Okt. 2009 Bundesministerin der Justiz. Mitgl. Deutscher Juristinnenbund, ver.di. Englisch (f), Französisch (G). - MdB seit 2005; Dez. 2013/Jan. 2017 Parl. Staatssekretärin beim BMin. für Wirtschaft und Energie, seit Jan. 2017 BMin. für Wirtschaft und Energie.
Mitglied des Stiftungsrates, ehrenamtlich', '1976 Abitur Bad Windsheim. 1976/77 Wehrdienst. 1977/82 Studium Rechtswiss. Univ. Erlangen und Lausanne, 1982 1., 1985 2. jur. Staatsprüfung. Seit 1985 Rechtsanwalt mit Schwerpunkt Arbeitsrecht (Zulassung ruht). 1980/86 Vorstandsmitgl. der Europa-Union Bayern; Präs. Deutsch-Atlantische Gesellschaft; Mitgl. der Gesellschaft für christlich-jüdische Zusammenarbeit. 1974 Eintritt in die JU, 1976 in die CSU; 1979/82 Kreisvors. JU, 1982/91 Bezirksvors. JU Mittelfranken; stellv. Bundesvors. des EAK der CDU/CSU, 1999/09 Kreisvors. der CSU Fürth-Stadt. Vors. des Ev. Arbeitskreises der CSU, 2004/14 Vors. des Arbeitskreises Außen- und Sicherheitspolitik der CSU, seit 2011 stellv. Parteivors. der CSU. 1984/90 Mitgl. Gemeinderat in Obernzenn, 1984/90 Kreisrat im Landkr. Neustadt/Aisch-Bad Windsheim. Englisch (f), Französisch (G). - MdB seit 1990; Okt. 2002/Nov. 2005 Vors. AG Verteidigung der CDU/CSU-Fraktion; Nov. 2005/Dez. 2013 Parl. Staatssekretär beim BMin. der Verteidigung, Dez. 2013/Feb. 2014 Parl. Staatssekretär beim BMin. für wirtschaftliche Zusammenarbeit und Entwicklung, seit Feb. 2014 Bundesminister für Ernährung und Landwirtschaft.', 'Christian', '11002003');
Mitglied des Stiftungsrates, ehrenamtlich', '1978 Abitur. Wehrdienst Luftwaffe, Reserveoffizier Marine. 1979/84 Ausbildung zum Notar, Studium an der Notarakademie Baden-Württemberg. 1985/90 Notarvertreter, 1990 Fachberater bei Liegenschaftsämtern in Sachsen, 1991 Leiter Grundbuchamt Dresden. 1992/94 Referent im Sächsischen Staatsministerium der Justiz. Notar in Stuttgart z. Zt. ruhend. 1989/14 Stadtrat in Esslingen, 1994/02 Vors. der CDU-Fraktion; 1999/02 Kreisrat Landkreis Esslingen. Mitgl. Kolpingwerk; seit 2006 Präs. Blasmusikverband Esslingen; 2007/14 Vorstandsvors. der Kath. Arbeitsgemeinschaft für Soldatenbetreuung, 2011/14 Vors. unabhängige Kommission sexueller Missbrauch der Diözese Rottenburg-Stuttgart. Englisch (G), Französisch (G). - MdB seit Okt. 2002; seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin der Verteidigung.', 'Markus', '11003542');
Mitglied des Stiftungsrates, ehrenamtlich', '1980 Abitur. Wehrdienst auf Zeit beim Pionierbataillon 6 in Plön/Holstein. Studium der Rechtswissenschaften Univ. Hamburg, 1989 1. jur. Staatsprüfung, 1992 2. jur. Staatsprüfung. Seit Dez. 1992 selbstständiger Rechtsanwalt, 2001 Bestellung zum niedersächsischen Notar, seit Mai 2009 Notar a. D. 1982 Eintritt in die CDU, 1992/15 Kreisvors. der CDU Harburg-Land, seit 2003 Vors. des CDU-Bezirksverbands Nordostniedersachsen. - MdB seit Okt. 2002; Okt. 2009/Okt. 2013 Vors. der CDU-Landesgruppe Niedersachsen, März 2010/Mai 2012 Justiziar und seit Mai 2012 Erster Parl. Geschäftsführer der CDU/CSU-Fraktion; Mitgl. Ältestenrat.', 'Michael', '11003541');
Mitglied des Stiftungsrates, ehrenamtlich', '1985 Abitur in Düsseldorf. Studium der Neueren Geschichte, Osteurop. Geschichte und Politikwissenschaft an der Heinrich-Heine-Univ. Düsseldorf, 1997 Magister Artium. 1987/97 freie und 1997/2000 Wiss. Mitarbeiterin der Mahn- und Gedenkstätte für die Opfer des Nationalsozialismus in Düsseldorf. 1986 Eintritt in die SPD; 1989/90 AStA-Vors; 1989/93 Mitgl. Bundesvorst. Juso-Hochschulgruppen und Juso-Bundesvorst.; 1995/2011 und seit 2013 Mitgl. SPD-Parteivorst. Seit 2003 Mitgl. der Synode und seit Nov. 2015 Mitgl. im Rat der EKD, seit 2001 stellv. Mitgl. der Synode der Ev. Kirche Rheinland, 2009/10 Vorstand Sozialpolitik des Diakonischen Werkes der EKD e. V.; Mitgl. Berliner Republik e. V., Willy-Brandt-Zentrum Jerusalem, Dt.-Israelische Gesellschaft, Gesellschaft für christlich-jüdische Zusammenarbeit, Gegen Vergessen - für Demokratie, Kinderschutzbund, Marie-Schlei-Verein, IG BCE, AWO, ASB, Pro Asyl. - MdB Mai 2000/Oktober 2009 und seit Juli 2010; in der 15. und 16. WP Vors. Ausschuss für Familie, Senioren, Frauen und Jugend; in der 16. WP und ab Nov. 2011 Beauftragte der SPD-Fraktion für Kirchen und Religionsgemeinschaften, seit Jan 2014 Vors. Ausschuss für Arbeit und Soziales, seit 2014 stellv. Vors. Deutsch-Israelische Parlamentariergruppe.', 'Kerstin', '11003440');
Mitglied des Stiftungsrates, ehrenamtlich', '1992 Abitur an der Peter-Petersen Schule, Hamburg. 1993/94 Zivildienst, Landesjugendring Hamburg. 1994/01 Studium der Geschichte und Lateinamerikastudien Univ. Hamburg, 2010 Bachelor of Arts, Geschichte und Spanisch an der Humboldt Universität, Berlin, 2011 Master of International Public Policy, Johns Hopkins University, Washington D.C., USA. 2010/11 Senior Resident Fellow, German Marshall Fund, Washington D.C., USA; 2011/13 Referat Internationale Politikanalyse der Friedrich-Ebert-Stiftung in Berlin. 2001/04 Bundesvors. der Jungsozialistinnen und Jungsozialisten in der SPD, seit 2003 Mitgl. des SPD-Parteivorst. Englisch (f), Spanisch (f), Portugiesisch (G). - MdB 2005/09 und seit Okt. 2013; außenpolitischer Sprecher der SPD-Fraktion.', 'Niels', '11003732');
Mitglied des Stiftungsrates, ehrenamtlich', '1994 Abitur an der Winfriedschule Fulda. 1994/95 Wehrdienst. 1995 Studium Politische Wissenschaften, Rechtswissenschaften und Geschichte in Bonn; 1997/98 Auslandsstudium in Sarajevo (Bosnien-Herzegowina); 2001 Abschluss "Magister Artium" an der Univ. Bonn. 1995/2000 European Balkan Institute, Bonn; 1998 OSZE-Wahlbeobachter in Bosnien-Herzegowina; 1996/ 2000 freie journalistische Tätigkeit im In- und Ausland; 2000/01 Pressesprecher JU Deutschlands, Berlin, 2001/05 Pressesprecher CDU-Fraktion im Hess. Landtag, Pressesprecher CDU Hessen, Wiesbaden. Mitgl. Förderverein Florenberg e. V., Malteser Hilfsdienst, Freunde und Förderer der Hochschule Fulda, Gesellschaft für bedrohte Völker e. V., Fuldaer Karnevalsgesellschaft e. V., Stiftungsrat "Point Alpha Stiftung", Kuratorium "Aktion Deutschland Hilft" (ADH), seit 2015 Mitgl. der Kammer für öffentl. Verantwortung der EKD, Mitgl. im Beirat Kinder-Akademie Fulda, Vors. Hospiz-Förderverein Fulda e. V. Seit 1993 Mitgl. der CDU. Seit 2006 Mitgl. im Kreistag des Landkreises Fulda. Englisch (f), Französisch (G), Bosnisch (G). - MdB seit 2005; stellv. Vors. der Dt.-Bosnischen Parlamentariergruppe; bis Jan 2017 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe; seit Jan. 2017 menschenrechtspol. Sprecher und Vors. der AG Menschenrechte und humanitäre Hilfe der CDU/CSU-Fraktion.', 'Michael', '11003742');
Mitglied des Stiftungsrates, ehrenamtlich', 'Abitur. Theologiestudium. Gründungsmitgl. "Demokratie jetzt" und "Bündnis 90", 1995/98 und 2002/07 Landessprecherin BÜNDNIS 90/DIE GRÜNEN. 2009/13 Präses der Synode der Evangelischen Kirche in Deutschland (EKD); 2011 Präsidentin des 33. Deutschen Evangelischen Kirchentags (DEKT) in Dresden. - MdB seit 1998; Okt. 2002/Okt. 2005 und wieder seit Okt. 2013 Vors. der Fraktion BÜNDNIS 90/ DIE GRÜNEN; 2005/13 Vizepräsidentin des Deutschen Bundestages.', 'Katrin', '11003132');
Mitglied des Stiftungsrates, ehrenamtlich', 'Abitur. Vierjährige Dienstzeit als Offizier bei der Marine der Bundeswehr. 1986/93 Studium der Volkswirtschaftslehre in Heidelberg und Köln, Abschluss Diplom-Volkswirt. 1992/98 zunächst Abteilungsleiter für Sozialpolitik, später Büroleiter des CDU-Generalsekretärs in der Bundesgeschäftsstelle der CDU; 1999/01 Referent für Europapolitik der CDU/CSU-Bundestagsfraktion. 2001/09 Leiter Unternehmenskommunikation bei Vorwerk. 1987/89 Bundesvors. des Rings Christlich-Demokratischer Studenten (RCDS); 2003/14 Kreisvors. der CDU Wuppertal, seit 2005 stellv. Bezirksvors. der CDU Bergisch Land/Düsseldorf. 2004/09 Stadtverordneter und Vors. des Wirtschaftsausschusses in Wuppertal. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit April 2014 Koordinator der BReg für die transatlantische Zusammenarbeit; seit Sept. 2015 außenpol. Sprecher der CDU/CSU-Fraktion.', 'Jürgen', '11004050');
Mitglied des Stiftungsrates, ehrenamtlich', 'Carl-Schurz-Grundschule, Hans-Carossa-Oberschule in Spandau. 1993/94 Wehrdienst bei der Luftwaffe. 1994/97 Ausbildung zum Versicherungskaufmann. 1997/99 Vertriebsmitarbeiter in einem Versicherungsunternehmen, 1999/02 Mitarbeiter in einem familiengeführten mittelständischen Bauunternehmen, 2001/02 Mitgl. der Geschäftsleitung. Seit 1989 Mitgl. der CDU und der JU in Spandau; 1990/92 Vors. der Berliner Schüler Union; 1994/97 Vors. der JU Spandau, 2000/03 Vors. der JU Berlin; 1998/05 stellv. Vors. der CDU Spandau, seit 2005 Vors. der CDU Spandau, Dez. 2011 bis Dez. 2016 Generalsekretär der CDU Berlin. 1995/99 Mitgl. Bezirksverordnetenvers. Spandau, 1999/05 Mitgl. des Abgeordnetenhauses von Berlin, dort stellv. Vors. der CDU-Fraktion und wirtschaftspol. Sprecher. Mitgl. u. a. in der Arbeitsgemeinschaft 13. August e. V., im Förderverein Gedenkstätte Berlin-Hohenschönhausen e. V., in der Mittelstandsvereinigung, im Wirtschaftshof Spandau e. V., in der CDA, in der GdP, im Union Hilfswerk (UHW), im Reservistenverband, im Kuratorium des InfraNeu Hauptverbandes, im Kuratorium Stiftung Denkmal für die ermordeten Juden Europas, bei Hertha BSC Berlin. - MdB seit 2005; seit März 2009 Vors. der Landesgruppe Berlin in der CDU/CSU-Fraktion, seit Jan. 2014 Großstadtbeauftragter der CDU/CSU-Fraktion.', 'Kai', '11003860');
Mitglied des Stiftungsrates, ehrenamtlich', 'Mittlere Reife, Ausbildung zum Industriekaufmann. 1973/78 Verkaufssachbearbeiter, 1972/78 Jugendvertreter und Betriebsrat, 1978/79 Studium Sozialakademie Dortmund. 1979/02 Sekretär, 1980/88 Bezirkssekretär, 1988/94 Geschäftsführer der IG Chemie-Papier-Keramik in Hamburg. 1989/94 Mitgl. AR AlliedSignal GmbH, Arbeitnehmervertr., 1989/94 ehrenamtl. Arbeitsrichter. Mitgl. (ehrenamtl.) AWO; Heimvolkshochschule Hustedt e. V.; Bundesvors. Dt.-Norwegische Freundschaftsges.; stellv. Vors. Norwegisch-Dt. Willy-Brandt-Stiftung Oslo und Vors. Verein zur Förderung der Norwegisch-Dt. Willy-Brandt-Stiftung Berlin, Mitgl. Parl. Beirat Bundesverb. Dt. Stiftungen, Mitgl. Beirat Dt.-Norw. Jugendforum, Kuratorium Tafelstiftung Schleswig-Holstein Hamburg, Landeskuratorium Intern. Bund und Beirat Tausendfüßler-Stiftung Kaltenkirchen, Mitgl. Stiftungsrat Stiftung Zentrum für Osteuropa- und intern. Studien (ZOiS). Seit 1978 SPD, 1986/92 Kreisvors. SPD Stormarn, 1986/94 Kreistagsabg. Kreis Stormarn, 1990/94 stellv. Kreisrat. 1992/94 Ortsvereinsvors., 1997/99 stellv. Landesvors., April 1999/April 2003 Landesvors. SPD Schleswig-Holstein. - MdB seit 1994; Nov. 2000/Jan. 2001 sozialpol. Sprecher, Feb. 2001/Okt. 2002 stellv. Vors. der SPD-Fraktion. Okt. 2002/Nov. 2005 Parl. Staatssekretär bei der BMin. für Gesundheit und Soziale Sicherung, Nov. 2005/Nov. 2009 beim BMin. für Arbeit und Soziales. 1998/02 und seit März 2006 Vors. der Dt.-Nordischen Parlamentariergruppe. Seit 1998 Mitgl. und seit 2002 Leiter der Delegation des BT in der Baltic Sea Parliamentary Conference (BSPC), seit 2006 Mitgl. und 2006/07 Vors. des Ständigen Ausschusses der BSPC, seit Nov. 2011 Mitgl. im Steuerungsausschuss des "Baltic Sea Labour Forum"; seit 2009 stellv. Mitgl., seit 2014 Mitgl. Parl. Vers. OSZE, seit 2010 Leiter Gesprächskreis Russland/GUS der SPD-Fraktion, seit 2013 stellv. Vors. Auswärtiger Ausschuss sowie stellv. außenpol. Sprecher der SPD-Fraktion.
Mitglied des Stiftungsrates, von Amts wegen (bis Dezember 2013)
Mitglied des Stiftungsvorstandes, ehrenamtlich
Mitglied des Thüringer Landtags, Erfurt', '1987/95 Studium der Philosophie, Biologie, Kultur- und Kunstwissenschaften Univ.  Bremen. 1996/97 Bildungs- und Öffentlichkeitsreferentin beim Deutsch-Kurdischen Freundschaftsverein e. V. in Bremen, 1998/02 Kulturmanagerin im Stadtteilkulturzentrum Fuhrpark e. V., 2002/09 wissenschaftl. Mitarbeiterin für den Bereich Innenpolitik der Fraktion DIE LINKE im Thüringer Landtag. Autorin und Referentin zum Thema Rechtsextremismus. Vorstandsmitgl. der Bürgerinitiative Bittstädt-Wachsenburggemeinde e. V., geschäftsführendes Vorstandsmitgl. im Thüringer Landesverband der Verfolgten des Naziregimes (TVVdN/BdA e. V.), 1999/06 Beirat der Rosa-Luxemburg-Initiative Bremen. 1993/95 Vorstandsmitgl. im Allgemeinen Studierendenausschuss der Univ. Bremen; zahlreiche Aktivitäten/Verantwortlichkeiten im Bereich antirassistischer und antifaschistischer Kampagnen. Mitgl. der PDS bzw. DIE LINKE, 1998/01 Mitgl. Landesvorst. der PDS in Bremen, 1999 Spitzenkandidatin der PDS zur Bürgerschaftswahl in Bremen, 2005/07 Mitgl. im Stadtvorstand der LINKEN Erfurt. MdL Thüringen Sept. 2009/Okt. 2013, ab Sept. 2009 stellv. Vors. der Fraktion DIE LINKE, ab Januar 2012 stellv. Vors. Untersuchungsausschuss zur NSU. - MdB seit Okt. 2013.', 'Martina', '11004385');
Mitglied des Transparenzgremiums', '1968 Mittlere Reife. Ausbildung zum Einzelhandelskaufmann bei der Konsumgenossenschaft Köln eG/COOP West AG, Supermarktleiter. Besuch der Rheinischen Akademie in Köln mit Abschluss "Staatlich geprüfter Betriebswirt". Abitur auf dem zweiten Bildungsweg. Studium der Rechtswissenschaften Univ. Köln, 1988 1. und 1991 2. jur. Staatsexamen. Seit 1991 Tätigkeit als Rechtsanwalt. 1972 Eintritt in die CDU. 1975/79 Mitgl. Kreistag Rheinisch-Bergischer Kreis; 1979/99 Mitgl. des Rates der Stadt Bergisch Gladbach. 2000/06 Mitgl. im Kuratorium der Stiftung "Erinnerung, Verantwortung und Zukunft". Englisch (f), Französisch (G). - MdB seit 1994; Febr. 2000/Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, Nov. 2009/Sept. 2015 Vors. Innenausschuss.', 'Wolfgang', '11002632');
