Mitglied des Verbandsrates, ehrenamtlich
Mitglied des Vergabeausschusses', '1979/80 Hochschulreferent im AStA der WWU Münster. Journalist City Magazin, Stadtblatt Münster. 1998/01 Mitarbeiter des Grünen Bundestagsabgeordneten Christian Simmert, 2001 Büroleiter des Landtagsabgeordneten Rüdiger Sagel DIE LINKE NRW, Referent des Fraktionsvorst. der NRW-Landtagsfraktion der LINKEN. 2010/12 Landessprecher DIE LINKE. 1987/89 für die GAL im Rat der Stadt Münster; 2007 Austritt aus den Grünen, Mitgl. der Partei DIE LINKE, 2008/09 stellv. Sprecher LINKE-Kreisverband Münster. 2009/13 Mitgl. Bezirksvertretung Münster-Hiltrup.- MdB seit Okt. 2013.', 'Hubertus', '11004449');
Mitglied des Verwaltungsbeirates, ehrenamtlich', 'Abitur an der Liebfrauenschule in Oldenburg. 1971/77 Studium der Pädagogik an der Carl-von-Ossietzky-Univ. in Oldenburg, 1. und 2. Staatsprüfung für das Lehramt an Grund- und Hauptschulen, Diplompädagogin. 1975/79 Schuldienst in Niedersachsen, ab 1979 in Baden-Württemberg, zuletzt als Rektorin an der Grund- und Hauptschule mit Werkrealschule Kollnau in Waldkirch. Mitgl. der SPD seit 1976, 2005/13 stellv. Vors. der SPD Baden-Württemberg. 1989/90 Gemeinderätin in Bahlingen. Mitgl. in verschiedenen örtlichen Vereinen, u. a. beim Deutschen Roten Kreuz Kehl, im Verein "Gegen Vergessen - Für Demokratie", im Förderverein Ursulaheim Offenburg. Trägerin des "Ordine della Stella della Solidarieta Italiana". Kuratoriumsmitgl. Deutsche Stiftung Verbraucherschutz, Mitgl. Verwaltungsbeirat Zentrum für Europäischen Verbraucherschutz e. V. - MdB seit Mai 2004; verbraucherpol. Sprecherin der SPD-Fraktion; Mitgl. der Parl. Versammlung der OSZE.
