Mitglied des Verwaltungsrates', '1960/70 zehnklassige Polytechnische Oberschule. 1970/73 Beruf mit Abitur als Facharbeiter für Datenverarbeitung. 1973/75 Grundwehrdienst. 1977/83 Hochschulfernstudium in Berlin und Dresden. 1975/89 berufliche Tätigkeit in der EDV-Branche, 1990 Geschäftsführer in der Schmuckindustrie. Seit 1984 Mitgl. der CDU, 1991/01 stellv. Landesvors. der CDU Mecklenburg-Vorpommern (M-V), 2001/05 Landesvors. der CDU M-V. 1990/05 Mitgl. des Landtages M-V, Vors. der CDU-Fraktion. - MdB seit Okt. 2005; 2009/15 Beauftragter der CDU/CSU-Fraktion für die Maritime Wirtschaft, seit 2009 Vors. der CDU/CSU-Landesgruppe Mecklenburg-Vorpommern, seit Dez. 2013 Sprecher der CDU-Landesgruppen, seit Feb. 2015 haushaltspol. Sprecher der CDU/CSU-Fraktion.', 'Eckhardt', '11003826');
Mitglied des Verwaltungsrates', '1969 Ausbildung zur Keramikmalerin. Seit 1980 DGB-Gewerkschaftssekretärin, 2001/15 Vors. des DGB, Region Koblenz. Fachreferentin zu unterschiedlichen Themen der Arbeitswelt. Versichertenberaterin der Deutschen Rentenversicherung. Mitgl. der SPD seit 1972, stellv. Vors. SPD-Ortsverein Wirges. SPD-Fraktionsvors. im Stadtrat Wirges. Organisationssekretärin des DGB im nördlichen Rheinland-Pfalz, stellv. Vors. der AWO in Wirges. - MdB seit Okt. 2013.', 'Gabi', '11004438');
Mitglied des Verwaltungsrates', '1970 Abitur am Max-Planck-Gymnasium Dortmund. Studium der Volks- und Betriebswirtschaft sowie Sozialwissenschaften an der Ruhr-Univ. Bochum, 1976 1. Staatsprüfung für das Lehramt an Gymnasien, 1977 2. Staatsprüfung. Seit 1977 Lehrtätigkeit am Bergischen Kolleg in Wuppertal (2. Bildungsweg); 1982 Ernennung zum Oberstudienrat, 1998 Ernennung zum Studiendirektor und stellv. Schulleiter. Seit 1972 Mitgl. der SPD, 1981/94 Vors. Ortsverein Elberfeld-Nordstadt, 2000/12 Mitgl. im Unterbezirksvorst. 1989/02 Mitgl. im Rat der Stadt Wuppertal, 1993/99 stellv. Fraktionsvors., 1999/02 Vors. Mitgl. im Verwaltungsrat und im Haushaltskontroll- und Prüfungsausschuss der BaFin. Mitgl. GEW, AWO, Else-Lasker-Schüler-Gesellschaft, Bürgerverein Elberfelder Nordweststadt und SV Bayer. Englisch (f). - MdB seit Okt. 2002; 2005/09 stellv. Vors. Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz; stellv. Vors. der Dt.-Brasilianischen Parlamentariergruppe; seit Mai 2012 stellv. finanzpol. Sprecher der SPD-Fraktion.
Mitglied des Verwaltungsrates', '1974 Hauptschlussabschluss. Berufsgrundschuljahr für Chemie, Fachoberschulreife, Ausbildung zum Chemisch-Technischen Assistenten. Mitarbeiter in der Qualitätssicherung einer Mönchengladbacher Brauerei; währenddessen Fernstudium zum Qualitätssicherungstechniker an der Technischen Fachhochschule Berlin. Seitdem Leiter der Qualitätssicherung der Mönchengladbacher Brauerei. 1975 Eintritt in die SPD, 1976/79 stellv. Vors. der JUSOS im Kreis Viersen, 1978/82 Mitgl. des Vorst. der SPD im Ortsverein Kempen, 1981/89 Vors. der SPD in St. Hubert, 1994/02 stellv. Vors. der SPD im Kreis Viersen und seit 2002 Vors., seit 2008 stellv. Vors. der SPD Niederrhein. 1983/09 Mitglied Rat der Stadt Kempen, 1984/90 Geschäftsführer der SPD-Ratsfraktion Kempen, 1990/09 Vors. der SPD-Fraktion im Rat der Stadt Kempen. Seit 2004 Mitgl. Kreistag Viersen, 2009/Dez. 2013 Vors. der Kreistagsfraktion. - MdB seit Okt. 2013.
Mitglied des Verwaltungsrates', '1978/92 Schulbesuche in Thönse, Großburgwedel und Abingdon (England), Abitur am Gymnasium Großburgwedel. 1992/93 Wehrdienst und Ausbildung zum Reserveoffizier, derzeitiger Dienstgrad Oberstleutnant d. R. 1993/99 Studium der Rechtswissenschaften in Passau, Lausanne und Würzburg, Promotion. 1999/01 Referendariat in Hannover mit Stationen am Landgericht, der Staatsanwaltschaft und der Bezirksregierung. Wahlstation beim Bundesrat in Berlin und bei der Deutschen Botschaft in den USA (Washington D.C.). 2002/05 Angestellter bei der Allianz Versicherungs-AG (Zweigniederlassung Berlin), erst als Assistent der Geschäftsleitung, dann als Bereichsleiter, zeitgleich Rechtsanwalt. Mitgl. der CDU seit 1997 in versch. Funktionen, derzeit u. a. Vors. der CDU in der Region Hannover, Kreisvors. CDU Hannover-Land, Mitgl. Bezirksvorst. Hannover und Landesvorst. CDU Niedersachsen. 2005/13 Bürgermeister der Stadt Burgwedel. - MdB seit Okt. 2013; seit Dez. 2016 stellv. Vors. Ausschuss für Recht und Verbraucherschutz.', 'Hendrik', '11004305');
Mitglied des Verwaltungsrates', 'Abitur 1985. Grundwehrdienst bei der Bundeswehr. Studium der Betriebswirtschaftslehre Univ. des Saarlandes und Univ. Göttingen, 1992 Examen, Abschluss Dipl.-Kaufmann. Danach Tätigkeit in einer Wirtschaftsprüfungsgesellschaft. 1999 Bestellung zum Steuerberater. Seit 2000 Sozius der Kanzlei Prof. Dr. Ludewig und Sozien, Wirtschaftsprüfer und Steuerberater, Kassel, Geschäftsführer der Prof. Dr. Ludewig und Partner GmbH Wirtschaftsprüfungsgesellschaft, Kassel. Seit 2001 Geschäftsführer der EURATIO Prof. Dr. Ludewig und Quattek GmbH Wirtschaftsprüfungsgesellschaft, Göttingen. Seit 2002 Partner der Quattek und Partner Steuerberatungsgesellschaft, Göttingen. 2003 Bestellung zum Wirtschaftsprüfer. Mitgl. NDR-Rundfunkrat, Mitgl. Verwaltungsrat Institut der Wirtschaftsprüfer. Mitgl. der CDU seit 1989, 1990 Eintritt in die Junge Union; 1992/95 Vors. Stadtverband der Jungen Union Göttingen, 1995/2000 Vors. Bezirksverband Südniedersachsen-Hildesheim der Jungen Union, seit 1996 Mitgl. Landesvorst. der CDU Niedersachsen, seit 2014 stellv. Landesvors., 1999/05 Vors. CDU-Stadtverband Göttingen, seit 2009 Vors. CDU-Kreisverband Göttingen, seit 2013 Vors. des CDU-Bezirksverb. Hildesheim. 2001/14 Ratsherr der Stadt Göttingen und Vors. der CDU-Ratsfraktion. MdL Niedersachsen 2003/08 und 2010/13. Seit Nov. 2016 Mitgl. Kreistag Landkreis Göttingen. Englisch (G). - MdB seit Okt. 2013; seit April 2014 Schatzmeister und Vorstandsmitgl. der Landesgruppe Niedersachsen der CDU/CSU-Fraktion.', 'Fritz', '11004285');
Mitglied des Verwaltungsrates', 'Abitur. 1992/95 Ausbildung zum Bankkaufmann bei der Raiffeisenbank Volkmarsen eG. 1995/96 Grundwehrdienst. 1996/2000 Servicemitarbeiter bei der Raiffeisenbank Volkmarsen eG, seit 2000 Kundenberater bei der Raiffeisenbank Volkmarsen eG. 1989 Eintritt zur Jungen Union Volkmarsen, 1993 Vors. JU-Stadtverband Volkmarsen, 1994 Eintritt zur CDU Volkmarsen, seit Ende 2013 Stadtverbandsvors., 1996/98 stellv. Kreisvors. der JU Waldeck-Frankenberg, seit 2010 stellv. Vors. der CDU Waldeck-Frankenberg, seit 2015 stellv. Vors. der CDU Nordhessen, kooptiertes Mitgl. der CDU Kassel-Land, Mitgl. in den Wahlvorbereitungsausschüssen der CDU Waldeck-Frankenberg und der CDU Volkmarsen.1997/11 Fraktionsvors. der CDU Volkmarsen, seit 2011 Erster Stadtrat der Stadt Volkmarsen, stellv. Bürgermeister. - MdB seit Okt. 2013.', 'Thomas', '11004430');
Mitglied des Verwaltungsrates', 'Wehrdienst bei der Bundesmarine. Abitur am Nordseegymnasium in St. Peter-Ording. Jura-Studium, Zweites Staatsexamen. Rechtsanwalt. Justitiar und Geschäftsführer von Kieler Unternehmen. 1976 Eintritt in die JU und CDU, 1978/80 Kreisvors. der JU Nordfriesland, 1981/87 Mitgl. Bundesvorst. der JU Deutschland, 1986/92 Landesvors. der JU Schleswig-Holstein; 1991/02 stellv. Landesvors., seit 2003 Kreisvors. der CDU Kiel. 1987/09 MdL Schleswig-Holstein. - MdB seit Okt. 2013.', 'Thomas', '11004420');
