Mitglied des Vorstandes der Ortsgruppe Rehau
Mitglied des Vorstandes der Sektion Dithmarschen, ehrenamtlich', '1989/99 Auguste Viktoria-Schule, Itzehoe, Abitur; 1995/96 Stanton College Preparatory School, Jacksonville, Florida, USA. 1999/2000 Grundwehrdienst, 8./ Sanitätsregiment 6, Breitenburg. 2000/04 BWL-Studium, PFH Göttingen, Dipl.-Kfm. (FH). 2005 Konzernrevision Barilla Holding S.p.A., Düsseldorf; 2005/10 verschiedene kaufmännische Funktionen in der Energiewirtschaft. 2010/13 Assistent der Geschäftsführung der Hamburg Netz GmbH. Seit 1995 Mitgl. der Jungen Union, 2000/02 Kreisvors. der JU Steinburg; seit 2002 Vorstandsmitgl. CDU Steinburg; 2010/14 Schatzmeister; seit 2014 stellv. Kreisvors. der CDU Steinburg. 2003/05 und 2008/13 Kreistagsabgeordneter im Kreis Steinburg, u. a. Vors. des Wirtschaftsausschusses. Seit 2015 stellv. Vors. THW-Landesvereinigung Scheswig-Holstein - MdB seit Okt. 2013.', 'Mark', '11004298');
Mitglied des Vorstandes und Leiter der Arbeitsgruppe Sozialpolitik', 'Polytechnische Oberschule Erfurt-Möbisburg. 1981/83 Ausbildung zum Kfz-Mechaniker. 2001/03 Studium an der Verwaltungsakademie, Abschluss Verwaltungs-Betriebswirt (VWA). 1990/09 Gewerkschaftssekretär beim DGB, zuständig für Jugend, Handwerk, Medien und Berufliche Bildung, 2004/06 DGB-Regionsvorsitzender, 2006/09 Landesvors. des DGB Thüringen und stellv. Bezirksvors. des DGB-Bezirks Hessen-Thüringen, Mitgl. MOBIT e. V., Mitgl. Verwaltungsrat der AOK PLUS, der Versammlung der Thüringer Landesmedienanstalt (TLM), Mitgl. im Bundesvorst. der Volkssolidarität, Mitgl. ver.di, Mitgl. VVN-BdA e. V., Mitgl. Ferienpark Feuerkuppe e. V., Mitgl. Freiwillige Feuerwehr Möbisburg e. V. Englisch (G), Russisch (G). - MdB seit Okt. 2009.
