Mitglied des Vorstandes und des Geschäftsführenden Vorstandes ehrenamtlich
Mitglied des Vorstandes', '1955/63 Volksschule in Büdingen und Offenbach am Main. 1963/66 Ausbildung zum Einzelhandelskaufmann. 1971/Nov. 2012 Mitarbeiter der Fraport AG, 1975/Nov. 2010 Mitgl. des Betriebsrates, 1989/98 Leiter Bereich Sozialwesen, 2002/Mai 2010 Betriebsratsvors., 2004/12 Aufsichtsratsmitgl. und Vors. Personalausschuss. 2008 Preis "Soziale Marktwirtschaft" der Konrad-Adenauer-Stiftung. Seit 1977 Mitgl. der CDU und der CDA; 1978/01 Vorstandsmitgl. der CDU Obertshausen, 1993/01 Vors. der CDU Obertshausen, seit 2000 stellv. Kreisvors. der CDU Offenbach-Land; 1991/März 2011 stellv. Landesvors. der CDA. 1981/10 Mitgl. Stadtverordnetenversammlung der Stadt Obertshausen, 2001/10 Vorsteher der Stadtverordnetenversammlung, 1989/01 ehrenamtlicher Stadtrat. - MdB seit Okt. 2009.', 'Peter', '11004189');
Mitglied des Vorstandes', '1972 Hauptschulabschluss. Bis 1975 Kfm. Ausbildung, 2. Bildungsweg, Abitur. Studiengang Sozialwesen mit Abschluss Sozialarbeit. 15 Jahre tätig in der Behindertenhilfe im evangelischen Stift Neuerkerode, 1999/05 arbeitssuchend, Ausbildung zur Mediengestalterin. Mitgl. AG Bergen Belsen, Freiwillige Feuerwehr Kapern, IG Metall Chor Gegenwind, ver.di, VVN-BDA, Wählergemeinschaft Wolfsburger Linke; Fördermitgl. Linksjugend [´solid]. 1972/96 Mitgl. der SPD; 2002 Eintritt in die PDS, jetzt DIE LINKE, seit März 2017 Landesvors. 2006/12 Ratsfrau der Stadt Wolfsburg für die Wählergemeinschaft Wolfsburger Linke. 2008/13 MdL Niedersachsen, dort innenpol. Sprecherin. Englisch (G). - MdB seit Okt. 2013; Pflegepolitische Sprecherin der Fraktion DIE LINKE.', 'Pia', '11004454');
Mitglied des Vorstandes', '1980 Abitur am Leibniz-Gymnasium Düsseldorf. 1980/82 Studium Betriebswirtschaft Fernuniversität Hagen. 1984/95 selbstständige Unternehmerin im Bereich Transportwesen. 1995/01 Vollzeitpflege einer Familienangehörigen. 2001 Mitarbeit in der medizinischen Gesundheitsvorsorge. 2012 Verleihung des Bundesverdienstkreuzes am Bande. 1996 Eintritt in die CDU, 1998 Eintritt in die CDA, Mitgl. im Kreisvorstand der CDA Düsseldorf, 2002 stellv. und seit 2006 Vors. der Frauen Union Düsseldorf, seit 2009 Beisitzerin im Landesvorst. der Frauen Union NRW und seit 2013 Beisitzerin im Bundesvorst. der Frauen Union, seit 2004 Vors. des Ortsverbandes der CDU Düsseldorf-Rath, seit 2005 Mitgl. Kreisvorst. Düsseldorf, 2013/15 stellv. Kreisvors. CDU Düsseldorf, 2010/14 Mitgl. im Landesvorst. der CDU NRW. 2004 und 2009 Direktwahl in den Stadtrat der Landeshauptstadt Düsseldorf. - MdB seit Okt. 2013.', 'Sylvia', '11004370');
Mitglied des Vorstandes', '1980 Abitur. 1980/85 Humboldt-Univ. Berlin, 1985 Dipl.-Lehrerin. 1985/88 Forschungsstudium Humboldt-Univ., 1988 Promotion Dr. phil. Wissenschaftl. Assistentin Humboldt-Univ., Auslandsaufenthalt: 1987 Forschungssemester in den Niederlanden. 1984/90 Mitgl. der SED, seit 1990 Mitgl. der PDS, 1994/2012 Vors. des Bezirksverbandes der PDS Berlin-Lichtenberg, Mai 2010/April 2012 Vors. der Partei DIE LINKE. 1989/90 Mitgl. der BVV Lichtenberg, Mai/Dez. 1990 Mitgl. der Stadtverordnetenvers. Berlin. 1991/02 Mitgl. Abgeordnetenhaus Berlin, 1991/93 Vors. der PDS-Fraktion, bis 2002 Vors. Ausschuss für Europa. U. a. Mitgl. GEW, Bund demokratischer Wissenschaftlerinnen und der Gesellschaft für Interlinguistik. Mitgl. Stefan Heym Gesellschaft, Mitgl. Verwaltungsrat der KfW und in der Mitgliedervers. des Goethe-Instituts. - MdB seit Okt. 2002; 2005/April 2012 stellv. Fraktionsvors., seit Jan. 2014 Vors. Haushaltsausschuss.', 'Gesine', '11003584');
Mitglied des Vorstandes', '1982 Abitur an der Gustav-Heinemann-Schule in Rüsselsheim. Studium Sozialarbeit-Sozialpädagogik an der Staatlichen Fachhochschule Berlin. 1997/09 freiberufliche Berufsbetreuerin, vorher tätig im Bereich Erwachsenenbildung, offene Sozialarbeit und im Betreuungsverein des Diakonischen Werkes Wunsiedel, sozialpädagogische Familienhilfe. Seit 1999 Mitgl. von Bündnis 90/Die Grünen, 1999/13 Vorstandssprecherin im Kreisverband Hof, 2002/10 Sprecherin der Grünen im Bezirk Oberfranken. Mitgl. im Kuratorium Deutsche Altershilfe, Mitgl. Kuratorium Internationaler Bund Bayern, Mitgl. Bund Naturschutz, Schriftführerin Ortsgruppe Rehau; Mitgl. Kind & Kegel e. V., ASV Rehau und der Wasserwacht Selb. - MdB seit Okt. 2005; Sprecherin für Pflegepolitik und Altenpolitik der Fraktion Bündnis 90/Die Grünen.', 'Elisabeth', '11003835');
Mitglied des Vorstandes', '1985 Abitur am Romäusgymnasium Villingen. 1986/89 Studium der Katholischen Theologie an der Eberhard-Karls-Universität Tübingen, 1990/97 Studium der Oecotrophologie an der Justus-Liebig-Universität Gießen, 1997 Diplomabschluss. Seit 1997 Projektleitung und Öffentlichkeitsarbeit bei der Gesellschaft Kultur des Friedens. Mitgl. bei ver.di, Attac und DFG-VK. - MdB seit Okt. 2005, seit Nov. 2015 stellv. Vors. der Fraktion DIE LINKE.', 'Heike', '11003763');
Mitglied des Vorstandes', '1985 Abitur in Olpe. 1985/94 Studium Musikwiss., Kunstgesch., Film- und Fernsehwissenschaften, Journalistik, Öff. Recht in Köln, Frankfurt am Main und Mainz. 1991/09 freie Journalistin, Autorin und Redakteurin. Seit 1986 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, 2001/06 Landesvors. von BÜNDNIS 90/DIE GRÜNEN in Rheinland-Pfalz. 2004/12 Mitgl. Stadtrat Mainz. Mitgl. beim BUND, VCD, seit 2008 Mitgl. Vorst. Verein Rheinhessen gegen Rechts e. V., seit 2011 Mitgl. im Vorst. Smart City e. V., Verein Für ein lebenswertes Mainz und Rheinhessen - gegen Fluglärm und den Ausbau des Frankfurter Flughafens e.V., Mitgl. Europa-Union, ver.di und Verband alleinerziehender Mütter und Väter. Mitgl. der Parlamentsgruppe Bahnlärm. - MdB seit Okt. 2009.', 'Tabea', '11004138');
Mitglied des Vorstandes', '1987 Realschulabschluss in Stade. 1990 Ausbildungsabschluss zum Chemielaboranten in Buxtehude. 1993 Abitur über 2. Bildungsweg Wirtschaftsgymnasium (BBS Stade). 1995 Ende zweijähriger Bundeswehrdienstzeit als Reserveoffizier in Cuxhaven (Hauptmann d. R.). 2001 Erstes jur. Staatsexamen an der Univ. Hamburg, 2005 Zweites jur. Staatsexamen. Ab 2001 Assistent der Geschäftsleitung, anschl. Justiziar/Rechtsanwalt, Leitender Syndikus, Geschäftsführer in inhabergeführter, mittelständischer Unternehmensgruppe im Bereich der Umweltdienstleistungen. Aufsichtsratstätigkeiten in den Elbe Kliniken Stade-Buxtehude und der Eisenbahnen und Verkehrsbetriebe Elbe-Weser GmbH (EVB), Auszeichnung der aufgebauten Gesellschaft mit dem Deutschen Rohstoffeffizienzpreis 2011 und Auszeichnung "Ort im Land der Ideen 2012". 1987 Eintritt in die JU, Stadt-, Kreis- und Bezirksvors., 1987 Eintritt in die CDU, seit 2003 Vors. der CDU Hansestadt Stade, Mitgl. in übergeordneten parteipol. Gremien. Mitgl. im Rat der Hansestadt Stade, seit 2011 stellv. Bürgermeister der Hansestadt Stade, seit 2001 Abg. im Stader Kreistag, stellv. Fraktionsvors. und u. a. Vors. des Regionalplanungs- und Umweltausschusses. Englisch (G). - MdB seit Okt. 2013.', 'Oliver', '11004283');
Mitglied des Vorstandes', '1997/06 Franz-Haniel-Gymnasium Duisburg, Abitur. 2006/10 Heinrich-Heine-Univ. Düsseldorf Jurastudium mit Schwerpunkt "Öffentliches Recht", 2011 1. jur. Staatsexamen, 2011/Mai 2013 jur. Vorbereitungsdienst als Rechtsreferendar am Oberlandesgericht Düsseldorf; Febr./April 2007 Anwaltspraktikum, August/Sept. 2007 Verwaltungspraktikum in der SPD-Fraktion im Landtag Nordrhein-Westfalen. April/Nov. 2008 studentische Hilfskraft am Institut für Parteienrecht und Parteienforschung (PRuF), Düsseldorf, 2007/13 Mitarbeiter der SPD-Landtagsfraktion Nordrhein-Westfalen. Mitgl. Freundeskreis Historisches Homberg e. V., Vorstandsmitgl. Freundeskreis der Juristischen Fakultät zu Düsseldorf e. V., Mitgl. der Arbeiterwohlfahrt e. V. Kreisverb. Duisburg, Ortsgruppe Homberg, Vorstandsmitgl. im Deutschen Mieterbund Rhein-Ruhr e. V., Mitgl. Feuerwehrverein Duisburg-Homberg e. V., Senator der Karnevalsgemeinschaft Narrenzunft 1957 e. V., Gründungsmitgl. der Arbeitsgemeinschaft Westvereine Duisburg e. V., Mitgl. Baerler Heimat- und Bürgerverein 1988 e. V. und des MSV Duisburg. Gewerkschaftsmitgliedschaften, seit Juni 2010 Mitgl. der IG Bergbau, Chemie, Energie. - MdB seit Okt. 2013.', 'Mahmut', '11004368');
Mitglied des Vorstandes', 'Abitur in Jena. Physik-Studium in Leipzig. 2009 Jugendbildungsreferentin bei ARBEIT UND LEBEN Sachsen. Mitgl. u. a. im Erich-Zeigner-Verein, ver.di, SGK Sachsen, "Leipzig Courage zeigen" und den SJD-Die Falken. 2002 Eintritt in die SPD, 2004/09 Vors. der Jusos Leipzig, seit 2015 Generalsekretärin der SPD Sachsen, 2014/15 Beisitzerin im Landesvorstand der SPD Sachsen. - MdB seit Okt. 2009; stellv. Vors. des Kuratoriums der Bundeszentrale für politische Bildung; in der 17. WP Vors. Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; 2013/15 Vors. der Landesgruppe Ost der SPD-Fraktion, stellv. Sprecherin für Arbeit und Soziales der SPD-Fraktion.
Mitglied des Vorstandes', 'Diplom Chemie-Ingenieur, Univ. Paderborn. Umweltbeauftragter, Interner Auditor, Fachkraft für Arbeitssicherheit, Prokurist und Umweltbeauftragter der INNOVATHERM GmbH in Lünen; freiberuflicher Referent für die Concada GmbH (Abfallwirtschaft, Arbeitssicherheit). Seit 1997 Mitgl. der SPD, seit 2003 Mitgl. Vorst. SPD-Ortsverein Altlünen, seit 2005 stellv. Vors. im SPD-Ortsverein Altlünen, seit 2005 Mitgl. SPD-Stadtverbandsvorst. Lünen, 2007/09 stellv. Stadtverbandsvors. SPD Lünen, seit 2009 Stadtverbandsvors. - MdB seit Okt. 2013.', 'Michael', '11004424');
Mitglied des Vorstandes', 'Facharbeiterausbildung zum Kfz-Mechaniker. 1990 Geschäftsführer in der Gastronomie. 1990 Bürgermeister in Ebendorf (mittlerer Verwaltungsdienst). 2001/03 Wissenschaftlicher Mitarbeiter im Landtag. 2003 Verwaltungsvollzugsbeamter. Mitgl. der Freiwilligen Feuerwehr Ebendorf, des Kultur- und Geschichtsvereins, der Sportgemeinschaft Eintracht Ebendorf; Vorstandsmitgl. Verschönerungsverein Ebendorf und des OK-Barleben Wolmirstedt, Ehrenmitgl. im Schützenverein Ebendorf und dem Hundesportverein Ebendorf. Vertreter im Wolmirstedter Wasser- und Abwasserverband, Mitgl. in der Abfallentsorgungsgesellschaft, im Eigenbetrieb Straßenbau, stellv. Verbandsvors. im Technologiepark Ostfalen. 1992 Eintritt in die CDU, seit 2004 Ortsverbandsvors. der Ortsverbände Barleben, Ebendorf, Meitzendorf, sowie im Gemeinderat Barleben (Hauptausschuss); 1999 Mitgl. im Kreistag OK, 2007 Mitgl. im Kreistag Börde, Vorsitz des Umwelt- und Wirtschaftsausschusses; 2004 ehrenamtl. Ortsbürgermeister Ebendorf. Englisch (G), Russisch (G). - MdB seit Okt. 2009.', 'Manfred', '11004008');
Mitglied des Vorstandes', 'Mittlere Reife, Betonfacharbeiter, 1967 Abitur. Kein Wehrdienst. 1971 Diplomsozialpädagoge/Sozialarbeiter, 1990 Pädagogik Didaktik für Lehrtätigkeiten, 1991 Verwaltungswissenschaft Höherer Dienst. 1971/89 Heimleiter Kinder- und Jugendheim, 1990/94 Referatsleiter Erziehungshilfen Landesregierung Magdeburg, 1994/02 Beigeordneter Bildung, Kultur, Soziales, Jugend, Gesundheit Frankfurt (Oder), 2002/10 Oberbürgermeister Frankfurt (Oder). Vorstand versch. soziale und kulturelle Vereine und Verbände, Ehrenbürger der Stadt Slubice (Polen). 1989 Mitarbeit in der Bürgerbewegung Neues Forum, dann Demokratischer Aufbruch, seit 1990 Mitgl. der CDU, 1990/94 Landkreis Schönebeck, Kreisvors., Fraktionsvors. - MdB seit Okt. 2013.', 'Martin', '11004372');
Mitglied des Vorstandes', 'Mittlere Reife. Ab 1979 Biologielaborantin im Dt. Krebsforschungszentrum, Jugendvertreterin, Personalrätin. Seit 1992 Jugendbildungsreferentin im DGB Baden-Württemberg. Ab 1996 Regionsvorsitzende DGB-Mittelbaden, 2002/09 Attac-Bundesgeschäftsführerin. Seit 2009 Mitgl. der Partei DIE LINKE., seit Mai 2016 Mitgl. im Parteivorst. Mitgl. attac, ver.di, ProAsyl, VVN-BDA, BUND, Gemeingut in BürgerInnenhand (G.i.B) e. V., Institut Solidarische Moderne (ISM) e. V., Pro Bahn e. V. - MdB seit Okt. 2009; verkehrspolitische Sprecherin der Fraktion DIE LINKE. und Koordinatorin Plan B für sozialökonomischen Umbau.', 'Sabine', '11004089');
