Mitglied des Vorstandes, ehrenamtlich (bis 01.04.2014)', 'Abitur. Ausbildung als Einzelhandelskauffrau, Gemmologin und Diamantgutachterin, Unternehmerin. 1984 Eintritt in die CDU, 1994/98 Stadtrat in Höxter, 1997/99 Mitgl. im Landesvorst. der CDU NRW, seit 2009 stellv. Kreisvors. CDU Oberhausen. 1995/03 Kreisverbandsvors. der Mittelstandsvereinigung der CDU (MIT), seit 1995 im Bundesvorst. der Mittelstands- und Wirtschaftsvereinigung der CDU (MIT/WIV). Seit 2001 Vors. Bund Katholischer Unternehmer (BKU), Mitgl. Präsidium Guardini Stiftung, Mitgl. Unternehmerfrauen im Handwerk (UFH), Mitgl. Initiative Neue Soziale Marktwirtschaft (INSM), Mitgl. im Wirtschaftsrat der CDU e. V., stellv. Vors. Gesellschaft zum Studium strukturpolitischer Fragen e.V., Mitgl. der Kommission für Zeitgeschichte, Mitgl. Kolping, Kinderschutzbund, Weißer Ring, Kuratorium Don Bosco Mondo. - MdB seit 1998; seit 1998 stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, seit Nov. 2005 Vors. der AG Umwelt, Naturschutz und Reaktorsicherheit, ab 2014 zusätzl. Baupolitik, seit Jan. 2014 Umwelt- und Baupolitische Sprecherin der CDU/CSU-Fraktion.', 'Marie-Luise', '11003070');
Mitglied des Vorstandes, ehrenamtlich (bis 07.11.2015)
Mitglied des Vorstandes, ehrenamtlich (bis 10.11.2013)', 'April 1990 Abschluss Studium der Geologie mit dem akad. Grad Dipl.-Geologin, Ruhr-Univ. Bochum, Nov. 1997 Dissertation zur Erlangung des Doktorgrades an der Mathematisch-Naturwissenschaftlichen Fakultät der Christian-Albrechts-Univ. zu Kiel. 1991/03 wiss. Angestellte am Forschungszentrum GEOMAR, Kiel, Abteilung Vulkanologie und Petrologie, bis 2013 Geschäftsführerin Planungsbüros für Energietechnik. Mitgl. AWO, BUND. 2011/13 stellv. Vors. des Landesvorst. der Arbeitsgemeinschaft der Selbstständigen (AGS) Schleswig-Holstein. Seit 2009 Vors. des SPD Ortsvereins Probsteierhagen, seit 2013 stellv. Vors. der SPD im Kreis Plön, 2009/11 Mitgl. des Landesvorst. der SPD Schleswig-Holstein. 2003/13 Abgeordnete des Plöner Kreistages, umweltpol. Sprecherin der Fraktion, Vors. Natur- und Umweltstiftung Kreis Plön, 2006/13 Mitgl. Hauptausschuss. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2013; Mitgl. der Querschnitts-Arbeitsgemeinschaft Migration und Integration der SPD-Fraktion, stellv. Mitgl. Eisenbahninfrastrukturbeirat bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahn.', 'Birgit', '11004347');
Mitglied des Vorstandes, ehrenamtlich (bis 31.12.2015)', '1994/95 Wehrdienst. 1995/2000 Hochschulstudium. Kreisvors. der CDU Zwickau, Vors. Netzwerk Medien und Regulierung der CDU Deutschlands. Ehrenamtl. Stadtrat der Großen Kreisstadt Hohenstein-Ernstthal, ehrenamtl. Verbandsrat Zweckverband "Am Sachsenring", ehrenamtl. Kreisrat Landkreis Zwickau. Vors. Aufsichtsrat der SRM Sachsenring Rennstrecken Management GmbH, Mitgl. Aufsichtsrat Volksbank Mittweida eG., Mitgl. Präsidium der Filmförderungsanstalt, Vors. Distributionsausschuss des Rundfunkrats der Deutschen Welle. - MdB seit Okt. 2002; Mitgl. im Fraktionsvorst, seit Jan. 2014 Vors. der AG Kultur und Medien der CDU/CSU-Fraktion; Mitgl. Richterwahlausschuss.', 'Marco', '11003655');
Mitglied des Vorstandes, ehrenamtlich (bis Ende Oktober 2014)', 'Polytechn. Oberschule, 1977/79 Erweiterte Oberschule, Abschluss Abitur. 1979/83 Studium an der Martin-Luther-Universität Halle-Wittenberg, 1983 Diplom-Volkswirtin, 1983/85 Forschungsstudium und 1985/88 befristete Assistenz MLU, 1987 Promotion Dr. oec. 1988/89 2. Sekretär der FDJ-Kreisleitung der Martin-Luther-Universität, Delegierung, 1990/91 Aspirantur. 1981/89 Mitgl. der SED, seit 1990 Mitgl. der PDS/Die Linkspartei.PDS, 1997/02 Mitgl. PDS-Bundesvorstand. 1990/91 Mitgl. Stadtverordnetenvers. Halle/Saale und Fraktionsvors.,2004/14 Mitgl. Stadtrat Halle, 1990/05 Mitgl. Landtag von Sachsen-Anhalt und bis 2004 Fraktionsvors., Mitgl. Ältestenrat und in den Ausschüssen Kultur und Medien und Bildung und Wissenschaft. - MdB seit Okt. 2005; 2005/13 Obfrau im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung, Berichterstatterin gegenüber dem Büro für Technikfolgenabschätzung beim Dt. Bundestag, seit Okt. 2013 Obfrau im Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung; seit Okt. 2013 1. Parl. Geschäftsführerin der Fraktion DIE LINKE, Mitgl. Fraktionsvorstand, Mitgl. Ältestenrat.', 'Petra', '11003848');
Mitglied des Vorstandes, ehrenamtlich (bis März 2014)
Mitglied des Vorstandes, ehrenamtlich (bis März 2014)
Mitglied des Vorstandes, ehrenamtlich (bis November 2014)
Mitglied des Vorstandes, ehrenamtlich (bis September 2014)
Mitglied des Vorstandes, ehrenamtlich', '1954/66 Schule, Abitur. 1962/66 Ausbildung zum Facharbeiter für Rinderzucht. 1966/70 Jurastudium, Dipl.-Jurist. Seit 1971 Rechtsanwalt, seit Ende 1989 Politiker. Dez. 1989/Jan. 1993 Vors. PDS, 1990 Fraktionsvors. in der Volkskammer, Jan./Aug. 2002 Bürgermeister und Senator für Wirtschaft, Arbeit und Frauen in Berlin. Seit Dez. 2016 Vors. der Europäischen Linken. Mitgl. bei ver.di. - MdB 1990/02 und seit 2005; 1990/Okt. 2000 Fraktionsvors. der PDS, 2005/15 Fraktionsvors. Die Linke.', 'Gregor', '11000756');
Mitglied des Vorstandes, ehrenamtlich', '1959/67 POS in Leipzig, Zwenkau, Vehlefanz, 1967/71 EOS in Hennigsdorf, Abitur. Studium an der Pädagogischen Hochschule in Dresden, Abschluss 1975 als Lehrerin für Deutsch und Kunsterziehung. 1975/80 Arbeit an der EOS in Oschersleben. 1980/82 Mitarbeiterin der SED-Kreisleitung Oschersleben. 1982/86 Aspirantur für Gesellschaftswissenschaften, 1986 Promotion (Dr. phil.). 1986/89 Arbeit in der Bezirksleitung der SED in Magdeburg, zuletzt Abteilungsleiterin für Kultur. Seit 1976 Mitgl. der SED, 1990 Mitgl. der PDS, Linkspartei PDS, DIE LINKE, März 1990 Wahl zur Bezirksvors. der PDS in Magdeburg, Juli 1990/Okt. 1995 stellv. Landesvors., 1997/2005 Landesvors. der PDS, 2006/12 Mitgl. Parteivorst. der Linkspartei PDS und DIE LINKE. 1990/2006 MdL Sachsen-Anhalt, Arbeit im Ausschuss für Bildung und Wissenschaft und im Ausschuss für Kultur und Medien. 2004/14 Stadträtin in Magdeburg. Mitgl. Kuratorium der Bundeszentrale für politische Bildung, Mitgl. ver.di, Mitgl. Jugendweihe e. V. Sachsen-Anhalt, Vorstand der Rosa-Luxemburg-Stiftung Sachsen-Anhalt. Englisch (G), Russisch (G). - MdB seit 2009.', 'Rosemarie', '11004053');
Mitglied des Vorstandes, ehrenamtlich', '1964/74 POS. Berufsausbildung zur Fachverkäuferin mit Abitur 1977. 1978/84 Fernstudium Handels-Hochschule Leipzig, Dipl.-Ökonomin. 1977/90 Verwaltungsangestellte, Lehrausbilderin in der Berufsausbildung, Lehrerin für Erwachsenenbildung in der Einzelhandelsorganisation Potsdam; 1990/91 arbeitslos. 1991 Verkäuferin FILA Deutschland GmbH, 1991/92 Mitarbeiterin Bürgerberatung Brandenburg e. V. im Haus des SPD-Landesverb. 1992/2000 Mitarbeiterin in einem Bundestagsbüro; 2000/2002 Referentin für Öffentlichkeitsarbeit der SPD-Landtagsfraktion Brandenburg. 1992 Eintritt in die SPD. Vors. Verein für Demokratie, politische und kulturelle Bildung Potsdam e. V., Mitgl. AWO Potsdam, Mitgl. Vorst. Wissenschaftsforum der Sozialdemokratie Berlin, Brandenburg, Mecklenburg-Vorpommern, Mitgl. der IG Metall. Mitgl. Verein proWissen e. V., der Universitätsgesellschaft Potsdam e. V., im Verein der Freunde und Förderer des PIK e. V., im Verein Gegen Vergessen - Für Demokratie e. V., Berlin, Mitgl. Universitätsgesellschaft Potsdam e. V., Mitgl. Förderverein Begegnungshaus der Generationen Nuthetal e. V. und Mitgl. Kuratorium DLRG-Landesverb. Brandenburg e. V.- MdB seit Okt. 2002.
Mitglied des Vorstandes, ehrenamtlich', '1971/80 Quirinus-Gymnasium Neuss, Abitur 1980. 1980/87 Studium der Rechtswissenschaften an der Univ. Köln, 1987 1. jur. Staatsprüfung. 1987/93 wissenschaftl. Mitarbeiter am Seminar für Staatsphilosophie und Rechtspolitik Univ. Köln; 1991/93 Rechtsreferendariat am Landgericht Köln, 1993 2. jur. Staatsprüfung. Seit 1994 Rechtsanwalt (Zulassung ruht seit Dez. 2013). Evangelische Kirche in Deutschland (EKD): seit 1997 Mitgl. der Synode, 1997/09 Mitgl. im Rat der EKD, Vorstandsmitgl. in der Konrad-Adenauer-Stiftung, 2000/Sept. 2008 Vors. Diakonisches Werk Neuss, März 2010/Dez. 2013 Mitgl. ZDF-Fernsehrat. Seit 1977 Mitgl. CDU, 1983/89 Kreisvors. JU Neuss, 1989/94 Bundesvors. der JU Deutschlands, 2001/Nov. 2009 Vors. der CDU im Rhein-Kreis Neuss, seit Dez. 2014 Mitgl. des Bundesvorst. der CDU Deutschlands. 1984/89 und 1993/94 Mitgl. Kreistag Neuss. Englisch (f). - MdB seit 1994; 1994/98 Sprecher der Jungen Gruppe der CDU/CSU-Fraktion, 1998/05 Sprecher der CDU/CSU-Fraktion für Menschenrechte und Humanitäre Hilfe, Nov. 2005/Sept. 2008 Justitiar der CDU/CSU-Fraktion. Okt. 2008/Okt. 2009 Staatsminister bei der Bundeskanzlerin; Okt. 2009/Dez. 2013 Generalsekretär der CDU Deutschlands; seit Dez. 2013 Bundesminister für Gesundheit.', 'Hermann', '11002666');
Mitglied des Vorstandes, ehrenamtlich', '1974 Abitur am Preetzer Gymnasium. Studium Sonderschulpädagogik und Biologie Univ. Hamburg bis 1976. 1976/80 Goldschmiedelehre mit Gesellenbrief in Plön. 1983 Eintritt in die SPD, 1993/03 stellv. Kreisvors. SPD Ostholstein, seit 2003 Mitglied im SPD-Landesvorst. Schleswig-Holstein, seit März 2007 als stellv. Landesvors., Mitgl. Umweltforum. 1984/2003 Arbeit in der Kommunalpolitik, 1990/97 Fraktionsvors., 1994/97 stellv. Bürgermeisterin, 1997/2003 ehrenamtl. Bürgermeisterin, 2001/03 ehrenamtliche Amtsvorsteherin Amt Schönwalde. 2005/10 Kuratoriumsmitgl. und seit 2010 stellv. Mitgl. der Bundeszentrale für politische Bildung.Seit 2005 Mitgl. Vertrauensgremium, seit 2013/2014 Mitgl. Vorst. des Deutschen Kinderhilfswerks. Englisch (f). - MdB seit Okt. 2002; seit 2009 stellv. Sprecherin der SPD im Haushaltsausschuss und Sprecherin im Rechnungsprüfungsausschuss, seit 2014 Vors. Rechnungsprüfungsausschuss, seit 2005 stellv. Sprecherin AG Kommunalpolitik der SPD-Fraktion, seit 2008 stellv. Mitgl. Ostseeparlamentarierkonferenz.', 'Bettina', '11003545');
Mitglied des Vorstandes, ehrenamtlich', '1979 qualifiz. Hauptschulabschluss, im Anschluss Berufsfachschule mit Berufsaufbauschule Münnerstadt, 1982 Abschluss staatl. gepr. Kinderpflegerin und Mittlere Reife. Besuch des Bayernkollegs Schweinfurt, Abitur 1985. 1987/93 Medizinstudium an der Universität Würzburg, 1993 Approbation. Weiterbild. zur Praktischen Ärztin. Anerkennung der Zusatzbez. Naturheilverfahren und Akupunktur, bis 2010 Hausärztin. 1981 Eintritt in die  SPD, seit 2008 SPD-Kreisvors. im Lkr. Bad Kissingen, seit 2008 Mitgl. im Bezirksvorst. SPD Unterfranken, seit Juni 2011 Mitgl. im Landesvorstand der BayernSPD. Seit 1990 Kreisrätin im Kreistag Bad Kissingen, 2005/08 SPD-Fraktionsvorsitzende im Kreistag; seit Mai 2008 Marktgemeinderätin Markt Maßbach. Mitgliedschaften (Auswahl): AWO, Europaunion, KIDRO (Kissinger Drogenhilfe), Kreisverkehrswacht, "Gegen Vergessen - Für Demokratie" e. V., Förderverein Fränkisches Theater Maßbach. MdL Bayern 2008/13. Englisch (G), Spanisch (G). - MdB seit Okt. 2013; stellv. gesundheitspolitische Sprecherin der SPD-Fraktion, Mitgl. erweiterter Fraktionsvorst.
Mitglied des Vorstandes, ehrenamtlich', '1980/90 Besuch einer POS in Königs Wusterhausen, 1990/92 Gymnasium in Königs Wusterhausen, 1992 Abitur. Okt. 1992/März 1999 Studium der Rechtswissenschaften an der Freien Univ. Berlin, 1. jur. Staatsexamen, Anfang 2002 2. jur. Staatsprüfung. 2003;Zulassung als Rechtsanwältin in Sachsen. Rechtsanwältin in Kanzleien in Potsdam und Berlin. In der 16. WP hauptberuflich Justiziarin der Bundestagsfraktion DIE LINKE sowie nebenberuflich Rechtsanwältin. 1990 Eintritt in die PDS, 1995/99 Mitgl. des Parteivorst., 2005/07 stellv. Landesvors. der Linkspartei.PDS in Berlin, 2007/16 Mitgl. des Bundesvorst. der LINKEN, Mitgl. Parteivorst. der LINKEN, 2007/11 Vors. des Bezirksverb. Friedrichshain-Kreuzberg der LINKEN in Berlin, 2008/12 stellv. Bundesvors. der LINKEN, langjährige Mitarbeit in der Bundesschiedskommission. Mitglied u. a. bei ver.di und Rote Hilfe e. V.  - MdB seit Okt. 2009.', 'Halina', '11004185');
Mitglied des Vorstandes, ehrenamtlich', '1980/90 Polytechnische Oberschule; 1990/93 Berufsausbildung zur Industriekauffrau.
Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur am Bunsen-Gymnasium Heidelberg. 1991/96 Studium der Rechtswissenschaften an der Ruprecht-Karls-Univ. Heidelberg, 1996 Erste jur. Staatsprüfung, 1997/99 jur. Vorbereitungsdienst am Kammergericht Berlin, 1998 Promotion zum Dr. iur. an der Ruprecht-Karls-Universität Heidelberg, Stipendiat der Dt. Forschungsgemeinschaft (DFG), 1999 Zweite jur. Staatsprüfung, 1999/2000 Studium der Rechtswissenschaften an der Yale Law School, New Haven, Connecticut, USA, Stipendiat des Dt. Akademischen Austauschdienstes (DAAD), 2000 Master of Laws (LL.M.) der Yale Law School. 2000 Zulassung als Rechtsanwalt, 2006/08 Partner der intern. Anwaltssozietät Shearman & Sterling LLP, seit 2008 Vorstandsmitgl. der SZA Schilling, Zutt & Anschütz Rechtsanwalts AG, seit 2004 Lehrbeauftragter an der Ruprecht-Karls-Universität Heidelberg. Seit 2012 Vorstandsmitgl. der Wissenschaftlichen Vereinigung für Unternehmens- und Gesellschaftsrecht (VGR) e.V. Mitgl. in zahlreichen Vereinen und Organisationen. 1995/97 Kreisvors. der JU Rhein-Neckar, seit 1995 Mitgl. und seit 2011 Kreisvors. der CDU Rhein-Neckar, seit 2005 Mitgl. im Bezirksvorst. CDU Nordbaden, seit 2013 Mitgl. Landesvorst. der CDU Baden-Württemberg, seit 2009 Mitgl. CDU-Bundesausschuss, seit 2010 Mitgl. BFA Wirtschaft-, Haushalts- und Finanzpolitik der CDU Deutschlands. - MdB seit Okt. 2009; 2014/16 Obmann der CDU/CSU-Fraktion im Ausschuss für Recht und Verbraucherschutz, seit Juni 2016 stellv. Vors. der CDU/CSU-Fraktion; Mitgl. Vorst. Parlamentskreis Mittelstand.', 'Stephan', '11004049');
Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur am Europa-Gymnasium in Wörth am Rhein. 1991 Zivildienst am St.Vincentius-Krankenhaus Karlsruhe. 1992 Studium der Betriebswirtschaftslehre und Politikwissenschaft in Mannheim und Birmingham, Abschluss Magister Artium; 2002 Promotion zum Dr. rer. pol. (Universität Mannheim). 1998 Assistent des Bundestagsabgeordneten Dr. Heiner Geißler; 2002 Angestellter der BASF-AG, Bereich Umwelt, Sicherheit und Energie. 1989 Eintritt in die Junge Union, 1996 Eintritt in die CDU, 2002 Vors. CDU-Kreisverband Germersheim, seit 2007 stellv. Vors. CDU-Bezirksverb. Rheinhessen-Pfalz. Seit 1999 Mitgl. des Kreistags Germersheim. 2003/09 MdL Rheinland-Pfalz, 2006/09 Umweltpolitischer Sprecher der CDU-Landtagsfraktion. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Thomas', '11004038');
Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur. Zivildienst. 1992/98 VWL-Studium in Bamberg, Madrid und Freiburg, 2002 Promotion in Finanzwissenschaft. 1998/01 wissenschaftlicher Mitarbeiter am Walter-Eucken-Institut Freiburg, 2001/04 bei der Stiftung Marktwirtschaft Berlin, 2004/05 Projektmanager bei der Bertelsmann Stiftung in Gütersloh. Seit 1996 Mitgl. von Bündnis 90/Die Grünen, 2001/07 Sprecher der Bundesarbeitsgemeinschaft Wirtschaft und Finanzen von Bündnis 90/Die Grünen, seit Nov. 2008 Mitgl. im Parteirat von Bündnis 90/Die Grünen. Englisch (f), Französisch (f), Spanisch (f). - MdB seit Okt. 2005; Dez. 2006/Nov. 2007 Obmann der Fraktion Bündnis 90/Die Grünen im Parlamentarischen Beirat für nachhaltige Entwicklung, seit 2007 finanzpolitischer Sprecher der Fraktion Bündnis 90/Die Grünen, stellv. Vors. des Finanzausschusses, seit Juni 2011 Mitgl. parl. Finanzmarktgremium.', 'Gerhard', '11003837');
Mitglied des Vorstandes, ehrenamtlich', '1993 Abitur. 1990/91 Zivildienst in Wiesbaden bei der Arbeiterwohlfahrt. 1993/98 Studium der Politologie an der Johann Wolfgang Goethe-Univ. Frankfurt am Main; Diplom. 1994/98  Persönlicher Mitarbeiter des Vorsitzenden der SPD-Fraktion im Hessischen Landtag, Staatsminister a. D., Armin Clauss, 1998/99 Mitarbeiter der SPD-Fraktion im Hessischen Landtag, 1999/2013 Referent der SPD-Fraktion im Hessischen Landtag. 1993 Eintritt in die SPD, 1998/99 Mitarbeit Koordination und Organisation Landtagswahlkampf der hessischen SPD; 2000 Mitarbeit und versch. Funktionen in der SPD Rheingau-Taunus. 2005 und 2009 Kandidatur für den Deutschen Bundestag im Wahlkreis Rheingau-Taunus/Limburg. Landes- und Bundesdelegierter; seit 2007 Vors. SPD Rheingau-Taunus. Seit 2001 Mitgl. Kreistag Rheingau-Taunus, seit 2006 stellv. Vors. SPD-Fraktion. Seit 2014 Mitgl. AfB-Bundesvorstand und Sprecher des "Netzwerk Berlin", stellv. Vors. der "Berliner Republik". - MdB seit Okt. 2013; Mitgl. im SPD-Fraktionsvorstand.
Mitglied des Vorstandes, ehrenamtlich', '1996 Abitur; während der Schulzeit Mitarbeit im Jugendverein Roter Baum. 1996/97 Freiw. Soziales Jahr in Russland. 2003 Abschl. Magisterstudium Slawistik, Amerikanistik und Rechtswissenschaft an der TU Dresden. 1998 Eintritt in die PDS, ab 2003 stellv. Parteivors., Juni 2007/Juni 2012 stellv. Parteivors. und seit Juni 2012 Parteivors. Die Linke. 1999/03 Stadträtin in Dresden, 1999/05 Mitgl. des Sächsischen Landtages. Mitgl. ver.di. - MdB seit 2005; Nov. 2009/Juli 2012 Vors. Ausschuss für Arbeit und Soziales, seit 2005 sozialpolitische Sprecherin der Fraktion DIE LINKE.', 'Katja', '11003786');
Mitglied des Vorstandes, ehrenamtlich', '32 Jahre Bundeswehr, Stabsoffizier. 1992/2013 geschäftsführender Gesellschafter der LORENZ GmbH, seit 2013 Unternehmensberater. 1986/2016 Mitgl. Rat der Stadt Hannover, seit 1996 acht Jahre Abgeordneter der Region Hannover, fünf Jahre Vizepräsident Region Hannover. Mitgl. im Vorstand des Albert-Schweitzer Familienwerks Niedersachsen e.V., Vors. des Vahrenwalder Wirtschaftsforums e.V., Mitgl. Vorstand Haus- und Grundeigentum Hannover e. V., Mitgl. Aufsichtsrat Stadtwerke Hannover AG, Kreisvors. Volksbund Deutsche Kriegsgräberfürsorge Hannover e. V.  - MdB seit Okt. 2013.', 'Wilfried', '11004343');
Mitglied des Vorstandes, ehrenamtlich', 'Abitur, Luitpold-Gymnasium München. Wehrdienst WBK VI/1. GebDiv. Bayer. Akad. für Werbung u. Marketing, Abschl. Electronic Marketing Fachwirt (BAW). Seit 2006 berufsbegl. MBA-Studiengang. 2012/15 Dozent BAW, München. Frühere Stationen: Krauss-Maffei Wegmann, Gast Service AG, Landesgeschäftsführer JU Bayern, 2003/09 Referent CSU-Landesleitung: Landesgeschäftsführer KPV, UdV und EAK, 2008/09 stellv. Leiter Politik u. Parteiarbeit. U. a. Mitgl. Freunde und Förderer Realschule Neubiberg, Vizepräs. Interessengem. Dt. Luftwaffe e. V. (IDLw), seit 2014 stellv. Vors. Kuratorium "Soldaten und Vertrauenstiftung (SVS)", Mitgl. Krieger- und Soldatenkameradschaft Putzbrunn, Sundergauer Verein zur Pflege der bay. Kultur und Traditionen, Schützenverein Wendelstoana Putzbrunn, Salutschützen Putzbrunn, FC Bayern München, Sudetendt. Landsmannschaft, TC Putzbrunn, Ayinger Freundeskreis, Förderverein Kirche St. Aegidius Keferloh e. V. Seit 2016 Ehrensenator Univ. der Bundeswehr München, seit 2015 Mitgl. gem. Kuratorium der Max-Planck-Institute f. Astrophysik u. extraterrestrische Physik, seit 2015 Vors. Stiftung Lebenshilfe München e. V., Mitgl. Keferloher Montag e. V. und DONUM VITAE in Bayern e. V., 2008/10 stellv. Vors. Aufsichtsrat Gemeindewerk Putzbrunn GmbH, seit 2010 Mitgl. Aufsichtsrat IABG, seit 2015 Mitgl. Beirat Quantum-Systems GmbH. Seit 1992 Mitgl. CSU, 1998/03 Mitgl. Landesausschuss und Deutschlandrat der JU, 1999/06 Kreisvors. JU München-Land; seit 1997 Mitgl. CSU-Kreisvorst., seit 2004 CSU-Ortsvors., seit 2005 Mitgl. Bezirksvorst. CSU Oberbayern, seit 2013 Mitgl. Parteivorst., seit 2014 Landesvors. Arbeitskreis Außen- und Sicherheitspolitik ASP der CSU, seit 2015 CSU-Kreisvors. München-Land. 1996/10 Mitgl. Gemeinderat Putzbrunn, 2005/10 dort CSU-Fraktionsvors., 2002/08, seit 2014 Kreisrat im Landkreis München. - MdB seit Okt. 2009, seit 2013 Sprecher CSU-Landesgruppe für Auswärtiges, Verteidigung, Angelegenheiten der EU, wirtsch. Zusammenarbeit und Menschenrechte.', 'Florian', '11004048');
Mitglied des Vorstandes, ehrenamtlich', 'Deutsch-Französisches Gymnasium Freiburg. Institut dEtudes Politiques, Paris, Columbia University, New York. Tätigkeiten bei United Nations Development Fund for Women, Bertelsmann Stiftung und der Univ. Mannheim. 2010 Promotion an der Universität Mannheim zum Thema Reformfähigkeit der Vereinten Nationen. Mitgl. Grüne Jugend Baden-Württemberg, Mitgl. Landes- und Bundesvorst. Mitgl. des Europäischen Parlaments für Deutschland Juli 2009/Okt. 2013. - MdB seit Okt. 2013.', 'Franziska', '11004255');
Mitglied des Vorstandes, ehrenamtlich', 'Grundschule in Eutingen im Gäu, Abitur in Nagold. Studium der Rechtswissenschaft und Wirtschaftswissenschaft Univ. Tübingen, 2. jur. Staatsexamen 1979/80. Höherer Dienst des Landes Baden-Württemberg, zuletzt vom Landtag abgeordnet zur CDU-Landtagsfraktion als Parlamentarischer Berater bei Erwin Teufel. 1992/09 Rechtsanwalt in Nagold, seit der Berufung zum Parl. Staatssekretär ruht die Rechtsanwaltstätigkeit. Bis März 2010 Präsident der THW-Bundesvereinigung e. V. und Vorstandsvors. Stiftung THW - Technisch Helfen Weltweit, jetzt Ehrenpräsident der THW-Bundesvereinigung; Vors. Kreisverband Blasmusik Calw e. V.; Mitgl. Verein "Freunde der Bauwagen" Kreis Calw; Ehrenamtl. Vorstandsmitgl. Internationales Forum Burg Liebenzell. Mitgl. Verein "Helfende Hände" e.V., 2013 Ehrensenator Deutsch-Hellenische Wirtschaftsvereinigung, 2013 Preisträger der Akademie-Medaille der Deutsch-Griechischen Akademie. Bundesverdienstkreuz 2006. 1975/87 Stadtrat in Altensteig, mehrere Jahre 1. Bürgermeister-Stellvertreter, 1979/09 Mitgl. des Calwer Kreistages. Englisch (f). - MdB seit 1987; bis 2009 Obmann der Schriftführer und 2005/09 stellv. Vors. Rechnungsprüfungsausschuss; Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Arbeit und Soziales, ab Nov. 2011 zusätzlich Beauftragter für die Dt.-Griechische Versammlung, seit Dez. 2013 Parl. Staatssekretär beim Bundesminister für wirtschaftliche Zusammenarbeit und Entwicklung.', 'Hans-Joachim', '11000616');
Mitglied des Vorstandes, ehrenamtlich', 'Gymnasium in Bremen. 1980/83 Ausbildung zum Industriekaufmann. 1983/89 Tätigkeiten in den Bereichen Vertrieb, Controlling und Personal in der Industrie. 1989/2000 Gewerkschaftssekretär beim Vorstand der IG Metall Frankfurt; 2000/08 Gewerkschaftssekretär IG Metall Emden, seit 2008 Gewerkschaftssekretär beim DGB Ostfriesland-Nördliches Emsland. Mitgl. IG Metall, Mitgl. der SPD. Mitgl. Auto-Club Europa (ACE) und GUV, Arbeitskreis Erwerbslose (AK Elo)  Wittmund (Erwerbslosenberatung), 2012/16 Vors. Verwaltungsausschuss der Agentur für Arbeit Emden-Leer, seit 2009 2. Vors. der Verbundausbildung Ostfriesland, seit 2008 Mitgl. im Interregionalen Gewerkschaftsrat Weser-Ems-Noord-Niederlande. Bis 2015 Programmbeirat Friesischer Rundfunk, seit 2011 stellv. Mitgl. im Beirat der Innungskrankenkasse IKK classic, seit 2008 Vors. Arbeit und Leben, Aurich, Mitgl. THW Helfervereinigung, Mitgl. Förderverein Jugendfeuerwehr Kreis Leer, "Mach meinen Kumpel nicht an" für Gleichbehandlung gegen Fremdenfeindlichkeit und Rassismus e. V. und Dt. Parlamentarische Gesellschaft. - MdB seit Okt. 2013; Mitgl. Dt.-Niederländische und Dt.-Spanische Parlamentariergruppe und Mitgl. AK Binnenschifffahrt.', 'Markus', '11004371');
Mitglied des Vorstandes, ehrenamtlich', 'Gymnasium. Abgeschlossene Ausbildung zum Zahntechniker. Berater des äthiopischen Tourismusministers, Teilzeitberater bi-lateraler Fonds des BMELV, BMZ. Autor: Ein Niederbayer im Senegal - mein Leben zwischen zwei Welten. Blogger bei der Huffington Post. Mitgl. im Autorenverband PEN international, Ehrenkommissar der bayerischen Polizei, Gründer und Vorstandsvors. des Vereins Afrika Direkt e. V., Vorstandsvors. Afrika direkt e. V., Mitgl. Kuratorium Georg-Kraus-Stiftung, Mitgl. Parl. Beirat für Bevölkerung und Entwicklung der Stiftung Weltbevölkerung, Mitgl. Advisory Board des Institute for Cultural Diplomacy. - MdB seit Okt. 2013; Hauptberichterstatter Afrika im Auswärtigen Ausschuss; Mitgl. in der PV der NATO; stellv. Vors. Arbeitskreis Afrika der CDU/CSU-Faktion, Vors. der Parlamentariergruppe Englisch- und Portugiesischsprachige Staaten West- und Zentralafrikas.', 'Charles M.', '11004308');
Mitglied des Vorstandes, ehrenamtlich', 'Mitglied der CDU Essen seit 1981. 1984 Fraktionsvors. der Bezirksvertretung VI - Essen-Borbeck, seit 1989 Mitgl. Rat der Stadt Essen. Mitgl. Landschaftsverband Rheinland. Mitgl. Parteivorst. der CDU Essen sowie der CDA Christlich Demokratische Arbeitnehmerschaft Essen und der KPV Kommunalpolitischen Vereinigung Essen. Mitgl. Aufsichtsräte der Stadtwerke Essen, Mitgl. Vorstand Sozialdienst kath. Frauen Essen-Mitte e. V. und Vorstand KAB Stadtverband Essen. - MdB seit Okt. 2013.', 'Jutta', '11004265');
Mitglied des Vorstandes, ehrenamtlich', 'Realschule Oberbruch, Cusanus-Gymnasium Erkelenz. Jurastudium in Köln; Referendardienst in Aachen. Rechtsanwalt, zugleich Fachanwalt für Arbeitsrecht in Heinsberg. Zuerst Mitgl. der Jungen Union, dort Mitgl. im Vorstand Stadtverband Heinsberg und bis 2010 im Vorstand Kreisverband Heinsberg, seit 2003 Mitgl. der CDU, seit 2007 Mitgl. Stadtverbandsvorst. Heinsberg, zunächst als Beisitzer und seit 2009 als Schatzmeister. 2004/13 Mitgl. Rat der Stadt Heinsberg. - MdB seit Okt. 2013.', 'Wilfried', '11004365');
Mitglied des Vorstandes, ehrenamtlich', 'Staatliche Handelsschule, Wirtschaftsgymnasium, Abitur. Jurastudium an der Johannes-Gutenberg-Univ. Mainz, 2. Staatsexamen. Ein Jahr beim DGB und vier Jahre bei der ÖTV als Rechtssekretärin tätig; anschließend fünf Jahre bei den Technischen Werken Ludwigshafen in der Personalabteilung. Anschließend Leiterin des Sozialverwaltungsamtes der Stadtverwaltung Ludwigshafen. Mitgl. ver.di, der IG BCE, der AWO und im Arbeitsgerichtsverband, Landesvors. der Naturfreunde Rheinland-Pfalz. Mitgl. SPD seit 1971, seit 1984 im Ortsvereinsvorst. Ludwigshafen-Oggersheim, seit 1992 im Landesvorst. der SPD. Englisch (f), Französisch (G). - MdB seit 1994; in der 14. WP Vors. Ausschuss für Arbeit und Sozialordnung, in der 16. WP Vors. Unterausschuss für Regionale Wirtschaftspolitik; seit der 17. WP Leiterin dt. Delegation in der Parl. Versammlung der OSZE (OSZE PV), 2013/15 Vizepräsidentin der OSZE PV, seit 2015 Schatzmeisterin der OSZE PV.
