Mitglied des gemeinsamen Kuratoriums, ehrenamtlich', 'Katholische Volksschule in Köln-Gartenstadt Nord, Dreikönigsgymnasium Köln. 1977 Studium der Rechtswissenschaften Univ. Köln, 1. Staatsexamen. Studienjahr 1979/80 in der Schweiz an der Université de Lausanne,  1984 Referendariat am Landgericht Köln, 1985 Promotion, 1988/89 University of California, Berkeley, 1994 Habilitation. 1993/94 Friedrich-Schiller-Universität Jena, 1999/04 Professor am Centre Universitaire de Luxembourg. 2001 Gastprofessor an der Doshisha-Universität in Kyoto und an der Korea University in Seoul. Seit 2006 Gastprofessor an der Wirtschaftsuniversität Luigi Bocconi in Mailand. 1995/2000 stellv. Mitgl. Thüringer Verfassungsgerichtshof. Seit 2000 Professor für Rechtswissenschaft an der Universität Hamburg und dort Geschäftsführender Direktor des Seminars für Handels-, Schifffahrts- und Wirtschaftsrecht. Ortsvors. der CDU-Köln Sürth. - MdB seit Okt. 2013; Vors. des Stephanuskreises der CDU/CSU-Fraktion, Vorstandsmitgl. des Parlamentskreises Mittelstand der CDU/CSU-Fraktion.', 'Heribert', '11004302');
