Mitglied des wissenschaftlichen Beirates, ehrenamtlich', '1980 Abitur Sachsenwaldoberschule Reinbek. 1982/89 Studium Biologie Univ. Hamburg, 1993 Promotion. 1993/97 wiss. Mitarbeiter Univ. Hamburg, 1997/98 Kampagnenleiter Greenpeace Deutschland, Bereich Gentechnik, 1999 Gründer und Geschäftsführer Sunshine Project e. V. zur Ächtung biologischer Waffen. 2001/03  wiss. Mitarbeiter Univ. Hamburg, 2004/06 UN-Biowaffeninspektor, 2005/06 Leiter "Forschungsstelle biologische Waffen und Rüstungskontrolle" Univ. Hamburg, 2006/09 Internationaler Koordinator Greenpeace International, Amsterdam. Mitgl. VDW e. V. und IPPNW Deutschland. Seit 1977 in der Friedens-, Anti-AKW- und Gentechnikbewegung, seit 1999 Aktivist in der intern. Friedensbewegung mit Schwerpunkt Abrüstung von Massenvernichtungswaffen; bis 2007 parteilos, seit März 2007 Mitgl. der Partei DIE LINKE, 2012/14 stellv. Vors. der Partei DIE LINKE, seit Mai 2016 Mitgl. Parteivorst.. Englisch (f). - MdB seit Okt. 2009; Okt. 2009/April 2011 stellv. Vors. der Fraktion DIE LINKE.', 'Jan', '11004001');
Mitglied im Advisory Council, ehrenamtlich', 'Abitur 1989. 1989/94 Studium Rechtwissenschaft und Geschichte Univ. Köln, 1994 1. jur. Staatsprüfung; 1994/95 Studium des US-amerikanischen und internat. Rechts Temple University Philadelphia (USA), 1995 Master of Laws (LL.M.), 1997 2. jur. Staatsprüfung. 1997/02 Wiss. Mitarbeiter Institut für Staatsrecht Univ. Köln, 2002 Promotion Dr. jur. 1997/02 Dozent an der Kölner Journalistenschule. Seit 1998 Rechtsanwalt in Mönchengladbach. Seit 2004 Lehrbeauftragter für Staatsrecht, seit 2010 Honorarprofessor an der Univ. Köln. 1992/03 Bezirksvors. der JU Niederrhein; 1998/14 stellv. Bezirksvors. und seit Nov. 2014 Bezirksvors. der CDU Niederrhein, Kreisvors. der CDU Mönchengladbach, Landesvorst. CDU NRW; stellv. Landesvors. MIT NRW; Vors. Bundesarbeitskreis Christl.-Dem. Juristen. Seit 1989 Mitgl. Kulturausschuss der Stadt Mönchengladbach. Schirmherr GBS-Patienten-Initiative, Mitgl. Synode Ev. Kirchenkreis Gladbach, Mitgl. Kuratorium Haus der Geschichte Bonn, Mitgl. Verwaltungsrat Dt. Nationalbibliothek, Vors. Dt. Gesellschaft für Gesetzgebung, Mitgl. Freiwillige Feuerwehr Herrath. Englisch (f), Französisch (G). - MdB seit Okt. 2002; seit Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, seit Jan. 2017 Vors. der NRW-Landesgruppe der CDU/CSU-Fraktion. Seit Dez. 2013 Parl. Staatssekretär beim BMin. des Innern.', 'Günter', '11003574');
