Pressesprecher', 'Albert-Martmöller Gymnasium Witten, Abitur. Zivildienst beim Kreisverband Witten der Arbeiterwohlfahrt. Beginn 1975/76 Studium der Wirtschaftswissenschaften Ruhr-Univ. Bochum, 1980 Diplomexamen. Ko-Autor eines Gutachtens für die Kommission der Europäischen Gemeinschaften zum Thema "Teilzeitschichtarbeit" in verschiedenen europäischen Ländern im Rahmen der Forschungsgruppe "Arbeit und Gesundheit", Dortmund. Diverse Tätigkeiten für das "Innovations- und Technologietransferzentrum der Universitäten des Ruhrgebiets" (ITZ) zu Arbeitsmarktproblemen im Ruhrgebiet. 1981 Hospitanz beim Deutschlandfunk, 1981/82 Volontariat beim Deutschlandfunk, anschließend freier Journalist. 1984 Redakteur und Moderator beim Westdeutschen Fernsehen, Landesstudio Dortmund, 1987 Wechsel ins Landesstudio Düsseldorf, Aufbau des Politikmagazins Westpol, 1995/04 Leiter der Redaktion Landespolitik, WDR-Fernsehen. 2004 Reportage-Sendung "hier und heute", zuletzt Redaktionsleiter. Seit 2010 Pressesprecher der SPD-Landtagsfraktion NRW. 1972/81 und seit 1987 Mitgl. der SPD, Mitgl. Unterbezirksvorst. der SPD Ennepe-Ruhr. Mitgl. ver.di. - MdB seit Okt. 2013.', 'Ralf', '11004321');
