Präsident', '1970/79 Goethe-Gymnasium Karlsruhe. 1979/85 Jurastudium, 1986 erstes Staatsexamen, 1986/89 Rechtsreferendar, 1989 zweites Staatsexamen. 1989/91 Staatsanwalt in Baden-Baden, 1991/2000 Richter am Landgericht Karlsruhe; 2000 Referent der CDU/CSU-Bundestagsfraktion im 1. Untersuchungsausschuss "Parteispenden". 2001 Oberlandesgericht Karlsruhe (abgeordnet), seit Okt. 2002 Vorsitzender Richter am Landgericht a. D. Seit 2010 Präsident des Karlsruher Sportclub e. V. (KSC), seit 2013 Mitgl. Vorst. des Dt. Fußball-Bundes e. V. (DFB), seit 2002 Vorstandsmitgl. Landesvereinigung Baden in Europa e. V. und Kuratoriumsmitgl. im Internationalen Bund - Freier Träger der Jugend-, Sozial- und Bildungsarbeit e. V., 2006/11 Mitgl. im Kuratorium der Stiftung "Erinnerung, Verantwortung und Zukunft"; seit 2007 Mitgl. im Kuratorium der Bundeszentrale für politische Bildung, seit 2008 Vors. Karlsruher Kindertisch e. V. Seit 2002 Kreisvors. der CDU Karlsruhe. 1999/13 Stadtrat in Karlsruhe. - MdB seit Okt. 2002.', 'Ingo', '11003658');
Präsident', '1980/84 Grundschule in Neuötting, 1984/93 König-Karlmann-Gymnasium Altötting, allg. Hochschulreife. 1993/97 Studium der Rechtswissenschaft Ludwig-Maximilians-Univ. München, 1997 1. jur. Staatsexamen, 2000 2. jur. Staatsexamen. Seit Sept. 2000 Rechtsanwalt, derzeit  in einer Anwaltskanzlei in München, Schwerpunkte Wirtschafts- und Verwaltungsrecht.1994/03 JU-Kreisvors., seit April 1997 stellv. Vors. CSU-Kreisverb. Altötting, seit Juli 1997 Beisitzer in der CSU-Bezirksvorstandschaft Oberbayern, seit 1997 Mitgl. des CSU-Bezirksvorst. Oberbayern, seit 2009 Mitgl. des CSU-Parteivorst.. Seit Mai 1996 Stadtrat in Neuötting und Kreisrat im Landkreis Altötting, seit 2002 stellv. Fraktionsvors. der CSU-Kreistagsfraktion Altötting. 1998/02 Jugendreferent der Stadt Neuötting. Nov. 2007/Okt. 2010 Landesvors. THW Bayern, seit April 2008 Mitgl. Präsidium Bund der Vertriebenen. 2000/03 Abteilungsleiter der Tennisabteilung TSV Neuötting e. V., seit März 2010 Präsident THW-Bundesvereinigung e. V. Englisch (f), Französisch (G), Italienisch (G). - MdB seit Okt. 2002; seit Jan. 2014 Vors. der AG Innen der CDU/CSU-Fraktion.', 'Stephan', '11003589');
Präsident', '1983 Abitur Brukenthalgym. Hermannstadt. 1985/88 Studium Sozialverwaltung Bay. BFH, Dipl.-Verwaltungswirt; 1989/91 Studium Politikwiss., Hochschule für Politik (HFP), Abschlusszertifikat; 1991/95 Studium Rechtswiss., LMU München, 1997 2. Staatsexamen; Promotion Dr. iur. (2000/03 Kooperationspromotion ULBS Hermannstadt und Eberhard-Karls-Univ. Tübingen). 1985/91 Beamter Bay. Staatsmin. für Arbeit, Sozialordnung, Familie und Frauen, Landesversicherungsanstalt (LVA) Oberbayern, 1991/97 Rentenberater/Prozessagent (Zulassung: Bay. Landessozialgericht); seit 1997 Rechtsanwalt; 1997/05 Lehrbeauftragter für Prozessrecht FHSV Meißen, seit 2003 Prof. Univ. Asoc. Europa-Universität ROGER und ULBS Hermannstadt. Präs. Bund der Vertriebenen (BdV), Präsident Verband der Siebenbürger Sachsen in Deutschland e. V., Präs. Föderation der Siebenbürger Sachsen in aller Welt, Mitgl. Sudentendeutscher Rat e. V., Vizepräs. Stiftung Bavaria-Romania für Soziale Assistenz, Vorstandsmitgl. Deutsch-Rumänisches-Forum. 2011 Träger der Europa-Medaille der Bayrischen Staatsregierung, 2011 Träger des Nationalen Verdienstordens Rumäniens. Seit 2003 Mitgl. der CSU, Mitgl. CSU-Parteivorst., stellv. Landesvors. Union der Vertriebenen und Aussiedler (UdV), Mitgl. Bundesvorst. Ost- und Mitteldeutsche Vereinigung der CDU/CSU - Union der Vertriebenen und Flüchtlinge (OMV). - MdB seit Okt. 2013; 1. stellv. Vors. der Gruppe der Vertriebenen, Aussiedler und dt. Minderheiten, stellv. Vors. Dt.-Rumänische PG; stellv. Mitgl. der PV des Europarats (PVER), dort 1. stellv. Vors. im Ausschuss für Recht und Menschenrechte und UA für Minderheitenrechte, stellv. Mitgl. der Interparl. Union (IPU), dort ord. Mitglied Ausschuss Menschenrechte von Parlamentariern; Vertreter des BT im Kuratorium der Bundesstiftung Magnus Hirschfeld; Mitgl. in der MV des Goethe-Instituts e.V. und Kuratorium Dt. Inst. für Menschenrechte (DIMR).', 'Bernd', '11004268');
Präsident', 'Bezirksvorstandsmitgl. der CDU Nordbaden. Vors. Volksbund Deutsche Kriegsgräberfürsorge e. V., Bezirksverb. Nordbaden. Hauptmann d. R., Präs. der Weltliga für Freiheit und Demokratie Deutschland, Vizepräs. der European Security and Defense Assiciation (ESDA), Paris. - MdB seit 1998.', 'Axel E.', '11003118');
