Präsident, ehrenamtlich', '1966/80 Grundschule, Gymnasium Marktbreit. 1980/81 Grundwehrdienst Heeresflieger Niederstetten. 1981/84 Lehre als Augenoptiker, Gesellenbrief. 1984/89 Studium Rechtswissenschaft Univ. Würzburg, 1. jur. Staatsexamen, 1990/93 Referendariat, 2. jur. Staatsexamen. 1990/06 Erster Bürgermeister der Gemeinde Gaukönigshofen. 1993 Zulassung als Rechtsanwalt. 1980 Gründungsmitgl. JU Gaukönigshofen, stellv. Kreisvors. JU Würzburg-Land; Mitgl. Kommunalpol. Vereinigung der CSU; Mitgl. CSA; stellv. Ortsvors. CSU Gaukönigshofen, Mitgl. im Kreis- und Bezirksvorstand der CSU. Seit 1996 Kreisrat, 2002/05 stellv. Landrat. 1. Vors. Förderverein Wärmestube e. V.; Mitgl. Nordbay. Musikbund, seit 2016 Präsident Bundesvereinigung Deutscher Musikverbände (BDMV) e. V. Englisch (f), Französisch (G). - MdB seit Okt. 2005; März 2009/Jan. 2014 stellv. Vors. AG Arbeit und Soziales der CDU/CSU-Fraktion, stellv. Vors. der Arbeitnehmergruppe; stellv. Vors. dt.-südasiatische Parlamentariergruppe; seit Jan. 2014 Vors. Ausschuss für Familie, Senioren, Frauen und Jugend.', 'Paul', '11003799');
Präsident, ehrenamtlich', '1973 Burggymnasium Friedberg, 1980 Abitur. Studium der Rechtswissenschaften an der Justus-Liebig-Univ. Gießen, 1. und 2. jur. Staatsexamen. 1980/81 Grundwehrdienst, W 15. 1991 Rechtsanwalt, 1991 Regierungsrat, Bundesministerium der Verteidigung, Rechtsdozent, Rechtsberater und Wehrdisziplinaranwalt; 1994 Oberregierungsrat, wiss. Mitarbeiter am Bundesverwaltungsgericht, 1996 Regierungsdirektor, Hessischer Rechnungshof, Prüfungsgruppenleiter und persönlicher Referent des Präsidenten.  1998 Bürgermeister von Butzbach, 2006 Erster Kreisbeigeordneter des Wetteraukreises. Mitgl. in zahlreichen Gesellschaften und Vereinen. Seit 1985 Mitgl. der CDU. Seit 2010 Leiter einer Generalstabsabteilung einer Division des Deutschen Heeres, Oberst der Reserve, seit Nov. 2015 Stellvertreter des Präsidenten des Verbandes der Reservisten der Dt. Bundeswehr e. V., seit August 2016 Präsident. Seit 2012 Kreisvors. Kommunalpolitische Vereinigung CDU Wetterau. - MdB seit Okt. 2013.', 'Oswin', '11004428');
