Rechtsanwälte Lindholz GbR, Goldbach', '1991 Abitur am Hanns-Seidel-Gymnasium Hösbach. 1991/94 Studium der Rechtswissenschaften Johann-Wolfgang-Goethe Univ. Frankfurt und 1994/95 Julius-Maximilian-Universität Würzburg, 1. jur. Staatsexamen 1995, Referendariat am Landgericht Aschaffenburg und am Verwaltungsgericht Würzburg, 2. jur. Staatsexamen 1999. Seit 2000 selbstständige Rechtsanwältin in Aschaffenburg mit den Schwerpunkten Familienrecht und Erbrecht, seit 2007 Fachanwältin für Familienrecht. Mitgl. der Jungen Union und der CSU, 1999/03 Vors. der JU Goldbach-Hösbach, seit 1998 Mitgl. im CSU-Ortsverband Goldbach, seit 2001 stellv. Ortsvors. CSU-Ortsverband Goldbach, 1999/05 Mitgl. im CSU-Kreisvorst. Aschaffenburg-Land, seit 2005 stellv. CSU-Kreisvors. Aschaffenburg-Land, seit 2011 Schriftführerin des CSU-Bezirksvorst.; Mitgl. der Frauen Union, 2009/11 Mitgl. im Landesvorstand der Frauen Union. 2002/14 Gemeinderätin in Goldbach, Kreisrätin im Landkreis Aschaffenburg seit 2002, Mai 2008/April 2014 erste Stellv. des Landrats. Englisch (G). - MdB seit Okt. 2013.', 'Andrea', '11004342');
