Rechtsanwältin (bis 30.11.2013)', '1978 Abitur an der Otto-Hahn-Schule in Hanau. 1978/80 Studium der Germanistik und Philosophie Goethe-Univ. Frankfurt/Main. 1980/83 Ausbildung zur Krankenschwester am Stadtkrankenhaus Hanau (Examen). 1983/84 Krankenschwester im Stadtkrankenhaus Hanau, 1984/85 Gemeindeschwester beim Caritas-Verband Frankfurt. 1985/91 Studium der Rechtswissenschaften Goethe-Univ. Frankfurt/Main, 1. jur. Stattsexamen, 1992/95 Referendariat beim Landgericht Hanau, 2. jur. Staatsexamen. Seit 1995 eigene Kanzlei mit Ehemann Thomas Runkel, Schwerpunkt Familienrecht (Betreuungsrecht, Sozialrecht, Sorgerecht). 1979/81 Gründungsmitglied bei "Die Grünen". Mitgl. der SPD seit 1997, 2000/05 Vors. Ortsverein Flörsbachtal, 2006/08, 2010/12 und seit Mai 2014 Mitgl. Unterbezirksvorst. der SPD Main-Kinzig, Mitgl. im Landesvorst. der SPD Hessen seit Dez. 2013. Beigeordnete und regelmäßige Vertreterin des Bürgermeisters 2001/06, Fraktionsvors. der SPD/BB-Fraktion im Gemeindeparlament 2006/09. Mitgl. Kreistag Main-Kinzig-Kreis seit 2006, Mitgl. im SPD-Fraktionsvorst. Kreis des Main-Kinzig-Kreises. - MdB seit Okt. 2013.
