Rechtsanwältin, selbständig, Viernheim', '1984 Abitur in Viernheim. 1984 Studium der Rechtswissenschaften in Mannheim und Mainz, 1. und 2. jur. Staatsexamen. 1992 Aufbaustudium an der Verwaltungshochschule in Speyer, Abschluss Magister der Verwaltungswissenschaften. 1992 Lehrauftrag an der Berufsakademie Mannheim für Zivil- und Wirtschaftsrecht. Vorträge in der Erwachsenenbildung. Seit 1995 selbstständige Rechtsanwältin in Viernheim. Seit 1982 Mitgl. der SPD, stellv. Vors. SPD Hessen-Süd und Vorstandsmitgl. SPD-Landesverb. Hessen, seit 2007 SPD-Unterbezirksvors. Kreis Bergstraße, Mitgl. SPD-Parteikonvent. 1985/10 Stadtverordnete Stadt Viernheim, 1989/97 Kreistagsabg. Kreis Bergstraße. Mitgl. AWO, VdK, Verein Bürger und Polizei e. V., Gründungsmitgl. Frauenhaus Verein Bergstraße e. V., 2010 Vizepräsidentin THW-Helfervereinigung. - MdB seit 1998; April 2011/Dez. 2013 stellv. Vors. und seit Dez. 2013 1. Parl. Geschäftsführerin der SPD-Fraktion; Mitgl. Vermittlungsausschuss und gemeinsamer Ausschuss.', 'Christine', '11003167');
