Stellv. Vorsitzende der deutschen Gruppe, ehrenamtlich', '1959/62 Volksschule Döhren, 1972 Abitur am Aufbaugymnasium Petershagen. 1972/73 Auslandsaufenthalt im Kibbutz Bror Chail. Studium der Politischen Wissenschaften und Anglistik in Hannover, 1978 Erstes, 1980 Zweites Staatsexamen. Studienrätin Lutherschule bis 1987. 1990/98 Mitgl. Kuratorium Ökoinstitut, Mitgl. AWO. 1994/98 Mitgl. Kuratorium Fraunhofer-Gesellschaft, 1995/98 Mitgl. Kuratorium und seit 2014 Ehrensenatorin der Arbeitsgemeinschaft industrieller Forschungseinrichtungen (AiF) "Otto von Guericke", 1999/09 Kuratorium der Volkswagenstiftung, stellv. Vors. Kuratorium der Deutschen Telekom Stiftung, Mitgl. Kuratorium des DIW Berlin, 1999/09 Senatorin der Stiftung Niedersachsen, Vorsitzende der Gesellschaft für Denkmalpflege Niedersachsen, Mitgl. Stiftungsrat der Berghof Stiftung für Konfliktforschung, stellv. Vors. Atlantik-Brücke, Schirmherrin der Linden-Limmer-Stiftung, Hannover, seit 2016 Mitgl. Kuratorium Humboldt-Univ. Berlin. Mitgl. der SPD seit 1969, Mitgl. Parteivorst. der SPD 1993/2011, Landesvors. der SPD Niedersachen 1998/03, 1995/2011 Vors. Wissenschaftsforum der Sozialdemokratie. - MdB seit 1987; 1987/90 stellv. Vors. Enquete-Kommission Technikfolgenabschätzung, 1990/94 stellv. Vors. Ausschuss Forschung und Technologie, 1994/96 Vors. Ausschuss für Bildung, Wissenschaft, Forschung, Technologie und Technikfolgenabschätzung; 1996/98 Sprecherin für Bildung und Forschung der SPD-Fraktion; 1998/bis Okt. 05 Bundesministerin für Bildung und Forschung; 2005/09 Vors. Ausschuss für Wirtschaft und Technologie, 2011/13 Sprecherin SPD-Fraktion in der Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; seit 22. Okt. 2013 Vizepräsidentin des Bundestages.', 'Edelgard', '11000305');
