Stellv. Vorsitzende, ehrenamtlich', '1986 Abitur an der Rudolf-Hildebrandt-Oberschule in Markkleeberg. 1986/90 Studium der Ökonomie des Binnenhandels an der Handelshochschule Leipzig. 1990/96 Bäckerin im elterlichen Betrieb, dazu Ausbildung zur Bäckerin 1991/93. 1996/98 Aufbaustudium Betriebswirtschaft und Weiterbildung zur Betriebswirtin. 1998/04 Mitarbeiterin beim "ZeitPunkt-Kulturmagazin" Leipzig. Seit 1993 Mitgl. von BÜNDNIS 90/DIE GRÜNEN. 1997/98 Mitgl. im Landesvorst. Sachsen; Direktkandidatin Bundestag 1998, 2002, 2005, 2009 und 2013. 1994/99 Stadträtin von Markkleeberg. Stellv. Vors. Netzwerk für Demokratie und Courage, Terre des Femmes e. V., Fördermitgl. Netzwerk Demokratische Kultur e. V. und Fördermitgl. Aktion Zivilcourage Pirna e. V., Fördermitgl. Landesfrauenrat Sachsen e. V. - MdB seit Dez. 2004.', 'Monika', '11003714');
