Stellv. Vorsitzender des Aufsichtsrates, von Amts wegen', '1991 Abitur, Wolfgang-Borchert-Gymnasium in Halstenbek. Juni 1991/Sept. 1992 Wehrdienst, Soldat auf Zeit bei der Luftwaffe. 1992/97 Studium der Rechtswissenschaften Univ. Hamburg, 1. jur. Staatsprüfung, 1998/99 Studium Univ. of Stellenbosch/Südafrika, Dez. 1998 Abschluss Master of Laws, Juli 2000 Dr. der Rechtswissenschaften; 1999/Okt. 2001 Referendariat und 2. jur. Staatsprüfung, seit 2001 tätig als Rechtsanwalt. Seit 2005 Kreisvors. CDU Pinneberg, seit 2002 Mitgl. Landesvorst. CDU Schleswig-Holstein. 1994/98 Gemeinderatsmitgl. in Rellingen. Mitgl. Deutsch-Südafrikanische Juristenvereinigung e. V. - MdB seit Okt. 2002; seit Okt. 2007 Vors. der CDU-Landesgruppe Schleswig-Holstein; seit Okt. 2009 Parl. Staatssekretär beim Bundesminister des Innern.', 'Ole', '11003628');
