Stellv. Vorsitzender des Beirates für Europa, ehrenamtlich', 'Kaufmännische Lehre. 1985 Abitur am Abendgymnasium. Anschließend Studium an der Sozialakademie in Dortmund. Arbeit im Handel und anschl. in der Bundeswehrverwaltung. Seit April 1987 Sekretär im Deutschen Gewerkschaftsbund. Engagement in den DGB-Kreisen Hamburg, Hildesheim und Oldenburg, seit Nov. 1991 gewerkschaftliche Arbeit in der Region Südostniedersachsen, Betreuung der Landkreise Gifhorn und Helmstedt von Wolfsburg aus, 10-jährige Tätigkeit als DGB-Kreisvors., seit 2007 Vors. der DGB-Region Süd Ost Niedersachsen. 1979 Eintritt in die SPD, stellv. Vors. des SPD-Unterbezirks Helmstedt. - MdB seit Okt. 2009; stellv Vors. Ausschuss für Angelegenheiten der Europäischen Union, stellv. Vors. der Deutsch-Zyprischen Parlamentariergruppe, stellv. Leiter der deutschen Delegation der PV-UfM.', 'Heinz-Joachim', '11004005');
Stellv. Vorsitzender des Beirates für Verkehr, Bau und Stadtentwicklung, ehrenamtlich', '1996 Abitur am Max-Planck-Gymnasium Saarlouis. Nebenberuflich Studium Politik- und Verwaltungswissenschaft. 2003 Mitgl. Sprecherrat und Mitbegründer Bürgerinitiative gegen die Müllverbrennung im Kraftwerk Ensdorf, 2007 Mitbegründer und Mitgl. Bürgerinitiative "Bürger für Klima- und Umweltschutz e. V." gegen ein Kohlegroßkraftwerk in Ensdorf, seit 2004 Mitgl. im erweiterten Vorst. Jugend- und Kommunikationszentrum SBS (Alter Betriebshof) Saarlouis. Seit 1994 Mitgl. der Grünen, 2000/02 Landesgeschäftsführer der Saar-Grünen, 2002/04 hauptamtl. Politischer Geschäftsführer der Saar-Grünen und Mitgl. im geschäftsf. Landesvorst., 2002 und 2005 Wahlkampfleiter der saarländischen Grünen im Bundestagswahlkampf, Okt. 2004/Sept. 2009 Fraktionsgeschäftsführer der Grünen-Fraktion im Landtag des Saarlandes, seit Okt. 2004 auch ehrenamtl. Generalsekretär der Saar-Grünen und Mitgl. im geschäftsführenden Landesvorst. 2000/09 Mitgl. Rat der Gemeinde Bous, stellv. Fraktionsvors. - MdB seit Okt. 2009; tourismuspol. Sprecher der Fraktion Bündnis 90/Die Grünen, seit 2013 auch Sprecher für ländliche Räume der Fraktion Bündnis 90/Die Grünen.', 'Markus', '11004178');
