Stellv. Vorsitzender, ehrenamtlich', '1971/81 Besuch der Allgemeinbildenden Oberschule. 1981/83 Ausbildung zum Lokomotivführer. Seit 1983 Lokomotivführer (Diesel- und E-Traktion), berufsbegl. Weiterbildung zum Ausbilder, Prüfer und Kontrolleur für Lokomotiv- und Triebfahrzeugführer der Deutschen Bahn AG. Ab 2002 Teamleiter "Fahrzeuge und Personal" bei der Erzgebirgsbahn in Chemnitz, seit 2009 Teamleiter "Disposition, Security und Qualität" bei der Erzgebirgsbahn in Chemnitz. Seit 1990 Mitgl. der SPD, Vorstandsmitgl. und stellv. Vors. SPD-Unterbezirk Chemnitz. Ortschaftsrat Chemnitz-Klaffenbach, stellv. Ortsvorsteher in Chemnitz-Klaffenbach, seit 1994 Stadtrat in Chemnitz, dort 1999/05 und seit 2014 Vors. der SPD-Fraktion und Mitgl. im Planungs-, Bau- und Umweltausschuss und im Kultur- und Sportausschuss. 2005/14 Präsident Basketballvereinigung Chemnitz 99 e. V. - Die "NINERS". - MdB 2005/09 und seit Dez. 2014.
Stellv. Vorsitzender, ehrenamtlich', '1992/95 Ausbildung zum Bankkaufmann. 1995/99 Studium der Rechtswissenschaft. Seit Juli 2002 Rechtsanwalt (Tätigkeit ruht seit Dez. 2013). Mitgl. bei amnesty international, Arbeiterwohlfahrt, ver.di, Bund Naturschutz und im Sozialverband VdK; Rundfunkrat des Bayer. Rundfunks (KdÖR). Mitgl. der Friedrich-Ebert-Stiftung, München, Vors. des Stiftungsrates Humboldt-Forum im Berliner Schloss. Mitgl. der SPD seit 1989, div. Funktionen bei der SPD und bei den Jungsozialisten/-innen, seit 2004 Vors. des SPD-Unterbez. Rottal-Inn, 1999/04 Landesvors. der Jungsozialisten, 2009/17 SPD-Landesvors. Bayern, seit 2007 Mitgl. SPD-Parteivorst., seit 2009 Mitgl. im Präsidium der SPD. Seit 1996 Kreisrat in Deggendorf. - MdB seit Okt. 2002; 2006/10 Vors. der bayer. Landesgruppe der SPD-Fraktion, Okt. 2009/Dez. 2013 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Florian', '11003612');
