Uwe Beckmeyer GmbH, Bremerhaven (in Auflösung)', '1955/68 Schulbesuch in Bremerhaven, 1968 Abitur am Wirtschaftsgymnasium. 1968/70 Studium der Erziehungswissenschaften, 1. und 2. Staatsexamen. 1970/75 Schuldienst beim Magistrat der Stadt Bremerhaven als Mathematik- und Physiklehrer. Seit 1969 Mitgl. der SPD, 1977/87 Vors. des Vorstandes des SPD-Unterbez. Bremerhaven, 2006/10 Landesvors. der SPD Bremen. 1975/87 und 1999/02 Abgeordneter der Bremischen Bürgerschaft, 1987/99 Mitgl. Senat der Freien Hansestadt Bremen. 1991/99 Mitgl. Bundesrat, Vors. Ausschuss für Verkehr. Seit 2006 stellv. und 2009/10 Vors. des Eisenbahninfrastrukturbeirates bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, sowie 2006/13 Mitglied des Beirates der DFS Deutsche Flugsicherung GmbH. Mitgl. der GEW, seit 1985 Vors. Deutsch-Isländische Gesellschaft Bremerhaven/Bremen e. V., Mitgl. Ostasiatischer Verein Bremen e. V., des Nautischen Vereins zu Bremerhaven e. V., des Wirtschaftsrates Bremen-Nord, der Männer vom Morgenstern e. V. und des Vereins zur Förderung der Hochschule Bremerhaven e. V.  Englisch (f). - MdB seit Okt. 2002; Okt. 2004/Okt. 2011 Vors. der AG Verkehr, Bau- und Wohnungswesen, jetzt Verkehr und digitale Infrastruktur, bis Okt. 2011 verkehrspol. Sprecher der SPD-Fraktion, 2005/09 Mitgl. Fraktionsvorstand, 2009/13 Lotse der Küstengang und 2011/13 Maritimer Koordinator der SPD-Fraktion. Dez. 2013/Jan. 2017 Parl. Staatssekretär beim BMin. für Wirtschaft und Energie und seit Jan. 2017 bei der BMin. für Wirtschaft und Energie, seit Jan. 2014 Koordinator der BReg. für die maritime Wirtschaft, seit Juli 2014 Sonderbeauftragter der BReg für die EITI-Umsetzung in Deutschland.', 'Uwe', '11003498');
