Vizepräsident', '1959 Grundschule, 1963 Gymnasium. 1968 Ausbildung im öffentl. Dienst, Berufsschule und Studieninstitut/FH, 1981/82 Weiterbildung an der Ruhr-Universität Bochum. 1968 Stadtverwaltung Frankfurt/Main, 1972 Stadtverwaltung Bochum. 1983/84 Leiter Europawahlbüro im SPD-Parteivorst. bei Willy Brandt, 1984/94 Leiter Europabüro im SPD-Bezirk Westliches Westfalen. 1999/2001 Akademieleiter einer Europäischen Heimvolkshochschule, seit 2002 Generalsekretär (z. Z. beurlaubt) und seit 2003 Vizepräsident Europäische Bewegung Deutschland. Lehrauftrag an der TH Georg Agricola zu Bochum. Seit 1969 Mitgl. SPD, seit 1970 versch. Parteiämter, seit 1976 Vors. SPD-Ortsverein Querenburg, seit 2001 Mitgl. SPD-Parteirat bzw. -konvent, seit 2000 Mitgl. SPD-Vorst. Westliches Westfalen/LV-NRW. Seit 1995 OSZE-Wahlbeobachter. Mitgl. ver.di, IG BCE, VDK, Heinz-Kühn-BW., Naturfreunde, AWO, ASB, THW, FES, IEP, Städtepartnerschaft, VfL Bochum sowie Kultur-, Karnevals- und Sport-Clubs. 1994/99 MdEP. Englisch (f), Französisch (G). - MdB seit Okt. 2002; 2005/10 Sprecher der AG Angelegenheiten der Europäischen Union, 2009/15 Vors. der Landesgruppe NRW der SPD-Fraktion, seit Sept. 2010 stellv. Vors. der SPD-Fraktion.', 'Axel', '11003624');
Vizepräsident', '1996 Abitur am Willibald-Gymnasium Eichstätt. 1996/97 Grundwehrdienst bei der Luftwaffe in Manching-Oberstimm. 1997/03 Universität Karlsruhe (TH), Abschluss als Dipl.-Wirtschaftsingenieur; 2001/03 Institut National Polytechnique de Grenoble, Abschluss als Ingénieur en génie industriel, 2007 Technische Universität München, Promotion zum Dr. rer. nat. am Lehrstuhl für Internetbasierte Geschäftssysteme, Fakultät für Informatik. 2003/06 BMW AG, München, 2007/08 Mitgl. der Geschäftsführung bei Erhard Brandl Dipl.-Ing., Eitensheim, Jan./Sept. 2009 Unternehmensberater bei The Boston Consulting Group GmbH, München. Seit 1993 verschiedene Ämter in JU und CSU. Englisch (f), Französisch (f). - MdB seit Okt. 2009.', 'Reinhard', '11004018');
Vizepräsident', 'Realschule, Kaufmännische Schulen Rheine, Fachoberschulreife. Bürokaufmann. Wehrdienst als Stabsdienstsoldat im D/NL Korps in Münster (9 Monate). 1997/98 Chivasso B.V., Hessisch Oldendorf, 1999/2000 Berendsohn AG, Hamburg, 2000/02 Flexarbeit GmbH, Duisburg. Seit 2002 Jobcenter Kreis Steinfurt AöR, Rheine, Arbeitsvermittler im Bereich von Aufgaben nach dem SGB II. Mitgl. ver.di, AWO, IG BCE, Europa Union, Kreisportbund, Turn- und Sportverein St. Arnold, Euregio. Seit 1986 Mitgl. der SPD, Vors. der SPD im Kreis Steinfurt. Stellv. Landrat des Kreises Steinfurt. Vizepräsident der Euregio, Vors. der SPD/PvdA-Fraktion im Euregiorat. - MdB seit Sept. 2016.
