Vizepräsident, ehrenamtlich', 'Abitur 1991. Wehrdienst. Studium der Rechts- und Staatswissenschaften in Düsseldorf, Bonn und Hagen, Studium der Geschichte und Politik in Bonn. Postgraduierten-Jurastudium in den USA (University of Virginia) mit Abschluss Master of Laws (LL.M.) Referendariat u.a. in Speyer (Deutsche Hochschule für Verwaltungswissenschaften), Chicago/USA (Brinks, Hofer, Gilson & Lione), Los Angeles/USA (Murchison & Cumming). Beruflicher Werdegang: Internationale Kanzlei Mayer Brown in Köln, BEYER Patent- und Rechtsanwälte in Ratingen mit der Spezialisierung im Bereich des Schutzes des Geistigen Eigentums (Fachanwalt für Gewerblichen Rechtsschutz). Mitgl. der CDU seit 1996. Englisch (f).  - MdB seit Okt. 2009; Berichterstatter der CDU/CSU-Fraktion für die Transatlantischen Beziehungen und für die Westbalkan-Region.', 'Peter', '11004010');
