Vizepräsidentin, ehrenamtlich', '1985/88 Ausbildung zur Rechtsanwalts- und Notarsgehilfin. 1988/92 Ausbildung zur Erzieherin. 1992/96 Studium an der Ev. FH Hannover, Dipl.-Sozialpädagogin. 1996/98 Leitung Kooperationsprojekt bei der AWO, 1998/2000 Jugendbildungsreferentin beim DGB, Kreis Hannover, 2000/02 Geschäftsführerin Betreuungsverein Hildesheim e. V., 2002/Sept. 2009 Nieders. Landesamt für Soziales, Jugend und Familie. Mitgl. u. a. AWO, ver.di, SJD - Die Falken, SoVD und Mieterverein, Juni 2012/Mai 2016 Vors. AWO Bezirksverband Hannover. Seit 1993 Mitgl. der SPD. Stadtbezirksrat Vahrenwald-List, 2006/Nov. 2009 Mitgl. Rat der Landeshauptstadt Hannover, Sprecherin der SPD-Ratsfraktion für Jugend und Familie. Seit 2014 Vizepräs. Special Olympics Deutschland (SOD). - MdB seit Okt. 2009; behindertenpolitische Sprecherin der SPD-Fraktion.', 'Kerstin', '11004173');
Vizepräsidentin, ehrenamtlich', 'Staatlich geprüfte und anerkannte Erzieherin, Judolehrerin. Bezugspädagogin an einer Förderschule für soziale und emotionale Entwicklung in Gummersbach. Seit 1992 Mitgl. der SPD, seit 2009 Mitgl. SPD-Parteivorstand, stellv. Kreisvors. SPD Oberberg, stellv. Regionalvors. der SPD Mittelrhein. Seit 2004 Kreistagsmitgl. Oberbergischer Kreis. Seit 2000 Vizepräsidentin des Deutschen Judo Bundes e. V., ehem. Mitgl. der Judo-Nationalmannschaft, seit April 2016 Vizepräsidentin des Landessportbundes NRW. - MdB seit Okt. 2013.
