Vorsitzende des Beirates, ehrenamtlich', '1996 Abitur Caspar-Vischer-Gymnasium Kulmbach. 1996/01 Studium der Rechtswissenschaften Univ. Bayreuth, 2001 1. Staatsexamen; 2001/02 wissenschaftl. Mitarbeiterin bei Prof. Dr. Dr. Wilhelm Mößle; 2002 Abschluss zur Wirtschaftsjuristin, 2002/04 Rechtsreferendariat am Landgericht Bayreuth, Regierung von Oberfranken, Deutsche Botschaft Washington D.C., USA; 2004 2. Staatsexamen, 2013 Promotion an der Universtät Bayreuth. 2005 Richterin am Amtsgericht Hof, Betreuungs- und Nachlassangelegenheiten, 2005/07 Richterin am Landgericht Hof, Zivilsachen, 2007/09 Staatsanwältin bei der Staatsanwaltschaft Hof, allgemeine Delikte, Jugendkriminalität, Kinderpornografie, häusliche Gewalt. 2009/10 Elternzeit. Seit Januar 2011 Richterin am Landgericht Hof, allg. Zivilsachen, Arzt-, Rechtsanwalts- und Steuerberaterhaftung, Insolvenzanfechtungs- und Kapitalanlagefälle. Mitgl. CSU-Bezirksvorstand Oberfranken, Mitgl. Landesvorst. der Frauenunion, Leiterin der Projektgruppe Familie und Frauen des FU-Landesverbandes, seit Juni 2013 FU-Bezirksvors. Oberfranken, stellv. Bezirksvors. der Mittelstands-Union Oberfranken, seit 2013 Mitgl. CSU-Parteivorstand. Mitgl. Richterverein, Juristische Gesellschaft e. V., Frankenwaldverein, Verband Wohneigentum, Europaclub der FU Oberfranken, Kulturkreis Hof e. V., Obst- und Gartenbauverein Wölbattendorf. - MdB seit Okt. 2013.', 'Silke', '11004336');
