Vorsitzende des Kuratoriums, ehrenamtlich', 'Abitur. Ausbildung zur Finanzkauffrau. Finanzwirtschaftsstudium in Berlin, Diplomfinanzökonomin. 1984/87 in der Staatsbank Leipzig tätig, 1987/90 Ökonomin in der LPG Lenzen. 2000/04 Ministerin der Finanzen des Landes Brandenburg, 2004/09 Ministerin für Arbeit, Soziales, Gesundheit und Familie des Landes Brandenburg. 1990 Gründerin der SPD Lenzen, 2004/10 Vors. SPD-Unterbezirk Prignitz, 2000/08 stellv. Vors. SPD-Landesverb. Brandenburg. Bis 2000 Mitgl. der Stadtverordnetenversammlung Lenzen, 1993/98 ehrenamtliche Bürgermeisterin der Stadt Lenzen; seit Sept. 2008 Mitgl. Kreistag Prignitz. 1994/09 MdL in Brandenburg, 1997/2000 stellv. Vors. SPD-Landtagsfraktion, 1997/99 finanzpol. Sprecherin und Mitgl. Enquetekommission "Gemeindegebietsreform". - MdB seit Okt. 2009; 2009/13 stellv. Vors. der SPD-Fraktion, seit Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion.
