Vorsitzende des Vorstandes, ehrenamtlich (bis 05.05.2015)', '1982/87 Studium der Rechtswissenschaft, 1987 1. jur. Staatsprüfung, 1991 2. jur. Staatsprüfung. 1994/01 Referentin der Frauen-Union NRW in Düsseldorf, seit 2001 Rechtsanwältin. 2010/12 stellv. Landesvors. der CDU Nordrhein-Westfalen, stellv. Vors. der CDU im Kreis Mettmann, bis 2013 stellv. Vors. BFA Familie, Frauen, Senioren und Jugend der CDU Deutschlands. Präsidentin "Förderkreis ZNS Langenfeld e. V. ", Schirmherrin Franziskus-Hospiz Hochdahl, Schirmherrin "Zündstoff - die 2. Chance" Erkrath. Englisch (f), Französisch (f). - MdB seit Okt. 2002; Jan. 2008/Okt. 2009 Obfrau der CDU/CSU-Fraktion im Ausschuss für Familie, Frauen, Senioren und Jugend; Nov. 2009/März 2010 Justiziarin und April 2010/Jan. 2017 Parl. Geschäftsführerin der CDU/CSU-Fraktion; Mitgl. Ältestenrat, seit 19. Jan. 2017 Vizepräsidentin des Bundestages.', 'Michaela', '11003645');
Vorsitzende des Vorstandes, ehrenamtlich', '1972 Abitur. 1977 Diplom-Volkswirtin; 1977/79 Wissenschaftliche Hilfskraft an der Albert-Ludwig-Universität Freiburg. 1981 Diplom-Handelslehrerin, 1981/91 Studienrätin an der Kaufmännischen Schule Emmendingen (Wirtschaft und Mathematik). 1991/96 Referentin im Kultusministerium des Landes Baden-Württemberg für Berufliche Gymnasien und Hochbegabtenförderung, 1996/98 Referentin des Schulausschussvorsitzenden der Kultusministerkonferenz (KMK), 1998/99 Vertreterin des Landes Baden-Württemberg im Schulausschuss der KMK und Referentin im Ministerbüro des Kultusministeriums des Landes Baden-Württemberg, 1999/2000 Leiterin des Ministerbüros im Kultusministerium des Landes Hessen; 2001/04 Leiterin des Landesinstituts für Schule und Medien, Berlin. März 2004/Mai 2008 Senatorin für Bildung und Sport von Hamburg. Seit 2009 Inhaberin einer Beratungsfirma. Mitgl. der Hamburgischen Bürgerschaft Mai 2008/Februar 2011. - MdB seit Okt. 2013.', 'Alexandra', '11004260');
Vorsitzende des Vorstandes, ehrenamtlich', 'Schulbesuch in Bonn, Abitur 1991. Musikstudium in Essen mit Hauptfach Violine, 1996 Künstlerische Abschlussprüfung (heutiges Diplom); Jurastudium in Bonn, erstes Staatsexamen 2001; Politikwissenschaftliche Promotion, 2008 Dr. rer.pol. in Leipzig. 1993/96 Violinistin am Folkwang Kammerorchester, 1996/04 freiberufliche Tätigkeit als Violinistin. 1997/02 Freie Mitarbeiterin der Zeitschrift für Neues Energierecht; 2006/07 Wissenschaftliche Mitarbeiterin des MdB Marco Bülow; 2007/13 Geschäftsführerin von UnternehmensGrün e. V., Bundesverband der grünen Wirtschaft. Seit 1987 Mitgl. der SPD, Mitgl. im SPD-Landesvorstand Schleswig-Holstein. - MdB seit Okt. 2013.', 'Nina', '11004396');
Vorsitzende', '1998 Abitur. 1998/05 Studium der Soziologie, BWL und Psychologie an der TU Chemnitz, Abschluss als Dipl.-Soziologin. 2005/13 wissenschaftliche Mitarbeiterin und Referentin. 2001 Eintritt in die CDU, 2001/07 Vors. Junge Union Vogtland, 2003/08 Beisitzerin Landesvorstand Junge Union Sachsen & Niederschlesien, 2008/10 Beisitzerin Landesvorstand der KPV Sachsen, seit 2008 stellv. Kreisvors. CDU-Vogtland. 2003/09 Stadträtin in Auerbach, 2003/05 Kreisrätin Vogtlandkreis. Seit 2014 Vors. Vogtländischer Verein zu Berlin e. V.- MdB seit Okt. 2013.', 'Yvonne', '11004346');
Vorsitzende', 'Abitur 1970 in Osnabrück. Studium Deutsch, Geschichte, Gemeinschaftskunde in Bielefeld und Heidelberg. Lehrerin an der Konrad-Adenauer-Realschule in Pforzheim. Vors. des Vereins "Brücke der Hoffnung". Mitgl. der Gesellschaft für bedrohte Völker und des BUND, Mitgl. Vorstand im Petersburger Dialog e. V. Ehrenbürgerin der bosn. Stadt Lukavac. 1991/94 Mitgl. der Bremischen Bürgerschaft. Mitgl. des Vorstands Petersburger Dialog e. V. - MdB 1983/April 1985, 1987/90 und seit 1994; im Kabinett Schröder/Fischer Beauftragte der Bundesregierung für Migration, Flüchtlinge und Integration und Parl. Staatssekretärin beim BMFSJ. Sprecherin für Osteuropapolitik der Fraktion Bündnis 90/ Die Grünen und Obfrau im Auswärtigen Ausschuss; Mitgl. der PV des Europarates; Vors. Dt.-Bosnische PG, stellv. Vors. Dt.-Ukrainische PG und Mitgl. Dt.-Südkaukasische PG.', 'Marieluise', '11002624');
Vorsitzende', 'Literaturwissenschaftlerin M. A. 1988 Eintritt in die SPD, 1989 Gründung Ortsverein Weiler, 2000/09 Vors. SPD-Kreisverband Mayen-Koblenz, 1993/95 Landesvors. der Jusos Rheinland-Pfalz, 1995/99 Juso-Bundesvors., seit 1997 Mitgl. SPD-Parteivorstand. Seit 1999 im Kreistag. Mitbegründerin und 2000/08 Vors. Forum Demokratische Linke 21. Seit Dez. 2003 Mitgl. SPD-Präsidium, seit 2004 Leiterin der Projektgruppe Bürgerversicherung beim SPD-Parteivorstand, Okt. 2007/Nov. 2009 stellv. Vors. der SPD, 2009/13 Generalsekretärin der SPD. Mitgl. IG Metall und Eurosolar. - MdB 1998/02 und seit Okt. 2005; Nov. 2007/Nov. 2009 arbeitsmarktpolitische Sprecherin der SPD-Fraktion; seit Dez. 2013 Bundesministerin für Arbeit und Soziales.
Vorsitzende', 'Realschulabschluss. 1973/Feb. 1976 Ausbildung zur Verwaltungsbeamtin im mittleren Dienst beim Kreis Olpe, anschließend Beamtin im mittleren Dienst. Nov. 1980/Feb. 1987 Büroleiterin von Paul Breuer MdB, 1990 bis 2011 freie Journalistin, Geschäftsführerin der Mineralienhalde Grube Clara UG (haftungsbeschränkt). Seit 1993 Vors. der CDU Wolfach, seit 1999 Mitgl. des Kreisvorst. der CDU Ortenau, seit 2013 stellv. Kreisvors., seit 2013 Mitgl. im Bezirksvors. der CDU Südbaden, seit 2013 im Kreisvorstand der Frauen Union und seit 2015 im Landesvorstand der Frauen Union Baden-Württemberg, seit 2012 im CDU-Landesfachausschuss ländlicher Raum. Seit 2009 Kreisrätin im Ortenaukreis. - MdB seit Okt. 2013.', 'Kordula', '11004604');
Vorsitzende', 'Sozialpädagogin. 1994/03 Mitglied des Niedersächsischen Landtages, stellv. Fraktionsvors. und sozialpolitische Sprecherin. 2003/05 Landesvors. Bündnis 90/Die Grünen Niedersachsen. Mitgl. ver.di, Frauenhaus und Frauen-JVA Hildesheim, Vors. Förderkreis HAWK Hildesheim. - MdB seit 2005; arbeitsmarktpolitische Sprecherin der Fraktion Bündnis 90/Die Grünen.', 'Brigitte', '11003823');
