Vorsitzende, ehrenamtlich (bis 10.11.2014)', '1969/79 POS Groß Börnecke, Abschluss 10. Klasse. 1979/81 Lehre VE HO Staßfurt. 1982/84 Ausbild. zum Kaufmann für Land- und Nahrungsgüterwirtschaft. 1984/89 Studium zum Ökonom AIS Weimar (Fernstudium), Abschl. Dipl.-Betriebswirt (FH); 1992/94 Weiterbild. Studieninstitut Hannover. 1981/88 Haushaltssachbearb. beim Rat des Kreises Staßfurt; 1989/90 Ökonom LPG Tarthun, 1990/94 Gemeindedirektorin in Tarthun, 1994/03 Leiterin d. gem. Verwaltungsamtes Bördeaue. 2003/07 Landrätin LK Aschersleben-Staßfurt. 2008 Geschäftsführerin Studentenwerk Magdeburg. Mitgl. u.a. Beirat Internat. Bund Kinder- und Jugendhilfezentrum Harz, 2012/14 Beirat Biosphärenreservat Karstlandschaft Südharz, 2012/14 Beiratsmitgl. DUK Versorgungswerk e.V., 2010/14 Vorstand VMDU Verein Mittelstand Dienstleistungsunternehmen e.V., Freiw. Feuerwehr Tarthun, Ehrenmitgl. Spielmannszug Tarthun e. V., bis 2014 stellv. Mitgl. Verwaltungsrat Salzlandsparkasse, seit 2010 stellv. Vors. Förderverein "Jedem Kind sein Verein", seit Feb. 2014 Mitgl. Vergabebeirat Flüchtlingshilfe Sachsen-Anhalt. 1996 stellv. Vors. und 2000/06 Vors. CDU-Kreisverb. Aschersleben-Staßfurt, 2003 Mitgl. Landesvorst. und seit 2010 stellv. Vors. CDU Sachsen-Anhalt; 2005 Eintritt in die CDA; 2007 Schatzmeisterin CDU-Kreisverb. Salzland; seit 2009 Mitgl. BV der KPV, seit 2010 stellv. Vors. KPV Sachsen-Anhalt, seit 2010 Vors. Bildungswerk KPV Sachsen-Anhalt, seit Nov. 2015 stellv. Bundesvors. der KPV. 1990/94 Mitgl. Kreistag Staßfurt, 1994/98 Mitgl. Kreistag Aschersleben-Staßfurt, stellv. Fraktionsvors. 1998/99 Vors. der CDU-Fraktion und 1999/03 Vors. Kreistag Aschersleben-Staßfurt, 2007/Juli 2014 Mitgl. Kreistag des Salzlandkreises. - MdB seit Okt. 2009; seit 2014 Vors. Ausschuss für Tourismus.', 'Heike', '11004019');
Vorsitzende, ehrenamtlich (bis Dezember 2013)', '1983 Abitur am Gymnasium Mellendorf in der Wedemark. 1983/88 Studium der Geographie Univ. Hannover, 1988 Abschluss Diplom-Geographin. 1989/90 wissenschaftl. Mitarbeiterin an der Univ. Hannover. 1991 Geburt des 1. Kindes, bis 2002 Familienfrau. Seit 1998 Mitgl. der SPD, seit 1999 Vors. SPD-Ortsverein Wedemark, Mitgl. im SPD-Bezirksvorstand Hannover. Nov. 2001/Okt. 2002 Mitgl. der Regionsversammlung der Region Hannover, seit Nov. 2001 Mitgl. im Rat der Gemeinde Wedemark, 2011/14 Mitgl. im Ortsrat Mellendorf/Gailhof. Dez. 2009/Dez. 2013 Vors. pro familia Landesverband Niedersachsen; Mitgl. IG BCE, AWO, pro familia, Sozialdemokratische Gemeinschaft für Kommunalpolitik (SGK), Freiwillige Feuerwehr Mellendorf, Schützenverein Mellendorf, Kneipp-Verein Garbsen und Hannover 96. Nov. 2011/Jan. 2014 stellv. Mitgl. Verwaltungsrat Deutsch-Französisches Jugendwerk, 2011/Dez. 2013 Mitgl. Verwaltungsrat Pestalozzi-Stiftung. - MdB seit Okt. 2002; seit Dez. 2005 Mitgl. im Fraktionsvorst. und 2008/13 Sprecherin der SPD-Fraktion für Familie, Senioren, Frauen und Jugend; seit Dez. 2013 Parlamentarische Staatssekretärin bei der Bundesministerin für Familie, Senioren, Frauen und Jugend.', 'Caren', '11003587');
Vorsitzende, ehrenamtlich', '1980 Abitur am Scharnhorst-Gymnasium Hildesheim. 1982 Abschluss Bankkauffrau; 1986/88 Bankakademie Hannover , Abschluss Bankfachwirtin. 1982/94 Deutsche Bank AG, Filialen Hildesheim, Hannover, Frankfurt, Hongkong. 2006 Eintritt in die CDU, seit 2008 Vors. Stadtverband der CDU Alfeld und stellv. Vors. CDU Kreisverb. Hildesheim, Beisitzerin im Landesvorst. der CDU Niedersachsen, seit Okt. 2016 Vors. CDU-Kreisverb. Hildesheim und stellv. Vors. CDU-Bezirksverb. Hildesheim. Seit 2011 Ratsfrau im Rat der Stadt Alfeld (Leine), 2011/13 Fraktionsvors., 2011/16 CDU-Kreistagsabgeordnete im Landkreis Hildesheim hier 2011/13 Sprecherin für Gesundheit und Soziales. Mitgl. Kuratorium Stiftung Denkmal für die ermordeten Juden Europas Berlin, Mitgl. Parlamentarierbeirat der UNESCO-Weltkulturerbestätte FAGUS-Werk Alfeld, Mitgl. im Vorst. der Heinrich-Dammann-Stiftung. - MdB seit Okt. 2013; Mitgl. Vorst. der CDU/CSU-Fraktion.', 'Ute', '11004253');
Vorsitzende, ehrenamtlich', '1998/2014 Präsidentin des Bundes der Vertriebenen e. V., seit Sept. 2000 Vors. der Stiftung ZENTRUM GEGEN VERTREIBUNGEN. 1974/Jan. 2017 Mitgl. der CDU, 2000/10 Mitgl. des CDU-Bundesvorst. 1977/81 Mitgl. Verbandstag des Umlandverbandes Frankfurt a. M.; 1977/90 Stadtverordnete in Frankfurt. - MdB seit 1990; Nov. 2005/Jan. 2017 Vors. der AG Menschenrechte und Humanitäre Hilfe der CDU/CSU-Fraktion. Seit Jan. 2017 fraktionslos.', 'Erika', '11002808');
Vorsitzende, ehrenamtlich', 'Abitur. Magisterabschluss Politikwissenschaft, Soziologie, Geschichte. Trainerin in der Jugend- und Erwachsenenbildung. Ehrenamtliche Tätigkeit beim Netzwerk für Demokratie und Courage (NDC); Projektmanagerin beim NDC für Berlin und Brandenburg; Geschäftsführerin und Projektleiterin beim NDC Sachsen. Mitgliedschaften: AWO, Gegen Vergessen - für Demokratie e. V., Buntes Radebeul e. V., Bürgerinitiative Hochwasser Nünchritz, Gewerkschaft Erziehung und Wissenschaft (GEW), Landesfrauenrat Sachsen e. V., stellv. Mitgl. Kuratorium der Bundeszentrale für politische Bildung. Mitgl. Falken, 1998/2000 Falken-Landesvors. Sachsen; 1996/2000 Juso-Landesvorstandsmitgl.; 1998/02 und wieder seit 2008 SPD-Landesvorstandsmitgl. Sachsen, 1999/02 stellv. SPD-Landesvors. Sachsen, seit 2010 SPD-Unterbezirksvors. Meißen. - MdB seit Okt. 2013; seit Feb. 2014 Kinderbeauftragte der SPD-Fraktion, seit Juni 2014 Sprecherin der AG Strategien gegen Rechtsextremismus der SPD-Fraktion, seit Nov. 2015 stellv. Vors. 3. Untersuchungsausschuss (Terrorgruppe NSU II).
