Vorsitzender des Aufsichtsrates', 'Ausbildung zum Groß- und Außenhandelskaufmann, Weiterbildung zum staatl. anerkannten Bilanzbuchhalter. 1970/05 tätig als Baukaufmann in einem großen Bauunternehmen in Wilhelmshaven, dort ca. 30 Jahre als Prokurist und kaufmännischer Leiter in verantwortl. Position. Seit 1974 Mitgl. CDU, Vorstandsmitgl. CDU Zetel, 1976/92 dort Vors., 2002/10 Vors. CDU Friesland, seit Dez. 2015 Vors. CDU Zetel/Neuenburg. 1976/98 und seit Nov. 2016 Mitgl. Gemeinderat Zetel, 1981/91 Bürgermeister; 1980/Okt. 2011 Mitgl. Kreistag Friesland, 2001/11 Vors. Kreistagsfraktion. Vors. Pflegeheim Osterforde. - MdB 2005/09 und seit April 2010; stellv. Vors. AK Küste der CDU/CSU-Fraktion.', 'Hans-Werner', '11003783');
