Vorsitzender des Fördervereins der Landjugend, ehrenamtlich', '1959/67 Volksschule. 1967/70 Ausbildung im elterl. Betrieb, Landwirtschaftsgehilfe; 1971/72 und 1977/78 Landwirtschaftl. Fachschule Mayen, 1978 Meisterprüfung. Selbst. Landwirt. 1985/92 Kreisvors. Bauern- und Winzerverb. Cochem-Zell, 1990/2000 Präsidiumsmitgl. Bauern- und Winzerverb. Rheinland-Nassau e. V. 1987/99 Mitgl. Landwirtschaftskammer Rheinland-Pfalz. 1984/01 Mitgl. AR Raiffeisenbank Kaifenheim, 1994/01 dessen Vors.; 2001/11 Aufsichtsratsvors. Raiffeisenbank Kaisersesch - Kaifenheim eG, 1996/11 Vors. Aufsichtsrat Raiffeisen Warenzentrale Rhein-Main eG und 2008/11 Mitgl. Präsidium Dt. Raiffeisenverband e. V., Berlin und Bonn, als Repräsentant des bäuerl. Berufsstands. 2007/11 Vorstandsmitgl. Fachagentur für Nachwachsende Rohstoffe (FNR) e. V., Gülzow. Seit 1970 Mitgl. der JU und CDU, 1975/79 Gemeindeverbandsvors. JU Kaisersesch, 1992/06 Kreisvors. CDU-Kreisverb. Cochem-Zell, 2006/16 Landesschatzmeister der CDU Rheinland-Pfalz, 2004/14 Vors. CDU-BFA Ernährung, Landwirtschaft und Verbraucherschutz. 1984/91 Mitgl. Gemeinderat Brachtendorf, 1994/11 und seit Juni 2014 Mitgl. im Verbandsgemeinderat Kaisersesch; seit 1979 Mitgl. Kreistag Cochem-Zell. MdL Rheinland-Pfalz Febr./Mai 1987. - MdB seit 1990; 2003/05 Tierschutzbeauftr. und 2005/11 Vors. AG Ernährung, Landwirtschaft und Verbraucherschutz der CDU/CSU-Fraktion, seit Sept. 2013 Vors. Landesgruppe Rheinland-Pfalz in der CDU/CSU-Fraktion; Feb. 2011/Dez. 2013 Parl. Staatssekretär bei der BM für Ernährung, Landwirtschaft und Verbraucherschutz, seit Dez. 2013 beim BM für Ernährung und Landwirtschaft.', 'Peter', '11000198');
