Vorsitzender des Schiedsausschusses, ehrenamtlich', '1967 Abitur am Städtischen Neusprachlichen Gymnasium in Velbert. Wehrdienst in Mittenwald als Gebirgsjäger. Ab 1969 Studium der Rechtswissenschaften Ruhruniv. Bochum, ab 1970 an der Westfälischen Wilhelms-Univ. Münster, 1974 1. Staatsexamen, 1980 2. Staatsexamen in Münster. Jugendbildungsreferent beim Landesverband NRW der Jungdemokraten, danach Referendariat am Landgericht Wuppertal. Seit 1982 Rechtsanwalt in Münster, seit 1993 zusätzlich auch in Wittenberg, Sachsen-Anhalt. Seit Okt. 2016 Präsident Preußen Münster. 1969 Eintritt in die Jungdemokraten, 1977/80 Bundesvors. der Jungdemokraten, bis 1982 Mitgl. Bundesvorst. der FDP, 1982 Austritt aus der FDP wegen der Aufkündigung der Sozialliberalen Koalition. 1984 Eintritt in die SPD, 1993/07 Vors. Unterbezirk. Münster. 1999/02 Mitgl. Rat der Stadt Münster als Vors. der Finanz- und Beteiligungskommission. Politisches Engagement in der Umwelt- und Friedensbewegung, intensive Beschäftigung mit Fragen der Menschenrechts- und Rechtspolitik. Englisch (f), Französisch (G). - MdB seit Okt. 2002; Dez. 2005/Jan. 2014 Sprecher der AG Menschenrechte und humanitäre Hilfe der SPD-Fraktion; Jan. 2014/Feb. 2016 Beauftragter der BReg für Menschenrechtspolitik und humanitäre Hilfe.', 'Christoph', '11003644');
Vorsitzender des Stiftungsrates
Vorsitzender des Stiftungsrates (bis 31.01.2014)', '1978 Abitur in Bremen. 1979/80 Grundwehrdienst. 1987 Abschluss der einstufigen Juristenausbildung an der Univ. Hamburg; 1987 Rechtsanwalt in Hamburg-Altona; 1991 Promotion zum Dr. jur. am Hamburger Institut für Friedensforschung; 1991 Eintritt in den Dienst der Freien und Hansestadt Hamburg, Sozialbehörde, hier bis 2013 in unterschiedlichen Leitungspositionen, zuletzt als Leiter der Rechtsabteilung. 1978 Eintritt in die SPD Südbayern, München, Ortsverein Schwabing-West; 1989 Vors. des SPD-Distriktes Altona-Nord, 2004 stellv. Kreisvors. der SPD Altona, 2009 Landesvorst. der SPD Hamburg, 2010 Gründung der AG "Selbst Aktiv" für Menschen mit Behinderung in der SPD. 1986 Mitglied der Bezirksversammlung Hamburg-Altona. Mitgl. von ver.di, AWO und SoVD, seit Nov. 2016 Vors. Lebenshilfe Landesverband Hamburg e. V. - MdB seit Okt. 2013; seit Jan. 2016 Justiziar der SPD-Fraktion und Mitgl. Ältestenrat.', 'Matthias', '11004248');
Vorsitzender des Stiftungsrates, ehrenamtlich
Vorsitzender des Stiftungsrates, ehrenamtlich
Vorsitzender des Stiftungsrates, ehrenamtlich', '1980/83 Studium FH des Bundes für öffentliche Verwaltung Köln/Lübeck, 1993/95 Deutsche Hochschule der Polizei Münster, European Quality System Manager und Auditor, Senior Quality Manager. Seit 1982 versch. Verwendungen im gehobenen und höheren Dienst der Bundespolizei (BP), zuletzt Leiter BP-Amtes/-Inspektion Weil am Rhein. Ehrenamtl. Jury-Mitgl. der Initiative Ludwig-Erhard-Preis (Deutscher Qualitätspreis), Dozent und Prüfer Deutsche Gesellschaft für Qualität e. V., Mitgl. International Police Association, Mitgl. DPolG Bundespolizeigewerkschaft, Vors. Stiftungsrat der Sportstiftung Südbaden, Vorstandsmitgl. der Dt. Gesellschaft für Qualität (DGQ) e. V. Seit 1987 Mitgl. der CDU, Vors. des CDU-Kreisverb. Lörrach, Mitgl. AK Polizei der CDU, Mitgl. im CDU-Bundesfachausschuss Innenpolitik; stellv. Vors. MIT Kreisverb. Lörrach. - MdB seit Okt. 2009; seit 2014 Obmann der AG Innen und Mitgl. im PKGr., seit 2015 Obmann im 3. Untersuchungsausschuss.', 'Armin', '11004149');
