Vorsitzender des Vorstandes', '1978/83 Studium der Agrarwissenschaften Univ. Halle-Wittenberg. 1983/90 verschiedene leitende Tätigkeiten in der LPG Wust. 1990/92 Bürgermeister der Heimatgemeinde Wust, 1992/94 Landrat des Landkreises Havelberg, 1994/99 1. Beigeordneter des neuen Landkreises Stendal, 1999/13 Landrat des Landkreises Stendal. Vors. des Regionalvereines Altmark, Vors. Förderkreis der Fachhochschule Magdeburg-Stendal am Standort Stendal, Vors. der Sommerschule Wust e.V. Seit 1992 Mitgl. der CDU, seit 2009 Vors. des Ortsverbandes Schönhausen. - MdB seit Okt. 2013.', 'Jörg', '11004299');
Vorsitzender des Vorstandes', 'Abitur 1979 in Wiesbaden. 1980/86 Studium Volkswirtschaftslehre und Politikwiss. Univ. Mainz, Diplom-Volkswirt. Wehrdienst 1987/88, Hauptmann d. R. 1989/94 Flughafen Frankfurt/Main AG. Ab April 1994 Bürgermeister in Schlangenbad. Beratungs- und Vortragstätigkeit als beratender Volkswirt, Herausgeber einer Monatszeitung. 2015 Veröffentlichung "Von Rettern und Rebellen". Okt. 2003/Okt. 2010 Mitgl. Senat der Fraunhofer Ges., seit 2010 Vors. Freundeskreis Berlin-Taipeh, seit 2008 Mitgl. im Universitätsrat der Dt.-Vietnamesischen Universität, seit 2013 Vors. Rheingau-Taunus Marketingverein und Mitgl. Aufsichtsrat Rheingau-Taunus-Kultur und Tourismus GmbH. 1978/96 Mitgl. JU, Gemeindeverbandsvors. Hohenstein, Kreisvors. Rheingau-Taunus, 1986/92 im Landesvorst., seit 1979 Mitgl. der CDU, seitdem im Kreisvorst., seit 2002 Kreisvors. der CDU im Rheingau-Taunus, seit 1993 Mitgl. Bezirksvorst., seit 2013 Bezirksvors. Westhessen. 1981/93 Gemeindevertreter in Hohenstein, 1985/11 und seit 2016 Mitgl. Kreistag Rheingau-Taunus-Kreis, bis 2011 stellv. Fraktionsvors., seit 2016 Kreistagsvors. 1993/01 Kreisvors. KPV Rheingau-Taunus, 1993/06 Mitgl. Landesvorst. Mitgl. in zahlr. Gremien und Vereinen, Mitgl. Kuratorium Wissenschaftszentrum Berlin für Sozialforschung (WZB) gGmbH und im Kuratorium Fraunhofer/IPK. Englisch (f), Französisch (G). - MdB seit 1998;  Beisitzer im Vorst. des Parlamentskreises Mittelstand; 2005/09 Vors. Unterausschuss zu Fragen der Europäischen Union im Haushaltsausschuss, 2009/13 Obmann der CDU/CSU-Fraktion im Haushaltsausschuss; 2006/10 Vors. und 2010/13 stellv. Vors. Dt.-Kroatische Parlamentariergruppe, seit 2009 Vors. Parlamentsgruppe Luft- und Raumfahrt.', 'Klaus-Peter', '11003264');
Vorsitzender des Vorstandes, ehrenamtlich
