Vorsitzender des Vorstandes, ehrenamtlich (bis 31.12.2015)
Vorsitzender des Vorstandes, ehrenamtlich', 'Berufsfachaufbauschule für Landwirtschaft in Ansbach, Landwirtschaftliche Lehre, Landwirtschaftliche Fachschule, Höhere Landbauschule Triesdorf. Studienkurs "Landwirtschaft und Interessenvertretung" Deutsche Landjugendakademie in Bonn-Röttgen. 1985 Übernahme des elterlichen Bauernhofes mit Schwerpunkt Milchviehhaltung. 1994 Eintritt in die CSU, stellv. Landesvors. CSU-AG Landwirtschaft (AGL), Gründungsmitgl. und stellv. Landesvors. CSU-Arbeitskreis Energiewende (AKE). Seit 1996 Kreisrat, seit 2002 Stadtrat. Vors. Maschinen- und Betriebshilfsring, stellv. Kreisobmann, Ortsobmann des Bayer. Bauernverbandes; bis zum Eintritt in den Bundestag ehrenamtl. Richter am Bayer. VGH; ehrenamtl. Richter am OLG Nürnberg; seit Nov. 2015 ehrenamtl. Vorstandsvors. des Bundesverbands BioEnergie. - MdB Juli 2004/05 und seit Okt. 2013.', 'Artur', '11003706');
Vorsitzender des Vorstandes, ehrenamtlich', 'Studium der Rechtswissenschaften in München und Augsburg, 2. Staatsexamen 1986. Studium der Wirtschaftswissenschaften in Augsburg, Vordiplom für Diplom-Ökonomen 1986. Ab 1988 Bundesministerium für Wirtschaft, zuletzt Ministerialrat. 1991/98 Wirtschaftsreferent der CSU-Landesgruppe. Mitgl. der CSU seit 1974, seit 2011 Bezirksvors. der CSU Oberfranken. - MdB seit 1998; 2005/09 stellv. Vors. der CDU/CSU-Fraktion, Okt. 2009/März 2011 Vors. der CSU-Landesgruppe und 1. stellv. Vors. der CDU/CSU-Fraktion, März 2011/Dez. 2013 Bundesminister des Innern, Dez. 2013/Feb. 2014 Bundesminister für Ernährung und Landwirtschaft, seit Feb. 2014 stellv. Vors. der CDU/CSU-Fraktion.', 'Hans-Peter', '11003124');
Vorsitzender des Vorstandes, monatlich, Stufe 1
Vorsitzender', '1979 Abitur in Neunkirchen. 1979/86 Volkswirtschaftsstudium in Bonn, 1986 Diplom-Volkswirt. 1980/84 Abgeordnetenmitarbeiter im Deutschen Bundestag; 1986/87 Praktikum in Australien. 1987/95 Leitender Mitarbeiter mittelständischer Firmen. 1983/89 Vors. der JU im Sauer-/Siegerland, seit 2001 Mitgl. im CDU-Landesvorst., seit 2003 CDU-Kreisvors. in Siegen-Wittgenstein, 2004/15 Landesvors. Ev. Arbeitskreis der CDU in NRW. 1984/05 Ratsmitgl. in Burbach, 1992/96 Bürgermeister in Burbach; 1995/09 Mitgl. Landtag von Nordrhein-Westfalen. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Volkmar', '11004071');
Vorsitzender', '1994 Abitur am Gymnasium Leopoldinum Passau. 1998 erstes Staatsexamen Lehramt Realschule, anschließend Magisterstudium der Politikwissenschaft, Wirtschaft und Soziologie an der Univ. Passau mit Abschluss 2001; 2004 Promotion an der Karlsuniversität Prag. Seit 1994 Mitgl. der CSU und der JU, 1997/03 JU-Kreisvors. Passau-Stadt, 1999/01 Wahl zum JU-Deutschlandrat, 2001/03 JU-Landesvorst., seit 2001 CSU-Bezirksvorst. Niederbayern, 2003/07 Bezirksvors. der JU Niederbayern, seit Febr. 2016 Bezirksvors. der CSU Niederbayern, seit Dez. 2013 Generalsekretär der CSU. Seit 2002 Stadtrat. - MdB seit Okt. 2002; Okt. 2009/Dez. 2013 Parl. Staatssekretär beim Bundesminister für Verkehr, Bau und Stadtentwicklung und Koordinator der BReg für Güterverkehr und Logistik.', 'Andreas', '11003625');
Vorsitzender', '1997 Abitur, Paderborn. 1997/98 Wehrdienst, Augustdorf. 1998 Angestellter in einem mittelständischen Unternehmen (Buchhandel), Paderborn. 1999/02 Studium der Betriebswirtschaftslehre, FHDW Paderborn, Abschluss Dipl.-Kaufmann (FH). 2002/06 Promotionsstudium der Volkswirtschaftslehre, TU Chemnitz, Abschluss Dr. rer. pol. Diplom-Volkswirt. 2003/04 wiss. Mitarbeiter und Lehrbeauftragter am Lehrstuhl für Makroökonomie, TU Chemnitz. 2006/07 Assistent des Chefökonomen der Deutschen Bank, Prof. Norbert Walter, und Volkswirt bei Deutsche Bank Research, Frankfurt. 2007/09 Volkswirt bei der IKB Deutsche Industriebank, Bereich Konjunktur und Mittelstand, Düsseldorf. 2004/08 Mitgl. Rat der Gemeinde Altenbeken. Seit 2009 Mitgl. im Vorstand des Parlamentskreis Mittelstand. Seit 2009 Mitgl. im Bundesvorst. der Mittelstands- und Wirtschaftsvereinigung der CDU/CSU, seit 2013 dessen Bundesvors., damit Mitgl. im Bundesvorst. der CDU Deutschlands. Seit 2010 Gründer und Vors. der Stiftung Lebenslauf. - MdB seit Okt. 2009.', 'Carsten', '11004098');
Vorsitzender', '1997/06 Werner-Heisenberg-Gymnasium in Bad Dürkheim, Abitur. 2007 Studium auf Lehramt für Gymnasien in den Fächern Mathematik und Politikwissenschaften Univ.  Mannheim, 2013 1. Staatsexamen, Referendariat am Rudi-Stephan-Gymnasium in Worms, Stipendiat der Konrad-Adenauer-Stiftung, seit Febr. 2016 Gymnasiallehrer für Mathematik und Gemeinschaftskunde. 2002 Eintritt in die Junge Union, seit 2003 Mitgl. der CDU, Mitgl. im Orts- und Kreisvorstand der CDU Bad Dürkheim, seit 2005 Vors. der Jungen Union Bad Dürkheim, seit 2010 Vors. der Jungen Union Rheinland-Pfalz, Mitgl .im Bezirksvorstand der CDU Rheinhessen-Pfalz und im Landesvorstand der CDU Rheinland-Pfalz. Seit 2009 Mitgl. im Ortsbeirat Seebach und im Stadtrat Bad Dürkheim. DFB-Trainer-C-Lizenz, Mitgl. im Fußballverein SV Rot-Weiß Seebach, dort seit 2003 Trainer versch. Jugendmannschaften. - MdB seit Okt. 2013.', 'Johannes', '11004418');
