Vorsitzender, ehrenamtlich (bis 21.05.2014)', 'Ausbildung zum Bürokaufmann. Fachschul- und Fachhochschulreife Wirtschaft. Studium an der Fachhochschule für Öffentliche Verwaltung, Fachbereich Arbeitsverwaltung, Diplom-Verwaltungswirt. Zeitsoldat der Bundeswehr, Reserveoffizier. Seit 1982 bei der Bundesanstalt für Arbeit, seit 1991 Geschäftsstellenleiter des Arbeitsamtes Auerbach/Vogtland. Mitgl. der CDU seit 1983, der CDA seit 1985. - MdB seit Okt. 2002; Vors. Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung.', 'Robert', '11003557');
