Vorsitzender, ehrenamtlich (bis Juli 2014)
Vorsitzender, ehrenamtlich', '1964/74 Besuch der Allgemeinbildenden Oberschule in Papstdorf. 1974/77 Lehre als Elektroinstallateur und Besuch des heutigen beruflichen Schulzentrums für Wirtschaft in Pirna, 1980/83 Ausbildung zum Handwerksmeister bei der Handwerkskammer Dresden. 1977/78 Wehrdienst in Dresden. Elektrohandwerksmeister. Vors. des Tourismusverbandes Sächsische Schweiz e. V. und des Vereins und Festivals "Sandstein und Musik". Präsidiumsmitgl. Kreissportbund Sächsische Schweiz-Osterzgebirge und Mitgl. im Helfer- und Förderverein THW des Landkreises Sächsische Schweiz e. V. Mitgl. der CDU seit Jan. 1990, vorher parteilos, CDU-Vorstandsmitgl. im Kreisverband Sächsische Schweiz-Osterzgebirge. - MdB seit 1990; Vors. der Gruppe der Vertriebenen, Aussiedler und deutschen Minderheiten und Vorstandsmitgl. im Parlamentskreis Mittelstand der CDU/CSU-Fraktion; stellv. Vors. Ausschuss für Tourismus; Vors. dt.-österreichische Parlamentariergruppe.', 'Klaus', '11000240');
Vorsitzender, ehrenamtlich', '1973 Abitur. 1973/75 Zeitsoldat, Hauptmann d. R. 1975/79 Studium Rechtswiss. Univ. Kiel, 1977/79 Stipendiat KAS Institut für Begabtenförderung, 1979 1. jur. Staatsprüfung OLG Schleswig, 1979/82 Rechtsreferendar, 1982 2. jur. Staatsprüfung. 1977/81 Wahlkreisassistent MdB Olaf v. Wrangel, 1982 Referent Programmdirektor Hörfunk NDR, 1985 Abteilungsleiter Sendeleitung Hörfunk NDR, 2000 Aufbau und Leitung des Programmbereichs (Hauptabteilung) Programmbegl. Dienste/Multimedia (verantw. für alle Internet- und Videotextangeb. des NDR, tagesschau.de und Intranet). 1998 Patentanmeldung Reg. 841 DE. 1980/91 Mitgl. AR Raiffeisenbank Lauenburg e. G., seit 1991 Vors. 1993 Freiherr vom Stein Gedenkmedaille, 2003 Einsatzmedaille Fluthilfe 2002; seit 1969 Mitgl. DLRG, 2008 Verdienstabzeichen in Gold mit Brillant, DLRG Mitgliedsehrenzeichen in Silber. Seit 1991 Rettungsassistent, seit 1998 Organis. Leiter Rettungsdienst Kreis Herzogtum Lauenburg. 1972 Eintritt in die CDU, seit 1975 im CDU-Kreisvorst., 1990/94 Kreispräs.; seit 1978 Abg. des Lauenburgischen Kreistages, 1986/90 Fraktionsvors. und 1. Kreisrat, stellv. Landrat, seit 1998 Fraktionsvors. Seit Juni 2013 stellv. Vors. Verwaltungsrat Bundesanstalt für Immobilienaufgaben (BImA). - MdB seit Okt. 2009; seit März 2015 Obmann der CDU/CSU-Fraktion im Haushaltsausschuss, Vors. des Bundesfinanzierungsgremiums.', 'Norbert', '11004017');
Vorsitzender, ehrenamtlich', '1982/84 Dorfschule in Klettbach, 1984/91 POS in Erfurt, 1991/94 Johann-Wilhelm-Häßler-Gymnasium in Erfurt, Abitur. 1994/97 Ausbildung zum Bankkaufmann bei der Volksbank Erfurt eG. 1997/98 Zivildienst in der Jugendherberge Erfurt. 1998 Bankkaufmann bei der Sparkasse Erfurt. 1994 Mitgl. der Jusos, seit 1995 Mitgl. der SPD, seit 2014 stellv. Vors. der SPD Thüringen. 2004/05 Mitgl. im Erfurter Stadtrat. Mitgl. ver.di, ADFC und AWO, VDSF. - MdB seit 1998; 2005/13 haushaltspol. Sprecher der SPD-Fraktion, seit 2013 stellv. Vors. der SPD-Fraktion.
Vorsitzender, ehrenamtlich', '1989 Abitur in Braunschweig. 1989/91 Ausbildung zum Bankkaufmann. 1992/99 Bundesanstalt Technisches Hilfswerk. 1992/98 Studium der Rechtswissenschaften Univ. Göttingen; 1999/01 juristisches Referendariat am OLG Braunschweig. 1991/01 Tätigkeit (auch studienbegleitend) bei der Deutschen Bank AG in Braunschweig, Hannover und London. 1998/01 Geschäftsführer in einer Ingenieurgesellschaft. Seit 2002 selbstständiger Rechtsanwalt. 2003/Januar 2006 und erneut seit Mai 2010 Geschäftsführer in mittelständischen Unternehmen. Seit 1986 Mitgl. der Jungen Union und CDU, 1989/90 Landesvors. der Schüler Union Niedersachsen, 1989/91 der Jungen Union Braunschweig, 1990/92 und seit 2000 Mitgl. CDU-Landesvorst. Braunschweig, derzeit Landesschatzmeister, seit 1998 stellv. Kreisvors. der CDU Braunschweig, seit 2014 Mitgl. im Präsidium der CDU Niedersachsen. 1991/2016 Ratsherr der Stadt Braunschweig. Seit 2010 ehrenamtl. Vors. der Deutschen Unternehmensinitiative Energieeffizienz e. V. (DENEFF). - MdB 2005/09 und seit Okt. 2013; seit 2014 Vors. Parlamentskreis "Automobiles Kulturgut", seit 2014 Vors. Parlamentskreis "Energieeffizienz".', 'Carsten', '11003815');
Vorsitzender, ehrenamtlich', 'Abitur. Zivildienst. Biologie-Studium an der RWTH Aachen. 1997/02 Mitarbeiter bei Michaele Hustedt, MdB; 2002/09 Wissenschaftlicher Mitarbeiter der Grünen Landtagsfraktion NRW. Vors. des Fördervereins Nationalpark Eifel, Mitgl. u.a. bei BUND, NABU, Eurosolar, Tierschutzverein Düren, Mitgl. Rat der Agora Energiewende, des Parl. Beirates des Bundesverbands Erneuerbarer Energien (BEE) und des Beirats der Unternehmensinitiative Energieeffizienz (DENEFF). Seit 1989 Mitgl. der Grünen, Vors. Kreisverband Düren, Vorstandsmitgl. Bezirksverband Mittelrhein. 1994/09 Mitgl. des Kreistags Düren, 1997/09 Vors. der Grünen- Fraktion im Kreistag Düren. Mitgl. Beirat der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Fraktionsvors. und Politischer Koordinator des AK Umwelt, Energie, Agrar, Verkehr und Bau der Fraktion Bündnis 90/Die Grünen.', 'Oliver', '11004081');
Vorsitzender, ehrenamtlich', 'Ausbildung zum Werkzeugmacher. 1980/09 Technischer Sachbearbeiter; seit 1970 bei Volkswagen in Wolfsburg beschäftigt. Seit 1978 Vors. der Vorsfelder Kyffhäuserkameradschaft, seit 1986 Kyffhäuser Kreisvorsitzender KV Helmstedt/Wolfsburg. Seit 1995 Mitgl. der CDU. Seit 1996 im Rat der Stadt Wolfsburg sowie im Ortsrat Vorsfelde, seit 2001 Ortsbürgermeister von Vorsfelde, 2002/09 Fraktionssprecher im Rat der Stadt Wolfsburg, 2006/11 Bürgermeister der Stadt Wolfsburg, Vorsitzender im Ausschuss Bürgerdienste und Feuerwehren. - MdB seit Okt. 2009.', 'Günter', '11004086');
Vorsitzender, ehrenamtlich', 'Qualif. Hauptschulabschluss. 1987/88 Mittlere nichttechn. Beamtenlaufbahn. Wehrdienst. Seit 1990 Gewerkschaftssekr. Eisenbahn- und Verkehrsgewerkschaft (EVG), ehem. TRANSNET. Seit 2008 Vorstandsmitgl. EVG, Mitgl. AWO, ACE, im Eisenbahnerverein 03, Vors. der Nürnberger Herzhilfe, Mitgl. ESV-Nürnberg-Rangierbahnhof, Familienverband, Bürgerverein Gebersdorf, Zugführer- und Schaffnerverein sowie im Fränkischen Albverein. Mitgl. der SPD seit 1985, Mitgl. Bahnsozialwerk (BSW). Englisch (G). - MdB seit 2005; seit Feb. 2010 Vors. der bayerischen Landesgruppe der SPD-Fraktion, seit Jan. 2014 Vors. Ausschuss für Verkehr und digitale Infrastruktur.
